    property :P60002,
      definition: {en: "Relates an agent to a resource that is a thesis or dissertation associated with an academic degree that is approved by an agent.", ar: "يربط بين وكيل ومصدر عبارة عن أطروحة للحصول على درجة أكاديمية معتمدة من وكيل.", da: "Relaterer en korporation der tildeler en akademisk grad til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der es sich um eine Hochschulschrift handelt, die von einem Akteur genehmigt wird und mit einem akademischen Grad in Verbindung steht.", fi: "Liittää toimijan aineistoon, joka on yhteisön hyväksymä akateemisen oppiarvon opinnäyte tai väitöskirja."},
