    property :P60004,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for managing the financial, technical, and organizational aspects of a production for stage, screen, sound recording, television, webcast, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل إدارة الجوانب المالية، التقنية، والتنظيمية لإنتاج من أجل المسرح، شاشة العرض، التسجيل الصوتي، التلفزيون، البث عبر الإنترنت...إلخ.", da: "Relaterer en korporation, der er ansvarlig for økonomisk, teknisk og organisatorisk ledelse af en produktion beregnet til scene, lærred, lydoptagelse, tv, webcast etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die mit einer Verantwortung des Akteurs verbunden ist, das Management für die finanziellen, technischen und organisatorischen Aspekte einer Produktion für die Bühne, die Leinwand, die Tonaufnahme, das Fernsehen, für einen Webcast und so weiter zu verwalten.", fi: "Liittää toimijan aineistoon, jossa hän vastaa kuvien tallentamisesta joko sähköisesti tai filmille tai videolle, usein myös valaistuksen valitsemisesta ja järjestämisestä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionCompanyOf.en",
