    property :P60005,
      definition: {en: "Relates an agent to a resource of a court governed by court rules, regardless of their official nature to a resource.", ar: "يربط بين وكيل ومصدر من مصادر المحكمة يخضع للوائح المحاكم، دون النظر إلى الطابع الرسمي بأحد المصادر.", da: "Relaterer en retsinstans underlagt retsregler, uanset hvad deres officiele art er til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource eines Gerichts, das durch gerichtliche Verfahrensvorschriften geregelt wird, unabhängig von deren förmlicher Rechtsnatur.", fi: "Liittää toimijan tuomioistuimen sääntöjen ohjaamaan tuomioistuinaineistoon riippumatta siitä, mikä on sääntöjen virallinen suhde aineistoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/courtGovernedOf.en",
