      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60006,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for collecting by selecting and arranging resources that are other resources.", ar: "يربط بين وكيل ومصدر تم تجميعه مع مصادر من مصادر مختلفة رُتبت، وُصفت، وفُهرست كمجموعة.", da: "Relaterer en kurator der sammenfører ressourcer fra forskellige kilder, som så bliver arrangeret, beskrevet og katalogiseret som en samling til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die von einem Akteur mit Ressourcen aus unterschiedlichen Quellen zusammengetragen wird, die dann als Sammlung geordnet, beschrieben oder katalogisiert werden.", fi: "Liittää toimijan aineistoon, jossa hän vastaa uuden teoksen, kuten bibliografian tai hakemiston luomisesta valitsemalla, järjestämällä, koostamalla ja toimittamalla dataa, informaatiota tms."},
