      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60007,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for creating a metadata resource.", ar: "يربط بين أَمِين معرض ومصدر مدرج في القائمة أو تم جرده في مصدر تجميعي مثل مجموعة من المصادر.", da: "Relaterer en kurator der lister eller opstiller ressourcerne i en samlingsressource, som fx en samling af ressourcer til en ressource.", de: "Setzt eine Kuratorin/einen Kurator in Beziehung zu einer Ressource, die als aggregierte Ressource verzeichnet oder inventarisiert wird, wie zum Beispiel eine Sammlung von Ressourcen.", fi: "Liittää aineistoon toimijan, joka vastaa metatietoteoksen luomisesta."},
