      subPropertyOf: "http://rdaregistry.info/Elements/u/P60657",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60008,
      definition: {en: "Relates an agent to a resource that is deposited into the custody of another agent without transferring ownership.", ar: "يربط بين وكيل ومصدر تم إيداعه في عهدة وكيل آخَر دون نقل الملكية.", da: "Relaterer en nuværende ejer af en ressource deponeret i forvaring hos en anden agent, men der beholder det oprindelige ejerskab til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die in die Obhut eines anderen Akteurs gegeben wird, ohne das Eigentumsrecht zu übertragen.", fi: "Liittää toimijan aineistoon, jokaon luovutettu toisen toimijan haltuun siirtämättä omistajuutta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/depositorOf.en",
