      subPropertyOf: "http://rdaregistry.info/Elements/u/P60628",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60009,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for the general management and supervision of a filmed performance.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن الإدارة العامة والإشراف على أداء مصور.", da: "Relaterer en instruktør der er ansvarlig for ledelse og tilsyn med en filmoptagelse til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das allgemeine Management und die Leitung einer verfilmten Darbietung verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa elokuvan yleisestä johtamisesta ja valvonnasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/filmDirectorOf.en",
