      subPropertyOf: "http://rdaregistry.info/Elements/u/P60673",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60010,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for the general management and supervision of a radio program.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل الإدارة العامة والإشراف على برنامج إذاعي.", da: "Relaterer en instruktør der er ansvarlig for ledelse og tilsyn med et radioprogram til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das allgemeine Management und die Leitung einer Hörfunksendung verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa radio-ohjelman yleisestä johtamisesta ja valvonnasta."},
