      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60011,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for the general management and supervision of a television program.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل الإدارة العامة والإشراف على برنامج تليفزيوني.", da: "Relaterer en instruktør der er ansvarlig for ledelse og tilsyn med et tv-program til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das allgemeine Management und die Leitung einer Fernsehsendung verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa televisio-ohjelman esityksen yleisestä johtamisesta ja valvonnasta."},
