    property :P60012,
      definition: {en: "Relates an agent to a resource donated to another owner.", ar: "يربط بين وكيل ومصدر تم التبرع به إلى مالك آخَر.", da: "Relaterer en tidligere ejer af en ressource, der donerede den ressource til en anden ejer til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die einer anderen Eigentümerin/einem anderen Eigentümer überlassen wurde.", fi: "ittää toimijan aineistoon, jonka toimija on lahjoittanut toiselle omistajalle."},
