      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60015,
      definition: {en: "Relates an agent to a resource that involves a responsibility for managing the financial, technical, and organizational aspects of a production for stage, screen, sound recording, television, webcast, etc.", ar: "يربط بين وكيل ومكان يخضع لسلطة قضائية يحكمها قانون، لائحة تنظيمية...إلخ، سنتها حكومة أخرى.", da: "Relaterer en jurisdiktion, der er underlagt en lov, forordning etc., der var vedtaget af en anden domsmyndighed til en ressource.", de: "Setzt einen Akteur in Beziehung zu einem Geografikum, das durch ein Gesetz, eine Verordnung und so weiter geregelt wird, das/die von einer anderen Regierung erlassen wurde.", fi: "Liittää toimijan paikkaan, joka on toisen julkishallinnollisen yhteisön säätämien lakien, asetusten tms. alainen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/jurisdictionGovernedOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60097",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is jurisdiction governed of", ar: "هو نطاق جغرافى خاضع لـ", da: "er jurisdiktion underlagt", de: "ist geregelte Gebietskörperschaft von", fi: "soveltava lainkäyttöalue yhteisölle", nl: "is jurisdictie geregeerd van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60016,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of leading of a performing group in a musical or dramatic presentation, etc.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في قيادة فرقة عزف في عرض موسيقي أو درامي...إلخ.", da: "Relaterer en udøver, der bidrager til en musikalsk ressource ved at lede en udøvende gruppe i en musikalsk eller dramatisk præsentation etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er ein aufführendes Ensemble in einer musikalischen oder dramatischen Darbietung und so weiter leitet.", fi: "Liittää toimijan aineistoon, jonka tekemisessä toimija on osallisena johtamalla esiintyjäryhmän esiintymistä musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60843", "http://rdaregistry.info/Elements/u/P60845"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/conductorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60141",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is conductor of", ar: "هو مايسترو لـ", da: "er dirigent af", de: "ist Dirigentin/Dirigent von", fi: "johtajana aineistossa", nl: "is dirigent van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60017,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of acting as a cast member or player in a musical or dramatic presentation.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل يعمل كعضو فريق تمثيل أو كعازف في عرض موسيقي أو درامي.", da: "Relaterer en udøver, der bidrager til en ressource ved at være skuespiller eller musiker i en musikalsk eller dramatisk præsentation etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er als Ensemble-Mitglied oder Darstellerin/Darsteller in einer musikalischen oder dramatischen Darbietung fungiert.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu näyttelemällä musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60027",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/actorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60142",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is actor of", ar: "هو ممثل لـ", da: "er skuespiller i", de: "ist Schauspielerin/Schauspieler von", fi: "näyttelijänä aineistossa", nl: "is acteur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60018,
      definition: {en: "Relates a performer who contributes to a resource by appearing on screen to provide contextual or background information. an on-screen presenter may appear in nonfiction moving image materials or in introductions to fiction moving image materials to a resource.", ar: "يربط مؤدٍ يُساهم في مصدر من خلال الظهور على الشاشة لتقديم معلومات تتعلق بالسياق أو الخلفية. قد يظهر مقدم عرض على الشاشة في مواد الصور المتحركة غير الخيالية أو أثناء تقديم مواد لصور متحركة خيالية إلى أحد المصادر.", da: "Relaterer en udøver, der bidrager til en ressource ved at optræde på en skærm for at give kontekstuel- eller baggrundsinformation til en ressource.", de: "Setzt eine Ausführende/einen Ausführenden in Beziehung zu einer Ressource, zu der sie/er beiträgt, indem sie/er auf dem Bildschirm erscheint, um Kontext- und Hintergrundinformationen zu liefern.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu esiintymällä televisiossa tai elokuvassa taustatiedon antajana."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60825",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/onscreenPresenterOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Appearance in nonfiction moving image materials or in introductions to fiction moving image materials is included. Appearance on screen in a non-performing role is excluded.", ar: "يتضمن الظهور في مواد الصور المتحركة غير الخيالية أو أثناء تقديم مواد لصور متحركة خيالية. يُستبعد من ذلك الظهور على الشاشة في دور غير مؤدِ.", da: "En programvært kan optræde i levende billedmaterialer af faktuel karakter eller i introduktioner til levende billedmaterialer af fiktiv karakter. Optræden på skærmen i en ikke-optrædende rolle er ikke omfattet.", de: "Darunter fallen Auftritte in nicht-fiktionalen Bewegtbildmaterialien oder in Einführungen zu fiktionalen Bewegtbildmaterialien. Darunter fallen keine Bildschirmauftritte in einer passiven Rolle.", fi: "Koskee ei-fiktiivisessä elokuvassa tai fiktiivisen elokuvan johdannossa esiintymistä. Ei koske esiintymistä ei-esittävässä roolissa."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60143",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is onscreen presenter of", ar: "هو مقدم على الشاشة لـ", da: "er programvært på skærmen i", de: "ist On-Screen-Präsentatorin/On-Screen-Präsentator von", fi: "esittelijänä aineistossa", nl: "is presentator in beeld van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60019,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of dancing in a musical or dramatic presentation.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالرقص في عرض موسيقي أو درامي.", da: "Relaterer en udøver, der bidrager til en ressource ved at danse i en musikalsk, dramatisk etc. præsentation til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er in einer musikalischen oder dramatischen Darbietung tanzt.", fi: "Liittää toimijan aineistoon jonka tekemiseen hän osallistuu tanssimalla musiikki- tai näyttämöesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dancerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60144",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is dancer of", ar: "هو راقص لـ", da: "er danser i", de: "ist Tänzerin/Tänzer von", fi: "tanssijana aineistossa", nl: "is danser van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60020,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of teaching or providing a demonstration.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالتدريس أو تقديم عرض توضيحي.", da: "Relaterer en udøver, der bidrager til en ressource ved at give instruktion eller demonstration til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er unterrichtet oder etwas demonstriert.", fi: "Liittää toimijan aineistoon jonka tekemiseen hän osallistuu opettamalla tai esittelemällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/instructorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60145",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is instructor of", ar: "هو مُحاضر لـ", da: "er lærer i", de: "ist Ausbilderin/Ausbilder von", fi: "opettaja", nl: "is instructeur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60021,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent who is a performer of leading a program, often broadcast, that includes other performers.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في إدارة برنامج، غالبًا مُذاع، ويستضيف ضيوفا وفنانين ووكلاء آخرين.", da: "Relaterer en udøver, der bidrager til en ressource ved at lede et program, ofte transmitteret, der inkluderer andre gæster, optrædende etc. til en ressource", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er eine Veranstaltung (meist eine Sendung) leitet, an der auch andere Ausführende teilnehmen.", fi: "Liittää toimijan aineistoon, jonka tekemiseen toimija, joka on esittäjä, osallistuu (useimmiten lähetettyyn) ohjelmaan, johon osallistuu muita esiintyjiä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/hostOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60146",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is host of", ar: "هو مُضيف لـ", da: "er vært for", de: "ist Gastgeberin/Gastgeber von", fi: "juontajana aineistossa", nl: "is gastgever van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60022,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of leading a program, often broadcast, where topics are discussed, usually with participation of experts in fields related to the discussion.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في إدارة برنامج، غالبًا مُذاع، حيث تتم مناقشة موضوعات، عادةً بمشاركة خبراء في المجالات المتعلقة بموضوع النقاش.", da: "Relaterer en udøver, der bidrager til en ressource ved at lede et program, ofte transmitteret, hvor emner diskuteres, normalt med deltagelse af fagfolk indenfor felter, der er relateret til diskussionen, til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er eine Veranstaltung (meist eine Sendung) leitet, in der Themen üblicherweise mit Expertinnen/Experten diskutiert werden.", fi: "Liittää toimijan aineistoon jonka tekemiseen hän osallistuu juontamalla (useimmiten lähetettyä) ohjelmaa, jossa keskustellaan eri aiheista tavallisesti keskusteluun liittyvien aiheiden asiantuntijoiden kanssa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/moderatorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60147",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is moderator of", ar: "هو رئيس جلسة لـ", da: "er ordstyrer i", de: "ist Moderatorin/Moderator von", fi: "moderoijana aineistossa", nl: "is moderator van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60023,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of manipulating, controlling, or directing puppets or marionettes in a moving image production or a musical or dramatic presentation or entertainment", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في اللعب بالعرائس أو الدمى المتحركة أو التحكم فيها، أو توجيهها في إنتاج لصور متحركة أو في عرض موسيقي أو درامي أو ترفيهي.", da: "Relaterer en udøver der bidrager til en ressource ved at manipulere, kontrollere, eller føre dukker eller marionetter i en levende billedproduktion eller en musikalsk eller dramatisk præsentation eller underholdning til en ressource", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er Puppen oder Marionetten in einer Bewegtbildproduktion oder einer musikalischen oder dramatischen Darbietung oder Aufführung bewegt, kontrolliert oder lenkt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu käsittelemällä, kontrolloimalla tai ohjaamalla nukkeja tai marionetteja elokuvatuotannossa tai musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/puppeteerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60148",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is puppeteer of", ar: "هو محرك عرائس لـ", da: "er dukkefører i", de: "ist Puppenspielerin/Puppenspieler von", fi: "nukettajana aineistossa", nl: "is poppenspeler van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60024,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of participating in a program, often broadcast, where topics are discussed, usually with participation of experts in fields related to the discussion.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالمشاركة في برنامج، غالبًا مُذاع، حيث تتم مناقشة موضوعات، عادةً بمشاركة خبراء في المجالات المتعلقة بموضوع النقاش.", da: "Relaterer en udøver der bidrager til en ressource ved at deltage i et program, ofte transmitteret, hvor emner diskuteres, normat med deltagelse af fagfolk indenfor felter, der er relateret til diskussionen til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er an einer Veranstaltung (meist in einer Sendung) teilnimmt, in der Themen üblicherweise mit Expertinnen/Experten diskutiert werden.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu panelistina (useimmiten lähetetyssä) ohjelmassa, jossa keskustellaan eri aiheista tavallisesti keskusteluun liittyvien aiheiden asiantuntijoiden kanssa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/panelistOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60149",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is panelist of", ar: "هو مشارك في برنامج لـ", da: "er paneldeltager i", de: "ist Diskussionsteilnehmerin/Diskussionsteilnehmer von", fi: "panelistina aineistossa", nl: "is panellid van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60025,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of playing a musical instrument.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالعزف على آلة موسيقية.", da: "Relaterer en udøver der bidrager til en ressource ved at spille et musikinstrument til en ressource", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er ein Musikinstrument spielt.", fi: "Liittää toimijan aineistoon jonka tekemiseen hän osallistuu soittamalla soitinta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/instrumentalistOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60150",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is instrumentalist of", ar: "هو عَازِف لـ", da: "er musiker i", de: "ist Instrumentalmusikerin/Instrumentalmusiker von", fi: "instrumentalistina aineistossa", nl: "is instrumentalst van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60026,
      definition: {en: "Relates a performer who contributes to a resource by providing interpretation, analysis, or a discussion of the subject matter on a recording, film, or other audiovisual medium to a resource.", ar: "يربط بين مصدر ومؤدِ يُساهم بأحد المصادر من خلال تقديم تفسير للموضوع، أو تحليله، أو مناقشته على تسجيل أو على فيلم، أو على أي وسيط سمعي بصري آخر.", da: "Relaterer en udøver der bidrager til en ressource ved at give en fortolkning, analyse, eller diskussion af det emne, der behandles i en optagelse, film eller andet audiovisuelt medium til en ressource.", de: "Setzt eine Ausführende/einen Ausführenden in Beziehung zu einer Ressource, indem sie/er zu einer Ressource beiträgt, indem sie/er in einer Aufnahme, in einem Film oder in einem anderen audiovisuellen Medium eine Interpretation, eine Analyse oder eine Diskussion des Themas präsentiert.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu tulkitsemalla tai analysoimalla äänitteen, elokuvan tai muun audiovisuaalisen aineiston aihetta tai keskustelemalla siitä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/commentatorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60151",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is commentator of", ar: "هو مُعلِق لـ", da: "er kommentator i", de: "ist Kommentatorin/Kommentator von", fi: "kommentaattorina aineistossa", nl: "is commentator van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60027,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of providing the voice for characters in radio and audio productions and for animated characters in moving image resources, as well as voice-overs in radio and television commercials, dubbed resources, etc.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالتمثيل الصوتي لشخصيات في الإنتاج الإذاعي والسمعي وللشخصيات الكرتونية في أعمال الصور المتحركة، إضافة إلى التعليق الصوتي في إعلانات الإذاعة والتليفزيون، والتعبيرات المدبلجة...إلخ.", da: "Relaterer en skuespiller, der har bidraget til en ressource ved at lægge stemme til figurer i radio- og audioproduktioner og til animerede figurer i levende billed-ressourcer, og ved at indtale voice-overs i radio- og tv-reklamer, eftersynkroniserede ressourcer etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er seine Stimme Charakteren in Hörfunk- und Audioproduktionen und animierten Charakteren in Bewegtbildwerken leiht und Begleitkommentare in Hörfunk- oder Fernsehwerbung, untertitelten Expressionen und so weiter zur Verfügung stellt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu antamalla äänen hahmoille radio- ja äänituotannoissa ja animoiduille hahmoille elokuva-aineistoissa sekä esiintymällä radio- ja TV-mainoksissa, dubatuissa aineistoissa tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/voiceActorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60152",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is voice actor of", ar: "هو مُمثل صوتي لـ", da: "er dubber i", de: "ist Sprecherin/Sprecher einer Rolle von", fi: "ääninäyttelijänä aineistossa", nl: "is stemacteur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60017",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60028,
      definition: {en: "Relates an agent to an resource that includes a contribution by an agent of reading aloud or giving an account of an act, occurrence, or other event.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالقراءة بصوت مرتفع أو بسرد فصل من مسرحية، واقعة، أو حدث آخر.", da: "Relaterer en udøver der bidrager til en ressource ved at læse højt eller berette om en handling, en hændelse, et begivenhedsforløb, etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er vorliest oder eine Handlung, ein Geschehnis oder ein anderes Ereignis schildert.", fi: "Liittää henkilön aineistoon, jonka tekemiseen hän osallistuu lukemalla ääneen tai kertomalla toiminnasta, tapahtumasta, tapahtumien kulusta tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/narratorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60153",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is narrator of", ar: "هو راوٍ لـ", da: "er fortæller i", de: "ist Erzählerin/Erzähler von", fi: "kertojana aineistossa", nl: "is verteller van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60029,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent who is a performer of relaying a story with dramatic or theatrical interpretation.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل يقوم بنقل قصة أصلية ووصفها بصورة درامية أو مسرحية.", da: "Relaterer en udøver der bidrager til en ressource ved at give en ophavspersons oprindelige historie med dramatisk eller teatralsk fortolkning til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er eine Geschichte mit dramatischer oder theatralischer Interpretation wiedergibt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu esittäjänä tekijän alkuperäisen tarinan draamallisella tai teatraalisella tulkinnalla."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/storytellerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60154",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is storyteller of", ar: "هو راوي قصص لـ", da: "er historiefortæller i", de: "ist Geschichtenerzählerin/Geschichtenerzähler von", fi: "tarinankertojana aineistossa", nl: "is verhalenverteller van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60030,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of speaking words, such as a lecture, speech, etc.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالتحدث بكلمات، كما في محاضرة، خطبة، إلخ.", da: "Relaterer en udøver der bidrager til en ressource ved at fremføre ord, fx en forelæsning, tale, etc. til en ressource", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er Worte, wie zum Beispiel einen Vortrag, eine Rede oder ähnliches, spricht.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu puhumalla, kuten luennoimalla tai pitämällä puheen tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/speakerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60155",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is speaker of", ar: "هو متحدث لـ", da: "er taler i", de: "ist Rednerin/Redner von", fi: "puhujana aineistossa", nl: "is spreker van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60031,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent who is a performer of voice, with or without instrumental accompaniment, to produce music.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل يقوم بأداء صوتي، بمصاحبة أو دون مصاحبة آلة موسيقية، لإنتاج أغنية.", da: "Relaterer en udøver der bidrager til en ressource ved at bruge sin stemme, med eller uden instrumentalledsagelse, til at skabe musik til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er durch seine Singstimme, mit oder ohne instrumentale Begleitung, Musik erzeugt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu esiintymällä lauluäänellä (soitinsäestyksellä tai ilman) tuottaakseen musiikkia."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/singerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60156",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is singer of", ar: "هو مغنِ لـ", da: "er sanger i", de: "ist Sängerin/Sänger von", fi: "laulajana ainestossa", nl: "is zanger van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60615",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60032,
      definition: {en: "Relates an agent held to be a channel of communication between the earthly world and a world of spirits to a resource.", ar: "يربط بين وكيل يعمل بوصفه قناة اتصال بين العالم الأرضي وعالم الأرواح وأحد المصادر.", da: "Relaterer en agent der siges at være en kanal for kommunikation mellem den jordiske verden og en åndevereden, til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der der der Akteur für sich in Anspruch nimmt, als Kommunikationskanal zwischen der irdischen Welt und einer Geisterwelt zu dienen.", fi: "Liittää aineistoon toimijan, jota pidetään kanavana henkimaailman ja maallisen maailman välillä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mediumOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60157",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is medium of", ar: "هو وسيط روحاني لـ", da: "er medie i", de: "ist Channel von", fi: "meediona aineistossa", nl: "is medium van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60033,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for most of the business aspects of the production of a film.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن معظم الجوانب التجارية لإنتاج فيلم.", da: "Relaterer en producer, der er ansvarlig for størstedelen af de forretningsmæssige aspekter ved en film til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die meisten geschäftlichen Aspekte bei der Produktion eines Films verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa suurimmasta osasta elokuvan liiketoimintaa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/filmProducerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60169",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is film producer of", ar: "هو منتج الفيلم لـ", da: "er filmproducer af", de: "ist Filmproduzentin/Filmproduzent von", fi: "elokuvatuottajana aineistossa", nl: "is filmproducent van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60668",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60034,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for most of the business aspects of the production of a radio program.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن معظم الجوانب التجارية لإنتاج برنامج إذاعي.", da: "Relaterer en producer der er ansvarlig for størstedelen af de forretningsmæssige aspekter ved et radioprogram, til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die meisten geschäftlichen Aspekte einer Hörfunksendung verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa suurimmasta osasta radio-ohjelman liiketoimintaa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/radioProducerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60170",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is radio producer of", ar: "هو منتج إذاعي لـ", da: "er radioproducer af", de: "ist Hörfunkproduzentin/Hörfunkproduzent von", fi: "radiotuottajana aineistossa", nl: "is radioproducent van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60668",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60035,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for most of the business aspects of the production of a television program.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن معظم الجوانب التجارية لإنتاج برنامج تليفزيوني.", da: "Relaterer en producer der er ansvarlig for størstedelen af de forretningsmæssige aspekter ved et tv-program, til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die meisten geschäftlichen Aspekte einer Fernsehsendung verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa suurimmasta osasta televisio-ohjelman liiketoimintaa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/televisionProducerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60171",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is television producer of", ar: "هو منتج تليفزيوني لـ", da: "er tv-producer af", de: "ist Fernsehproduzentin/Fernsehproduzent von", fi: "televisiotuottajana aineistossa", nl: "is televisieproducent van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60668",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60036,
      definition: {en: "Relates an agent to a nomen that is a pseudonym or other appellation used by an agent.", ar: "يربط بين وكيل وتسمية قد تكون اسما مستعارا أو أي تسمية أخرى يستخدمها وكيل.", da: "Relaterer en pseudonym eller anden identitet antaget af en person til en agent.", de: "Setzt einen Akteur in Beziehung zu einem Nomen, bei dem es sich um ein Pseudonym oder eine andere, von einem Akteur verwendete, Bezeichnung handelt.", fi: "Liittää toimijan nomeniin, joka on pseudonyymi tai toimijan käyttämä muu nimitys."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/alternateIdentity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has alternate identity", ar: "له هوية بديلة", da: "har alternativ identitet", de: "hat andere Identität", fi: "vaihtoehtoinen identiteetti", nl: "heeft alternatieve identiteit"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60037,
      definition: {en: "Relates an agent to a nomen that is a real appellation of an agent who uses another nomen.", ar: "يربط وكيل حقيقي يدّعي هوية بديلة لوكيل", da: "Relaterer en virkelig agent der antager en alternativ identitet til en agent.", de: "Setzt einen realen Akteur, der eine andere Identität annimmt, in Beziehung zu einem Akteur.", fi: "Liittää todellisen toimijan oletettuun vaihtoehtoiseen identiteettiin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/realIdentity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has real identity", ar: "له هوية حقيقية", da: "har virkelig identitet", de: "hat wirkliche Identität", fi: "todellinen identiteetti", nl: "heeft echte identiteit"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60045,
      definition: {en: "Relates a resource to an agent who is a candidate for a degree who defends or opposes a thesis provided by the praeses in an academic disputation.", ar: "يربط مصدر بوكيل باحث للحصول على درجة علمية يدافع عن أو يعارض أطروحة مقدمة من رؤساء جلسة علمية في مناظرة أكاديمية.", da: "Relaterer en ressource til en kandidat til en akademisk grad, der forsvarer eller opponerer mod en tese, der er fremsat af præses i et akademisk afhandlingsforsvar.", de: "Setzt eine Ressource in Beziehung zu einer Kandidatin/einem Kandidaten für einen akademischen Grad, die/der eine These, die vom Praeses in einer akademischen Disputation aufgestellt wird, verteidigt oder ablehnt.", fi: "Liittää aineiston toimijaan, joka on oppiarvoa tavoitteleva kandidaatti, joka puolustaa tai opponoi preeseksen akateemisessa väitöstilaisuudessa esittelemää väitöskirjaa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/respondent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has respondent", ar: "له مُستَجِيب", da: "har respondent", de: "hat Respondentin/Respondent", fi: "respondentti", nl: "heeft respondent"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60046,
      definition: {en: "Relates a name to a categorization indicating that a name is insufficient to differentiate between two or more entities.", ar: "يربط بين اسم وفئة تشير إلى اسم غير كافِ للتمييز بين كيانين أو أكثر.", da: "Relaterer en ressource til en kategorisering, der angiver, at de registrerede kerneelementer er utilstrækkelige til at skelne mellem to eller flere agenter med det samme navn.", de: "Setzt einen Namen in Beziehung zu einer Kategorisierung die angibt, dass ein Name nicht ausreicht, um zwischen zwei oder mehreren Entitäten zu unterscheiden.", fi: "Liittää aineiston kategorisointiin, jolla ilmaistaan sen riittämättömyys kahden tai useamman entiteetin erottamiseen toisistaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/undifferentiatedNameIndicator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has undifferentiated name indicator", ar: "له مؤشر لاسم غير مميز", da: "har ikke entydig navneindikator", de: "hat Indikator für nicht individualisierte Namen", fi: "yksilöimättömän nimen ilmaus aineistolle", nl: "heeft niet-onderscheiden naam indicatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60047,
      altLabel: {en: "type of agent", ar: "نوع الوكيل", fi: "toimijan tyyppi"},
      definition: {en: "Relates an agent to a type to which an agent belongs.", ar: "يربط بين وكيل والنوع الذي ينتمي إليه وكيل.", da: "Relaterer en ressource til en kategorisering eller almindelig beskrivelse på en type af agent.", de: "Setzt einen Akteur in Beziehung zu einer Art, zu der ein Akteur gehört.", fi: "Liittää toimijan tyyppiin tai jaotteluun, johon toimija kuuluu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/categoryOfAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has category of agent", ar: "له فئة لوكيل", da: "har type af agent", de: "hat Kategorie eines Akteurs", fi: "toimijan kategoria", nl: "heeft categorie van actor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60048,
      definition: {en: "Relates a resource to a categorization reflecting the format of the storage medium and housing of a carrier in combination with the type of intermediation device required to view, play, run, or otherwise access the content of a resource.", ar: "يربط بين مصدر وفئة تعكس شكل وسيط التخزين ومكان الحامل المصاحب لنوع الجهاز الوسيط المطلوب لعرض، لتشغيل، أو لمعالجة أو للوصول إلى محتوى مصدر.", da: "Relaterer en manifestation til en kategorisering der specifikt afspejler lagringsmediet og dets udstyr i kombination med den type af afspilningsudstyr, som kræves for at se, spille, fremvise eller på anden måde give adgang til en manifestations indhold.", de: "Setzt eine Ressource in Beziehung zu einer Kategorisierung, die das Format des Speichermediums und das Gehäuse eines Datenträgers widerspiegelt, in Kombination mit der Art des Hilfsmittels, das benötigt wird, um den Inhalt einer Ressource anzuschauen, abzuspielen oder laufen zu lassen und so weiter.", fi: "Liittää aineiston kategorisointiin, joka ilmaisee säilytysvälineen ja tallenteen koteloinnin formaatin yhdessä aineiston sisällön katsomiseen, toistamiseen, suorittamiseen tai muuhun toimintaan tarvittavan välittävän laitteen tyypin kanssa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/carrierType.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has carrier type", ar: "له نوع الحامل", da: "har bærertype", de: "hat Datenträgertyp", fi: "aineiston tallennetyyppi", nl: "heeft type drager"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60049,
      definition: {en: "Relates a resource to a categorization reflecting a fundamental form of communication in which a content is expressed and a human sense through which it is intended to be perceived.", ar: "يربط بين مصدر وفئة تعكس الشكل الأساسي للتواصل الذي يتم فيه التعبير عن المحتوى والحس الإنساني الذي من المفترض أن يُنظر إليها من خلاله.", da: "Relaterer en ressource til en kategorisering, der afspejler den grundlæggende kommunikationsform, hvorigennem indholden ressourcekes, og den menneskelige sans, hvorigennem det er meningen, at det skal opfattes.", de: "Setzt eine Ressource in Beziehung zu einer Kategorisierung, die zum einen die grundlegende Form der Kommunikation widerspiegelt, in der der Inhalt ausgedrückt wird, und zum andern die menschliche Wahrnehmung wiedergibt, durch die diese wahrgenommen werden soll.", fi: "Liittää aineiston viestintämuotoon, jolla aineiston sisältö on ilmaistu sekä aistiin, jolla se on tarkoitus vastaanottaa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/contentType.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Content type also reflects the number of spatial dimensions and the presence or absence of movement in which content expressed in the form of an image or images is intended to be perceived.", ar: "يعكس نوع المحتوى أيضًا عدد الأبعاد المكانية ووجود أو عدم وجود الحركة التي يُقصد من خلالها إدراك المحتوى المعبر عنه في شكل صورة أو صور.", da: "Hvad angår indhold, der udtrykkes i form af et eller flere billeder, afspejler indholdstype desuden antallet af rumlige dimensioner, som indholdet skal opfattes i, samt opfattelsen af tilstedeværelse eller fravær af bevægelse.", de: "Für Inhalt, der in Form eines Bilds oder mehrerer Bilder ausgedrückt wird, spiegelt der Inhaltstyp auch die Anzahl räumlicher Dimensionen wider, in denen der Inhalt wahrgenommen werden soll, sowie die Wahrnehmung von vorhandener oder nicht vorhandener Bewegung.", fi: "Sisältötyyppi kuvaa myös mahdollista kuvasisällön hahmottamiseen vaikuttavaa moniulotteisuutta ja liikettä.", nl: "Type content geeft ook het aantal ruimtelijke dimensies weer en de aanwezigheid of afwezigheid van beweging waarmee content uitgedrukt in de vorm van een beeld of beelden geacht wordt waargenomen."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has content type", ar: "له نوع محتوى", da: "har indholdstype", de: "hat Inhaltstyp", fi: "aineiston sisältötyyppi", nl: "heeft type content"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60050,
      definition: {en: "Relates a resource to a categorization reflecting the general type of intermediation device required to view, play, run, or otherwise access the content of a resource.", ar: "يربط بين مصدر وفئة تعكس النوع العام للجهاز الوسيط المطلوب لعرض، أو لتشغيل، أو لمعالجة أو للوصول إلى محتوى مصدر.", da: "Relaterer en ressource til en kategorisering der generelt afspejler typen af formidlingsudstyr/afspiller, der kræves for at tilgå en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einer Kategorisierung, welche die allgemeine Art des Hilfsmittels widerspiegelt, das erforderlich ist, um den Inhalt einer Ressource anzuschauen, abzuspielen oder laufen zu lassen und so weiter.", fi: "Kategorisointi, joka ilmaisee aineiston sisällön katsomiseen, toistamiseen, suorittamiseen tai muuhun toimintaan tarvittavan välittävän laitteen yleistä tyyppiä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mediaType.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has media type", ar: "له نوع الوسيط", da: "har medietype", de: "hat Medientyp", fi: "aineiston mediatyyppi", nl: "heeft type medium"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60051,
      definition: {en: "Relates a resource to a categorization that reflects whether a resource is issued in one or more units.", ar: "يربط بين مصدر وفئة تعكس ما إذا كان المصدر قد صدر في جزء واحد أو عدة أجزاء، طريقه تحديثه، وتوقيفه عن قصد.", da: "Relaterer en ressource til en kategorisering, der afspejler, hvorvidt en ressource er udgivet i en eller flere dele, hvordan den opdateres, og hvorvidt dens ophør er forudbestemt eller ej.", de: "Setzt eine Ressource in Beziehung zu einer Kategorisierung die widerspiegelt, ob eine Ressource in einem Teil oder mehreren Teilen erscheint, wie sie aktualisiert wird und wie sie enden soll.", fi: "Liittää aineiston kategorisointiin, joka kertoo, ilmestyykö se yhdessä vai useassa osassa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/modeOfIssuance.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has mode of issuance", ar: "له أسلوب للإصدار", da: "har udgivelsesform", de: "hat Erscheinungsweise", fi: "aineiston julkaisutapa", nl: "heeft wijze van uitvaardiging"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60052,
      definition: {en: "Relates a resource to a nomen that is an appellation of resource that consists of a code, number, or other string, usually independent of natural language and social naming conventions, used to identify a resource.", ar: "يربط بين مصدر وتسمية لمصدر يتكون من رمز، رقم، أو سلسلة تمثيلات أخرى، عادة ما تكون مستقلة عن اللغة الطبيعية وعن التسميات المتعارف عليها اجتماعيًا، المستخدمة في تحديد هوية مصدر.", da: "Relaterer en ressource til en ressourcebenævnelse, der består af en kode, et nummer, eller anden streng, normalt uafhængig af naturligt sprog og sociale navngivningskonventioner, der tjener til at skelne denne ressource fra andre ressourcer.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung für eine Ressource, die aus einem Code, einer Nummer oder einer anderen Zeichenkette besteht, der/die normalerweise nicht in natürlicher Sprache und unabhängig von den sozialen Benennungskonventionen ist und zur Identifizierung einer Ressource verwendet wird.", fi: "Liittää aineiston aineiston nimitykseen, joka koostuu koodista, luvusta tai muusta tavallisesti luonnollisesta kielestä ja yleisistä nimeämiskäytännöistä riippumattomasta merkkijonosta, jota käytetään aineiston identifiointiin."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60139", "http://rdaregistry.info/Elements/u/P60140", "http://rdaregistry.info/Elements/u/P60945"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/identifierForResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "The coded string is usually independent of natural language and social naming conventions.", ar: "عادة ما تكون سلسلة التمثيلات المرمزة مستقلة عن اللغة الطبيعية وعن التسميات المتعارف عليها اجتماعيًا.", da: "Den kodede streng er normalt uafhængig af naturligt sprog og sociale navnekonventioner.", de: "Die kodierte Zeichenkette ist normalerweise nicht in natürlicher Sprache und unabhängig von den sozialen Benennungskonventionen.", fi: "Koodattu merkkijono on yleensä luonnollisesta kielestä ja sosiaalisista nimeämisen käytännöistä riippumaton."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60938",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has identifier for resource", ar: "له معرف لمصدر", da: "har identifikator for ressourcen", de: "hat Identifikator für eine Ressource", fi: "aineiston tunniste", nl: "heeft identificatie voor resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60919",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60053,
      definition: {en: "Relates an agent to a nomen that is an appellation of agent that consists of a code, number, or other string, usually independent of natural language and social naming conventions, used to identify an agent.", ar: "يربط بين وكيل وتسمية لوكيل يتكون من رمز، رقم، أو سلسلة تمثيلات أخرى، عادة ما تكون مستقلة عن اللغة الطبيعية وعن التسميات المتعارف عليها اجتماعيًا، المستخدمة في تحديد هوية وكيل.", da: "Relaterer en ressource til en tegnrække, der er entydigt knyttet til en agent eller til en erstatning for en agent, fx en autoritetsregistrering", de: "Setzt einen Akteur in Beziehung zu einer Bezeichnung für einen Akteur, die aus einem Code, einer Nummer oder einer anderen Zeichenkette besteht, der/die normalerweise nicht in natürlicher Sprache und unabhängig von den sozialen Benennungskonventionen ist und zur Identifizierung eines Akteurs verwendet wird.", fi: "Liittää toimijan nimitykseen, joka koostuu koodista, numerosta tai muusta merkkijonosta ja joka yleensä on luonnollisesta kielestä ja kielen sosiaalisista konventioista riippumaton toimijan tunnistamiskeino."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/identifierForAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60937",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has identifier for agent", ar: "له معرف لوكيل", da: "har identifikator for agent", de: "hat Identifikator für einen Akteur", fi: "toimijan tunniste", nl: "heeft identificatie voor actor"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60919",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60054,
      definition: {en: "Relates a resource to a characteristic, other than form, date, or place of origin, that serves to differentiate a resource from another resource with the same preferred title of resource. (Deorecated)", da: "Relaterer en ressource til et kendetegn, bortset fra form af ressource, dato af ressource, sted af ressource, indholdstype, eller sprog, der tjener til at skelne én ressource fra en anden ressource med samme titel eller fra et navn på en anden agent."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/otherDistinguishingCharacteristicOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has other distinguishing characteristic of resource (Deprecated)", da: "har andet særligt kendetegn ved ressourcen"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60055,
      definition: {en: "Relates a resource to a characteristic that applies to the carrier or carriers of the specific early printed resource being described and is assumed not to apply to other resources exemplifying the same resource. includes rubrication, illumination, and other hand colouring, manuscript additions, and binding. (Deprecated)"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/itemSpecificCarrierCharacteristicOfEarlyPrintedResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource-specific carrier characteristic of early printed resource (Deprecated)"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60056",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60056,
      definition: {en: "Relates a resource to a modification that is specific to a resource and is assumed not to apply to other resources exemplifying the same resource.", ar: "يربط بين مصدر وتعديل مخصص لمصدر ومن المفترض أنه لا ينطبق على المصادر الأخرى التي تمثل المصدر نفسه.", da: "Relaterer en ressource til en note om oplysninger om ekstra karakteristika, der er specifikke for en beskreven ressource og der antages ikke at være gyldige for andre ressourcer der eksemplificerere den samme ressource.", de: "Setzt eine Ressource in Beziehung zu einer Variante, die spezifisch für eine Ressource ist und von der angenommen wird, dass sie nicht auf andere Ressourcen zutrifft, die dieselbe Ressource verkörpern.", fi: "Liittää aineiston sille ominaiseen muunnokseen, jonka ei oleteta sisältyvän muihin samaa aineistoa edustaviin aineistoihin."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60055",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/modificationOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has modification of resource", ar: "له تعديل لمصدر", da: "har note om ressourcespecifikke indholdskarakteristika", de: "hat Variante einer Ressource", fi: "muunnos aineistosta", nl: "heeft aanpassing van resource"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60057,
      definition: {en: "Relates a resource to a citation for a resource in the form preferred by a creator, publisher, custodian, indexing or abstracting service, or other agent.", ar: "يربط بين مصدر واستشهاد لمصدر في الشكل المفضل للمنشئ، الناشر، الجهة المودعة، خدمة التكشيف والاستخلاص، أو وكيل آخر.", da: "Relaterer en ressource til en reference til en ressource i den form, der foretrækkes af et ophav, en udgiver, en forvalter eller virksomheder der udarbejder referater og abstracts etc.", de: "Setzt eine Ressource in Beziehung zu einer Zitierweise für eine Ressource, die von einer geistigen Schöpferin/einem geistigen Schöpfer, einem Verlag, einer Verwahrerin/einem Verwahrer, einem Indexierungs- oder Abstract-Service und so weiter bevorzugt wird.", fi: "Liittää aineiston viittausmuotoon, jonka teoksen tekijä, kustantaja, aineiston säilyttäjä, kuvailija, tiivistelmän tekijä tai muu toimija on valinnut aineistosta ensisijaisesti käytettäväksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/preferredCitation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has preferred citation", ar: "له استشهاد مُفضل", da: "har foretrukken referenceform", de: "hat bevorzugte Zitierweise", fi: "ensisijainen viittausmuoto aineistolle", nl: "heeft voorkeurscitatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60058,
      altLabel: {en: "has form of resource", ar: "له شكل لمصدر", da: "har form af ressource", de: "hat Form einer Ressource", fi: "aineiston muoto"},
      definition: {en: "Relates a resource to a type to which a resource belongs.", ar: "يربط بين مصدر ونوع ينتمي إليه مصدر.", da: "Relaterer en ressource til en art, form eller genre, som en ressource tilhører.", de: "Setzt eine Ressource in Beziehung zu einer Art, zu der eine Ressource gehört.", fi: "Liittää aineiston aineistolajiin, johon aineisto kuuluu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/categoryOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has category of resource", ar: "له فئة لمصدر", da: "har ressources art eller form", de: "hat Kategorie einer Ressource", fi: "aineiston kategoria", nl: "heeft categorie van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60944",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60059,
      definition: {en: "Relates a resource to a designation for one or more regions of the world for which a videodisc or video game carrier is encoded, indicating that playback is restricted to a device configured to decode it.", ar: "يربط بين مصدر وتسمية لواحدة أو أكثر من مناطق العالم التي تم تشفير حامل الفيديو أو ألعاب الفيديو، يشير إلى أن عملية التشغيل مقصورة على الأجهزة المكودة بكود المنطقة فقط.", da: "Relaterer en ressource til en kode, der identificerer den region i verden, som en videodisc er kodet til, og som forhindrer, at videodiscen bliver spillet på en afspiller solgt i en anden region.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung, die die Region(en) der Welt angibt, für die eine Videodisk oder ein Videospiel-Datenträger kodiert ist, und der verhindert, dass die Disk von einem Wiedergabegerät, das in einer anderen Region verkauft wurde, abgespielt werden kann.", fi: "Liittää aineiston yhteen tai useampaan nimettyyn alueeseen, joille video tai videopelitallenne on koodattu niin, että se on toistettavissa vain sen koodin avaamiseen konfiguroiduilla laitteilla."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/regionalEncoding.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has regional encoding", ar: "له كود منطقة", da: "har regional kodning", de: "hat Regionalcode", fi: "aineiston aluekoodi", nl: "heeft regiocodering"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60350",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60060,
      definition: {en: "Relates a resource to an agent who approves a resource that is a thesis or dissertation associated with an academic degree.", ar: "يربط مصدر بوكيل يُصادق على مصدر هو أطروحة للحصول على درجة أكاديمية.", da: "Relaterer en ressource til en korporation der tildeler en akademisk grad.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der eine Hochschulschrift genehmigt, die mit einem akademischen Grad in Verbindung steht.", fi: "Liitää opinnäyte- tai väitöskirja-aineiston akateemisen oppiarvon myöntävään toimijaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/degreeGrantingInstitution.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60002",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has degree granting institution", ar: "له مؤسسة مانحة لدرجة", da: "har tildelende institution", de: "hat grad-verleihende Institution", fi: "oppiarvon myöntävä instituutio", nl: "heeft graadverlenende instantie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60061,
      definition: {en: "Relates a resource to an agent who hosts a conference, exhibition, or other event that gives rise to a resource, but has little or no responsibility of an agent for the content.", ar: "يربط مصدر بوكيل يستضيف مؤتمرًا، معرضًا، أو حدثًا آخر يؤدي إلى مصدر، ولكن لديه مسؤولية محدودة عن وكيل أو غير مسؤول مطلقًا عن المحتوى.", da: "Relaterer en ressource til en korporation der afholder en event, udstilling, konference, etc., der fører til en ressource, som korporationen har ringe eller intet ansvar for indholdet af.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der eine Konferenz, eine Ausstellung oder eine andere Veranstaltung ausrichtet, die eine Ressource zur Folge hat, der aber für den Inhalt wenig oder gar keine Verantwortung trägt.", fi: "Liittää aineiston toimijaan, joka isännöi konferenssin, näyttelyn tai muun tapahtuman, mutta jonka sisällöstä toimijalla on vähän tai ei lainkaan vastuuta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/hostInstitution.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60003",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has host institution", ar: "له مؤسسة مُضِيفة", da: "har værtsinstitution", de: "hat gastgebende Institution", fi: "isäntäorganisaatio", nl: "heeft hostorganisatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60062,
      definition: {en: "Relates a resource to an agent who is responsible for managing the financial, technical, and organizational aspects of a production for stage, screen, sound recording, television, webcast, etc.", ar: "يربط مصدر بوكيل مسؤول عن إدارة الجوانب المالية، التقنية، والتنظيمية في الإنتاج للمسرح، للسينما، للتسجيل الصوتي، للتليفزيون، للبث عبر الإنترنت، إلخ.", da: "Relaterer en ressource til en korporation, der er ansvarlig for økonomisk, teknisk og organisatorisk ledelse af en produktion beregnet til scene, lærred, lydoptagelse, tv, webcast etc.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das finanzielle, technische und organisatorische Management einer Produktion für die Bühne, den Bildschirm, die Tonaufnahme, das Fernsehen, für einen Webcast und so weiter verantwortlich ist.", fi: "Liittää teoksen toimijaan, joka on vastuussa näyttämö-, elokuva-, äänite-, televisio-, suoratoistolähetys- tms. tuotannon taloudellisesta, teknisestä ja organisatorisesta johtamisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionCompany.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60004",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has production company", ar: "له شركة إنتاج", da: "har produktionsselskab", de: "hat Produktionsfirma", fi: "aineiston tuotantoyhtiö", nl: "heeft productiebedrijf"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60063,
      definition: {en: "Relates an agent to a place that is a country with which an agent is identified.", ar: "يربط بين مصدر وبلد يُستدل به على وكيل.", da: "Relaterer en ressource til et land som en agent forbindes med.", de: "Setzt eine Ressource in Beziehung zu einem Land, mit dem einem Akteur identifiziert wird.", fi: "Liittää aineston maahan, johon toimija yhdistetään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/countryAssociatedWithAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60999",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has country associated with agent", ar: "له بلد مرتبط بوكيل", da: "har land knyttet til agent", de: "hat Land, das mit einem Akteur in Verbindung steht", fi: "toimijaan liittyvä maa aineistossa", nl: "heeft land geassocieerd met actor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60064,
      definition: {en: "Relates a resource to a country, state, province, etc., or local place in which an organization has its headquarters. (Deprecated)"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/locationOfHeadquarters.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has location of headquarters (Deprecated)"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60325",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60065,
      definition: {en: "Relates a resource to an agent that is a court governed by court rules, regardless of their official nature.", ar: "يربط بين مصدر ومحكمة تخضع لقواعد محكمة، بغض النظر عن طبيعتها الرسمية.", da: "Relaterer en ressource til en retsinstans, der er underlagt retsregler, uanset hvad deres officielle art er.", de: "Setzt eine Ressource in Beziehung zu einem Gericht, das durch gerichtliche Verfahrensvorschriften geregelt wird, unabhängig von deren förmlicher Rechtsnatur.", fi: "Liittää aineiston sääntöjen ohjaamaan tuomioistuimeen riippumatta säännön virallisesta luonteesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/courtGoverned.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60005",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has court governed", ar: "له محكمة خاضعة", da: "har retsinstans underlagt", de: "hat durch Verfahrensvorschriften geregeltes Gericht", fi: "sääntöjen ohjaama tuomioistuin", nl: "heeft hof geregeerd"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60066,
      definition: {en: "Relates a resource to an agent who is responsible for creating a collection resource by selecting and arranging resources that are other resources.", ar: "يربط بين مصدر وأَمِين معرض يقوم بجمع مصادر من مصادر مختلفة رُتبت، وُوصفت، وفُهرست كمجموعة.", da: "Relaterer en ressource til en samler der sammenfører ressourcer fra forskellige kilder, som så bliver arrangeret, beskrevet og katalogiseret som en samling.", de: "Setzt eine Ressource in Beziehung zu einer Kuratorin/einem Kurator, der Ressourcen aus unterschiedlichen Quellen zusammenträgt, die dann als Sammlung geordnet, beschrieben oder katalogisiert werden.", fi: "Liittää aineiston toimijaan, joka vastaa uuden teoksen, kuten bibliografian tai hakemiston luomisesta valitsemalla, järjestämällä, koostamalla ja toimittamalla dataa, informaatiota tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/collector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60006",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has collector", ar: "له جامع", da: "har samler", de: "hat Sammlerin/Sammler", fi: "kokoelman muodostaja", nl: "heeft verzamelaar"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60067,
      definition: {en: "Relates a resource to an agent who is responsible for creating an analytic finding aid.", ar: "يربط بين مصدر وأَمِين معرض يقوم بتسجيل مصادر أو جردها لمجموعة مجمعة من المصادر", da: "Relaterer en ressource til en samler der lister eller opstiller ressourcerne i et samlingsRessource, som fx en samling af ressourcer.", de: "Setzt eine Ressource in Beziehung zu einer Kuratorin/einem Kurator, die/der Ressourcen in einer aggregierten Ressource verzeichnet oder inventarisiert, wie zum Beispiel eine Sammlung von Ressourcen.", fi: "Liittää aineiston toimijaan, jossa toimija vastaa metatietoteoksen luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/collectionRegistrar.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60007",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has collection registrar", ar: "له مسجل مجموعة", da: "har samlingsregistrator", de: "hat Registrarin/Registrar", fi: "kokoelman luetteloija", nl: "heeft collectieregistrator"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60428",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60068,
      definition: {en: "Relates a resource to an agent who is a current owner of a resource who deposits the resource into the custody of another agent without transferring ownership.", ar: "يربط مصدر بوكيل هو المالك الحالي لمصدر قام بإيداع مصدر تحت وصاية وكيل آخر دون نقل ملكيتها.", da: "Relaterer en ressource til en nuværende ejer af en ressource deponeret i forvaring hos en anden agent, men beholder det oprindelige ejerskab.", de: "Setzt eine Ressource in Beziehung zu einer gegenwärtigen Eigentümerin/einem gegenwärtigen Eigentümer (Akteur) einer Ressource, die/der die Ressource in die Obhut eines anderen Akteurs gibt, ohne das Eigentumsrecht zu übertragen.", fi: "Liittää aineiston toimijaan, joka on aineiston nykyinen omistaja ja luovuttanut aineiston toisen toimijan haltuun siirtämättä omistajuutta"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/depositor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has depositor", ar: "له مُودِع", da: "har depositor", de: "hat Leihgeberin/Leihgeber", fi: "aineiston tallettaja", nl: "heeft bruikleengever"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60400",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60069,
      definition: {en: "Relates a resource to a timespan associated with a claim of protection under copyright or a similar regime.", ar: "يربط بين مصدر وفترة زمنية مرتبطة بفترة حماية حقوق الطبع والنشر أو أي نظام حماية آخر.", da: "Relaterer en ressource til et år knyttet til et krav om beskyttelse i henhold til ophavsret eller et lignende system.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, der mit einem Schutzanspruch nach dem Urheberrecht oder einem ähnlichen Regelwerk in Verbindung steht.", fi: "Liittää aineiston ajanjaksoon, joka liittyy copyright-säädösten tai vastaavien säädösten alaiseen copyright-suojaukseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/copyrightDate.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61108",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has copyright date", ar: "له تاريخ حقوق الطبع والنشر", da: "har copyrightår", de: "hat Copyright-Datum", fi: "aineiston tekijänoikeusvuosi", nl: "heeft copyrightdatum"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60070,
      definition: {en: "Relates a resource to a timespan during which a published resource is distributed.", ar: "يربط بين مصدر وفترة زمنية يتم خلالها توزيع مصدر منشور.", da: "Relaterer en ressource til et år eller dato knyttet til distributionen af en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, in dem eine veröffentlichte Ressource vertrieben wird.", fi: "Liittää aineiston julkaistun aineiston jakeluun liittyvään ajanjaksoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfDistribution.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60979",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of distribution", ar: "له تاريخ توزيع", da: "har distributionsår", de: "hat Vertriebsdatum", fi: "aineiston jakeluaika", nl: "heeft datum van distributie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61020",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60071,
      definition: {en: "Relates a resource to a timespan during which an unpublished resource is inscribed, fabricated, constructed, or otherwise produced.", ar: "يربط بين مصدر وفترة زمنية يتم خلالها تدوين مصدر غير منشور، أو تأليفه، أو تجميعه، أو إنتاجه بطريقة أخرى.", da: "Relaterer en ressource til et år eller dato knyttet til indgravering, fremstilling, konstruktion etc. af en ressource i upubliceret form.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, in dem eine unveröffentlichte Ressource beschriftet, erschaffen, konstruiert oder anderweitig produziert wird.", fi: "Liittää aineiston julkaisemattoman aineiston kaivertamiseen, valmistamiseen, kokoamiseen tai muuhan tuottamiseen liittyvään ajanjaksoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfProduction.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60982",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of production", ar: "له تاريخ إنتاج", da: "har produktionsår", de: "ist Entstehungsdatum", fi: "aineiston tuotantoaika", nl: "heeft datum van productie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61020",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60072,
      definition: {en: "Relates a resource to a timespan during which a published resource is printed, duplicated, cast, or otherwise manufactured.", ar: "يربط بين مصدر وفترة زمنية يتم خلالها طباعة مصدر منشور، أو نسخه، أو صياغته، أو إنتاجه بطريقة أخرى.", da: "Relaterer en ressource til et år eller dato knyttet til trykning, duplikering, støbning etc. af en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, in dem eine veröffentlichte Ressource gedruckt, vervielfältigt, gegossen oder anderweitig hergestellt wird.", fi: "Liittää aineiston julkaistun aineiston painamiseen, monistamiseen, kirjasinten valamiseen tai muuhun valmistamiseen liittyvään ajanjaksoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfManufacture.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60981",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of manufacture", ar: "له تاريخ تصنيع", da: "har fremstillingsår", de: "ist Herstellungsdatum", fi: "aineiston valmistusaika", nl: "heeft datum van vervaardiging"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61020",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60073,
      definition: {en: "Relates a resource to a timespan during which a published resource is published, released, or issued.", ar: "يربط بين مصدر وفترة زمنية يتم خلالها نشر مصدر منشور، أو إطلاقه، أو إصداره.", da: "Relaterer en ressource til et år eller dato knyttet til publicering, offentliggørelse eller udgivelse af en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, in dem eine veröffentlichte Ressource veröffentlicht, freigeschaltet oder herausgegeben wird.", fi: "Liittää aineiston aineiston kustantamiseen, julkaisemiseen tai ilmestymiseen liittyvään ajanajaksoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfPublication.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60983",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of publication", ar: "له تاريخ نشر", da: "har udgivelsesår", de: "hat Erscheinungsdatum", fi: "aineiston julkaisuaika", nl: "heeft datum van publicatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61020",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60074,
      definition: {en: "Relates a resource to a timespan associated with recording, filming, etc., the content of a resource.", ar: "يربط بين مصدر وفترة زمنية مرتبطة بتسجيل، تصوير، الخ.، محتوى مصدر.", da: "Relaterer en ressource til et år eller dato, der er knyttet til en indspilning, filmoptagelse, etc., af en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, der mit der Aufnahme, dem Filmen und so weiter des Inhalts einer Ressource in Verbindung steht.", fi: "Liittää aineiston ajanjaksoon, joka liittyy aineiston sisällön äänitykseen, filmaukseen tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfCapture.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60976",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of capture", ar: "له تاريخ التقاط", da: "har optagelsestidspunkt/indspilningstidspunkt", de: "ist Aufzeichnungsdatum", fi: "aineiston tallennusajankohta", nl: "heeft datum van vastleggen"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60075,
      definition: {en: "Relates a nomen to a timespan that is a date or range of dates that is associated with the use of a nomen.", ar: "يربط بين تسمية وتاريخ أو نطاق تواريخ مرتبطة باستخدام اسم كيان.", da: "Relaterer et navn til et år eller dato eller række af år eller datoer datoer knyttet til brugen af det navn, der er valgt som det foretrukne navn for en agent.", de: "Setzt ein Nomen in Beziehung zu einem Datum oder einem Datumsbereich, das/der mit der Verwendung von einer Bezeichnung für eine Entität in Verbindung steht.", fi: "iittää nomenin ajanjaksoon, joka on entiteetin nimityksen käyttöön liittyvä ajankohta tai aikaväli."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfUsage.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60986",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of usage", ar: "له تاريخ استخدام", da: "har anvendelsesperiode", de: "hat Verwendungsdatum", fi: "aineiston käyttöajankohta", nl: "heeft datum van gebruik"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60076,
      definition: {en: "Relates an agent to a timespan during which an agent is active in their primary field of endeavor.", ar: "يربط بين وكيلً وتاريخ أو نطاق تواريخ تُشير إلى فترة كان الوكيل نشطًا في مجال عمله الأساسي.", da: "Relaterer en ressource til en periode, hvori en agent var aktiv i sit primære virkefelt.", de: "Setzt einen Akteur in Beziehung zu einem Datum oder einer Reihen von Daten, die auf einen Zeitraum hinweisen, in dem ein Akteur in seinem primären Tätigkeitsfeld aktiv ist.", fi: "Liittää henkilön ajanjaksoon, jonka aikana henkilö on ollut aktiivinen ensisijaisella toiminta-alallaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/periodOfActivityOfAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60990",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has period of activity of agent", ar: "له فترة نشاط لوكيل", da: "har aktivitetsperiode for agent", de: "hat Wirkungszeitraum eines Akteurs", fi: "toimijan toiminta-aika", nl: "heeft periode van activiteit van actor"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60324",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60077,
      definition: {en: "Relates a resource to a designation of a named revision of an edition in another language or script.", ar: "يربط بين مصدر وتسمية لمراجعة مسماة لطبعة بلغة أو نص مختلف عن تلك المُسجلة داخل تسمية مراجعة مسماه لعنصر طابعه.", da: "Relaterer en ressource til en betegnelse for en navngivet revision af en udgave på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af den navngivne revision. ", de: "Setzt eine Ressource in Beziehung zu einer Ausgabebezeichnung einer näher erläuterten Überarbeitung in einer oder Schrift, die von der bereits erfassten Ausgabezeichnung einer näher erläuterten Überarbeitung abweicht.", fi: "Nimetyn uudistetun painoksen määrite toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelDesignationOfNamedRevisionOfEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel designation of named revision of edition", ar: "له تسمية موازية لمراجعة مسماة لطبعة", da: "har parallel betegnelse for en navngivet revision af en udgave", de: "hat parallele Ausgabebezeichnung einer näher erläuterten Überarbeitung", fi: "aineiston nimetyn uudistetun painoksen rinnakkainen määrite", nl: "heeft parallelle aanduiding van benoemde herziening van editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60078,
      definition: {en: "Relates a resource to a designation of edition in another language or script.", ar: "يربط بين مصدر وتسميه لطبعة بلغة أو نص مختلف عن تلك المُسجلة داخل تسمية لعنصر طابعه.", da: "Relaterer en ressource til en betegnelse for en udgave på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af udgavebetegnelsen.", de: "Setzt eine Ressource in Beziehung zu einer Ausgabebezeichnung in einer Sprache oder Schrift, die von der bereits erfassten Ausgabezeichnung abweicht.", fi: "Liittää aineiston painoksen määritteeseen toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelDesignationOfEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel designation of edition", ar: "له تسمية موازية لطبعة", da: "har parallel udgavebetegnelse", de: "hat parallele Ausgabebezeichnung", fi: "aineiston painoksen rinnakkainen määrite", nl: "heeft parallelle aanduiding van editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60079,
      definition: {en: "Relates an agent to a designation of the sequencing of a conference, exhibition, or other formally named and convened event that gives rise to a resource.", ar: "يربط بين مصدر وتحديد تتابع مؤتمر، إلخ.، ضمن سلسلة من المؤتمرات، إلخ.", da: "Relaterer en ressource til en sekvensbetegnelse etc. i en række af konferencer etc.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung für ein Zählfolge einer Konferenz und so weiter innerhalb einer Reihe von Konferenzen und so weiter.", fi: "Liittää aineiston konferenssin, näyttelyn tai muun nimetyn ja kokontuneen tapahtuman järjestyslukuun."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/numberOfConference.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has number of conference", ar: "له رقم مؤتمر", da: "har nummer på konference etc.", de: "hat Zählung einer Konferenz", fi: "konferenssin numero aineistolle", nl: "heeft nummer van conferentie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60080,
      definition: {en: "Relates a resource to a designation that is assigned to a resource to identify its position in a sequence of individual parts of a larger resource.", ar: "يربط بين مصدر وتسمية في شكل أرقام أو حروف هجائية، أو تاريخ أو أي فترة زمنية أخرى، مستخدمة لتشير إلى تسلسل جزء من مصدر ضمن مصدر كامل.", da: "Relaterer en ressource til en sekvensbetegnelse for en del eller flere dele i et større Ressource.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung in Form von Nummern oder Buchstaben oder zu einem Datum oder einem anderen Zeitraum, die/das/der verwendet wird, um die Abfolge eines Teils einer Ressource innerhalb der gesamten Ressource anzugeben.", fi: "Liittää aineiston numero- tai kirjainmuotoiseen määritteeseen tai ajankohtaan, jota käytetään määrittämään aineiston osan paikka aineiston kokonaisuudessa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/numberingOfPart.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Numbering may consist of a numeral, a letter, any other character, or the combination of these with or without an accompanying caption, and/or a chronological designation.", ar: "قد يتكون الترقيم من رقم، أو حرف، أو أي تمثيلات أخرى تُستخدم بشكل منفصل أو مُجمع، وقد يُصاحبها أو لا يُصاحبها تعليقًا، و/أو تسمية زمنية.", da: "Nummerering af del kan omfatte et tal, et bogstav, ethvert andet tegn eller en kombination af disse med eller uden tilhørende tekst og/eller en kronologisk betegnelse", de: "Darunter fallen Ziffern, Buchstaben, beliebige andere Zeichen oder Kombinationen davon (mit oder ohne begleitende Beschriftung) und/oder chronologische Bezeichnungen.", fi: "Numerointi voi koostua numerosta, kirjaimesta, mistä tahansa muusta merkistä tai näiden yhdistelmästä. Siihen voi kuulua, mutta välttämättä ei kuulu, liittyvä seloste ai kronologinen tunniste."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has numbering of part", ar: "له ترقيم لجزء", da: "har nummerering af del", de: "hat Zählung eines Teils", fi: "aineiston osan numerointi", nl: "heeft nummering van deel"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60081,
      definition: {en: "Relates a resource to a nomen that is a designation that is assigned to a resource to identify its position in a sequence of individual parts of a larger resource or parts or issues of a larger resource.", ar: "يربط بين مصدر وتسمية لتسلسل خاصة بجزء أو عدة أجزاء ضمن سلسلة.", da: "Relaterer en ressource til en sekvensbetegnelse for en del eller flere dele i en serie.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung einer Sequenzierung eines Teils oder mehrerer Teile innerhalb einer Reihe.", fi: "Liittää aineiston määritelmään, joka identifioi sen sijainnin sarjan osan tai osien jaksossa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/numberingWithinSequence.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Numbering may include dates or other timespans, alphanumeric or other characters, and an accompanying caption.", ar: "قد يتضمن الترقيم تواريخ أو أي فترات زمنية أخرى، أو تمثيلات هجائية رقمية أو تمثيلات أخرى، ويتضمن أيضًا تعليق مصاحب.", da: "Nummerering omfatter et tal, et bogstav, ethvert andet tegn eller en kombination af disse med eller uden tilhørende tekst og/eller en kronologisk betegnelse.", de: "Darunter fallen Daten oder andere Zeiträume, alphanumerische oder andere Zeichen und ein Begleittext.", fi: "Numerointi voi sisältää päivämääriä tai muita ajanjaksoja, aakkosnumeerisia tai muita merkkejä sekä selosteen."},
      inverseOf: "http://rdaregistry.info/Elements/u/P61209",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has numbering within sequence", ar: "له ترقيم ضمن تسلسل", da: "har nummerering indenfor serie", de: "hat Zählung innerhalb einer Reihe", fi: "sarjan sisäinen numerointi aineistolle", nl: "heeft nummering binnen volgorde"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60082,
      definition: {en: "Relates a resource to a designation of a sequencing of a part or parts within a subseries. (Deprecated)", da: "Relaterer en ressource til en sekvensbetegnelse for en del eller flere dele i en underserie."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/numberingWithinSubseries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Numbering may consist of a numeral, a letter, any other character, or the combination of these with or without an accompanying caption and/or a chronological designation. (Deprecated)", da: "Nummerering omfatter et tal, et bogstav, ethvert andet tegn eller en kombination af disse med eller uden tilhørende tekst og/eller en kronologisk betegnelse."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has numbering within subseries (Deprecated", da: "har nummerering indenfor underserie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60083,
      definition: {en: "Relates a resource to a resource in a digital format that is a result of a transfer of a resource in an analog format.", ar: "يربط بين مصدر ومصدر في صيغة رقمية ناتج عن تحويله في شكل تناظري.", da: "Relaterer en ressource til en ressource i et digitalt format der er resultatet of en overførsel af en ressource i et analogt format.", de: "Setzt eine Ressource in Beziehung zu einer Ressource in einem digitalen Format, die ein Ergebnis einer Übertragung einer Ressource in ein analoges Format ist.", fi: "Liittää aineiston digitaalisessa muodossa olevaan aineistoon, joka analogisen aineiston muunnoksen tulos."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/electronicReproduction.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60469",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has electronic reproduction", ar: "له إنتاج إلكتروني", da: "har elektronisk reproduktion", de: "hat elektronische Reproduktion", fi: "aineiston digitoitu jäljenne", nl: "heeft elektronische reproductie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60272",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60084,
      definition: {en: "Relates a resource to an agent who is a director who is responsible for the general management and supervision of a filmed performance.", ar: "يربط مصدر بوكيل يعمل بصفته مخرجًا مسؤولًا عن الإدارة العامة والإشراف على أداء الفيلم.", da: "Relaterer en ressource til en instruktør, der er ansvarlig for ledelse og tilsyn med en filmoptagelse.", de: "Setzt eine Ressource in Beziehung zu einer Regisseurin/einem Regisseur, die/der für das allgemeine Management und die Leitung einer verfilmten Darbietung verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka ohjaajana vastaa elokuvatun esityksen yleisestä johtamisesta ja valvonnasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/filmDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60009",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has film director", ar: "له مخرج فيلم", da: "filminstruktør", de: "hat Filmregisseurin/Filmregisseur", fi: "elokuvaohjaaja aineistossa", nl: "heeft filmregisseur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60449",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60085,
      definition: {en: "Relates a resource to an agent who is a director who is responsible for the general management and supervision of a radio program.", ar: "يربط مصدر بوكيل يعمل بصفته مخرجًا مسؤولًا عن الإدارة العامة والإشراف على برنامج إذاعي.", da: "Relaterer en ressource til en instruktør, der er ansvarlig for ledelse af og tilsyn med et radioprogram.", de: "Setzt eine Ressource in Beziehung zu einer Regisseurin/einem Regisseur (Akteur), die/der für das allgemeine Management und die Leitung einer Hörfunksendung verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka ohjaajana vastaa radio-ohjelman yleisestä johtamisesta ja valvonnasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/radioDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60010",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has radio director", ar: "له مخرج إذاعي", da: "har radioinstruktør", de: "hat Hörfunkregisseurin/Hörfunkregisseur", fi: "radio-ohjaaja aineistossa", nl: "heeft radioregisseur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60449",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60086,
      definition: {en: "Relates a resource to an agent who is a director who is responsible for the general management and supervision of a television program.", ar: "يربط مصدر بوكيل يعمل بصفته مخرجًا مسؤولًا عن الإدارة العامة والإشراف على برنامج تليفزيوني.", da: "Relaterer en ressource til en instruktør, der er ansvarlig for ledelse af og tilsyn med et tv-program.", de: "Setzt eine Ressource in Beziehung zu einer Regisseurin/einem Regisseur, die/der für das allgemeine Management und die Leitung einer Fernsehsendung verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka ohjaajana vastaa televisio-ohjelman yleisestä johtamisesta ja valvonnasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/televisionDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60011",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has television director", ar: "له مخرج تلفزيوني", da: "har tv-instruktør", de: "hat Fernsehregisseurin/Fernsehregisseur", fi: "televisio-ohjaaja aineistossa", nl: "heeft televisieregisseur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60449",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60087,
      definition: {en: "Relates a resource to a name of distributor in a language or script that differs from that recorded in a name of distributor element.", ar: "يربط بين مصدر واسم موزع بلغة أو نص مختلف عن تلك المُسجل بإسم عنصر موزع.", da: "Relaterer en ressource til et distributørnavn på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af distributørnavnet.", de: "Setzt eine Ressource in Beziehung zu einem Vertriebsnamen in einer Sprache oder Schrift, die von dem bereits erfassten Vertriebsnamen abweicht.", fi: "Liittää aineiston jakelijan nimeen, joka on jakelijan nimi toisella kielellä tai kirjoitusjärjestelmällä, ja joka eroaa jakelija-elementtiin tallennetusta nimestä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelNameOfDistributor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel name of distributor", ar: "له اسم موازي للموزع", da: "har parallelt distributørnavn", de: "hat parallelen Vertriebsnamen", fi: "aineiston jakelijan rinnakkainen nimi", nl: "heeft parallelle naam van distributeur"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60088,
      definition: {en: "Relates a resource to a dramatic resource adapted from another resource.", ar: "يربط بين مصدر ومصدر درامي مقتبس من مصدر آخر.", da: "Relaterer en ressource til en dramatisk ressource bearbejdet ud fra en oprindelig ressource.", de: "Setzt eine Ressource in Beziehung zu einer Theaterressource, die auf einer anderen Ressource basiert.", fi: "Liittää aineiston toisesta aineistosta sovitettuun aineistoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dramatizedAs.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60225",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is dramatized as", ar: "هو معدل دراميًا كـ", da: "er dramatiseret som", de: "ist Bühnenbearbeitung als", fi: "dramatisoitu aineisto", nl: "is gedramatiseerd als"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60260",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60089,
      definition: {en: "Relates an agent to a field of endeavor, area of competence, or responsibility in which an agent is engaged. ", ar: "يربط بين وكيل ومجال عمل، مجال خبرة، اختصاص، مسؤولية، سلطة إلخ.، الذي يمارسه الوكيل", da: "Relaterer en ressource til det område inden for hvilket en agent er eller var engageret.", de: "Setzt einen Akteur in Beziehung zu einem Tätigkeitsfeld, einem Wissensgebiet, einem Kompetenzbereich, einer Verantwortlichkeitsangabe, einer Zuständigkeit und so weiter, in dem/der ein Akteur aktiv ist.", fi: "Liittää toimijan toimijan pyrkimykseen, asiantuntemukseen, kompetenssiin, vastuuseen, toimivaltaan tms"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/fieldOfActivityOfAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has field of activity of agent", ar: "له مجال نشاط لوكيل", da: "har agents virkefelt", de: "hat Betätigungsfeld eines Akteurs", fi: "toimijan toiminta-ala", nl: "heeft veld van activiteit van actor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60090,
      definition: {en: "Relates a resource to a formal recognition of excellence or other merit given by an award- or prize-granting body, for the content of a resource.", ar: "يربط بين مصدر وإقرار رسمي بإمتياز أو أي استحقاق آخر يُمنح بواسطة هيئة مانحة للمكافأت -الجوائز-، لمحتوى أحد المصادر.", da: "Relaterer en ressource til en formel anerkendelse af fortræffelig kvalitet etc., givet af en pristildelende institution for indholdet af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer formalen Anerkennung von herausragenden Fähigkeiten oder Leistungen, die durch eine auszeichnende oder Preis vergebende Körperschaft für den Inhalt einer Ressource verliehen wird.", fi: "Liittää aineiston tunnustuksen tai palkinnon myöntävän tahon antamaan laadukkuuden tai muiden ansioiden muodolliseen tunnustukseen aineiston sisällöstä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/award.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has award", ar: "له منحة", da: "har udmærkelse", de: "hat Auszeichnung", fi: "palkinto aineistolle", nl: "heeft prijs"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60091,
      definition: {en: "Relates a resource to an agent who is a former owner of a resource who donates the resource to another owner.", ar: "يربط بين مصدر ومالك سابق لمصدر قام بالتبرع بهذا المصدر إلى مالك آخر.", da: "Relaterer en ressource til en tidligere ejer af en ressource, der har doneret denne ressource til en anden ejer.", de: "Setzt eine Ressource in Beziehung zu einer früheren Eigentümerin/einem früheren Eigentümer einer Ressource, die/der die Ressource einer anderen Eigentümerin/einem anderen Eigentümer überlässt.", fi: "Liittää aineiston aiempaan omistajaan, joka on lahjoittanut aineiston toiselle omistajalle."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/donor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60012",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has donor", ar: "له متبرع", da: "har donor", de: "hat Stifterin/Stifter", fi: "aineiston lahjoittaja", nl: "heeft schenker"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60401",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60092,
      definition: {en: "Relates a resource to an agent who is a former owner of a resource who sells the item to another owner.", ar: "يربط بين مصدر ومالك سابق لمصدر قام ببيع هذا المصدر إلى مالك آخر.", da: "Relaterer en ressource til en tidligere ejer af en ressource, der har solgt denne ressource til en anden ejer.", de: "Setzt eine Ressource in Beziehung zu einer früheren Eigentümerin/einem früheren Eigentümer einer Ressource, die/der die Ressource einer anderen Eigentümerin/einem anderen Eigentümer verkauft hat.", fi: "Liittää aineiston aiempaan omistajaan, joka on myynyt aineiston toiselle omistajalle."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/seller.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60013",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has seller", ar: "له بائع", da: "har sælger", de: "hat Verkäuferin/Verkäufer", fi: "aineiston myyjä", nl: "heeft verkoper"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60401",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60093,
      definition: {en: "Relates a resource to a general type of data content encoded in a computer file.", ar: "يربط بين مصدر ونوع عام لمحتوى بيانات تم تشفيرها في ملف كمبيوتر.", da: "Relaterer en ressource til en betegnelse for type af dataindhold, der er kodet i en computerfil.", de: "Setzt eine Ressource in Beziehung zu den Details zu einer allgemeinen Art von Dateninhalt, der in einer Datei kodiert ist.", fi: "Liittää aineiston tiedostoon koodatun datasisällön yleiseen tyyppiin"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/fileType.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has file type", ar: "له نوع الملف", da: "har filtype", de: "hat Dateityp", fi: "aineiston tiedostotyyppi", nl: "heeft bestandstype"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60350",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60095,
      definition: {en: "Relates a resource to a group with which an agent is affiliated or is affiliated through employment, membership, cultural identity, etc. (Deprecation)", da: "Relaterer en ressource til en gruppe, som en agent er eller har været tilknyttet via beskæftigelse, medlemskab, kulturel identitet etc."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/affiliation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has affiliation (Deprecated)", da: "har tilhørsforhold"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60096,
      definition: {en: "Relates a resource to an agent who is a government enacting a resourcce that is a law, regulation, constitution, court rule, or other legislation.", ar: "يربط مصدر بوكيل يُمثل حكومة تسن مصدرًا هو قانون، أو لائحة، أو دستور، أو حكم قضائي، أو تشريع آخر.", da: "Relaterer en ressource til en jurisdiktion, der har vedtaget en lov, forordning, forfatning, retsplejeregel etc.", de: "Setzt eine Ressource in Beziehung zu einer Regierung, die eine Ressource erlässt, bei dem es sich um ein Gesetz, eine Verordnung, eine Verfassung, eine Rechtsverordnung oder eine andere Gesetzgebung handelt.", fi: "Liittää aineiston lainsäädännöllistä aineistoa kuten lakeja, perustuslakia, tuomioistuimen sääntöjä tai muuta lainsäädäntöä säätävään hallinnolliseen toimijaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/enactingGovernment.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60014",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has enacting government", ar: "له سلطة سن القوانين", da: "har vedtagende jurisdiktion", de: "Normerlassende Gebietskörperschaft", fi: "toimijan säätävä lainkäyttöalue", nl: "heeft vaststellende jurisdictie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60097,
      definition: {en: "Relates an agent to a place that is a jurisdiction governed by a law, regulation, etc., that was enacted by another government.", ar: "يربط مكانًا يُمثل ولاية قضائية لوكيل يُمثل حكومة تخضع لسُلطة نطاق جغرافي يحكمه قانون أو لائحة تنظيمية، إلخ.، سنتها حكومة أخرى.", da: "Relaterer en ressource til en jurisdiktion, der har vedtaget en lov, forordning, forfatning, retsplejeregel etc.", de: "Setzt eine Gebietskörperschaft in Beziehung zu einem Akteur, bei dem es sich um die Regierung einer Gebietskörperschaft handelt, die durch ein Gesetz, eine Verordnung und so weiter geregelt wird, das/die von einer anderen Regierung erlassen wurde.", fi: "Liittää paikan julkishallinnolliseen toimijaan, jota toisen julkishallinnollisen yhteisön säätämät lait, asetukset tms. ohjaavat."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/jurisdictionGoverned.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60015",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has jurisdiction governed", ar: "له اختصاص قضائي", da: "har jurisdiktion underlagt", de: "hat geregelte Gebietskörperschaft", fi: "toimijan soveltava lainkäyttöalue", nl: "heeft geregeerde jurisdictie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61018",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60098,
      definition: {en: "Relates an agent to a language that is used by an agent in its communications.", ar: "يربط بين مصدر ولغة يستخدمها وكيل في اتصالاته، عند الكتابة للنشر، للبث الإذاعي، إلخ.", da: "Relaterer en ressource til et sprog en agent anvender til at skrive til publicering, udsendelse etc.", de: "Setzt eine Ressource in Beziehung zu einer Sprache, die ein Akteur bei seiner Kommunikation verwendet, wenn er für eine Veröffentlichung, einen Hörfunkbeitrag und so weiter schreibt.", fi: "Liittää aineiston kieleen, jota toimija käyttää viestinnässään kirjallisissa julkaisuissa, radiolähetyksessä yms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/languageOfAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has language of agent", ar: "له لغة لوكيل", da: "har agents sprog", de: "hat Sprache eines Akteurs", fi: "toimijan käyttämä kieli", nl: "heeft taal van actor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60099,
      definition: {en: "Relates a resource to a language used for the content of a resource.", ar: "يربط بين مصدر ولغة مُستخدمة لمحتوى مصدر.", da: "Relaterer en ressource til et sprog, der anvendes til at udtrykke en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einer Sprache, die für den Inhalt einer Ressource verwendet wird.", fi: "Liittää aineiston aineiston sisällössä käytettyyn kieleen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/languageOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has language of resource", ar: "له لغة لمصدر", da: "har indholdets sprog", de: "hat Sprache einer Ressource", fi: "aineiston kieli", nl: "heeft taal van resource"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60100,
      definition: {en: "Relates a resource to a larger resource of which a part is a discrete component that exactly reproduces a related resource embodying a resource.", ar: "يربط بين مصدر ومصدر أكبر بحيث يُشكل جزء منه عنصرًا منفصلًا يقوم باستنساخ مصدر يجسد المصادر ذات الصلة بشكل حرفي.", da: "Relaterer en ressource til en større ressource, hvoraf en del udgør en separat del, der er en nøjagtig reproduktion af en anden ressource, der omfatter den samme ressource.", de: "Setzt eine Ressource in Beziehung zu einer größeren Ressource, von der ein Teil ein einzelnen Bestandteil ist, der eine in Beziehung stehende Ressource, die eine Ressource verkörpert, exakt reproduziert.", fi: "Liittää aineiston laajempaan aineistoon, jonka osana on erillinen, liittyvän aineiston tarkasti kopioiva aineisto."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/facsimilePartOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60300",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is facsimile part of", ar: "هو جزء طبق الأصل لـ", da: "er faksimile indeholdt i", de: "ist Faksimile als Teil von", fi: "näköispainos sisältyy aineistoon", nl: "is facsimile deel van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60101",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60101,
      altLabel: {en: "is contained in resource", ar: "هو متضمن في مصدر", da: "er indholdt i ressource", de: "ist enthalten in (Ressource)", fi: "sisältyy aineistoon"},
      definition: {en: "Relates a resource to a resource that has another resource as a discrete component.", ar: "يربط بين مصدر ومصدر له مصدر آخر كعنصر منفصل.", da: "Relaterer en ressource til en større ressource, som ressourcen udgør en separat del af.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die eine andere Ressource als einzelnen Bestandteil enthält.", fi: ".Liittää aineiston aineistoon, johon itsenäisenä osana sisältyy toinen aineisto"},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60100", "http://rdaregistry.info/Elements/u/P60192", "http://rdaregistry.info/Elements/u/P60193", "http://rdaregistry.info/Elements/u/P60194", "http://rdaregistry.info/Elements/u/P60317", "http://rdaregistry.info/Elements/u/P61223"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/partOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60249",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is part of resource", ar: "هو جزء من المصدر", da: "er indeholdt i", de: "ist Teil von Ressource", fi: "aineiston osa", nl: "is deel van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60714",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60102,
      altLabel: {en: "is prequel to", ar: "له بادئه لـ", da: "er forløber til", de: "ist Prequel zu", fi: "aineiston esiosa"},
      definition: {en: "Relates a resource to a resource that extends the narrative of another resource forwards in time.", ar: "يربط بين مصدر ومصدر يوسع السرد لمصدر آخر يسبقه زمنيًا.", da: "Relaterer en ressource til en senere ressource, der fortsætter en tidligere ressources fortælling.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die den Erzählstrang einer anderen Ressource zeitlich vorwärts erweitert.", fi: "Liitää aineiston aineistoon, joka laajentaa toisen aineiston kerrontaa ajassa eteenpäin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/sequel.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60577",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has sequel", ar: "له تَتِمّة", da: "er efterfølger", de: "hat Sequel", fi: "aineiston jatko-osa", nl: "heeft sequel"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60278",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60103,
      definition: {en: "Relates a resource to a resource whose content partially supersedes and renders obsolete the content of another resource.", ar: "يربط بين مصدر ومصدر يحل محتواه جزئيا محل مصدر آخر ويجعل محتواه متقادمًا.", da: "Relaterer en ressource til en senere ressource, der er delvist anvendt i stedet for et tidligere udtryk, normalt fordi den senere ressource indeholder opdateret eller ny information, der betyder, at den tidligere ressource er forældet.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, dessen Inhalt den Inhalt einer anderen Ressource teilweise ersetzt und obsolet macht.", fi: "Liittää aineiston aineistoon, jonka sisältö osittain korvaa ja tekee vanhentuneeksi toisen aineiston."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/replacedInPartBy.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "This relationship applies generally to single-part units, multipart monographs, and integrating resources.", ar: "تنطبق هذه العلاقة بشكل عام على وحدات من جزء واحد، مونوجرافيا متعددة الأجزاء، ومصادر متكاملة.", da: "Denne relation anvendes generelt til enkeltstående monografier, flerbindsværker og integrerende ressourcer.", de: "Diese Beziehung gilt allgemein für einteilige Einheiten, mehrteilige Monographien und integrierende Ressourcen.", fi: "Koskee yleensä yksiosaisia yksiköitä, moniosaisia monografioita ja päivittyviä aineistoja."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60479",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is replaced in part by", ar: "هو مستبدَل جزئيًا", da: "er delvis erstattet af", de: "ist teilweise ersetzt durch", fi: "osittain korvattu aineistolla", nl: "is gedeeltelijk vervangen door"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60278",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60104,
      definition: {en: "Relates a resource to a resource whose content supersedes and renders obsolete the content of another resource.", ar: "يربط بين مصدر ومصدر يحل محتواه محل محتوى مصدر آخر ويجعله متقادمًا.", da: "Relaterer en ressource til en senere ressource, der er anvendt delvist i stedet for en tidligere ressource, normalt fordi den senere ressource indeholder opdateret eller ny information, der betyder, at den tidligere ressource er forældet.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, deren Inhalt den Inhalt einer anderen Ressource ersetzt und obsolet macht.", fi: "Liittää aineiston aineistoon, jonka sisältö korvaa ja tekee vanhentuneeksi toisen aineiston."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/replacedBy.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "This relationship applies generally to single-part units, multipart monographs, and integrating resources.", ar: "تنطبق هذه العلاقة بشكل عام على وحدات من جزء واحد، مونوجرافيا متعددة الأجزاء، ومصادر متكاملة.", da: "Den her relation bruges generelt til enkeltstående monografier, flerbindsværker og integrerende ressourcer.", de: "Diese Beziehung gilt allgemein für einteilige Einheiten, mehrteilige Monographien und integrierende Ressourcen.", fi: "Koskee yleensä yksiosaisia yksiköitä, moniosaisia monografioita ja päivittyviä aineistoja."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60480",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is replaced by", ar: "هو مستبدَل بـ", da: "er erstattet af", de: "ist ersetzt durch", fi: "korvattu aineistolla", nl: "is vervangen door"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60278",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60105,
      definition: {en: "Relates a resource to a listing of agents, families, or corporate bodies making contributions to the artistic and/or technical production of a resource. (Deprecated)"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/artisticAndOrTechnicalCredit.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has artistic or technical credit (Deprecated)"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60106,
      definition: {en: "Relates a resource to a literary composition in verse form adapted from another resource.", ar: "يربط بين مصدر وتركيب أدبي في شكل شعر مُقتبس من مصدر آخر.", da: "Relaterer en ressource til en litterær komposition i versform, bearbejdet ud fra en oprindelig ressource.", de: "Setzt eine Ressource in Beziehung zu einer literarischen Dichtung in Versform, die auf einer anderen Ressource basiert.", fi: "Liittää aineiston runomuodossa olevaan aineistoon, joka on sovitettu toisesta aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/adaptedInVerseAs.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60226",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is adapted in verse as", ar: "هو مقتبَس شعريًا كـ", da: "bearbejdet i versform som", de: "ist bearbeitet als Gedicht", fi: "aineiston runomukaelma", nl: "is bewerkt in versvorm als"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60260",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60107,
      definition: {en: "Relates a resource to a place where a conference, exhibition, or other formally named and convened event that gives rise to a resource is held.", ar: "يربط بين مصدر ومكان محلي عُقد فيه مؤتمر، اجتماع، جلسة، معرض، مهرجان، إلخ.", da: "Relaterer en korporation til et sted, hvor en konference, en kongres, et møde, en udstilling, en messe, en festival etc. blev afholdt.", de: "Setzt eine Ressource in Beziehung zu einem lokalen Ort, an dem eine Konferenz, ein Kongress, eine Ausstellung, eine Messe, ein Festival und so weiter stattgefunden hat.", fi: "Liittää aineiston paikkaan, jossa konferenssi, kongressi, kokous, nättely, messut, festivaalit yms. järjestettiin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfConference.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60997",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of conference", ar: "له مكان مؤتمر", da: "har sted for konference etc.", de: "hat Ort einer Konferenz", fi: "konferenssin paikka", nl: "heeft plaats van conferentie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61018",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60108,
      definition: {en: "Relates a resource to a name of manufacturer in a language or script that differs from that recorded in a name of manufacturer element.", ar: "يربط بين مصدر واسم مُصّنع بلغة أو نص مختلف عن تلك المُسجل بإسم عنصر مُصّنع.", da: "Relaterer en ressource til et producentnavn på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af producentnavnet.", de: "Setzt eine Ressource in Beziehung zu einem Herstellernamen in einer Sprache oder Schrift, die von dem bereits erfassten Herstellernamen abweicht.", fi: "Liittää aineiston nimeen, joka on valmistajan nimi toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelNameOfManufacturer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel name of manufacturer", ar: "له اسم موازي للمُصّنع", da: "har parallelt producentnavn", de: "hat parallelen Herstellername", fi: "valmistajan rinnakkainen nimi aineistolle", nl: "heeft parallelle naam van vervaardiger"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60109,
      definition: {en: "Relates a resource to a place that is the area of coverage of a cartographic resource that is described using a mathematical system to identify its boundaries or location.", ar: "يربط بين مصدر ونظام رياضي يقوم بتحديد مكان مُغطى بواسطة محتوى رسم خرائطي لمصدر.", da: "Relaterer en ressource til et matematisk system til identificering af det område, der dækkes af en ressources kartografiske indhold.", de: "Setzt eine Ressource in Beziehung zu einem mathematischen System zur Identifizierung eines Gebiets, das durch den kartografischen Inhalt einer Ressource abgedeckt wird.", fi: "Liittää aineiston matemaattiseen järjestelmään, jolla identifioidaan aineiston kartografisen sisällön kattama paikka."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60345", "http://rdaregistry.info/Elements/u/P60346", "http://rdaregistry.info/Elements/u/P60347"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/coordinatesOfCartographicContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61191",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has coordinates of cartographic content", ar: "له إحداثيات لمحتوى خرائطي", da: "har koordinater for kartografisk indhold", de: "hat Koordinaten von kartografischem Inhalt", fi: "kartografisen sisällön koordinaatit aineistolle", nl: "heeft coördinaten van cartografische content"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60110,
      definition: {en: "Relates a resource to a motion picture that is based on another resource.", ar: "يربط بين مصدر وفيلم سينمائي اعتمد على مصدر آخر.", da: "Relaterer en ressource til en film baseret på en oprindelig ressource.", de: "Setzt eine Ressource in Beziehung zu einem Film, der auf einer anderen Ressource basiert.", fi: "Liittää aineiston toiseen aineistoon perustuvaan liikkuvan kuvan käsikirjoitukseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/adaptedAsMotionPicture.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60227",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is adapted as motion picture", ar: "هو مقتبَس كفيلم سينمائي", da: "er bearbejdet som film", de: "ist bearbeitet als Film", fi: "aineiston elokuvaversio", nl: "is bewerkt als speelfilm"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60260",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60111,
      definition: {en: "Relates a resource to a moving image resource whose spoken dialogue is translated into a language different from another resource.", ar: "يربط بين مصدر ومصدر لصورة متحركة يتم فيه ترجمة حوار منطوق إلى لغة مختلفة عن لغة المصدر الأصلي.", da: "Relaterer et udtryk til en ressource af et levende billedværk, hvori den talte dialog er blevet oversat til et andet sprog end det, der er anvendt i den originale ressource.", de: "Setzt eine Ressource in Beziehung zu einer Bewegtbildressource, in der die Dialoge in eine Sprache übersetzt wurden, die sich von der der Originalressource unterscheidet.", fi: "Liittää aineiston elokuva-aineistoon, jossa alkuperäisteoksen puhuttu dialogi on käännetty toiselle kielelle."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dubbedVersionOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60112",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is dubbed version of", ar: "هي نسخة مدبلجة من", da: "er synkroniseret version af", de: "ist Synchronfassung von", fi: "aineiston dubattu versio", nl: "is nagesynchroniseerde versie van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60244",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60112,
      definition: {en: "Relates a resource to a moving image resource that translates spoken dialogue of another resource into a different language.", ar: "يربط بين مصدر ومصدر لصورة متحركة يتم فيه ترجمة حوار منطوق لمصدر أصلي إلى لغة مختلفة.", da: "Relaterer en ressource til en ressource af et levende billedværk, der oversætter den originale ressources talte dialog til et andet sprog.", de: "Setzt eine Ressource in Beziehung zu einer Bewegtbildressource, die die Dialoge der Originalressource in eine andere Sprache übersetzt.", fi: "Liittää aineiston elokuvateoksen aineistoon, jossa alkuperäisteoksen puhuttu dialogi on käännetty toiselle kielelle."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dubbedVersion.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60111",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has dubbed version", ar: "له نسخة مدبلجة", da: "er synkroniseret version", de: "ist Synchronfassung", fi: "dubatun version perusta", nl: "heeft nagesynchroniseerde versie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60280",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60113,
      definition: {en: "Relates a resource to a resource that is a musical resource that is an ornamental passage for a soloist added to a musical resource, such as a concerto, by the same or a different composer.", ar: "يربط بين مصدر ومصدر موسيقي يُمثل فقرة مصاحبة لعازف منفرد تُضاف إلى مصدر موسيقي مثل، كونشيرتو، للملحن نفسة أو لملحن مختلف.", da: "Relaterer en ressource til en musikressource, der består af en nedskreven improvisation for solist, som er føjet til en musikressource såsom en koncert, enten af den samme eller af en anden komponist.", de: "Setzt eine Ressource in Beziehung zu einer Musikressource, die aus einer ausgeschmückten Passage für eine Solistin/einen Solisten besteht, die einer Musikressource, wie zum Beispiel einem Konzert, entweder von derselben/demselben oder einer/einem anderen Komponistin/Komponisten hinzugefügt wird.", fi: "Liittää aineiston musiikkiaineistoon, joka koostuu solistille tarkoitetusta koristeellisesta osasta ja on lisätty saman tai eri säveltäjän musiikkiteokseen, kuten konserttoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/cadenza.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60116",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has cadenza", ar: "له كادنزا", da: "er kadence", de: "hat Kadenz", fi: "kadenssiaineisto", nl: "heeft cadens"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60204",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60114,
      definition: {en: "Relates a resource to a musical resource from which melodic, thematic, or harmonic material is taken to form a discrete theme, which is repeated one or more times with subsequent modifications.", ar: "يربط بين مصدر ومصدر موسيقي تؤخذ منه المواد اللحنية أو الموضوعية أو التناغمية لتشكل مقطوعة متميزة، تتكرر مرة واحدة أو أكثر مع تعديلات لاحقة.", da: "Relaterer en ressource til en musikressource, hvorfra der er taget melodisk, tematisk eller harmonisk materiale til dannelse af et bestemt tema, som gentages en eller flere gange med efterfølgende ændringer.", de: "Setzt eine Ressource in Beziehung zu einer Musikressource, aus der melodisches, thematisches oder harmonisches Material entnommen wird, um ein einzelnes Thema zu bilden, das ein- oder mehrmals mit nachfolgenden Modifikationen wiederholt wird.", fi: "Liittää aineiston musiikkiaineistoon, josta melodinen, temaattinen tai harmoninen aines on otettu erillisen, toistettavan ja muunneltavan teeman muodostamiseksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/variationsBasedOn.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60115",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is variations based on", ar: "هي تنويعات تعتمد على", da: "er variationer baseret på", de: "ist Variationen basierend auf", fi: "muunnelma aineistosta", nl: "is variatie gebaseerd op"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60305",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60115,
      definition: {en: "Relates a resource to a musical resource in which melodic, thematic, or harmonic material taken from another resource forms a discrete theme, which is repeated one or more times with subsequent modifications.", ar: "يربط بين مصدر ومصدر موسيقي تكون فيه المواد اللحنية أو المواضعية أو التناغمية مأخوذة من مصدر آخر لتشكل مقطوعة متميزة، تتكرر مرة واحدة أو أكثر مع تعديلات لاحقة.", da: "Relaterer en ressource til en musikressource, hvori melodisk, tematisk eller harmonisk materiale taget fra det oprindelige værk danner et bestemt tema, der gentages en eller flere gange med efterfølgende ændringer.", de: "Setzt eine Ressource in Beziehung zu einer Musikressource, in dem melodisches, thematisches oder harmonisches Material aus einer anderen Ressource ein einzelnes Thema bildet, das ein- oder mehrmals mit nachfolgenden Modifikationen wiederholt wird.", fi: "Liittää aineiston musiikkiaineistoon, jossa toisesta aineistosta otettu melodinen, temaattinen tai harmoninen aines muodostaa erillisen teeman, jota toistetaan muunnellen yhden tai useamman kerran."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/modifiedByVariationAs.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60114",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is modified by variation as", ar: "هو معدل بتنويع كـ", da: "er ændret ved variation til", de: "ist durch Variation modifiziert als", fi: "variaatioaineisto", nl: "is aangepast door variatie als"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60250",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60116,
      definition: {en: "Relates a resource to a musical resource, such as a concerto, to which is added a musical resource that is an ornamental passage for a soloist by the same or a different composer.", ar: "يربط بين مصدر ومصدر موسيقي مثل كونشيرتو يضاف إلي مصدر موسيقي يمثل فقرة مصاحبة لعازف منفرد للملحن نفسه أو لملحن مختلف.", da: "Relaterer en ressource til en musikressource, såsom en koncert, hvortil der er komponeret en nedskreven improvisation for solist, enten af den samme eller af en anden komponist.", de: "Setzt eine Ressource in Beziehung zu einer Musikressource, zum Beispiel einem Konzert, dem eine Musikressource, das aus einer ausgeschmückten Passage für eine Solistin/einen Solisten besteht, entweder von derselben/demselben oder einer/einem anderen Komponistin/Komponisten hinzugefügt wird.", fi: "Liittää aineiston musiikkiaineistoon, joka koostuu solistille tarkoitetusta koristeellisesta osasta ja on lisätty saman tai eri säveltäjän musiikkiaineistoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/cadenzaComposedFor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60113",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is cadenza composed for", ar: "هو كادنزا مؤلَفة لـ", da: "er kadence komponeret til", de: "ist Kadenz komponiert für", fi: "kadenssi aineistoon", nl: "is cadens gecomponeerd voor"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60307",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60117,
      definition: {en: "Relates a resource to a resource that is a musical or choreographic resource such as an opera, a ballet, or other resource for the musical stage, or an oratorio, that is complemented by a textual resource.", ar: "يربط بين مصدر ومصدر موسيقي أو راقص مثل الأوبرا، الباليه، أو مصدر آخر للمسرح الموسيقي، أو موسيقى دينية يكملها مصدر نصي.", da: "Relaterer en ressource til en musikressource, såsom en opera eller et andet musikalsk sceneværk, eller et oratorium, der anvender den relaterede ressources tekst.", de: "Setzt eine Ressource in Beziehung zu einer Musikressource oder einer choreographischen Ressource, wie zum Beispiel einer Oper, einem Ballett oder einer anderen Musikressource für die Bühne oder einem Oratorium, die/das durch eine textliche Ressource vervollständigt wird.", fi: "Liittää aineiston tekstiaineistolla täydennettyyn musiikkiin tai koreografiaan, kuten oopperaan, balettiin tai muuhun näyttämöteokseen tai oratorioon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/librettoFor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60270",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is libretto for", ar: "نص أوبرالي لـ", da: "er libretto til", de: "ist Libretto für", fi: "librettoaineisto", nl: "is libretto voor"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60198",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60118,
      definition: {en: "Relates a resource to a resource that is a musical resource that complements a resource that is a play or other work for the stage that is realized as spoken word.", ar: "يربط بين مصدر ومصدر موسيقي يكمل مصدرًا يمثل مسرحية أو مصدر آخر للمسرح يتحول إلى كلمة منطوقة.", da: "Relaterer en ressource til en musikressource, der indeholder tilhørende musik til et skuespil eller anden ressource for et talt sceneværk.", de: "Setzt eine Ressource in Beziehung zu einer Musikressource, die ein Drama oder eine andere, gesprochene Bühnenressource ergänzt.", fi: "Liittää aineiston musiikkiaineistoon, joka toimii näytelmän tai muun puhutun näyttämöesityksen näytelmämusiikkina."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/incidentalMusic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60202",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has incidental music", ar: "له موسيقى تصويرية", da: "er skuespilsmusik", de: "hat Bühnenmusik", fi: "näytelmämusiikkiaineisto", nl: "heeft toneelmuziek"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60723",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60119,
      definition: {en: "Relates an agent to a name of agent that is not selected for preference in a specific application or context.", ar: "يربط وبين كيل واسم وكيل لم يتم اختياره كاسم مختلف مفضل ضمن تطبيق محدد أو سياق محدد.", da: "Relaterer en ressource til et navn eller en navneform, hvorunder en ressource er kendt, og som adskiller sig fra det navn eller den navneform, der er valgt som det foretrukne navn.", de: "Setzt einen Akteur in Beziehung zu einem Name eines Akteurs, der in einer bestimmten Anwendung oder in einem bestimmten Kontext nicht als Vorzugsform bestimmt wird.", fi: "Liittää toimijan nimeen, jota jota ei ole valittu ensisijaiseksi tietyssä sovelluksessa tai kontekstissa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/variantNameOfAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60921",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has variant name of agent", ar: "له اسم مختلف لوكيل", da: "har variantnavn for agent", de: "hat abweichenden Namen eines Akteurs", fi: "toimijan varianttinimi", nl: "heeft variant naam van actor"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60368",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60120,
      definition: {en: "Relates a resource to a motion picture, radio program, television program, or video based on an earlier resource.", ar: "يربط بين مصدر وفيلم سينمائي، برنامج إذاعي، برنامج تليفزيوني، أو فيديو يعتمد على مصدر سابق.", da: "Relaterer en ressource til en ressource af en film, et radio- eller tv-program eller en video baseret på en tidligere ressource.", de: "Setzt eine Ressource in Beziehung zu einem Film, einer Hörfunksendung, einer Fernsehsendung oder einem Video, der/die/das auf einer früheren Ressource basiert.", fi: "Liittää aineiston elokuvaan, radio-ohjelmaan, televisio-ohjelmaan tai videoon, joka perustuu aiempaan aineistoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/remadeAs.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60295",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is remade as", ar: "هو إعادة كـ", da: "er genindspillet som", de: "ist Remake als", fi: "aineiston uusintaproduktio", nl: "is opnieuw gemaakt als"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60250",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60121,
      definition: {en: "Relates a resource to a non-dramatic musical resource, other than an oratorio, that uses a text of another resource.", ar: "يربط بين مصدر ومصدر موسيقي غير درامي، بخلاف الموسيقى الدينية، التي تستخدم نص مصدر آخر", da: "Relaterer en ressource til en ressource af et ikke-dramatisk musikværk, bortset fra et oratorium, der anvender en oprindelig ressources tekst.", de: "Setzt eine Ressource in Beziehung zu einer nicht dramatischen Musikressource, bei der es sich nicht um ein Oratorium handelt, die den Text einer anderen Ressource verwendet.", fi: "Ei-näytelmällisen musiikkiaineiston (muun kuin oratorion) ekspressio, jonka teksti on peräisin toisesta aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/setToMusicAs.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60266",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is set to music as", ar: "هو إعداد موسيقي كـ", da: "er sat i musik som", de: "ist vertont als", fi: "tekstiin perustuva musiikkiaineisto", nl: "is op muziek gezet als"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60250",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60122,
      definition: {en: "Relates a resource to a note on resource that identifies an issue or part of a multipart monograph or serial, or an iteration of an integrating resource that has been used as a basis for the identification of a resource.", ar: "يربط بين مصدر وتبصرة عن مصدر يُحدد عدد أو جزء من دراسات متعددة الأجزاء أو سلسلة، أو جزء من مصدر متكامل تم استخدامه كأساس لتحديد مصدر.", da: "Relaterer en ressource til en note, der identificerer et nummer eller en del af et flerbindsværk eller et periodikum, eller en iteration af en integrerende ressource, der er brugt som grundlag for identifikation af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die eine Ausgabe oder einen Teil einer mehrteiligen Monografie oder einer fortlaufenden Ressource oder eine Iteration einer integrierenden Ressource identifiziert, die/der als Grundlage für die Identifizierung einer Ressource verwendet wird.", fi: "Liittää aineiston huomautukseen moniosaisen monografian tai sarja-aineiston numerosta tai osasta tai päivittyvän aineiston iteraatiosta, jota käytetään aineiston identifioinnin perustana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/noteOnIssuePartOrIterationUsedAsBasisForIdentificationOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has note on issue, part, or iteration used as basis for identification of resource", ar: "له تبصرة عن عدد، جزء، أو إعادة إصدار يُستخدم كأساس لتحديد مصدر.", da: "har note om nummer, del eller iteration, anvendt som grundlag for identifikation af ressource", de: "hat Anmerkung zur Ausgabe, zum Teil oder zur Iteration, die/der als Grundlage für die Identifizierung einer Manifestation verwendet wird", fi: "huomautus numerosta, osasta tai iteraatiosta aineiston identifioinnin perustana.", nl: "heeft noot bij aflevering, deel of iteratie gebruikt als basis voor identificatie van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60470",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60123,
      definition: {en: "Relates a resource to a note on resource that provides information on variations in the content characteristics of parts, issues, or iterations of a diachronic resource.", ar: "يربط بين مصدر وتبصرة عن مصدر يُعطي معلومات عن التغيرات في سمات المحتوى الذي يوجد على الأجزاء، أو الأعداد، أو إعادة الإصدار الخاص بمصدر مستمر.", da: "Relaterer en ressource til en note om ændringer i bærerens karakteristika, der optræder i efterfølgende numre eller dele af en ressource, der er udgivet i successive dele, eller mellem iterationer af en integrerende ressource.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die Informationen über Veränderungen in den Inhaltseigenschaften von Teilen, Ausgaben oder Iterationen einer diachronen Ressource enthält.", fi: "Liittää aineiston aineistoa koskevaan huomaukseen, jossa annetaan tietoja vaihteluista diakronisen aineiston osien, numeroiden tai iteraatioiden isällön ominaisuuksissa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/noteOnChangesInContentCharacteristics.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has note on changes in content characteristics", ar: "له تبصرة على تغييرات في سمات المحتوى", da: "har note om ændringer i bærerkarakteristika", de: "hat Anmerkung zu Änderungen von Inhaltseigenschaften", fi: "huomautus muutoksista sisällön ominaisuuksissa", nl: "heeft noot bij veranderingen in karakteristieken van content"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60470",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60124,
      definition: {en: "Relates a resource to a note on resource that provides information on variations in the carrier characteristics that are found on resources of parts, issues, or iterations of a diachronic resource.", ar: "يربط بين مصدر وتبصرة عن مصدر يوفر معلومات عن التغيرات في سمات الحامل التي توجد على مصادر الأجزاء، الأعداد، أو إعادة الإصدار الخاص بمصدر تعاقبي.", da: "Relaterer en ressource til en note om ændringer i bærerens karakteristika, der optræder i efterfølgende numre eller dele af en ressource, der er udgivet i successive dele, eller mellem iterationer af en integrerende ressource.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die Informationen zu Veränderungen in den Datenträgereigenschaften enthält, die bei Ressourcen von Teilen, Ausgaben oder Iterationen einer diachronen Ressource vorkommen.", fi: "Liittää aineiston lisätietoon vaihteluista diakronisen ainieston osien, numeroiden tai iteraatioiden ominaisuuksissa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/noteOnChangesInCarrierCharacteristics.en",
