    property :P60130,
      definition: {en: "Relates a resource to note on resource that provides information on an agent, and their function, who is responsible for a resource.", ar: "يربط بين مصدر وتبصرة عن مصدر يوفر معلومات عن وكيل، ووظيفته، ومن مسؤول عن المصدر.", da: "Relaterer en ressource til en note, der giver oplysninger om en agent, der ikke er nævnt i ophavsangivelsen, men som er tillagt ansvaret for det intellektuelle eller kunstneriske indhold af værket, om variantformer af navne, der optræder i ressourcen, om ændringer i ophavsangivelser eller om andre detaljer der knytter sig til ophavsangivelsen.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die Informationen über einen Akteur und dessen Funktion enthält, der für eine Ressource verantwortlich ist.", fi: "Liittää aineiston lisätietoon aineistossa vastuussa olevasta toimijasta ja tämän roolista."},
