      subPropertyOf: "http://rdaregistry.info/Elements/u/P60470",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60136,
      definition: {en: "Relates a resource to a note on resource that provides information on inaccuracies appearing in titles, complex changes in titles, or on other information relating to a title.", ar: "يربط بين مصدر وتبصرة عن مصدر يوفر معلومات عن الأخطاء التي تظهر في العناوين، أو التغيرات المعقدة في العناوين، أو أي معلومات أخرى متعلقة بعنوان.", da: "Relaterer en ressource til en note, der giver oplysninger om titlens kilde, den dato, hvor titlen blev set, titelvariationer, unøjagtigheder, sletninger etc. eller om andre oplysninger relateret til en titel.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die Informationen über Ungenauigkeiten in Titeln, unübersichtliche Änderungen in Titeln oder andere Informationen, die sich auf den Titel beziehen, enthält.", fi: "Liittää aineiston lisätietoon nimekkeiden epätarkkuuksista, nimekkeiden vaihteluista tai muuta nimekkeeseen liittyvää tietoa."},
