    property :P60137,
      definition: {en: "Relates a resource to a note on resource that provides information on an edition of a resource.", ar: "يربط بين مصدر وتبصرة عن مصدر يوفر معلومات عن الطبعة الخاصة بمصدر.", da: "Relaterer en ressource til en note, der giver oplysninger om kilden til en udgavebeskrivelse, om udgavebeskrivelse relateret til numre, dele etc., om ændringer i udgavebeskrivelse eller om andre oplysninger relateret til en udgavebeskrivelse.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die Informationen über eine Ausgabe einer Ressource enthält.", fi: "Liitää aineiston lisätietoon painosmerkinnöstä."},
