    property :P60138,
      definition: {en: "Relates a resource to a novel adapted from another resource.", ar: "يربط بين مصدر ورواية مقتبسة من مصدر آخر.", da: "Relaterer en ressource til en roman bearbejdet ud fra en oprindelig ressource.", de: "Setzt eine Ressource in Beziehung zu einem Roman, der auf einer anderen Ressource basiert.", fi: "Liittää aineiston toisesta aineistosta sovitettuun romaaniin."},
