      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has publisher number for notated music", ar: "له رقم ناشر لموسيقى مدونة.", da: "har udgivers editionsnummer for noteret musik", de: "hat Noten-Bestellnummer", fi: "kustantajan nuottiaineistolle antama numero", nl: "heeft uitgeversnummer voor bladmuziek"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60052",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60140,
      definition: {en: "Relates a resource to a nomen that is an identifier for resource other than a publisher number for notated music, assigned by a publisher to a notated music resource to indicate the printing plate used in the printing process.", ar: "يربط بين مصدر وترقيم محدد خصصه ناشر لمصدر موسيقى مدونة.", da: "Relaterer en ressource til en noteret musikressource af en udgiver.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung einer Zählung, die einer notierten Musikressource vom Verlag zugewiesen wird.", fi: "Liittää aineiston kustantajan nuottikirjoitukselle antamaan laattanumeroon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/plateNumberForNotatedMusic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A plate number for notated music sometimes includes initials, abbreviations, or words identifying the publisher. It is sometimes followed by a number corresponding to the number of pages or plates or a number corresponding to an individual page or plate.", ar: "يتضمن رقم لوحة لموسيقى مدونة أحيانًا استهلاليات، إختصارات، أو كلمات التى تُعرّف بالناشر.يُتبع أحيانًا برقم يشير إلى رقم الصفحات أو اللوحات أو رقم يشير إلى صفحة أو لوحة واحدة.", da: "Pladenummer for noteret musik indeholder sommetider initialer, forkortelser eller ord der identificerer udgiveren og følges sommetider af et nummer der tilsvarer antallet af sider eller plader.", de: "Eine Druckplattennummer für Noten enthält manchmal Initialen, Abkürzungen oder Wörter, die den Verlag identifizieren. Ihr folgt manchmal eine Zahl, die der Zahl der Seiten oder Platten entspricht oder eine Zahl, die einer einzelnen Seite oder Platte entspricht.", fi: "Nuottiaineiston laattanumero sisältää joskus kustantajaa identifioivia alkukirjaimia, lyhenteitä tai sanoja. Numeron perässä voi olla vastaavien sivujen tai laattojen numerot tai yksittäisten sivujen ja laattojen numerot."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60988",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has plate number for notated music", ar: "له رقم لوحة لمدونة موسيقية", da: "har pladenummer for noteret musik", de: "hat Druckplattennummer für Noten", fi: "nuottiaineiston laattanumero", nl: "heeft plaatnummer voor bladmuziek"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60052",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60141,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a musical resource by leading a performing group in a musical or dramatic presentation.", ar: "يربط مصدر بوكيل يُمثل مؤدِ يُساهم في مصدر موسيقي من خلال قيادة فرقة عزف في عرض موسيقي أو درامي.", da: "Relaterer en ressource til en performer, der har bidraget til en musikressource af ved at lede en udøvende gruppe i en musikalsk eller dramatisk præsentation etc.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Musikressource beiträgt, indem sie/er ein aufführendes Ensemble in einer musikalischen oder dramatischen Darbietung leitet.", fi: "Liittää aineiston toimijaan, joka on osallisena musiikkiaineistoon johtamalla esiintyjäryhmää musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60842", "http://rdaregistry.info/Elements/u/P60844"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/conductor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60016",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has conductor", ar: "له قائد", da: "har dirigent", de: "hat Dirigentin/Dirigent", fi: "johtaja aineistossa", nl: "heeft dirigent"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60142,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by acting as a cast member or player in a musical or dramatic presentation.", ar: "يربط مصدر بوكيل يُمثل مؤدِ يُساهم في مصدر من خلال عمله كعضو فريق تمثيل أو كعازف في عرض موسيقي أو درامي.", da: "Relaterer en ressource til en performer, der har bidraget til en ressource ved at fungere som rolleindehaver eller aktør i en musikalsk eller dramatisk præsentation etc.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource als Ensemble-Mitglied oder Darstellerin/Darsteller in einer musikalischen oder dramatischen Darbietung und so weiter beiträgt.", fi: "Liittää aineiston henkilöön, joka on aineistossa osallisena esiintyjänä näyttelemällä tai soittamalla musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60152",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/actor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60017",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has actor", ar: "له ممثل", da: "har skuespiller", de: "hat Schauspielerin/Schauspieler", fi: "näyttelijä aineistossa", nl: "heeft acteur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60143,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by appearing on screen to provide contextual or background information.", ar: "يربط بين مصدر ومؤدٍ يُساهم في مصدر من خلال الظهور على الشاشة لتقديم معلومات تتعلق بالسياق أو الخلفية.قد يظهر مقدم عرض على الشاشة في مواد الصور المتحركة غير الخيالية أو أثناء تقديم مواد لصور متحركة خيالية.", da: "Relaterer en ressource til en performer, der har bidraget til en ressource ved at vise sig på skærmen for at give kontekstuel eller baggrundsinformation.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er auf dem Bildschirm erscheint, um Kontext- und Hintergrundinformationen zu liefern.", fi: "Liittää aineiston esiintyjään, joka on aineistossa osallisena esiintymällä televisiossa tai elokuvassa taustatiedon antajana. Voi esiintyä dokumentaarisissa elokuvissa tai fiktioelokuvien johdannoissa."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60824",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/onscreenPresenter.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Appearance in nonfiction moving image materials or in introductions to fiction moving image materials is included. Appearance on screen in a non-performing role is excluded.", ar: "يتم تضمين الظهور في مواد الصور المتحركة غير الخيالية أو أثناء تقديم مواد لصور متحركة خيالية.يُستبعد من ذلك الظهور على الشاشة في دور غير مؤدِ.", da: "Optræden i levende billedmaterialer af faktuel karakter eller i introduktioner til levende billedmaterialer af fiktiv karakter er omfattet. Optræden på skærmen i en ikke-fremførende rolle er ikke omfattet.", de: "Darunter fallen Auftritte in nicht-fiktionalen Bewegtbildmaterialien oder in Einführungen zu fiktionalen Bewegtbildmaterialien. Darunter fallen keine Bildschirmauftritte in einer passiven Rolle.", fi: "Koskee dokumentaarisessa elokuvassa tai fiktiivisen elokuvan johdannossa esiintymistä."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60018",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has onscreen presenter", ar: "له مُقدم برامج على الشاشة", da: "har programvært", de: "hat On-Screen-Präsentatorin/On-Screen-Präsentator", fi: "esittelijä aineistossa", nl: "heeft presentator op beeld"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60144,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by dancing in a musical or dramatic presentation.", ar: "يربط مصدر بوكيل يُمثل مؤدِ يُساهم في مصدر من خلال الرقص في عرض موسيقي أو درامي.", da: "Relaterer en ressource til en performer, der har bidraget til en ressource ved at danse i en musikalsk eller dramatisk præsentation etc.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er in einer musikalischen, dramatischen oder ähnlichen Darbietung tanzt.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena esiintyjänä tanssimalla musiikki-, näytelmä-tms. esityksessä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dancer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60019",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has dancer", ar: "له راقص", da: "har danser", de: "hat Tänzerin/Tänzer", fi: "tanssija aineistossa", nl: "heeft danser"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60145,
      definition: {da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at give instruktion eller en demonstration."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/instructor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60020",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {da: "har lærer"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60146,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by leading a program, often broadcast, that includes other performers.", ar: "يربط مصدر بوكيل يُمثل مؤدِ يُساهم في مصدر من خلال إدارة برنامج، غالبًا مُذاع، ويستضيف ضيوفًا وفنانين ووكلاءآخرين.", da: "Relaterer en ressource til en performer, der har bidraget til en ressource ved at lede et program, ofte transmitteret, der omfatter andre gæster, optrædende etc.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er eine Veranstaltung (meist eine Sendung) leitet, an der auch andere Ausführende teilnehmen.", fi: "Liittää aineiston toimijaan, joka on on osallisena (useimmiten lähetettyyn) ohjelmaan, johon osallistuu muita esiintyjiä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/host.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60021",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has host", ar: "له مُضِيف", da: "har vært", de: "ist Gastgeberin/Gastgeber", fi: "juontaja aineistossa", nl: "heeft gastgever"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60147,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by leading a program, often broadcast, where topics are discussed, usually with participation of experts in fields related to the discussion.", ar: "يربط بين مصدر ومؤدِ يُساهم في مصدر من خلال إدارة برنامج، غالبًا مُذاع، حيث تتم مناقشة موضوعات، عادةً بمشاركة خبراء في المجالات المتعلقة بموضوع النقاش.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at lede et program, ofte transmitteret, hvor emner diskuteres, normalt med deltagelse af fagfolk inden for felter, der er relateret til diskussionen.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er eine Veranstaltung (meist eine Sendung) leitet, in der Themen üblicherweise mit Expertinnen/Experten diskutiert werden.", fi: "Liittää aineiston esittäjään, joka on aineistossa osallisena juontamalla (usein lähetettyä) ohjelmaa, jossa keskustellaan eri aiheista, tavallisesti keskusteluun liittyvien aiheiden asiantuntijoiden kanssa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/moderator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60022",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has moderator", ar: "له رئيس جلسة", da: "har ordstyrer", de: "hat Moderatorin/Moderator", fi: "moderoija aineistossa", nl: "heeft moderator"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60148,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by manipulating, controlling, or directing puppets or marionettes in a moving image production or a musical or dramatic presentation or entertainment.", ar: "يربط بين مصدر ومؤدِ يُساهم في مصدر من خلال اللعب بالعرائس أو الدمى المتحركة أو التحكم فيها، أو توجيهها في إنتاج لصور متحركة أو في عرض موسيقي أو درامي أو ترفيهي.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at manipulere, kontrollere eller styre dukker eller marionetter i en levende billedproduktion eller en musikalsk eller dramatisk præsentation eller i underholdning.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er Puppen oder Marionetten in einer Bewegtbildproduktion oder einer musikalischen oder dramatischen Darbietung oder Aufführung bewegt, kontrolliert oder lenkt.", fi: "Liittää aineiston esittäjään, joka on aineistoon osalllisena käsittelemällä, kontrolloimalla tai ohjaamalla nukkeja tai marionetteja elokuvatuotannossa tai musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/puppeteer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60023",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has puppeteer", ar: "له محرك عرائس", da: "har dukkefører", de: "hat Puppenspielerin/Puppenspieler", fi: "nukettaja aineistossa", nl: "heeft poppenspeler"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60149,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by participating in a program, often broadcast, where topics are discussed, usually with participation of experts in fields related to the discussion.", ar: "يربط بين مصدر ومؤدِ يُساهم في مصدر من خلال المشاركة في برنامج، غالبًا مُذاع، حيث تتم مناقشة موضوعات، عادةً بمشاركة خبراء في المجالات المتعلقة بموضوع النقاش.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at deltage i et program, ofte transmitteret, hvor emner diskuteres, normalt med deltagelse af fagfolk inden for felter relateret til diskussionen.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er an einer Veranstaltung (meist einer Sendung) teilnimmt, in der Themen üblicherweise mit Expertinnen/Experten diskutiert werden.", fi: "Liittää aineiston esiintyjään, joka joka osallistuu aineiston tekemiseen osallistumalla ohjelmaan (usein lähetettyyn), jossa keskustellaan eri aiheista tavallisesti keskusteluun liittyvien aiheiden asiantuntijoiden kanssa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/panelist.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60024",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has panelist", ar: "له مشارك في برنامج", da: "har paneldeltager", de: "hat Diskussionsteilnehmerin/Diskussionsteilnehmer", fi: "panelisti aineistossa", nl: "heeft panellid"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60150,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by playing a musical instrument.", ar: "يربط بين مصدر ومؤدِ يُساهم في مصدر من خلال العزف على آلة موسيقية.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at spille et musikinstrument.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er ein Musikinstrument spielt.", fi: "Liittää aineiston esittäjään, joka osallistuu aineistoon soittamalla soitinta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/instrumentalist.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60025",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has instrumentalist", ar: "له عَازِف", da: "har musiker", de: "hat Instrumentalmusikerin/Instrumentalmusiker", fi: "instrumentalisti aineistossa", nl: "heeft instrumentalist"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60151,
      definition: {en: "Relates a resource to a performer who contributes to a resource by providing interpretation, analysis, or a discussion of the subject matter on a recording, film, or other audiovisual medium.", ar: "يربط بين مصدر ومؤدِ يُساهم بأحد المصادر من خلال تقديم تفسير للموضوع، أو تحليله، أو مناقشته على تسجيل أو على فيلم، أو على أي وسيط سمعي بصري آخر.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at forestå en fortolkning, analyse eller diskussion af det emne, der behandles i en optagelse, film eller andet audiovisuelt medium.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er in einer Aufnahme, in einem Film oder in einem anderen audiovisuellen Medium eine Interpretation, eine Analyse oder eine Diskussion des Themas präsentiert.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu tulkitsemalla tai analysoimalla äänitteen, elokuvan tai muun audiovisuaalisen aineiston aihetta tai keskustelemalla siitä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/commentator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60026",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has commentator", ar: "له مُعلِق", da: "har kommentator", de: "hat Kommentatorin/Kommentator", fi: "kommentaattorina aineistossa", nl: "heeft commentator"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60152,
      definition: {en: "Relates a resource to an agent who is an actor who contributes to a resource by providing the voice for characters in radio and audio productions and for animated characters in moving image resources, as well as by providing voice-overs in radio and television commercials, dubbed resources, etc.", ar: "يربط بين مصدر ومؤدِ يُساهم بأحد المصادر من خلال التمثيل الصوتي لشخصيات في الإنتاج الإذاعي والسمعي، وللشخصيات الكرتونية في أعمال الصور المتحركة، إضافة إلى التعليق الصوتي في إعلانات الإذاعة والتليفزيون، والتعبيرات المدبلجة، إلخ.", da: "Relaterer en ressource til en skuespiller, der har bidraget til en ressource ved at lægge stemme til figurer i radio- og audioproduktioner og til animerede figurer i levende billedværker, og ved at indtale tv-reklamer, synkroniserede ressourcer etc.", de: "Setzt eine Ressource in Beziehung zu einer Schauspielerin/einem Schauspieler, die/der zu einer Ressource beiträgt, indem sie/er ihre/seine Stimme Charakteren in Hörfunk- und Audioproduktionen und animierten Charakteren in Bewegtbildressourcen leiht, sowie Stimmen in Hörfunk- und Fernsehwerbung, synchronisierten Ressourcen und so weiter spricht.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu antamalla äänen hahmoille radio- ja äänituotannoissa ja animoiduille hahmoille elokuva-aineistoissa sekä esiintymällä radio- ja TV-mainoksissa, dubatuissa aineistoissa tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/voiceActor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60027",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has voice actor", ar: "له مُمثل صوتي", da: "har dubber", de: "hat Sprecherin/Sprecher einer Rolle", fi: "ääninäyttelijänä aineistossa", nl: "heeft stemacteur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60142",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60153,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by reading aloud or giving an account of an act, occurrence, or other event.", ar: "يربط مصدر بوكيل مؤدِ يُساهم بأحد المصادر من خلال القراءة بصوت مرتفع أو بسرد فصل من مسرحية، أو واقعة، أو حدث آخر.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at læse højt eller berette om en handling, en hændelse, et begivenhedsforløb etc.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er vorliest oder eine Handlung, ein Geschehnis oder ein anderes Ereignis schildert.", fi: "Liittää henkilön aineistoon, jonka tekemiseen hän osallistuu lukemalla ääneen tai kertomalla toiminnasta, tapahtumasta, tapahtumien kulusta tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/narrator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60028",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has narrator", ar: "له راوِ", da: "har fortæller/indlæser", de: "hat Erzählerin/Erzähler", fi: "kertojana aineistossa", nl: "heeft verteller"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60154,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by relaying a story with dramatic or theatrical interpretation.", ar: "يربط مصدر بوكيل مؤدِ يُساهم بأحد المصادر من خلال نقل قصة أصلية ووصفها بصورة درامية أو مسرحية.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at gengive en ophavspersons oprindelige historie med dramatisk eller teatralsk fortolkning.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er eine Geschichte mit dramatischer oder theatralischer Interpretation wiedergibt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu esittäjänä tekijän alkuperäisen tarinan draamallisella tai teatraalisella tulkinnalla."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/storyteller.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60029",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has storyteller", ar: "له راوي قصص", da: "har kunstnerisk fortæller", de: "hat Geschichtenerzählerin/Geschichtenerzähler", fi: "tarinankertojana aineistossa", nl: "heeft verhalenverteller"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60155,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by speaking words.", ar: "يربط مصدر بوكيل مؤدِ يُساهم بأحد المصادر من خلال التحدث بكلمات.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at fremføre ord, såsom en forelæsning, tale etc.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er ein Musikinstrument spielt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu puhumalla, kuten luennoimalla tai pitämällä puheen tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/speaker.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60030",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has speaker", ar: "له مُتحدث", da: "har taler", de: "hat Rednerin/Redner", fi: "puhujana aineistossa", nl: "heeft spreker"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60156,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by using their voice, with or without instrumental accompaniment, to produce music.", ar: "يربط مصدر بوكيل مؤدِ يُساهم بأحد المصادر من خلال أداء صوتي، بمصاحبة أو دون مصاحبة آلة موسيقية، لإنتاج أغنية.", da: "Relaterer en ressource til en optrædende, der har bidraget til en ressource ved at bruge sin stemme, med eller uden instrumentalledsagelse, til at skabe musik.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er durch ihre/seine Singstimme, mit oder ohne instrumentale Begleitung, Musik erzeugt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen hän osallistuu esiintymällä lauluäänellä (soitinsäestyksellä tai ilman) tuottaakseen musiikkia."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/singer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {da: "En sangers optræden kan omfatte egentlige ord, men gør det ikke nødvendigvis."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60031",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has singer", ar: "له مغنِ", da: "har sanger", de: "hat Sängerin/Sänger", fi: "laulajana ainestossa", nl: "heeft zanger"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60157,
      definition: {en: "Relates a resource to an agent who claims to be a channel of communication with a world of spirits.", ar: "يربط مصدر بوكيل يدعي أنه قناة اتصال مع عالم الأرواح.", da: "Relaterer en ressource til en agent der siges at være en kanal for kommunikation mellem den jordiske verden og en åndevereden.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der sich für einen Kommunikationskanal zwischen der irdischen Welt und einer Geisterwelt hält.", fi: "Liittää aineistoon toimijan, jota pidetään kanavana henkimaailman ja maallisen maailman välillä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/medium.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60032",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has medium", ar: "له وسيط روحاني", da: "har medie", de: "hat Channel", fi: "meediona aineistossa", nl: "heeft medium"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60158,
      definition: {en: "Relates a resource to a person, family, or corporate body other than a creator, custodian, owner, producer, publisher, distributor or manufacturer associated with a manifestation. (Deprecated)"},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60884", "http://rdaregistry.info/Elements/u/P60886", "http://rdaregistry.info/Elements/u/P60887", "http://rdaregistry.info/Elements/u/P60888", "http://rdaregistry.info/Elements/u/P60890"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/otherAgentAssociatedWithAResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Book designers, platemakers, etc., agents, etc., to whom correspondence is addressed, agents, etc., honoured by a festschrift, directors, cinematographers, sponsoring bodies, production companies, institutions, etc., hosting an exhibition or event, etc., curators, binders, restorationists, etc., are included.. (Deprecated)"},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has other agent associated with a resource (Deprecated)"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60159,
      definition: {en: "Relates a resource to a physical or chemical substance applied to a base material of a resource.", ar: "يربط بين مصدر ومادة فيزيائية أو كيميائية مستخدمة كمادة أساسية لمصدر.", da: "Relaterer en ressource til fysisk eller kemisk stof, der er påført en ressources basismateriale.", de: "Setzt eine Ressource in Beziehung zu einer physischen oder chemischen Substanz, die auf ein Trägermaterial einer Ressource aufgebracht wird.", fi: "Liittää aineiston fysikaaliseen tai kemialliseen aineeseen, jota on laitettu aineiston pohjamateriaalin päälle."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60344",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/appliedMaterial.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has applied material", ar: "له مادة مُستخدمة", da: "har anvendt materiale", de: "hat aufgebrachtes Material", fi: "aineiston päällimateriaali", nl: "heeft bevestigd materiaal"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60995",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60160,
      definition: {en: "Relates a resource to a place associated with the distribution of a published resource.", ar: "يربط بين مصدر ومكان مرتبط بتوزيع مصدر منشور.", da: "Relaterer en ressource til et sted forbundet med distributionen af en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, das mit dem Vertrieb einer veröffentlichten Ressource in Verbindung steht.", fi: "Liittää aineiston paikkaan, joka liittyy julkaistun aineiston jakeluun."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60164",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfDistribution.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60968",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of distribution", ar: "له مكان توزيع", da: "har distributionssted", de: "hat Vertriebsort", fi: "aineiston jakelupaikka", nl: "heeft plaats van distributie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61014",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60161,
      definition: {en: "Relates a resource to a place that is associated with the inscription, fabrication, construction, or other method of production of an unpublished resource.", ar: "يربط بين مصدر ومكان مرتبط بتسجيل، أو تصنيع، أو إنشاء، أو مرتبط بأي طريقة أخرى بإنتاج مصدر غير منشور.", da: "Relaterer en ressource til et sted forbundet med indgravering, fremstilling, konstruktion etc. af en ressource i upubliceret form.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, das mit der Beschriftung, der Fabrikation, der Konstruktion oder einer anderen Entstehungsmethode einer unveröffentlichten Ressource in Verbindung steht.", fi: "Liittää aineiston paikkaan, joka liittyy julkaisemattoman aineiston aivertamiseen, valmistamiseen, kokoamiseen tai muuhun tuotantotapaan."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60166",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfProduction.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60971",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of production", ar: "له مكان إنتاج", da: "har produktionssted - upublicerede ressourcer", de: "hat Entstehungsort", fi: "aineiston tuotantopaikka", nl: "heeft plaats van productie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61014",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60162,
      definition: {en: "Relates a resource to a place that is associated with the printing, duplicating, casting, or other method of manufacturing of a published resource.", ar: "يربط بين مصدر ومكان مرتبط بطبع، نسخ، طَرَح، أو مرتبط بأي طريقة أخرى بتصنيع مصدر منشور.", da: "Relaterer en ressource til sted forbundet med trykning, duplikering, støbning etc. af en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, das mit dem Druck, der Vervielfältigung, dem Guss oder einer anderen Herstellungsmethode einer veröffentlichten Ressource in Verbindung steht.", fi: "Liittää aineiston paikkaan, aikaan, joka liittyy julkaistun aineiston painamiseen, monistamiseen, kirjasinten valamiseen tai muuhun valmistustapaan."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60165",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfManufacture.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60969",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of manufacture", ar: "له مكان تصنيع", da: "har produktionssted - publicerede ressourcer", de: "hat Herstellungsort", fi: "aineiston valmistuspaikka", nl: "heeft plaats van vervaardiging"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61014",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60163,
      definition: {en: "Relates a resource to a place that is associated with the publication, release, or issuing of a published resource.", ar: "يربط بين مصدر ومكان مرتبط بنشر، تحرير، أو إصدار مصدر منشور.", da: "Relaterer en ressource til et sted forbundet med publicering, offentliggørelse eller udgivelse af en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, das mit der Veröffentlichung, dem Release oder der Herausgabe einer veröffentlichten Ressource in Verbindung steht.", fi: "Liittää aineiston paikkaan, joka liittyy julkaistun aineiston kustantamiseen, julkaisemiseen tai ilmestymiseen."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60167",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfPublication.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60972",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of publication", ar: "له مكان نشر", da: "har publiceringssted", de: "hat Erscheinungsort", fi: "aineiston julkaisupaikka", nl: "heeft plaats van publicatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61014",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60164,
      definition: {en: "Relates a resource to a place of distribution in a language or script that differs from that recorded in a place of distribution element.", ar: "يربط بين مصدر ومكان توزيع بلغة أو نص مختلف عن ذلك المُسجل داخل مكان عنصر توزيع.", da: "Relaterer en ressource til et distributionssted på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af distributionsstedet. ", de: "Setzt eine Ressource in Beziehung zu einem Vertriebsort in einer Sprache oder Schrift, die von dem bereits erfassten Vertriebsort abweicht.", fi: "Liittää aineiston jakelupaikkaan toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelPlaceOfDistribution.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel place of distribution", ar: "له مكان توزيع موازي", da: "har parallelt distributionssted", de: "hat parallelen Vertriebsort", fi: "aineiston rinnakkainen jakelupaikka", nl: "heeft parallelle plaats van distributie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60160",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60165,
      definition: {en: "Relates a resource to a place of manufacture in a language or script that differs from that recorded in a place of manufacture element.", ar: "يربط بين مصدر ومكان تصنيع بلغة أو نص مختلف عن ذلك المُسجل داخل مكان عنصر توزيع.", da: "Relaterer en ressource til et fremstillingssted på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af fremstillingsstedet. ", de: "Setzt eine Ressource in Beziehung zu einem Herstellungsort in einer Sprache oder Schrift, die von dem bereits erfassten Herstellungsort abweicht.", fi: "Liittää aineiston valmistuspaikkaan toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelPlaceOfManufacture.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel place of manufacture", ar: "له مكان تصنيع موازي", da: "har parallelt produktionssted - publicerede ressourcer", de: "hat parallelen Herstellungsort", fi: "aineiston rinnakkainen valmistuspaikka", nl: "heeft parallelle plaats van vervaardiging"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60162",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60166,
      definition: {en: "Relates a resource to a place of production in a language or script that differs from that recorded in a place of production element.", ar: "يربط بين مصدر ومكان إنتاج بلغة أو نص مختلف عن ذلك المُسجل داخل مكان عنصر إنتاج.", da: "Relaterer en ressource til et produktionssted på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af produktionsstedet. ", de: "Setzt eine Ressource in Beziehung zu einem Entstehungsort in einer Sprache oder Schrift, die von dem bereits erfassten Entstehungsort abweicht.", fi: "Liittää aineiston tuotantopaikkaan toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelPlaceOfProduction.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
