    property :P60173,
      definition: {en: "Relates a resource to a name of publisher name in a language or script that differs from that recorded in a name of publisher element.", ar: "يربط بين مصدر وإسم ناشر بلغة أو نص مختلف عن ذلك المُسجل بإسم عنصر ناشر.", da: "Relaterer en ressource til et udgivernavn på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af udgivernavnet.", de: "Setzt eine Ressource in Beziehung zu einem Verlagsnamen in einer Sprache oder Schrift, die von dem bereits erfassten Verlagsnamen abweicht.", fi: "Liittää aineiston kustantajan nimeen kielellä tai kirjoitusjärjestelmällä, joka eroaa kustantaja-elementtiin tallennetusta nimestä."},
