    property :P60176,
      definition: {en: "Relates a resource to a record of previous ownership or custodianship of a resource, including agent, place, and timespan.", ar: "يربط بين مصدر وسجل ملكية سابقة أو بوصاية على مصدر، يتضمن وكيلًا، مكانا، وفترة زمنية.", da: "Relaterer en ressource til en optegnelse over tidligere ejerskab eller opbevaring af en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Bericht über frühere Eigentümerinnen/Eigentümer oder Verwahrerinnen/Verwahrer einer Ressource, einschließlich eines Akteurs, eines Geografikums und eines Zeitraums.", fi: "Liittää aineiston tietoihin sen omistus- tai säilytyshistoriasta, mukaanlukien tiedot toimijoista, paikoista ja ajanjaksoista."},
