    property :P60177,
      definition: {en: "Relates a resource to a resource that abstracts the contents of another resource.", ar: "يربط بين مصدر ومصدر يستخلص محتويات مصدر آخر.", da: "Relaterer en ressource til en ressource, der er en abstracts- og indekseringsservice, der sammenfatter en oprindelig kildes indehold.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die den Inhalt einer anderen Ressource zusammenfasst.", fi: "Liittää aineiston aineistoon, joka on tiivistelmä toisen aineiston sisällöstä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/abstractedIn.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
