    property :P60179,
      definition: {en: "Relates a resource to a resource that consists of an exact reproduction on preservation-quality media, such as acid-free permanent or archival paper.", ar: "يربط بين مصدر ومصدر يتكون من استنساخ كامل على وسيط حفظ عالي الجودة، مثل الأوراق الدائمة الخالية من الأحماض أو أوراق المحفوظات الأرشيفية.", da: "Relaterer en ressource til en resssource, der består af en nøjagtig reproduktion på et medium af bevaringskvalitet, såsom syrefrit permanent- eller arkivpapir.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die aus einer exakten Reproduktion auf bestandserhaltenden Medien, wie zum Beispiel säurefreiem Papier oder Archivpapier, besteht.", fi: "Liittää aineiston aineistoon, joka on sen täsmällinen jäljennös. Jäljennöksen valmistuksessa on käytetty säilytyskelpoista materiaalia, esim. arkistopaperia."},
