    property :P60181,
      definition: {en: "Relates a resource to a resource that consists of errors discovered after the publication of a predominant resource, with their corrections.", ar: "يربط بين مصدر ومصدر يتكون من أخطاء تم اكتشافها بعد نشر مصدر شائع، مع تصويباتها.", da: "Relaterer en ressource til en ressource, der består af rettelser af fejl, som er blevet opdaget efter publicering af hovedressourcen, med deres rettelser.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die aus Fehlern und deren Korrekturen besteht, die nach der Veröffentlichung der Hauptressource entdeckt wurden.", fi: "Liittää aineiston aineistoon, joka koostuu julkaisemisen jälkeen löytyneistä virheistä ja niiden korjauksista."},
