      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60182,
      definition: {en: "Relates a resource to a resource that consists of pictorial content designed to explain or decorate an augmented resource.", ar: "يربط بين مصدر ومصدر يتكون من محتوى تصويري مصمم لشرح أو تزيين مصدر مُعَزَّز.", da: "Relaterer en ressource til en ressource, der består af billedindhold, som er skabt til at forklare eller udsmykke den berigede ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die durch Bildinhalte ergänzt wird, die eine erweiterte Ressource erklären oder ausschmücken sollen.", fi: "Liittää aineiston laajennettua aineistoa selittävästä tai koristavasta kuvamateriaalista koostuvaan aineistoon."},
