      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60239", "http://rdaregistry.info/Elements/u/P60255", "http://rdaregistry.info/Elements/u/P60288", "http://rdaregistry.info/Elements/u/P60289", "http://rdaregistry.info/Elements/u/P60292", "http://rdaregistry.info/Elements/u/P60298", "http://rdaregistry.info/Elements/u/P60474", "http://rdaregistry.info/Elements/u/P61219"],
