    property :P60193,
      altLabel: {en: "is in series", ar: "هو في سلسلة", da: "er i serie", fi: "kuuluu sarjaan"},
      definition: {en: "Relates a resource to a resource that is a successive aggregating resource that inspires the editorial policy, scope, and style of a static resource.", ar: "يربط بين مصدر ومصدر تجميعي متتالي يلهِم السياسة التحريرية، المجال، والأسلوب لمصدر ثابت.", da: "Relaterer en ressource til en ressource, i hvilket en del er blevet udgivet; en titel på en større ressource optræder på delen.", de: "Setzt eine Ressource in Beziehung zu einer sukzessiven, aggregierenden Ressource, die die redaktionelle Vorgehensweise, den Geltungsbereich und den Stil einer statischen Ressource beeinflusst.", fi: "Liittää aineiston staattiseen aggregoivaan aineistoon, josta toinen peräkkäinen staattinen aineisto saa vaikutteita toimitukselliseen käytäntöön, laajuuteen ja tyyliin."},
