    property :P60196,
      definition: {en: "Relates a rescource to a resource that is a part of the same resource as another part resource.", ar: "يربط بين مصدر ومصدر صَدر مع مصدر ذي صلة، بدون أي علاقة بمحتواه.", da: "Relaterer en ressource til en ressource udgivet sammen med en anden ressource uden nogen relation til dens indhold.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die mit einer in Beziehung stehenden Ressource erscheint, ohne eine Beziehung zu deren Inhalt zu haben.", fi: "Liittää aineiston aineistoon, joka on ilmestynyt yhdessä toisen aineiston kanssa, mutta ei liity siihen sisällöllisesti."},
