      subPropertyOf: "http://rdaregistry.info/Elements/u/P60709",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60197,
      definition: {en: "Relates a resource to a resource that is an exact copy of a website, used to reduce network traffic or improve the availability of the content of the original site.", ar: "يربط بين مصدر ومصدر يُعد نسخة طبق الأصل من موقع إلكتروني، مستخدم لتقليل الدخول على الشبكة أو لتحسين الإتاحة لمحتوى الموقع الأصلي.", da: "Relaterer en ressource til en ressource, der er en nøjagtig kopi af en hjemmeside, som er anvendt til at reducere netværkstrafik eller forbedre tilgængeligheden af originalsidens indhold.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die eine exakte Kopie einer Website ist und verwendet wird, um den Datenverkehr in einem Netzwerk zu reduzieren oder die Verfügbarkeit des Inhalts der Originalseite zu verbessern.", fi: "Liittää aineiston aineistoon, joka on verkkosivuston tarkka kopio ja jota käytetään parantamaan alkuperäisen sivuston saavutettavuutta vähentämällä verkkoliikenteen kuormitusta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mirrorSite.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
