      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has mirror site", ar: "له موقع بديل", da: "er spejlside", de: "hat Mirror-Site", fi: "peilisivusto", nl: "heeft mirror site"},
