      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60198,
      definition: {en: "Relates a resource to a resource paired with a related resource without either resource being considered to be predominant.", ar: "يربط بين مصدر ومصدر مقترن بمصدر ذي صلة دون اعتبار أحدهما هو المصدر السائد.", da: "Relaterer en ressource til en ressource, der er parret med en anden ressource, uden at én af ressourcerne betragtes som værende vigtigst.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die mit einer in Beziehung stehenden Ressource zusammengebracht wird, ohne dass eine der beiden als Hauptressource angesehen wird.", fi: "Liittää aineiston teokseen, joka on yhdistetty siihen liittyvään teokseen ilman, että kumpaakaan teosta pidetään ensisijaisena."},
