    property :P60199,
      definition: {en: "Relates a resource to a resource that is a diachronic resource that continues the partial content of another diachronic resource that is continuing.", ar: "يربط بين مصدر ومصدر ممتد زمنيًا يُكْمل المحتوى الجزئي لمصدر آخر ممتد زمنيًا ومستمر.", da: "Relaterer en ressource til en ressource, hvoraf en del af indholdet er udskilt fra en tidligere ressource, så en ny ressource er dannet.", de: "Setzt eine Ressource in Beziehung zu einer diachronen Ressource, die teilweise den Inhalt einer anderen fortlaufenden diachronen Ressource fortführt.", fi: "Liittää aineiston aineistoon, oka on diakroninen aineisto, joka jatkaa toisen diakronisen jatkuvan aineiston sisältöä osittain."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/separatedInto.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
