    property :P60200,
      definition: {en: "Relates a resource to a resource in a digital format that results from a transfer of a resource in another digital format.", ar: "يربط بين مصدر ومصدر فى صيغة رقمية نتج عن تحويل مصدر إلى شكل رقمي آخَر.", da: "Relaterer en ressource til en ressource i et digitalt format, der er resultatet af en overførsel af en ressource i et andet digitalt format.", de: "Setzt eine Ressource in Beziehung zu einer Ressource in einem digitalen Format, die durch die Übertragung einer Ressource in ein anderes digitales Format entsteht.", fi: "Liittää aineiston digitaalisessa muodossa olevaan aineistoon, joka on tulos toisessa digitaalisessa muodossa olevan aineiston muunnoksesta."},
