    property :P60206,
      definition: {en: "Relates a resource to a resource that is a metadata description set for the resources that are held by a collection resource.", ar: "يربط بين مصدر ومصدر يتكون من حصر كامل لمصادر مرتبة بشكل منهجي.", da: "Relaterer en ressource til en ressource, der består af en komplet fortegnelse over ressourcer, der er arrangeret systematisk.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die aus einer vollständigen Aufzählung von Ressourcen besteht, die systematisch angeordnet sind.", fi: "Liittää aineiston aineistoon, joka on kokoelma-aineistoon kuuluvan aineiston metatietokokonaisuus."},
