    property :P60241,
      definition: {en: "Relates a resource to a resource that is modified for a purpose, use, or medium other than that for which it was originally intended.", ar: "يربط بين مصدر ومصدر تم تعديله لغرض، استخدام، أو وسيط بخلاف ذلك الغرض الذي كان مخصصًا له في الأصل.", da: "Relaterer en ressource til en ressource, der er blevet ændret til et andet formål, en anden brug eller et andet medium end det, det oprindeligt var beregnet til.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die für einen anderen Zweck, eine andere Nutzung oder ein anderes Medium, als den/die/das, wofür sie ursprünglich konzipiert wurde, bearbeitet ist.", fi: "Liittää aineiston aineistoon, jota on muokattu jotain muuta kuin alkuperäistä tarkoitusta, käyttöä tai esitysmuotoa varten."},
