      definition: {en: "Relates a resource to a resource that modifies another resource for a purpose, use, or medium other than that for which it was originally intended.", ar: "يربط بين مصدر ومصدر يقوم بتعديل مصدر آخر لغرض، أو استخدام، أو وسيط بخلاف ذلك الغرض الذي كان مخصصًا له في الأصل.", da: "Relaterer en ressource til en ressource, der modificerer en oprindelig ressource til et andet formål, en anden brug eller et andet medium end det, det oprindeligt var beregnet til.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die eine andere Ressource für einen anderen Zweck, eine andere Nutzung oder ein anderes Medium bearbeitet als den/die/das, wofür sie ursprünglich konzipiert war.", fi: "Liittää aineiston aineistoon, joka muokkaa toista aineistoa muuta kuin aineistolle alun perin suunniteltua tarkoitusta, käyttöä tai esitysmuotoa varten."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60088", "http://rdaregistry.info/Elements/u/P60106", "http://rdaregistry.info/Elements/u/P60110", "http://rdaregistry.info/Elements/u/P60138", "http://rdaregistry.info/Elements/u/P60174", "http://rdaregistry.info/Elements/u/P60185", "http://rdaregistry.info/Elements/u/P60188", "http://rdaregistry.info/Elements/u/P60354", "http://rdaregistry.info/Elements/u/P60361", "http://rdaregistry.info/Elements/u/P60721", "http://rdaregistry.info/Elements/u/P60722", "http://rdaregistry.info/Elements/u/P60742", "http://rdaregistry.info/Elements/u/P60744"],
