      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "This relationship applies to changes in form or to resources completely rewritten in the same form.", ar: "تنتطبق هذه العلاقة على التغييرات في الشكل أو في المصادر المعاد كتابتها بالكامل بنفس الشكل.", da: "Denne relation gælder for ændringer i form eller for ressourcer, der er omskrevet fuldstændigt i samme form.", de: "Diese Beziehung bezieht sich auf Änderungen der Form oder auf Ressourcen, die in derselben Form vollständig neu geschrieben sind.", fi: "Koskee muodon muutoksia tai aineiston kattavaa uudelleenkirjoittamista samassa muodossa."},
