      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60261,
      definition: {en: "Relates a resource to a resource whose chronological coverage is before that of another resource.", ar: "يربط بين مصدر ومصدر تكون تغطيته الزمنية قبل التغطية الخاصة بمصدر آخر.", da: "Relaterer en ressource til en ressource, der går forud for den efterfølgende ressource, fx på et tidligere tidspunkt eller før noget i en fortælling.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, deren zeitliches Geschehen vor dem einer anderen Ressource liegt.", fi: "Liittää aineiston aineistoon, jonka ajallinen kattavuus on aineiston ajallista kattavuutta varhaisempi."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60220", "http://rdaregistry.info/Elements/u/P60276", "http://rdaregistry.info/Elements/u/P60277", "http://rdaregistry.info/Elements/u/P60479", "http://rdaregistry.info/Elements/u/P60480", "http://rdaregistry.info/Elements/u/P60505", "http://rdaregistry.info/Elements/u/P60574", "http://rdaregistry.info/Elements/u/P60575", "http://rdaregistry.info/Elements/u/P60576", "http://rdaregistry.info/Elements/u/P60577"],
