    property :P60262,
      definition: {en: "Relates a resource to a resource that is a metadata description set for a collection resource.", ar: "يربط بين مصدر ومصدر يوفر دليلًا لتنظيم، ترتيب واحتواء مجموعة أرشيفية.", da: "Relaterer en ressource til en ressource, der giver en vejledning til organiseringen, ordningen og indholdet af en arkivsamling.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die eine Orientierungshilfe zum Aufbau, zur Anordnung und zu den Inhalten einer Archivsammlung enthält.", fi: "Liittää aineiston aineistoon joka on kokoelma-aineiston metatietokokonaisuus."},
