      definition: {en: "Relates a resource to a resource that is a diachronic resource that continues the content of another diachronic resource that is completed.", ar: "يربط بين مصدر ومصدر ممتد زمنيًا ومستمر في محتوى مصدر آخر ممتد زمنيًا ومكتمل.", da: "Relaterer en ressource til en ressource, hvis indhold fortsætter en tidligere ressource med en ny titel.", de: "Setzt eine Ressource in Beziehung zu einer diachronen Ressource, die den Inhalt einer anderen abgeschlossenen diachronen Ressource fortführt.", fi: "Liittää aineiston diakroniseen aineistoon, joka jatkaa toisen, valmiin diakronisen aineiston sisältöä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/continuedBy.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "This element applies in general to a successive resource.", ar: "ينطبق هذا العنصر بشكل عام على مصدر متتالي.", da: "Denne relation anvendes generelt for periodika.", de: "Im Allgemeinen trifft dieses Element auf eine sukzessive Ressource zu.", fi: "Tämä elementti soveltuu yleensä peräkkäisesti ilmestyvään aineistoon."},
