      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60116", "http://rdaregistry.info/Elements/u/P60251", "http://rdaregistry.info/Elements/u/P60252", "http://rdaregistry.info/Elements/u/P60253", "http://rdaregistry.info/Elements/u/P60254", "http://rdaregistry.info/Elements/u/P60259", "http://rdaregistry.info/Elements/u/P60286"],
