      subPropertyOf: "http://rdaregistry.info/Elements/u/P60709",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60308,
      definition: {en: "Relates a resource to a resource that is abstracted by another resource.", ar: "يربط مصدر بمصدر تم تلخيصه من مصدر آخر", da: "Relaterer en ressource til en ressource, hvis indhold er blevet sammenfattet af en abstract- og indekseringsservice.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die durch eine andere Ressource zusammengefasst wird.", fi: "Liittää aineiston aineistoon, jonka toinen aineisto tiivistää."},
