    property :P60311,
      definition: {en: "Relates a resource to a resource whose style or content is copied in a derivative resource.", ar: "يربط بين مصدر ومصدر يتم نسخ أسلوبه أو محتواه في مصدر مشتق.", da: "Relaterer en ressource til en ressource, hvis stil eller indhold er kopieret i en afledt ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, deren Stil oder Inhalt in einer abgeleiteten Ressource kopiert wird.", fi: "Liittää aineiston aineistoon, jonka tyyliä tai sisältöä johdettu aineisto jäljittelee."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60312",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/imitationOf.en",
