      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60312,
      definition: {en: "Relates a resource to a resource whose style or content is imitated for comic effect.", ar: "يربط بين مصدر ومصدر يتم تقليد أسلوبه أو محتواه ليُحدث تأثيرًا هزليًا.", da: "Relaterer en ressource til en ressource, hvis stil eller indhold efterlignes for at opnå en komisk effekt.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, deren Stil oder Inhalt für eine lustige Wirkung nachgeahmt wird.", fi: "Liittää aineiston aineistoon, jonka tyyliä tai sisältöä jäljitellään humoristisesti."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parodyOf.en",
