      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60208", "http://rdaregistry.info/Elements/u/P60263", "http://rdaregistry.info/Elements/u/P60291", "http://rdaregistry.info/Elements/u/P60302", "http://rdaregistry.info/Elements/u/P61005", "http://rdaregistry.info/Elements/u/P61006", "http://rdaregistry.info/Elements/u/P61069", "http://rdaregistry.info/Elements/u/P61070", "http://rdaregistry.info/Elements/u/P61224", "http://rdaregistry.info/Elements/u/P61225", "http://rdaregistry.info/Elements/u/P61230"],
