      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60314,
      definition: {en: "Relates a resource to a schema or standard that is used to encode the digital content of a resource.", ar: "يربط بين مصدر وخطة، أو معيار مستخدم في تشفير المحتوى الرقمي لمصدر.", da: "Relaterer en ressource til et skema, standard etc., der anvendes til kodning af en ressources digitale indhold.", de: "Setzt eine Ressource in Beziehung zu einem Schema, einem Standard und so weiter, das/der zum Kodieren des digitalen Inhalts einer Ressource verwendet wird.", fi: "Liittää aineiston sen digitaalisen sisällön koodaamiseen käytettyyn skeemaan rai standardiin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/encodingFormat.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has encoding format", ar: "له نظام ترميز", da: "har kodningsformat", de: "hat Kodierungsformat", fi: "koodausmuoto", nl: "heeft coderingsformaat"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60350",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60315,
      definition: {en: "Relates a resource to a nomen that is a serial number, opus number, or thematic index number assigned to a musical resource by a composer, publisher, or a musicologist.", ar: "يربط بين مصدر ورقم مسلسل، رقم قطعة موسيقية، رقم كشاف موضوعى مخصص لمصدر موسيقى من جانب ملحن، ناشر، أو عالم موسيقى.", da: "Relaterer en ressource til et serienummer, opusnummer eller værkfortegnelsesnummer tildelt en musikressource af en komponist, en udgiver eller en musikforsker.", de: "Setzt ein Werk in Beziehung zu einer laufenden Nummer, einer Opus-Nummer oder einer Werkverzeichnisnummer, die einem Musikwerk durch eine Komponistin/einen Komponisten, einen Verlag oder eine Musikwissenschaftlerin/einen Musikwissenschaftler zugewiesen wird.", fi: "Liittää aineiston säveltäjän, julkaisijan tai musiikintutkijan antamaan järjestysnumeroon, opusnumeroon tai temaattisen teosluettelon numeroon."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60953", "http://rdaregistry.info/Elements/u/P60954", "http://rdaregistry.info/Elements/u/P60955"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/numericDesignationOfMusicalResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A numeric designation of a musical resource includes a caption such as e.g., no., op., BWV, and it may include a numeral, a letter, a word, any other character, or the combination of these.", ar: "تتضمن التسمية الرقمية لمصدر موسيقي تعليقًا (على سبيل المثال، رقم، مرجع سابق، BWV) وقد يتضمن رقمًا، حرفًا، كلمة، أو أي رمزًا آخر أو مزيجًا من هذه العناصر.", da: "En numerisk betegnelse for en musikressource inkluderer en indledning som fx no., op., BWV og den kan inkludere et nummer, et bogstav, et ord, eller et hvilket som helst andet tegn eller en kombination af disse.", de: "Darunter fallen einleitende Begriffe (zum Beispiel Nr., op., BWV) sowie gegebenenfalls Ziffern, Buchstaben, Wörter, beliebige andere Zeichen oder eine Kombination davon.", fi: "Musiikkiaineiston numeromäärite sisältää selosteen, esimerkiksi no., op. tai BWV, ja se voi sisältää numeron, kirjaimen, sanan, minkä tahansa muun merkin tai näiden yhdistelmän."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60963",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has numeric designation of musical resource", ar: "لديه تسمية رقمية لمصدر موسيقي", da: "har numerisk betegnelse for musikressource", de: "hat numerische Bezeichnung einer Musikressource", fi: "musiikkiaineiston numeromäärite", nl: "heeft numerieke aanduiding van muziek-resource"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60316,
      definition: {en: "Relates a resource to a resource that is a successive aggregating resource that is inspired by the overall editorial policy, scope, and style of another successive aggregating resource.", ar: "يربط بين مصدر ومصدر تجميعي متتالي مستوحى من السياسة التحريرية الشاملة، والمجال، وأسلوب مصدر تجميعي متتالي آخر.", da: "Relaterer en ressource til en serie eller et flerbindsværk der konsekvent optræder i en større ressource; en titel på en større ressource optræder på alle udgaver eller dele af underserien.", de: "Setzt eine Ressource in Beziehung zu einer sukzessiven, aggregierenden Ressource, die an die allgemeine redaktionelle Vorgehensweise, den Geltungsbereich und den Stil einer anderen sukzessiven, aggregierenden Ressource angelehnt ist.", fi: "Liittää aineiston peräkkäiseen aggregoivaan aineistoon, johon on vaikuttanut toisen peräkkäisen aggregoivan aineiston yleinen toimituksellinen käytäntö, laajuus ja tyyli."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/subseries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60192",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has subseries", ar: "له سلسلة فرعية", da: "er underserie", de: "hat Unterreihe", fi: "aineiston alasarja", nl: "heeft onderserie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60249",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60317,
      definition: {en: "Relates a resource to a resource that has an issue that is devoted to a specific topic.", ar: "يربط بين مصدر ومصدر له عدد مخصص لموضوع محدد.", da: "Relaterer en ressource til et periodikum eller avis, der indeholder et enkelt nummer eller et tillæg helliget et bestemt emne, med eller uden periodikanummerering, som fx. et jubilæumsnummer af en tidsskrift eller avis.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die eine Ausgabe einem bestimmten Thema gewidmet hat.", fi: "Liittää aineiston aineistoon, jolla on tietylle aiheelle omistettu numero."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/specialIssueOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60207",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is special issue of", ar: "إصدار خاص لـ", da: "er særnummer af", de: "ist Sonderausgabe von", fi: "aineiston erikoisnumero", nl: "is themanummer van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60101",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60318,
      definition: {en: "Relates a resource to a set of characters or symbols used to express the content of a resource in a form that can be perceived through touch.", ar: "يربط بين مصدر ومجموعة من أحرف أو رموز مُستخدمة للتعبير عن محتوى مصدر في شكل يمكن إدراكه من خلال اللمس.", da: "Relaterer en ressource til et sæt af tegn og/eller symboler, der anvendes til at udtrykke en ressources indhold på en måde, der kan opfattes ved berøring.", de: "Setzt eine Ressource in Beziehung zu einem Satz von Zeichen oder Symbolen der verwendet wird, um den Inhalt einer Ressource in einer Form auszudrücken, die über den Tastsinn wahrgenommen werden kann.", fi: "Liittää aineiston joukkoon merkkejä tai symboleja, joita käytetään aineiston sisällön ilmaisemiseen kosketeltavassa muodossa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/formOfTactileNotation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has form of tactile notation", ar: "له شكل من أشكال التدوين عن طريق اللمس", da: "har taktil notationsform", de: "hat Form der taktilen Notation", fi: "aineiston taktiilin merkkijärjestelmän tyyppi", nl: "heeft vorm van tactiele notatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60319",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60319,
      definition: {en: "Relates a resource to a set of characters or symbols used to express the content of a resource.", ar: "يربط بين مصدر ومجموعة من الأحرف أو الرموز المستخدمة للتعبير عن محتوى مصدر.", da: "Relaterer en ressource til et sæt af tegn og/eller symboler, der anvendes til at udtrykke en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einem Satz von Zeichen oder Symbolen der verwendet wird, um den Inhalt einer Ressource auszudrücken.", fi: "Liittää aineiston joukkoon merkkejä tai symboleja, joita käytetään aineiston sisällön ilmaisemiseen."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60318", "http://rdaregistry.info/Elements/u/P60320", "http://rdaregistry.info/Elements/u/P60321", "http://rdaregistry.info/Elements/u/P60322"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/formOfNotation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has form of notation", ar: "له شكل من أشكال التدوين", da: "har notationsform", de: "hat Form der Notation", fi: "aineiston merkkijärjestelmän tyyppi", nl: "heeft vorm van notatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60320,
      definition: {en: "Relates a resource to a set of characters or symbols used to express movement content of a resource.", ar: "يربط بين مصدر ومجموعة من الأحرف أو الرموز المستخدمة للتعبير عن محتوى حركي لمصدر.", da: "Relaterer en ressource til et sæt af tegn og/eller symboler, der anvendes til at udtrykke de bevægelser en ressource indeholder.", de: "Setzt eine Ressource in Beziehung zu einem Satz von Zeichen oder Symbolen der verwendet wird, um den Bewegungsinhalt einer Ressource auszudrücken.", fi: "Liittää aineiston joukkoon merkkejä tai symboleja, joita käytetään aineiston liikesisällön ilmaisemiseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/formOfNotatedMovement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has form of notated movement", ar: "شكل من أشكال الحركات المدونة", da: "har bevægelsesnotationsform", de: "hat Form der Bewegungsnotation", fi: "aineiston liikenotaation tyyppi", nl: "heeft vorm van bewegingsnotatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60319",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60321,
      definition: {en: "Relates a resource to a set of characters or symbols used to express musical content of a resource.", ar: "يربط بين مصدر ومجموعة من الأحرف أو الرموز المستخدمة للتعبير عن محتوى موسيقي لمصدر.", da: "Relaterer en ressource til et sæt af tegn og/eller symboler, der anvendes til at udtrykke en ressources musikindhold.", de: "Setzt eine Ressource in Beziehung zu einem Satz von Zeichen oder Symbolen der verwendet wird, um den musikalischen Inhalt einer Ressource auszudrücken.", fi: "Liittää aineiston joukkoon merkkejä tai symboleja, joita käytetään aineiston musiikkisisällön ilmaisemiseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/formOfMusicalNotation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has form of musical notation", ar: "له شكل من أشكال التدوين الموسيقي", da: "har musikalsk notationsform", de: "hat Form einer Musiknotation", fi: "aineiston nuottikirjoituksen tyyppi", nl: "heeft vorm van muzieknotatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60319",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60322,
      definition: {en: "Relates a resource to a set of characters or symbols used to express written language content of a resource.", ar: "يربط بين مصدر ومجموعة من الأحرف أو الرموز المستخدمة للتعبير عن محتوى لغة مكتوبة لمصدر.", da: "Relaterer en ressource til et sæt af tegn og/eller symboler, der anvendes til at udtrykke det skrevne sprogindhold i en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Satz von Zeichen oder Symbolen der verwendet wird, um den geschriebenen Sprachinhalt einer Ressource auszudrücken.", fi: "Liittää aineiston joukkoon merkkejä tai symboleja, joita käytetään aineiston kirjoitetun kielellisen sisällön ilmaisemiseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/script.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has script", ar: "له نص", da: "har skrift", de: "hat Schrift", fi: "aineiston kirjoitusjärjestelmä", nl: "heeft schrift"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60319",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60323,
      definition: {en: "Relates a resource to a set of technical details relating to an encoding of geospatial information in a cartographic resource.", ar: "يربط بين مصدر ومجموعة تفاصيل فنية مرتبطة بمعلومات الترميز الجغرافي في مصدر خرائطي", da: "Relaterer en ressource til et sæt af tekniske detaljer relateret til kodning af geospatiale oplysningerer i en kartografisk ressource.", de: "Setzt eine Ressource in Beziehung zu einem Satz von technischen Angaben, die sich auf die Kodierung von Geoinformationen in einer kartografischen Ressource beziehen.", fi: "Liittää aineiston aineiston maantieteellisen paikkatiedon koodaamisen tekniseen tietoon."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60875",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/digitalRepresentationOfCartographicContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has digital representation of cartographic content", ar: "له تمثيل رقمي للمحتوى الجغرافي", da: "har digital repræsentation af kartografisk indhold", de: "hat digitale Darstellung von kartografischem Inhalt", fi: "kartografisen sisällön digitaalinen esitysmuoto", nl: "heeft digitale representatie van cartografische content"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60350",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60324,
      definition: {en: "Relates a resource to a significant date associated with the history of an agent, or the date or range of dates on which a conference, etc., was held, or a date with which an agent is otherwise associated. (Deprecated)", da: "Relaterer en ressource til en væsentlig datering forbundet med en agents historie, eller et dato som en agent ellers forbindes med."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60076", "http://rdaregistry.info/Elements/u/P60524", "http://rdaregistry.info/Elements/u/P60525", "http://rdaregistry.info/Elements/u/P60526", "http://rdaregistry.info/Elements/u/P60598", "http://rdaregistry.info/Elements/u/P60599"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateAssociatedWithAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60974",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date associated with agent (Deprecated)", da: "har dato knyttet til agenten"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61020",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60325,
      definition: {en: "Relates an agent to a significant location associated with an agent, or a place where an agent resides or has resided or has some connection. (Deprecated)", da: "Relaterer en ressource til et væsentligt sted, der er forbundet med en agent, eller et sted hvor en agent bor eller har boet eller har en forbindelse til."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60064",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeAssociatedWithAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60993",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place associated with agent (Deprecated)", da: "har sted forbundet med agent"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61018",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60326,
      definition: {en: "Relates a resource to a schema or standard that is used to encode the analog video content of a resource.", ar: "يربط بين مصدر وخطة أو معيار مستخدم في تشفير محتوى الفيديو التناظري لمصدر.", da: "Relaterer en ressource til en standard etc., der anvendes til kodning af en ressources analoge videoindhold.", de: "Setzt eine Ressource in Beziehung zu einem Schema oder Standard, das/der zum Kodieren des analogen Videoinhalts einer Ressource verwendet wird.", fi: "Liittää aineiston standardiin tai skeemaan, jota on käytetty aineiston analogisen videon sisältöön."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/videoFormat.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has video format", ar: "له شكل فيديو", da: "har videoformat", de: "hat Videoformat", fi: "aineiston videoformaatti", nl: "heeft videoformaat"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60352",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60327,
      definition: {en: "Relates a resource to a statement associated with a title proper of a resource that relates to an identification or function of agents responsible for the creation of, or who contributes to a realization of, the intellectual or artistic content of a resource.", ar: "يربط بين مصدر وبيان مرتبط بالعنوان نفسه لمصدر يتعلق بتعريف أو وظيفة الوكلاء المسؤولين عن إنشاء المحتوى الفكري أو الفني لمصدر، أو الذين يساهمون في تحقيقه.", da: "Relaterer en ressource til en ophavsangivelse der knytter sig til en hovedtitel på en ressource, der relaterer sig til identificeringen eller funktionen af en hvilken som helst agent eller agenter, der er ansvarlige for at have skabt elle bidraget til realiseringen af det intellektuelle eller kunstneriske indhold af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die mit einem Haupttitel in Verbindung steht und die sich auf die auf eine Identifizierung oder Funktion von Akteuren bezieht, die für die Schaffung des geistigen oder künstlerischen Inhalts einer Ressource verantwortlich sind oder zu dessen Realisierung beitragen.", fi: "Liittää aineiston päänimekkeeseen liittyvään vastuullisuusmerkintöön, joka liittyy aineiston henkisen tai taiteellisen sisällön luomisesta vastaavien tai sen toteuttamiseen osallistuvien toimijoiden tunnistamiseen tai tehtävään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/statementOfResponsibilityRelatingToTitleProper.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has statement of responsibility relating to title proper", ar: "له بيان مسؤولية مرتبط بالعنوان نفسه", da: "har ophavsangivelse relateret til hovedtitel", de: "hat Verantwortlichkeitsangabe, die sich auf einen Haupttitel bezieht", fi: "päänimekkeeseen liittyvä vastuullisuusmerkintö", nl: "heeft verantwoordelijkheidsvermelding gerelateerd aan hoofdtitel"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60339",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60328,
      definition: {en: "Relates a resource to a statement that identifies a series that is associated with a resource and a numbering of a resource within the series,", ar: "يربط بين مصدر وبيان يحدد سلسلة مرتبطة بمصدر وترقيم مصدر داخل سلسلة.", da: "Relaterer en ressource til oplysninger, der identificerer en serie, som en ressource er en del af, samt nummerering af en ressource i serien.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die eine Reihe identifiziert, mit der eine Ressource in Verbindung steht und die eine Zählung einer Ressource innerhalb der Reihe aufweist.", fi: "Liittää aineiston huomautukseen, joka sisältää tietoa aineistoon liittyvästä sarjasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/seriesStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A series statement may also include information identifying one or more subseries to which the resource being described belongs. A series statement sometimes includes statements of responsibility relating to a series or subseries.", ar: "قد يتضمن بيان السلسلة أيضًا معلومات تُحدد سلسلة فرعية واحدة أو أكثر ينتمي إليها المصدر الموصوف.وفي بعض الأحيان يتضمن بيان السلسلة بيانات المسؤولية المتعلقة بسلسلة أو سلسلة فرعية.", da: "En seriebeskrivelse kan også indeholde oplysninger, der identificerer en eller flere underserier, som den beskrevne ressource er en del af. En seriebeskrivelse inkluderer sommetider en eller flere ophavsangivelser relaterede til serien eller underserien.", de: "Darunter können auch Informationen fallen, die eine Unterreihe oder mehrere Unterreihen identifizieren, zu der/denen die zu beschreibende Ressource gehört. Darunter können auch Verantwortlichkeitsangaben fallen, die sich auf eine Reihe oder Unterreihe beziehen.", fi: "Sarjamerkintöön voi kuulua myös yhden tai useamman kuvailtavaan aineistoon sisältyvän alasarjan identifioiva tieto. Joskus sarjamerkintö sisältää sarjaan tai alasarjaan liittyviä vastuullisuusmerkintöjä."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has series statement", ar: "له بيان سلسلة", da: "har seriebeskrivelse", de: "hat Gesamttitelangabe", fi: "aineiston sarjamerkintö", nl: "heeft reeksvermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60329,
      definition: {en: "Relates a resource to a statement that identifies an edition to which a resource belongs.", ar: "يربط بين مصدر وبيان يحدد طبعة ينتمي إليها مصدر.", da: "Relaterer en ressource til oplysninger, der identificerer den udgave, en ressource hører til.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die eine Ausgabe identifiziert, zu der eine Ressource gehört.", fi: "Liittää aineiston merkintöön, joka identifioi aineiston painoksen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/editionStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has edition statement", ar: "له بيان طبعة", da: "har udgavebeskrivelse", de: "hat Ausgabevermerk", fi: "aineiston painosmerkintö", nl: "heeft editievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60330,
      definition: {en: "Relates a resource to a statement that identifies a place of distribution, a distributor, or a date of distribution of a published resource.", ar: "يربط بين مصدر وبيان يحدد مكان توزيع، موزع، أو تاريخ توزيع خاص بمصدر منشور.", da: "Relaterer en ressource til oplysninger, der identificerer distributionssted, distributør, eller et dato for distribution af en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die einen Vertriebsort, einen Vertrieb oder ein Vertriebsdatum einer veröffentlichten Ressource identifiziert.", fi: "Liittää aineiston merkintöön, joka identifioi julkaistun aineiston jakelupaikan, jakelijan tai jakeluajan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/distributionStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has distribution statement", ar: "له بيان توزيع", da: "har distributionsbeskrivelse", de: "hat Vertriebsangabe", fi: "aineiston jakelumerkintö", nl: "heeft distributievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60331,
      definition: {en: "Relates a resource to a statement that identifies a place of manufacture, a manufacturer, or a date of manufacture of a published resource.", ar: "يربط بين مصدر وبيان يحدد مكان تصنيع، مصنعون، أو تاريخ تصنيع خاص بمصدر منشور.", da: "Relaterer en ressource til oplysninger, der identificerer fremstillingssted, producent og fremstillingsår eller -dato for en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die einen Herstellungsort, einen Hersteller oder ein Herstellungsdatum einer veröffentlichten Ressource identifiziert.", fi: "Liittää aineiston merkintöön, joka identifioi julkaistun aineiston valmistuspaikan, valmistajan tai valmistusajan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/manufactureStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A manufacture statement includes a statement about the printing, duplicating, casting, etc., of a published resource.", ar: "يشمل بيان التصنيع البيان المتعلق بالطباعة، النسخ، الطَرَح، إلخ. لمصدر منشور.", da: "Produktionsbeskrivelse omfatter en beskrivelse af trykning, kopiering, støbning, etc. af en publiceret ressource.", de: "Darunter fallen Angaben, die sich auf den Druck, die Vervielfältigung, den Guss und so weiter einer veröffentlichten Ressource beziehen.", fi: "Valmistusmerkintö sisältää julkaistun aineiston painamiseen, monistamiseen, kirjasinten valamiseen tms. liittyvän merkinnön."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has manufacture statement", ar: "له بيان تصنيع", da: "har produktionsbeskrivelse", de: "hat Herstellungsangabe", fi: "aineiston valmistusmerkintö", nl: "heeft vervaardigingsvermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60332,
      definition: {en: "Relates a resource to a statement that identifies a place of production, a producer, or a date of production of an unpublished resource.", ar: "يربط بين مصدر وبيان يُحدد مكان إنتاج، منتج، أو تاريخ إنتاج خاص بمصدر غير منشور.", da: "Relaterer en ressource til oplysninger, der identificerer produktionssted, producent og fremstillingsdato for en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die einen Entstehungsort, eine Produzentin/einen Produzenten oder ein Entstehungsdatum einer unveröffentlichten Ressource identifiziert.", fi: "Liittää aineiston merkintöön, joka identifioi julkaisemattoman aineiston tuotantopaikan, tuottajan tai tuotantoajan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A production statement includes a statement about the inscription, fabrication, construction, etc., of an unpublished resource.", ar: "يشمل بيان الإنتاج البيان المرتبط بالتسجيل، أو الصناعة، أو الإنشاء، إلخ. لمصدر غير منشور.", da: "Produktionsbeskrivelse omfatter en beskrivelse af inskription, fremstilling, konstruktion etc. af en ressource i ikke publiceret form.", de: "Darunter fallen Angaben, die sich auf die Beschriftung, die Fabrikation und die Konstruktion und so weiter einer unveröffentlichten Ressource beziehen.", fi: "Tuotantomerkintö sisältää julkaisettoman aineiston kaivertamiseen, valmistamiseen, kokoamiseen tms. liittyvän merkinnön."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has production statement", ar: "له بيان إنتاج", da: "har produktionsbeskrivelse", de: "hat Entstehungsangabe", fi: "aineiston tuotantomerkintö", nl: "heeft productievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60333,
      definition: {en: "Relates a resource to a statement that identifies a place of publication, a publisher, or a date of publication of a published resource.", ar: "يربط بين مصدر وبيان يُحدد مكان نشر، ناشر، أو تاريخ نشر خاص بمصدر منشور.", da: "Relaterer en ressource til oplysninger, der identificerer publiceringssted, udgiver og publiceringsdato for en publiceret ressource.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die einen Erscheinungsort, einen Verlag oder ein Erscheinungsdatum einer veröffentlichten Ressource identifiziert.", fi: "Liittää aineiston merkintöön, joka identifioi aineiston kustannuspaikan, kustantajan tai julkaisuajan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/publicationStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has publication statement", ar: "له بيان نشر", da: "har publiceringsbeskrivelse", de: "hat Veröffentlichungsangabe", fi: "aineiston julkaisumerkintö", nl: "heeft publicatievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60334,
      definition: {en: "Relates a resource to a statement of responsibility relating to a named revision of an edition in a language or script that differs from that recorded in a statement of responsibility relating to a named revision of an edition element.", ar: "يربط بين مصدر وبيان مسؤولية متعلق بمراجعة مسماة لطبعة بلغة أو نص مختلف عن تلك المُسجلة داخل بيان المسؤولية المرتبط بمراجعة مسماه لعنصر طابعه.", da: "Relaterer en ressource til en ophavsangivelse på et andet sprog eller i et andet alfabet end det som er anvendt ved angivelsen af den navngivne revision af en udgave.", de: "Setzt eine Ressource in Beziehung zu einer Verantwortlichkeitsangabe einer näher erläuterten Überarbeitung in einer Sprache oder Schrift, die von der bereits erfassten Verantwortlichkeitsangabe einer näher erläuterten Überarbeitung abweicht.", fi: "Liittää aineiston erikieliseen nimettyyn uudistettuun painokseen tai käsikirjoitukseen liittyvään vastuullisuusmerkintöön."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelStatementOfResponsibilityRelatingToNamedRevisionOfEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel statement of responsibility relating to named revision of edition", ar: "له بيان موازي لمسؤولية متعلقة بالمراجعة المسماة لطبعة", da: "har parallel ophavsangivelse relateret til en navngivet revision af en udgave", de: "hat parallele Verantwortlichkeitsangabe, die sich auf eine näher erläuterte Überarbeitung einer Ausgabe bezieht", fi: "nimettyyn uudistettuun painokseen liittyvä rinnakkainen vastuullisuusmerkintö aineistossa", nl: "heeft parallelle verantwoordelijkheidsvermelding gerelateerd aan benoemde herziening van editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60335,
      definition: {en: "Relates a resource to a statement of responsibility relating to series in a language or script that differs from that recorded in a statement of responsibility relating to series element.", ar: "يربط بين مصدر وبيان مسؤولية متعلق بسلسلة بلغة أو نص مختلف عن تلك المُسجلة داخل بيان المسؤولية المرتبط بعنصر سلسلة.", da: "Relaterer en ressource til en ophavsangivelse relateret til en serie på et andet sprog eller i et andet alfabet end det som er anvendt ved angivelsen af en ophavsangivelse til en serie.", de: "Setzt eine Ressource in Beziehung zu einer Verantwortlichkeitsangabe einer Reihe in einer Sprache oder Schrift, die von der bereits erfassten Verantwortlichkeitsangabe einer Reihe abweicht.", fi: "Liittää aineiston sarjan vastuullisuusmerkintöön toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelStatementOfResponsibilityRelatingToSeries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel statement of responsibility relating to series", ar: "له بيان موزاي لمسؤولية مرتبطة بسلسلة", da: "har parallel ophavsangivelse relateret til serie", de: "hat parallele Verantwortlichkeitsangabe, die sich auf eine Reihe bezieht", fi: "sarjan rinnakkainen vastuullisuusmerkintö aineistossa", nl: "heeft parallelle verantwoordelijkheidsvermelding gerelateerd aan reeks"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60336,
      definition: {en: "Relates a resource to a statement of responsibility relating to subseries in a language or script that differs from that recorded in a statement of responsibility relating to subseries element. (Deprecated)", da: "Relaterer en ressource til en ophavsangivelse relateret til en underserie på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af en ophavsangivelse til en underserie."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelStatementOfResponsibilityRelatingToSubseries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel statement of responsibility relating to subseries (Deprecated)", da: "har parallel ophavsangivelse relateret til underserie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60337,
      definition: {en: "Relates a resource to a statement of responsibility relating to an edition in a language or script that differs from that recorded in a statement of responsibility relating to an edition element.", ar: "يربط بين مصدر وبيان مسؤولية مرتبط بطبعة بلغة أو نص مختلف عن تلك المُسجلة داخل بيان المسؤولية المرتبط بعنصر طابعه.", da: "Relaterer en ressource til en ophavsangivelse på et andet sprog eller i et andet alfabet end det som er anvendt ved angivelsen af en ophavsangivelse til en underserie.", de: "Setzt eine Ressource in Beziehung zu einer Verantwortlichkeitsangabe einer Ausgabe in einer Sprache oder Schrift, die von der bereits erfassten Verantwortlichkeitsangabe einer Ausgabe abweicht.", fi: "Liittää aineiston sen erikieliseen painokseen tai käsikirjoitukseen liittyvään vastuullisuusmerkintöön."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelStatementOfResponsibilityRelatingToEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel statement of responsibility relating to edition", ar: "له بيان موازي لمسؤولية مرتبطة بطبعة", da: "har parallel ophavsangivelse relateret til udgave", de: "hat parallele Verantwortlichkeitsangabe, die sich auf eine Ausgabe bezieht", fi: "painoksen rinnakkainen vastuullisuusmerkintö aineistossa", nl: "heeft parallelle verantwoordelijkheidsvermelding gerelateerd aan editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60338,
      definition: {en: "Relates a resource to a statement of responsibility relating to title proper in a language or script that differs from that recorded in a statement of responsibility relating to title proper element.", ar: "يربط بين مصدر وبيان مسؤولية متعلق بعنوان مُنَاسِب بلغة أو نص مختلف عن تلك المُسجلة داخل بيان المسؤولية المرتبط بعنصر العنوان نفسه.", da: "Relaterer en ressource til en ophavsangivelse på et andet sprog eller i et andet alfabet end det som er anvendt ved angivelsen af en ophavsangivelse til en hovedtitel.", de: "Setzt eine Ressource in Beziehung zu einer Verantwortlichkeitsangabe eines Haupttitels in einer Sprache oder Schrift, die von der bereits erfassten Verantwortlichkeitsangabe eines Haupttitels abweicht.", fi: "Liittää aineiston sen erikieliseen painoksen tai käsikirjoituksen päänimekkeeseen liittyvään vastuullisuusmerkintöön."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelStatementOfResponsibilityRelatingToTitleProper.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel statement of responsibility relating to title proper", ar: "له بيان مسؤولية موازي مرتبط بالعنوان نفسه", da: "har parallel ophavsangivelse relateret til hovedtitel", de: "hat parallele Verantwortlichkeitsangabe, die sich auf einen Haupttitel bezieht", fi: "päänimekkeen rinnakkainen vastuullisuusmerkintö aineistossa", nl: "heeft parallelle verantwoordelijkheidsvermelding gerelateerd aan hoofdtitel"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60339",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60339,
      definition: {en: "Relates a resource to a statement relating to anidentification or function of any agents responsible for the creation of, or who contributes to a realization of, the intellectual or artistic content of a resource.", ar: "يربط بين مصدر وبيان متعلق بتحديد هوية أو وظيفة أي وكلاء مسؤولين عن إنشاء المحتوى الفكري أو الفني لمصدر، أو الذين يساهمون في تحقيقه.", da: "Relaterer en ressource til oplysninger relaterede til identificering eller funktion af alle agenter, der er ansvarlige for at have skabt eller bidraget til realiseringen af det intellektuelle eller kunstneriske indhold af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die mit der Identifizierung oder Funktion von Akteuren in Verbindung steht, die für die Schaffung des geistigen oder künstlerischen Inhalts einer Ressource verantwortlich sind oder zu dessen Realisierung beitragen.", fi: "Liittää aineiston merkintöön, joka liittyy aineiston henkisen tai taiteellisen sisällön luomisesta vastaavien tai sen toteuttamiseen osallistuvien toimijoiden tunnistamiseen tai tehtävään."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60327", "http://rdaregistry.info/Elements/u/P60338"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/statementOfResponsibility.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has statement of responsibility", ar: "له بيان مسؤولية", da: "har ophavsangivelse", de: "hat Verantwortlichkeitsangabe", fi: "vastuullisuusmerkintö aineistossa", nl: "heeft verantwoordelijkheidsvermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60340,
      definition: {en: "Relates a resource to a statement relating to an identification of agents responsible for a named revision of an edition.", ar: "يربط بين مصدر وبيان متعلق بتحديد هوية وكلاء مسؤولين عن مراجعة المسماة لطبعة.", da: "Relaterer en ressource til oplysninger relateret til identificering af alle agenter, der er ansvarlige for en navngivet revision af en udgave.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die mit der Identifizierung von Akteuren in Verbindung steht, die für eine näher erläuterte Überarbeitung eines Ausgabe verantwortlich sind.", fi: "Liittää aineiston merkintöön, joka liittyy uudistetun painoksen henkisen tai taiteellisen sisällön luomisesta vastaavien tai sen toteuttamiseen osallistuvien toimijoiden tunnistamiseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/statementOfResponsibilityRelatingToNamedRevisionOfEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has statement of responsibility relating to named revision of edition", ar: "له بيان مسؤولية مرتبط بمراجعة مسماة لطبعة", da: "har ophavsangivelse relateret til en navngivet revision af en udgave", de: "hat Verantwortlichkeitsangabe, die sich auf eine näher erläuterte Überarbeitung einer Ausgabe bezieht", fi: "nimetyn uudistetun painoksen vastuullisuusmerkintö", nl: "heeft verantwoordelijkheidsvermelding gerelateerd aan benoemde herziening van editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60341,
      definition: {en: "Relates a resource to a statement relating to an identification of agents responsible for a series.", ar: "يربط بين مصدر وبيان متعلق بتحديد هوية وكلاء مسؤولين عن سلسلة.", da: "Relaterer en ressource til oplysninger relateret til identificering af agenter, der er ansvarlige for en serie.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die mit der Identifizierung von Akteuren in Verbindung steht, die für eine Reihe verantwortlich sind.", fi: "Liittää aineiston merkintöön, joka liittyy sarjasta vastaavien toimijoiden tunnistamiseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/statementOfResponsibilityRelatingToSeries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has statement of responsibility relating to series", ar: "له بيان مسؤولية مرتبط بسلسلة", da: "har ophavsangivelse relateret til serie", de: "hat Verantwortlichkeitsangabe, die sich auf eine Reihe bezieht", fi: "sarjan vastuullisuusmerkintö aineistossa", nl: "heeft verantwoordelijkheidsvermelding gerelateerd aan reeks"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60342,
      definition: {en: "Relates a resource to a statement relating to an identification of agents responsible for a subseries. (Deprecated)", da: "Relaterer en ressource til oplysninger relateret til identificering af en hvilken som helst agent eller agenter, der er ansvarlige for en underserie."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/statementOfResponsibilityRelatingToSubseries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has statement of responsibility relating to subseries (Deprecated)", da: "har ophavsangivelse relateret til underserie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60343,
      definition: {en: "Relates a resource to a statement relating to an identification of agents responsible for an edition being described but not to all editions.", ar: "يربط بين مصدر وبيان متعلق بتحديد هوية وكلاء مسؤولين عن طبعة تم وصفها ولكن ليس لجميع الطبعات.", da: "Relaterer en ressource til oplysninger relateret til identificering af agenter, der er ansvarlige for en beskreven udgave men ikke alle udgaver.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die mit der Identifizierung von Akteuren in Verbindung steht, die für eine beschriebene Ausgabe, aber nicht für alle Ausgaben, verantwortlich sind.", fi: "Liittää aineiston merkintöön, joka liittyy kuvailtavana olevasta painoksesta, mutta ei kaikista painoksista, vastaavien toimijoiden tunnistamiseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/statementOfResponsibilityRelatingToEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has statement of responsibility relating to edition", ar: "له بيان مسؤولية مرتبط بطبعة", da: "har ophavsangivelse relateret til udgave", de: "hat Verantwortlichkeitsangabe, die sich auf eine Ausgabe bezieht", fi: "painoksen vastuullisuusmerkintö aineistossa", nl: "heeft verantwoordelijkheidsvermelding gerelateerd aan editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60344,
      definition: {en: "Relates a resource to a suspension of light-sensitive chemicals used as a coating on a microfilm or microfiche.", ar: "يربط بين مصدر ونظام تسجيل خاص بالمواد الكيميائية المستخدمة كغطاء على ميكروفيلم أو ميكروفيش.", da: "Relaterer en ressource til en opslæmning af lysfølsomme kemikalier, der er anvendt som belægning på en mikrofilm eller mikrofiche.", de: "Setzt eine Ressource in Beziehung zu einer Suspension aus lichtempfindlichen Chemikalien, die als Beschichtung eines Mikrofilms oder eines Mikrofiches verwendet wird.", fi: "Liittää aineiston mikrofilmin tai mikrokortin valoherkkiä kemikaaleja sisältävään pinnoitteeseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/emulsionOnMicrofilmAndMicrofiche.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has emulsion on microfilm and microfiche", ar: "له طبقة حساسة على ميكروفيلم وميكروفيش", da: "har emulsion på mikrofilm og mikrofiche", de: "hat Emulsionsschicht auf Mikrofilm und Mikrofiche", fi: "mikrofilmille ja mikrokortille emuloitu aineisto", nl: "heeft emulsie op microfilm en microfiche"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60159",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60345,
      definition: {en: "Relates a resource to a place that is the area of coverage of a cartographic resource that is identified using the longitude of the westernmost and easternmost boundaries and the latitude of the northernmost and southernmost boundaries.", ar: "يربط بين مصدر ومكان يحدد المنطقة التي يغطيها المحتوى الخرائطي لمصدر باستخدام خط الطول لأقصى الحدود الغربية والشرقية وخط العرض لأقصى الحدود الشمالية والجنوبية.", da: "Relaterer en ressource til et system til identificering af det område, der dækkes af en ressources kartografiske indhold; anvender længdegrader for de vestligste og østligste grænser samt breddegrader for de nordligste og sydligste grænser.", de: "Setzt eine Ressource in Beziehung zu einem Gebiet, das den Abdeckungsbereich des kartografischen Inhalts einer Ressource anhand des Längengrads der westlichsten und östlichsten Grenze sowie des Breitengrads der nördlichsten und südlichsten Grenze identifiziert.", fi: "Liittää aineiston paikkaan, joka määrittää aineiston kartografisen sisällön kattaman alueen indentifioidaan käyttämällä läntisimmän ja itäisimmän rajan pituusastetta sekä pohjoisimman ja eteläisimmän rajan leveysastetta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/longitudeAndLatitude.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61198",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has longitude and latitude", ar: "له خط طول وخط عرض", da: "har længdegrad og breddegrad", de: "ist Längengrad und Breitengrad von", fi: "pituus- ja leveysasteet aineistossa", nl: "heeft lengtegraad en breedtegraad"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60109",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60346,
      definition: {en: "Relates a resource to a place that is the location of a celestial body that is the coverage of a cartographic resource and is identified using the angles of right ascension and declination.", ar: "يربط بين مصدر ونظام لتحديد موقع جسم سماوي في السماء مغطى بمحتوى خرائطي لمصدر ما باستخدام زوايا الصعود المستقيم والانحراف.", da: "Relaterer en ressource til et system til identificering af den placering af et himmellegeme på himlen, der dækkes af en ressources kartografiske indhold, ved anvendelse af vinklerne for rektascension og deklination.", de: "Setzt eine Ressource in Beziehung zu einem System zur Identifizierung der Position eines Himmelskörpers am Himmel, die vom kartografischen Inhalt einer Ressource, unter Verwendung der Winkel der Rektaszension und der Deklination, abgedeckt wird.", fi: "Liittää aineiston järjestelmään, joka määrittää aineiston kartografiseen sisältöön kuuluvan taivaankappaleen sijainnin käyttämällä rektaskension ja deklinaation kulmamittoja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/rightAscensionAndDeclination.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61201",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has right ascension and declination", ar: "له صعود مستقيم وانحراف", da: "har rektascension og deklination", de: "hat Rektaszension und Deklination", fi: "rektaskensio ja deklinaatio aineistossa", nl: "heeft rechte klimming en declinatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60109",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60347,
      definition: {en: "Relates a resource to a system for identifying the precise area covered by the cartographic content of a resource using coordinates for each vertex of a polygon.", ar: "يربط بين مصدر ونظام لتحديد المنطقة المعينة التي يغطيها المحتوى الخرائطي لمصدر ما باستخدام إحداثيات لكل قمة مضلع.", da: "Relaterer en ressource til et system til identificering af det præcise areal, der dækkes af en ressources kartografiske indhold; anvender koordinater for hvert af en polygons toppunkter.", de: "Setzt eine Ressource in Beziehung zu einem System zur Identifizierung des genauen Gebiets, das durch den kartografischen Inhalt einer Ressource abgedeckt wird, indem Koordinaten für jeden Eckpunkt eines Vielecks verwendet werden.", fi: "Liittää aineiston järjestelmään, joka täsmällisesti määrittää kartografisen aineiston kattaman alueen käyttämällä monikulmion jokaisen kärjen koordinaatteja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/stringsOfCoordinatePairs.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61200",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has strings of coordinate pairs", ar: "له خطوط إحداثيات مزدوجة", da: "har hjørnekoordinater", de: "hat Reihen von Koordinatenpaaren", fi: "koordinaattiparit aineistossa", nl: "heeft tekenreeksen van coördinatenparen"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60109",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60348,
      definition: {en: "Relates a resource to a system of arranging materials in an archival resource or a collection.", ar: "يربط بين مصدر ونظام ترتيب المواد في مصدر أرشيفي أو مجموعة أرشيفية.", da: "Relaterer en ressource til et system til organisering af materialer i en arkivressource eller samling.", de: "Setzt eine Ressource in Beziehung zu einem System, um Materialien in einer archivalischen Ressource oder einer Sammlung zu ordnen.", fi: "Liitää aineiston arkiston tai kokoelman järjestämisessä käytettyyn järjestelmään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/systemOfOrganization.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has system of organization", ar: "له نظام للترتيب", da: "har organiseringssystem", de: "Ordnungssystem", fi: "aineiston järjestämisperiaate", nl: "heeft systeem van organisatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60349,
      definition: {en: "Relates a resource to a system used to format a video resource for television broadcast.", ar: "يربط بين مصدر ونظام مستخدم لتهيئة مصدر فيديو للبث التلفزيوني.", da: "Relaterer en ressource til et system, der anvendes til at formatere en videoressource til tv-transmission.", de: "Setzt eine Ressource in Beziehung zu einem System, das zur Formatierung einer Videoressource für eine Fernsehsendung verwendet wird.", fi: "Liittää aineiston järjestelmään, jonka mukaisesti videoaineisto muunnetaan televisiolähetystä varten."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/broadcastStandard.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has broadcast standard", ar: "له معيار بث", da: "har transmissionsstandard", de: "hat Sendestandard", fi: "lähetysstandardi aineistossa", nl: "heeft uitzendstandaard"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60352",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60350,
      definition: {en: "Relates a resource to a technical specification relating to a digital encoding of text, image, audio, video, and other types of data in a resource.", ar: "يربط بين مصدر ومواصفات فنية متعلقة بتشفير رقمي لنص، صورة، صوت، فيديو، وأي نوع بيانات آخر في مصدر.", da: "Relaterer en ressource til en teknisk specifikation relateret til den digitale kodning af tekst, billede, audio-, video- og andre datatyper i en ressource.", de: "Setzt eine Ressource in Beziehung zu einer technischen Spezifikation, die sich auf die digitale Kodierung von Text, Bild, Audio, Video und anderen Datentypen in einer Ressource bezieht.", fi: "Liittää aineiston aineiston sisältämän tekstin, kuvan, äänen, videon tai muun datan digitaaliseen koodauksen tekniseen määritykseen."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60059", "http://rdaregistry.info/Elements/u/P60093", "http://rdaregistry.info/Elements/u/P60314", "http://rdaregistry.info/Elements/u/P60323", "http://rdaregistry.info/Elements/u/P60519", "http://rdaregistry.info/Elements/u/P60551", "http://rdaregistry.info/Elements/u/P60587"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/digitalFileCharacteristic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has digital file characteristic", ar: "له خاصية ملف رقمي", da: "har digitale filkarakteristika", de: "hat Eigenschaft einer digitalen Datei", fi: "digitaalisen tiedoston ominaisuus aineistossa", nl: "heeft kenmerken digitale bestand"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60351,
      definition: {en: "Relates a resource to a technical specification relating to an encoding of sound in a resource.", ar: "يربط بين مصدر ومواصفات فنية متعلقة بتشفير صوت في مصدر.", da: "Relaterer en ressource til en teknisk specifikation relateret til kodning af lyd i en ressource.", de: "Setzt eine Ressource in Beziehung zu einer technischen Spezifikation, die sich auf die Kodierung des Tons in einer Ressource bezieht.", fi: "Liittää aineiston aineiston sisältämän äänen koodaamisen tekniseen määritykseen."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60481", "http://rdaregistry.info/Elements/u/P60522", "http://rdaregistry.info/Elements/u/P60532", "http://rdaregistry.info/Elements/u/P60543", "http://rdaregistry.info/Elements/u/P60552", "http://rdaregistry.info/Elements/u/P60553", "http://rdaregistry.info/Elements/u/P60586", "http://rdaregistry.info/Elements/u/P60594"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/soundCharacteristic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has sound characteristic", ar: "له خاصية صوت", da: "har lydkarakteristika", de: "hat Toneigenschaft", fi: "äänen ominaisuudet aineistossa", nl: "heeft kenmerken geluid"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60352,
      definition: {en: "Relates a resource to a technical specification relating to an encoding of video images in a resource.", ar: "يربط بين مصدر ومواصفات فنية متعلقة بتشفير صور فيديو في مصدر.", da: "Relaterer en ressource til en teknisk specifikation relateret til kodning af videobilleder i en ressource.", de: "Setzt eine Ressource in Beziehung zu einer technischen Spezifikation, die sich auf die Kodierung der Videobilder in einer Ressource bezieht.", fi: "Liittää aineiston aineiston sisältämän videon koodauksen tekniseen määritykseen."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60326", "http://rdaregistry.info/Elements/u/P60349"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/videoCharacteristic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has video characteristic", ar: "له خاصية فيدبو", da: "har videokarakteristika", de: "hat Video-Eigenschaft", fi: "videon ominaisuudet aineistossa", nl: "heeft kenmerken video"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60353,
      definition: {en: "Relates a resource to a technical specification relating to the projection of a motion picture film.", ar: "يربط بين مصدر ومواصفات فنية متعلقة بعرض فيلم صور متحركة.", da: "Relaterer en ressource til en teknisk specifikation relateret til projektion af en film.", de: "Setzt eine Ressource in Beziehung zu einer technischen Spezifikation, die sich auf die Projektion eines Films bezieht.", fi: "Liittää aineiston elokuvafilmin projisointia koskevaan tekniseen määritykseen."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60529", "http://rdaregistry.info/Elements/u/P60585"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/projectionCharacteristicOfMotionPictureFilm.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has projection characteristic of motion picture film", ar: "له خاصية عرض لفيلم صور متحركة", da: "har projektionskarakteristika for film", de: "hat Projektionseigenschaft von Filmen", fi: "elokuvafilmin projisointiominaisuudet aineistossa", nl: "heeft kenmerken van de projectie van speelfilm"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60354,
      definition: {en: "Relates a resource to a television program based on another resource.", ar: "يربط بين مصدر وبرنامج تلفزيوني اعتمد على مصدر آخر.", da: "Relaterer en ressource til et TV-program baseret på en oprindelig ressource.", de: "Setzt eine Ressource in Beziehung zu einer Fernsehsendung, die auf einer anderen Ressource basiert.", fi: "Liittää aineiston toiseen aineistoon perustuvaan televisio-ohjelmaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/adaptedAsTelevisionProgram.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
