      label: {en: "is adapted as television program", ar: "هو مقتبَس كبرنامج تليفزيوني", da: "er bearbejdet til tv-program", de: "ist bearbeitet als Fernsehsendung", fi: "televisiosovitus aineistosta", nl: "is bewerkt als televisieprogramma"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60260",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60355,
      definition: {en: "Relates a resource to a title of resource that is not selected for preference in a specific application or context.", ar: "يربط بين مصدر وعنوان مصدر لم يتم اختياره كعنوان مختلف مفضل في تطبيق محدد أو سياق محدد.", da: "Relaterer en ressource til en titel, der er knyttet til en ressource, der afviger fra en titel, der er registreret som hovedtitel, parallel hovedtitel, andre titeloplysninger, andre parallel titeloplysninger, tidligere hovedtitel, senere hovedtitel, nøgletitel eller forkortet titel.", de: "Setzt eine Ressource in Beziehung zu einem Titel einer Ressource, der in einer bestimmten Anwendung oder in einem bestimmten Kontext nicht als Vorzugsform bestimmt wird.", fi: "Liittää aineiston aineiston nimekkeeseen, jota ei ole valittu ensisijaiseksi nimikkeeksi tietyssä sovelluksessa tai kontekstissa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/variantTitleOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60925",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has variant title of resource", ar: "له عنوان مختلف لمصدر", da: "har varianttitel for ressource", de: "hat abweichenden Titel einer Ressource", fi: "aineiston varianttinimeke", nl: "heeft variant titel van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60367",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60356,
      definition: {en: "Relates an agent to a word or phrase indicative of royalty, nobility, etc., associated with an agent.", ar: "يربط بين وكيل ولقب نبالة، إلخ.، مرتبط بوكيل.", da: "Relaterer ressource til en adelstitel etc., knyttet til en agent.", de: "Setzt einen Akteur in Beziehung zu einem Adelstitel und so weiter, der mit einem Akteur in Verbindung steht.", fi: "Liittää toimijan häneen liittyvään aatelisnimeen tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/hereditaryTitle.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has hereditary title", ar: "له عنوان تقليدي", da: "har arvelig titel", de: "hat Erbtitel", fi: "peritty arvonimi", nl: "heeft erfelijke titel"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60357,
      definition: {en: "Relates a resource to a title proper appearing on a later issue or part of a multipart monograph or serial that differs from that on the first or earliest issue or part. (Deprecated)", da: "Relaterer en ressource til en hovedtitel, der optræder på et senere nummer eller en senere del af et flerbindsværk eller et periodikum, og som afviger fra den titel, der fremgår af første eller tidligste nummer eller del.."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/laterTitleProper.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has later title proper (Deprecated)", da: "har senere hovedtitel"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60369",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60358,
      definition: {en: "Relates a resource to a title proper appearing on an earlier iteration of an integrating resource that differs from that on a current iteration. (Deprecated)", da: "Relaterer en ressource til en hovedtitel, der forekommer på en tidligere iteration af en integrerende ressource, der afviger fra hovedtitlen på den aktuelle iteration."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/earlierTitleProper.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has earlier title proper (Deprecated)", da: "har tidligere hovedtitel"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60369",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60359,
      definition: {en: "Relates a resource to a title that is abbreviated for purposes of indexing or identification.", ar: "يربط بين مصدر وعنوان تم اختصاره لأغراض التكشيف أو التحديد.", da: "Relaterer en ressource til en titel, der er forkortet mhp. indeksering eller identifikation.", de: "Setzt eine Ressource in Beziehung zu einem Titel, der zum Zwecke der Indexierung oder der Identifizierung gekürzt ist.", fi: "Liittää aineiston nimekkeeseen, joka on lyhennetty indeksointia tai tunnistamista varten."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/abbreviatedTitle.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61111",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has abbreviated title", ar: "له عنوان مُختصر", da: "har forkortet titel", de: "hat Kurztitel", fi: "aineiston lyhennetty nimeke", nl: "heeft afgekorte titel"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60369",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60360,
      definition: {en: "Relates an agent to a place where an agent resides or has resided.", ar: "يربط بين وكيل وبلدة، مدينة، مُقاطعة، ولاية، أو بلد يقيم فيها الوكيل أو أقام فيها بالفعل، أو أي مكان هام آخر مرتبط بوكيل بخلاف مكان الميلاد أو مكان الوفاة، أو الإقامة.", da: "Relaterer en ressource til en landsby, by, region, stat og/eller land, hvor en agent bor eller har boet, eller andet væsentligt sted forbundet med agenten, bortset fra fødested, dødssted eller bopæl.", de: "Setzt einen Akteur in Beziehung zu einem Ort, einer Stadt, einem Bundesland, einem Staat oder einem Land, in dem er wohnt oder gewohnt hat, oder zu einem anderen bedeutenden Ort, der mit einem Akteur in Verbindung steht, außer dem Geburts-, Sterbe- oder Wohnort.", fi: "Liittää toimijan kaupunkiin, maakuntaan, osavaltioon tai maahan, jossa hän asuu tai on asunut, tai muuhun häneen liittyvään merkittävään paikkaan kuin syntymä-, kuolin- tai asuinpaikka."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfResidence.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A place where an agent has worked or studied is included.", ar: "يشمل ذلك مكان عمل فيه وكيل أو درس فيه.", da: "Sted, hvor en agent har arbejdet eller studeret er omfattet.", de: "Darunter fällt ein Geografikum, in dem ein Akteur gearbeitet oder studiert hat.", fi: "Koskee paikkaa, jossa toimija on työskennellyt tai opiskellut."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60973",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of residence", ar: "له مكان إقامة", da: "har opholdssted etc.", de: "hat Wohnort", fi: "asuinpaikka", nl: "heeft plaats van verblijf"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61018",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60361,
      definition: {en: "Relates a resource to a video based on another resource.", ar: "يربط بين مصدرً وفيديو مبني على مصدر آخر.", da: "Relaterer en ressource til en video baseret på en oprindelig ressource.", de: "Setzt eine Ressource in Beziehung zu einem Video, das auf einer anderen Ressource basiert.", fi: "Liittää aineiston videoon, joka perustuu toiseen aineistoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/adaptedAsVideo.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60236",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is adapted as video", ar: "هو مقتبَس كفيديو", da: "er bearbejdet til video", de: "ist bearbeitet als Video", fi: "videosovitus (aineisto)", nl: "is bewerkt als video"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60260",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60362,
      definition: {en: "Relates an agent to an agent who is a well-known individual who is a member of an agent.", ar: "يربط بين وكيل وفرد مشهور هو عضوًا لوكيل", da: "Relaterer en ressource til et velkendt individ, der er medlem af en agent.", de: "Setzt einen Akteur in Beziehung zu einem bekannten Individuum, das Mitglied eines Akteurs ist.", fi: "Liittää yhteistoimijan tunnettuun henkilöön, joka on toimijan jäsen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/prominentMemberOfFamily.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60996",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has prominent member of agent", ar: "له عضو بارز لوكيل", da: "har fremtrædende medlem af agent", de: "hat bedeutendes Akteurmitglied", fi: "yhteistoimijan tunnettu jäsen", nl: "heeft prominent lid van actor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60363,
      definition: {en: "Relates an agent to a word or phrase indicative of royalty, nobility, or ecclesiastical rank or office, a term of address for an agent of religious vocation, or another term indicative of rank, honour, or office.", ar: "يربط بين وكيل وكلمة أو عبارة تُشير إلى رتبة، منصب ملكي، أو نبيل، أو منصب كنسيَّ، وهو لقب لوكيل له مهنة دينية، أو لقب آخر يدل على رتبة، شرف، أو منصب", da: "Relaterer en ressource til et ord eller frase, der angiver kongelighed, adelskab, gejstlig rang eller embede, eller en tiltaleform for en agent med religiøst hverv.", de: "Setzt einen Akteur in Beziehung zu einem Wort oder einer Phrase, das/die auf die Zugehörigkeit zu einem Fürstentum, zum Adel, auf einen kirchlichen Rang oder ein kirchliches Amt hinweist, zu einer Anrede für einen Akteur mit religiöser Berufung oder zu einem anderen Begriff, der auf einen Rang, eine Ehre oder ein Amt hinweist.", fi: "Liittää henkilön sanaan tai ilmaukseen, joka osoittaa kuninkaallista tai aatelisarvoa, kirkollista virkaa tai asemaa tai uskonnolliseen tehtävään liittyvää puhuttelua."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/termOfRankHonourOrOffice.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has term of rank, honour, or office", ar: "له لقب رتبة، شرف، أو منصب", da: "har agents titel", de: "hat Rang-, Ehren- oder Amtsbezeichnung", fi: "henkilön arvonimi tai asema", nl: "heeft term van rang, eer of ambt"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60364,
      definition: {en: "Relates a resource to a word, character or group of words or characters, identifying a particular revision of a named edition.", ar: "يربط بين مصدر وكلمة، أو حرف، أو مجموعة من الكلمات، أو تمثيلات، تحدد مراجعة محددة لطبعة مسماة.", da: "Relaterer en ressource til et ord, tegn eller en gruppe af ord og/eller tegn, der identificerer en bestemt revision af en navngiven udgave.", de: "Setzt eine Ressource in Beziehung zu einem Wort, einem Zeichen oder einer Gruppe von Wörtern oder Zeichen, das/die eine bestimmte Überarbeitung einer näher erläuterten Ausgabe identifiziert.", fi: "Liittää aineiston sanaan, merkkiin tai sanojen tai merkkien joukkoon, jotka identifioivat aineiston tietyn uudistetun painoksen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/designationOfNamedRevisionOfEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has designation of named revision of edition", ar: "له تسمية لمراجعة مسماة لطبعة", da: "har betegnelse for en navngivet revision af en udgave", de: "hat Ausgabebezeichnung einer näher erläuterten Überarbeitung", fi: "uudistetun painoksen määrite aineistossa", nl: "heeft aanduiding van een benoemde herziening van editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60365,
      definition: {en: "Relates a resource to a word, character or group of words or characters, identifying an edition to which a resource belongs.", ar: "يربط بين مصدر وكلمة، حرف، أو مجموعة من الكلمات أو تمثيلات، تحدد طبعة ينتمي لها مصدر.", da: "Relaterer en ressource til et ord, tegn eller en gruppe af ord og/eller tegn, der identificerer en udgave som en ressource tilhører.", de: "Setzt eine Ressource in Beziehung zu einem Wort, einem Zeichen oder einer Gruppe von Wörtern oder Zeichen, das/die die Ausgabe identifiziert, zu der eine Ressource gehört.", fi: "Liittää aineiston sanaan, merkkiin tai ryhmään sanoja ja/tai merkkejä, jotka identifioivat aineiston painoksen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/designationOfEdition.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has designation of edition", ar: "له تسمية لطبعة", da: "har udgavebetegnelse", de: "hat Ausgabebezeichnung", fi: "painosmäärite aineistossa", nl: "heeft aanduiding van editie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60366,
      definition: {en: "Relates a place to a nomen that is an appellation of place in natural language and phrasing used in common discourse.", ar: "يربط مكان بتسمية مكان فىي اللغة الطبيعية وفي العبارات المستخدمة في الخطاب العام.", da: "Relaterer en ressource til et ord, tegn eller gruppe af ord og/eller tegn, som et sted er kendt under.", de: "Setzt ein Geografikum in Beziehung zu einer Bezeichnung für ein Geografikum in natürlicher Sprache und Ausdrucksweise, die beim normalen Sprechen und Schreiben verwendet wird.", fi: "Liittää paikan luonnollisen kielen ja sanamuodon mukaiseen, yleisessä diskurssissa käytettyyn paikan nimitykseen."},
