    property :P60372,
      definition: {en: "Relates a resource to an abstract, summary, synopsis, or other description of the content of a resource.", ar: "يربط بين مصدر ومستخلص، ملخص، موجز، أو وصف آخر لمحتوى أحد المصادر.", da: "Relaterer en ressource til et abstrakt, et resumé, en synopsis etc. af en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einem Abstract, einer Zusammenfassung, einer Synopse oder einer anderen Beschreibung des Inhalts einer Ressource.", fi: "Liittää aineiston tiivistelmään, yhteenvetoon, synopsikseen tai muuhun aineiston sisällön kuvaukseen."},
