    property :P60373,
      definition: {en: "Relates a resource to an agent against whom an appeal is taken on a decision of a lower court recorded in a legal resource of a higher court.", ar: "يربط مصدر بوكيل مستأنف ضده بحكم صادر عن محكمة أدنى مسجل في مصدر قانوني لمحكمة أعلى.", da: "Relaterer en ressource mod hvilken en indsigelse er gjort gennem en underrets beslutning, der er registreret i en juridisk ressource fra en højere retsinstans.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, gegen den Rechtsmittel (Berufung/Revision) gegen ein Gerichtsurteil einer unteren Instanz, das in einer juristischen Ressource einer höheren Instanz erfasst ist, eingelegt werden.", fi: "Liittää aineiston toimijaan, johon kohdistuu hakemus, jolla haetaan muutosta alemman oikeusasteen päätökseen."},
