    property :P60375,
      definition: {en: "Relates a resource to an agent who assigns a resource as an acknowledgement of the inspiration or support of a related agent.", ar: "يربط مصدر بوكيل خصص مصدر كإقرار بإلهام أو دعم وكيل ذو صلة.", da: "Relaterer en ressource til en agent, som har tilegnet en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der eine Ressource als Zeichen der Anerkennung oder Unterstützung einem in Beziehung stehenden Akteur widmet.", fi: "Liittää aineiston toimijaan, joka omistaa aineiston liittyvälle toimijalle kiitoksena inspiraatiosta tai tuesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dedicator.en",
