      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60377,
      definition: {en: "Relates a resource to an agent who is a contributor agent of cartography who provides measurements or dimensional relationships for a geographic area.", ar: "يربط مصدر بوكيل مُساهم في رسم الخرائط ويُوفر القياسات أوالعلاقات بين الأبعاد لمنطقة جغرافية.", da: "Relaterer en ressource til en agent, der har bidraget til en kartografisk ressource ved at tilvejebringe opmålinger eller målestoksforhold til det geografiske område, der er repræsenteret.", de: "Setzt eine Ressource in Beziehung zu einer Beiträgerin/einem Beiträger einer Kartografie (Akteur), die/der Messwerte oder Abmessungsverhältnisse für den dargestellten geografischen Bereich zur Verfügung stellt.", fi: "Liittää aineiston toimijaan, joka myötävaikuttaa kartantekijänä maantieteellisen alueen mittojen tai mittasuhteiden tuottamisessa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/surveyor.en",
