      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has surveyor", ar: "له مسّاح", da: "har landmåler", de: "hat Landvermesserin/Landvermesser", fi: "maanmittari aineistossa", nl: "heeft landmeter"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60378,
      definition: {en: "Relates a resource to an agent who contributes to a resource by giving apparent movement to inanimate objects or drawings.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال إعطاء حركة واضحة للأجسام غير الحية أو الرسومات .", da: "Relaterer en ressource til en agent, der har bidraget til en ressource af et levende billedværk eller et computerprogram ved at give en illusion af bevægelse til livløse genstande eller tegninger.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er unbelebte Objekte oder Zeichnungen in scheinbare Bewegung versetzt.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena tuottamalla näennäistä liikettä elottomiin esineisiin tai piirroksiin."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60431",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/animator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Creation of the drawings that are animated is excluded.", ar: "يُستبعد إنشاء الرسومات المتحركة.", da: "Skabelse af tegninger, der er animeret, er ikke omfattet.", de: "Darunter fällt nicht die Schaffung der Zeichnungen, die animiert werden.", fi: "Ei koske animaatiopiirrosten tekijää."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60606",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has animator", ar: "له فنان رسوم متحركة", da: "har animator", de: "hat Trickfilmzeichnerin/Trickfilmzeichner", fi: "aineiston animaattori", nl: "heeft animator"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60379,
      definition: {en: "Relates a resource to an agent who contributes to a resource by rewriting a composition for a medium of performance different from that for which a resource was originally intended.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال إعادة كتابة لحن موسيقي لوسيط أداء يختلف عن الوسيط الذي كان المصدر مقررا له أصلاً.", da: "Relaterer en ressource til en agent, der har bidraget til en musikressource ved at omskrive kompositionen til en anden besætning end den, ressourcen oprindeligt var beregnet til.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er eine Komposition für eine bestimmte Besetzung umschreibt, die sich von der Originalbesetzung, für die eine Ressource konzipiert ist, unterscheidet.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena muokkaamalla sävellyksen alkuperäisteoksesta poikkeavalle esityskokoonpanolle."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60426",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/arrangerOfMusic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Modification of the resource for the same medium of performance, etc., keeping the musical substance of the original composition essentially unchanged, is included. Substantial modification that results in the creation of a new musical resource is excluded.", ar: "يتضمن تعديل المصدر لنفس وسيط أداء، إلخ.، مع الإبقاء على اللحن الأصلي دون تغيير جوهري.يُستبعد التعديل الجوهري الذي ينتج عنه إنشاء مصدر موسيقي جديد.", da: "Bidrag omfatter ændring af en ressource for den samme besætning etc., der i alt væsentligt bevarer den originale kompositions musikalske substans uændret, og omfatter ikke væsentlige ændringer der resulterer i skabelsen af en ny musikressource.", de: "Darunter fallen auch Varianten einer Ressource für die gleiche Besetzung und so weiter, solange die musikalische Substanz der Originalkomposition im Wesentlichen unverändert bleibt. Darunter fallen keine substantiellen Veränderungen, die zur Schaffung einer neuen Musikressource führen.", fi: "Sovittaja voi myös muokata aineistoa samalle esityskokoonpanolle tms. säilyttäen alkuperäisen sävellyksen musiikillisen sisällön olennaisilta osin muuttumattomana. Tähän ei sisälly laaja muokkaaminen, joka johtaa uuden musiikkiaineiston luomiseen."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60607",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has arranger of music", ar: "له موزع موسيقى", da: "har musikarrangør", de: "hat Arrangeurin/Arrangeur", fi: "aineiston sovittaja", nl: "heeft arrangeur van muziek"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60380,
      definition: {en: "Relates a resource to an agent who contributes to a primarily non-textual resource by providing text, such as writing captions for photographs or descriptions of maps. (Deprecated)", da: "Relaterer en ressource til en agent, der har bidraget til en ressource af et fortrinsvist ikke-tekstmæssigt værk ved at tilvejebringe tekst til den ikke-tekstmæssige ressource, fx ved at skrive billedtekster til fotos, beskrivelser af kort."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60371",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/writerOfAddedText.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60608",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has writer of added text (Deprecated)", da: "har forfatter af tilføjet tekst"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60392",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60381,
      definition: {en: "Relates a resource to an agent who contributes to a resource by an architect, inventor, or other agent by making detailed plans or drawings for buildings, ships, aircraft, machines, objects, or other constructions.", ar: "يربط مصدر بوكيل يُساهم في مصدر بواسطة مهندس معماري أو مخترع أو وكيل آخر من خلال وضع خطط أو رسومات مُفصلة للمباني، السفن، الطائرات، الآلات أو الأشياء أو غيرها من الإنشاءات.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource af et værk af en arkitekt, opfinder etc. ved at lave detaljerede planer eller tegninger til bygninger, skibe, luftfartøjer, maskiner, genstande etc.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Expression einer Architektin/eines Architekten, einer Erfinderin/eines Erfinders oder eines anderen Akteurs beiträgt, indem er detaillierte Pläne oder Zeichnungen für Gebäude, Schiffe, Flugzeuge, Maschinen, Objekte oder andere Konstruktionen anfertigt.", fi: "Liittää aineiston toimijaan, joka osallistuu arkkitehdin, suunnittelijan tai muun toimijan aineistoon tuottamalla tarkkoja suunnitelmia tai piirroksia rakennuksista, laivoista, lentokoneista, laitteista, esineistä tai muista luomuksista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/draftsman.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60609",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has draftsman", ar: "له رسام هندسي", da: "har teknisk tegner", de: "hat Technische Zeichnerin/Technischen Zeichner", fi: "aineiston piirtäjä", nl: "heeft technisch tekenaar"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60382,
      definition: {en: "Relates a resource to an agent who contributes to a resource by writing down or notating unwritten or unnotated content, or by changing it from one system of notation to another.", ar: "يربط مصدر بوكيل يُساهم في مصدر بواسطة كتابة أو تدوين محتوى لم تسبق كتابته أو تدوينه، أو عن طريق تغييره من نظام تدوين إلى آخر.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource af et værk ved at nedskrive eller notere uskrevet eller ikke-noteret indhold, eller ved at ændre det fra et notationssystem til et andet.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er ungeschriebenen und nicht notierten Inhalt niederschreibt oder ihn von einem Notationssystem in ein anderes überträgt.", fi: "Liittää aineiston toimijaan, joka osallistuu aineiston tekemiseen kirjoittamalla muistiin tai nuotintamalla kirjoittattoman tai nuotintamattoman sisällön tai muuttamalla sen merkintäjärjestelmästä toiseen."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60379",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/transcriber.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Transcription of a musical resource for a different instrument or performing group is excluded.", ar: "يُستبعد اِستِنساخ مصدر موسيقي لآلة أو مجموعة أداء مختلفة.", da: "Afskrift af en musikressource for et andet instrument, eller optrædende gruppe, er ikke omfattet.", de: "Darunter fällt keine Transkription einer Musikressource für ein anderes Instrument oder ein anderes aufführendes Ensemble.", fi: "Tähän ei kuulu musiikkiteoksen transkribointi eri soittimelle tai esitysryhmälle."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60610",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has transcriber", ar: "له ناسخ", da: "har nedskriver", de: "hat Transkribiererin/Transkribierer", fi: "aineiston transkriboija", nl: "heeft transcribeerder"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60383,
      definition: {en: "Relates a resource to an agent who contributes to a resource by coordinating the activities of composers, sound editors, and sound mixers for a moving image production or for a musical or dramatic presentation or entertainment.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال تنسيق أنشطة ملحني؛ ومحرري؛ و مازجي الصوت لإنتاج فيلم؛ أو لعرض موسيقي أو درامي أو ترفيهي.", da: "Relaterer en ressource til en agent, der har bidraget til een ressource ved at koordinere komponistens, tonemesterens og lydmixernes aktiviteter ved en levende billedproduktion eller en musikalsk eller dramatisk præsentation eller i underholdning.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er die Arbeit der Komponistin/des Komponisten, der Tonbearbeiterin/des Tonbearbeiters und der Tonmeisterin/des Tonmeisters für eine Bewegtbildproduktion oder eine musikalische oder dramatische Darbietung oder Aufführung koordiniert.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena koordinoimalla säveltäjien, äänileikkaajien ja äänimiksaajien toimintaa elokuvatuotannossa tai musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/musicalDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60611",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has musical director", ar: "له مُخرج موسيقي", da: "har orkesterleder", de: "hat Musikalische Leiterin/Musikalischen Leiter", fi: "musiikkijohtaja aineistossa", nl: "heeft muzikaal director"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60384,
      definition: {en: "Relates a resource to an agent who contributes to a resource by designing costumes for a moving image production or for a musical or dramatic presentation or entertainment.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال تصميم أزياء لإنتاج فيلم؛ أو لعرض موسيقي أو درامي أو ترفيهي.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at designe kostumer til en levende billedproduktion eller til en musikalsk eller dramatisk præsentation eller til underholdning.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er die Kostüme für eine Bewegtbildproduktion oder für eine musikalische oder dramatische Darbietung oder Aufführung entwirft.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena suunnittelemalla elokuvatuotannon tai musiikki- tai näytelmäesityksen puvustuksen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/costumeDesigner.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60612",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has costume designer", ar: "له مصمم أزياء", da: "har kostumedesigner", de: "hat Kostümbildnerin/Kostümbildner", fi: "puvustaja aineistossa", nl: "heeft kostuumontwerper"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60385,
      definition: {en: "Relates a resource to an agent who contributes to a resource by expressing linguistic content of a resource in a language different from that of previous resources.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال التعبير عن المحتوى اللغوي لمصدر بلغة مختلفة عن تلك الموجودة في المصادر السابقة.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at udtrykke en ressources sproglige indhold på et andet sprog end det, der er anvendt i tidligere udtryk af en oprindelige ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er sprachlichen Inhalt einer Ressource in einer Sprache ausdrückt, die sich von früheren Ressourcen unterscheidet.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena ilmaisemalla teoksen kielellisen sisällön toisella kielellä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/translator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Translation of linguistic content between forms of the same language from different time periods is included.", ar: "يتضمن ترجمة المحتوى اللغوي بين أشكال اللغة نفسها خلال فترات زمنية مختلفة.", da: "Oversættelse af sprogligt indhold mellem former af det samme sprog fra forskellige tidsperioder er omfattet.", de: "Darunter fallen Übersetzungen sprachlichen Inhalts zwischen Formen derselben Sprache aus verschiedenen Zeitperioden.", fi: "Kääntäjä voi myös kääntää kielisisältöä saman kielen eri aikakausien kielimuotojen välillä."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60613",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has translator", ar: "له مُترجم", da: "har oversætter", de: "hat Übersetzerin/Übersetzer", fi: "aineiston kääntäjä", nl: "heeft vertaler"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60386,
      definition: {en: "Relates a resource to an agent who contributes to a resource by overseeing artists and craftspeople who build sets for moving image productions.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال الإشراف على الفنيين والحرفيين الذين يبنون مواقع لإنتاج الأفلام.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at føre tilsyn med de kunstnere og håndværkere, der har bygget kulisserne til levende billedproduktioner.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er Künstlerinnen/Künstler und Kunsthandwerkerinnen/Kunsthandwerker betreut, die Sets für Bewegtbildproduktionen aufbauen.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena valvomalla taiteilijoita ja käsityöläisiä, jotka rakentavat lavasteita elokuvatuotantoihin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/artDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60614",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has art director", ar: "له مخرج فني", da: "har kunstnerisk leder", de: "hat Art Director", fi: "taiteellinen johtaja (art director) aineistossa", nl: "heeft artdirector"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60387,
      definition: {en: "Relates a resource to an agent who contributes to a resource by performing music, acting, dancing, speaking, and other roles, often in a musical or dramatic presentation.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال أداء موسيقى، تمثيل، رقص، حوار، وغيرها من الأدوار التي غالبًا تكون في عرض موسيقي أو درامي.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at opføre musik, spille skuespil, danse, tale etc., ofte i en musikalsk eller dramatisk præsentation etc.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er, oftmals in einer musikalischen oder dramatischen Darbietung, Musik aufführt, schauspielt, tanzt, spricht oder eine andere Rolle übernimmt.", fi: "Liittää aineiston tanssijana, näyttelijänä, puhujana tai muissa rooleissa osallistuvaan toimijaan, usein musiikillisessa tai draamallisessa esityksessä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60141", "http://rdaregistry.info/Elements/u/P60142", "http://rdaregistry.info/Elements/u/P60143", "http://rdaregistry.info/Elements/u/P60144", "http://rdaregistry.info/Elements/u/P60145", "http://rdaregistry.info/Elements/u/P60146", "http://rdaregistry.info/Elements/u/P60147", "http://rdaregistry.info/Elements/u/P60148", "http://rdaregistry.info/Elements/u/P60149", "http://rdaregistry.info/Elements/u/P60150", "http://rdaregistry.info/Elements/u/P60151", "http://rdaregistry.info/Elements/u/P60153", "http://rdaregistry.info/Elements/u/P60154", "http://rdaregistry.info/Elements/u/P60155", "http://rdaregistry.info/Elements/u/P60156", "http://rdaregistry.info/Elements/u/P61202"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/performer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60615",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has performer", ar: "له مؤدٍ", da: "har performer", de: "hat Ausführende/Ausführenden", fi: "aineiston esittäjä", nl: "heeft uitvoerder"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60388,
      definition: {en: "Relates a resource to an agent who contributes to a resource by preparing a court's opinions for publication.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال إعداد رأي محكمة للنشر.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at klargøre en domstols afgørelser til publicering.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er eine Urteilsbegründung zur Veröffentlichung vorbereitet.", fi: "Liittää aineiston toimijaan, joka on aineistossa osalllisena valmistelemalla tuomioistuimen lausunnon julkaistavaksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/courtReporter.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60616",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has court reporter", ar: "له كاتب محكمة", da: "har retsstenograf", de: "hat Gerichtsstenografin/Gerichtsstenograf", fi: "aineiston kirjuri oikeudenkäyntiasiakirjoissa", nl: "heeft rechtbankverslaggever"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60389,
      definition: {en: "Relates a resource to an agent who contributes to a resource by providing a preface to an original resource. (Deprecated)", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at tilvejebringe et forord til en original ressource."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/writerOfPreface.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60617",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has writer of preface (Deprecated)", da: "har forfatter til forord"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60392",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60390,
      definition: {en: "Relates a resource to an agent who contributes to a resource by providing an interpretation or critical explanation of an original resource. (Deprecated)", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at tilvejebringe en fortolkning eller kritik af en original ressource."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/writerOfAddedCommentary.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60618",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has writer of added commentary (Deprecated)", da: "har forfatter til tilføjet kommentar"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60392",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60391,
      definition: {en: "Relates a resource to an agent who contributes to a resource by providing an introduction to an original resource. (Deprecated)", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at tilvejebringe en introduktion til en original ressource."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/writerOfIntroduction.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60619",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has writer of introduction (Deprecated)", da: "har forfatter til introduktion"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60392",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60392,
      definition: {en: "Relates a resource to an agent who contributes to a resource by providing supplementary textual content (e.g., an appendix, an introduction, a preface) to an original resource. (Deprecated)", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at tilvejebringe supplerende tekstindhold, fx en indledning eller et forord til en original ressource."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60380", "http://rdaregistry.info/Elements/u/P60389", "http://rdaregistry.info/Elements/u/P60390", "http://rdaregistry.info/Elements/u/P60391", "http://rdaregistry.info/Elements/u/P60715", "http://rdaregistry.info/Elements/u/P60716"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/writerOfSupplementaryTextualContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60620",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has writer of supplementary textual content (Deprecated)", da: "har forfatter til supplerende tekstindhold"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
