      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60409,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by being responsible for the entire graphic design of a book, including arrangement of type and illustration, choice of materials, and process used.", ar: "يربط مصدربوكيل مسؤول عن إنتاج مصدر بالتصميم الجرافيكي لكتاب بالكامل، ويشمل ذلك تنسيق الحروف، والإيضاحيات، واختيار المواد، والعمليات المستخدمة.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource ved at være ansvarlig for hele en bogs grafiske design, inkl. opsætning af tekst og illustrationer, materialevalg og anvendt proces.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er für das gesamte grafische Design eines Buchs, einschließlich Schriftbild, Bildgestaltung, Materialwahl und angewandter Verfahren, verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka on vastuussa aineiston valmistamisesta vastaamalla kirjan graafisesta suunnittelusta, taitosta, materiaalien valinnasta ja käytettävistä valmistusmenetelmistä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/bookDesigner.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60637",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has book designer", ar: "له مُصمم كتاب", da: "har bogdesigner", de: "hat Buchgestalterin/Buchgestalter", fi: "aineiston graafinen suunnittelija", nl: "heeft boekontwerper"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60410,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by cutting letters, figures, or other marks on a surface such as a wooden or metal plate used for printing.        ", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر بنقش حروف، أشكال، أو رموز أخرى على سطح مثل لوح خشبي أو معدني يستخدم للطباعة.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource ved at udskære bogstaver, figurer etc. på en overflade såsom en træ- eller metalplade, der har været anvendt til trykning.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er Buchstaben, figürliche Darstellungen und so weiter in eine Oberfläche, wie zum Beispiel eine Holz- oder Metallplatte schneidet, die zum Drucken benutzt wird.", fi: "Liittää aineiston toimijaan, joka on vastuussa aineiston valmistamisesta kaivertamalla kirjaimia, kuvioita tai muita merkkejä painamisessa käytettävälle pinnalle, kuten puu- tai metallipinnalle."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/engraver.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60638",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has engraver", ar: "له نقّاش", da: "har gravør", de: "hat Stecherin/Stecher", fi: "aineiston kaivertaja", nl: "heeft graveur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60412",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60411,
      definition: {en: "Relates a resource to an agent who is responsible for manufacturing a resource by embossing braille cells using a stylus, special embossing printer, or other device.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر عن طريق نقش حروف برايل باستخدام قلم أو طابعة خاصة للنقش أو أي أداة أخرى.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource ved at præge brailleceller vha. en stift, særlig prægeprinter eller andet apparatur.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource in Form von Braillezeichen verantwortlich ist, indem er einen Griffel, einen speziellen Brailledrucker oder ein anderes Gerät zum Prägen verwendet.", fi: "Liittää aineiston toimijaan, joka on vastuussa aineiston valmistamisesta tuottamalla pistekirjoitusmerkkejä piirtimen, erityistulostimen tai muun laitteen avulla."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/brailleEmbosser.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60639",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has braille embosser", ar: "له نقاش حروف بطريقة برايل", da: "har braillepræger", de: "hat Brailleschriftprägerin/Brailleschriftpräger", fi: "aineiston pistekirjoituksen tekijä", nl: "heeft brailleerder"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60443",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60412,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by making a relief, intaglio, or planographic printing surface.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر بعمل سطح طباعة بارزة، أو غائرة، أو مستوية.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource ved at lave en relief-, dybtryks- eller fladtryksoverflade.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er eine Hochdruck-, Tiefdruck- oder Flachdruckoberfläche erstellt.", fi: "Liittää aineiston toimijaan, joka osallistuu aineiston valmistamiseen valmistamalla kohokuvan, syväpainon tai laakapainon painopinnan."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60410", "http://rdaregistry.info/Elements/u/P60414", "http://rdaregistry.info/Elements/u/P60416", "http://rdaregistry.info/Elements/u/P60417"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/printmaker.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60640",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has printmaker", ar: "له طبّاع", da: "har grafiker", de: "hat Druckgrafikerin/Druckgrafiker", fi: "aineiston kuvalaatan valmistaja", nl: "heeft maker van platen"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60413,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by pouring a liquid or molten substance into a mold and leaving it to solidify to take the shape of the mold.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر بصب مادة سائلة أو مصهورة في قالب وتركها للتصلب لأخذ شكل القالب.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressourcer ved at hælde en væske eller et varmt, flydende stof i en form og lade det størkne, så det har taget facon efter formen.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er eine Flüssigkeit oder eine geschmolzenen Substanz in eine Form gießt, die in der Gießform verbleibt, bis sie ausgehärtet ist.", fi: "Liittää aineiston toimijaan, joka on vastuussa aineiston valmistamisesta muovaamalla sulatettua tai nestemäistä ainetta muotin avulla."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/caster.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60641",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has caster", ar: "له عامل صب", da: "har støber", de: "hat Formgießerin/Formgießer", fi: "aineiston valaja", nl: "heeft gieter"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60414,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by preparing a stone or plate for lithographic printing.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر من خلال تجهيز حجر أو لوح للطباعة الحجرية.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource ved at forberede en sten eller plade til litografisk trykning.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er einen Stein oder eine Platte für lithografischen Druck vorbereitet.", fi: "Liittää aineiston toimijaan, joka on vastuussa aineiston valmistamisesta valmistamalla litografiassa käytetyn kivilaatan tai muun painolaatan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/lithographer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A lithographer includes a graphic artist creating a design directly on the surface from which printing will be done.", ar: "يتضمن مصطلح طبّاع على الحجر كذلك إلى فنان الجرافيك الذي ينشيء تصميما مباشرة على السطح الذي ستتم الطباعة منه.", da: "En litograf omfatter en grafiker, der har skabt et design direkte på overfladen, hvorfra trykning vil blive lavet.", de: "Darunter fallen Grafikerinnen/Grafiker, die ein Muster direkt auf der Oberfläche erstellen, von der aus gedruckt werden soll.", fi: "Litografi tarkoittaa myös graafikkoa, joka tekee piirroksen suoraan painamiseen käytettävälle pinnalle."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60642",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has lithographer", ar: "له طبّاع على الحجر", da: "har litograf", de: "hat Lithografin/Lithograf", fi: "aineiston litografi", nl: "heeft lithograaf"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60412",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60415,
      definition: {en: "Relates a resource to an agent who is responsible for preparing plates used in the making of printed images or text in a resource.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر من خلال إعداد اللوحات المستخدمة في إنتاج الصور المطبوعة أو النص.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource ved at forberede plader, der anvendes til fremstilling af trykte billeder og/eller tekst.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er Druckformen für die Produktion von gedruckten Bildern oder gedrucktem Text anfertigt.", fi: "Liittää aineiston toimijaan, joka on vastuussa aineiston valmistamisesta valmistamalla painettujen kuvien tai tekstin valmistuksessa käytettäviä painolaattoja tai -levyjä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/platemaker.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60643",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has platemaker", ar: "له مُحضر سطح طباعي", da: "har plademager", de: "hat Druckformherstellerin/Druckformhersteller", fi: "painolaatan valmistaja", nl: "heeft platenmaker"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61008",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60416,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by subjecting metal, glass, or some other surface used for printing, to acid or another corrosive substance.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر من خلال غمر معدن أو زجاج أو أي سطح آخر يستخدم للطباعة، لحامض، أو في أي مادة أخرى كاوية.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource ved at udsætte metal, glas eller en anden overflade, der anvendes til trykning, for syre eller et andet ætsende stof.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er Metall, Glas oder eine andere Oberfläche, die zum Drucken benutzt wird, mit Säure oder einer anderen ätzenden Substanz behandelt.", fi: "Liittää aineiston toimijaan, joka on vastuussa aineiston valmistamisesta etsaamalla metallia, lasia tai muuta pintaa hapon tai muun syövyttävän aineen avulla."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/etcher.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60644",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has etcher", ar: "له حَفَّارُ بالزِنْكُوغْراف (الكليشيهات)", da: "har raderer", de: "hat Radiererin/Radierer", fi: "etsaaja", nl: "heeft etser"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60412",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60417,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by preparing a hardened film of gelatin or other colloid that has ink-receptive and ink-repellent surfaces and that is used to make prints using a photomechanical process.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر من خلال استخدام عمليات ميكانيكية ضوئية لإنتاج المطبوعات مباشرة من فيلم صلد من الجيلاتين أو من غيره من المواد الغروية التي تحتوي على أسطح مستقبلة أو طاردة للحبر.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource vha. en fotomekanisk proces, hvorved der er blevet lavet tryk direkte fra et hærdet gelatinelag eller andet kolloid, der har blækmodtagelige og blækafvisende overflader.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource verantwortlich ist, indem er ein fotomechanisches Verfahren zur Herstellung von Abzügen direkt von einem gehärteten Film aus Gelatine oder einem anderen Kolloid verwendet, der druckerfarbenaufnehmende und -abweisende Oberflächen aufweist.", fi: "Liittää aineiston toimijaan, joka osallistuu aineiston luomiseen tekemällä vedoksia suoraan kovettuneelta gelatiinifilmiltä tai muulta materiaalilta, jossa on mustetta imeviä ja hylkiviä pintoja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/collotyper.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60645",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has collotyper", ar: "طبّاع صور فوتوغرافية", da: "har lystrykker", de: "hat Lichtdruckerin/Lichtdrucker", fi: "kunnioitettu henkilö aineistossa", nl: "heeft collotype-maker"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60412",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60418,
      definition: {en: "Relates a resource to an agent who is responsible for manufacturing a resource of printed text, notated music, or other content from type or plates.", ar: "يربط مصدر بوكيل مسؤول عن إنتاج مصدر لنص مطبوع، موسيقى مدونة أو محتوى من نوع أو من لوحات آخرى.", da: "Relaterer en ressource til en agent, der har været involveret i fremstillingen af en ressource af trykt tekst, noteret musik etc. fra skrift eller plader, såsom en bog, en avis, et magasin, en plakat, et partitur etc.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Herstellung einer Ressource von gedrucktem Text, Noten oder anderem Inhalt durch Drucktypen oder Druckformen verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka on vastuussa painetun tekstin, nuottiaineiston tai muun aineiston valmistamiseen painolaatalta tai -levyltä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/printer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60646",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has printer", ar: "له طابعة", da: "har trykker", de: "hat Druckerin/Drucker", fi: "aineiston painaja", nl: "heeft drukker"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60443",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60419,
      definition: {en: "Relates a resource to an agent mentioned in an \"X presents\" credit for moving image materials and who is probably associated with production, finance, or distribution in some way.", ar: "يربط مصدر بوكيل وارد ذكره في \"أحد التقديمات\" مسؤول عن نقل مواد صور متحركة وربما يكون مرتبطا بطريقة ما بالإنتاج أو التمويل أو التوزيع", da: "Relaterer en ressource til en agent, der er nævnt i en fortekst i levende billedmaterialer som ”X præsenterer”, og som sandsynligvis er knyttet til produktion, finansiering eller distribution på en eller anden måde.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der in einem \"X präsentiert\"-Vorspann für Bewegtbildmaterialien erwähnt wird und der wahrscheinlich mit der Produktion, Finanzierung oder dem Vertrieb in Verbindung steht.", fi: "Liittää aineiston toimijaan, joka mainitaan alku- tai lopputekstien \"X esittää:\" -merkinnössä ja joka todennäköisesti liittyy liikkuvan kuvan teoksen aineiston tuotantoon, rahoitukseen tai jakeluun jollakin tavoin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/presenter.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60647",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has presenter", ar: "له مُقدم", da: "har presenter", de: "hat Präsentatorin/Präsentator", fi: "esittäjä aineistossa", nl: "heeft presenterende"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60420,
      definition: {en: "Relates a resource to an agent who is an academic supervisor who is responsible for advising or overseeing thesis or dissertation research for an academic degree that results in a resource.", ar: "يربط مصدر بمشرف أكاديمي مسؤول عن تقديم المشورة أو الإشراف على أطروحة ماجستير أو دكتوراه للحصول على درجة علمية تسفر عن مصدر.", da: "Relaterer en ressource til en agent, der vejleder ved udarbejdelsen af afhandlingen til enten en akademisk grad eller et speciale.", de: "Setzt eine Ressource in Beziehung zu einer akademischen Betreuerin/einem akademischen Betreuer, die/der für die Beratung und Aufsicht von Forschungstätigkeiten im Rahmen einer Hochschulschrift verantwortlich ist, die zur Erlangung eines akademischen Grads und zu einer Ressource führen.", fi: "Liittää aineiston toimijaan, joka vastaa akateemisen opinnäytteen tai väitöskirjan ohjaamisesta tai valvomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/degreeSupervisor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60649",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has degree supervisor", ar: "مشرف على درجة أكاديمية", da: "har vejleder", de: "hat Betreuerin/Betreuer einer Hochschulschrift", fi: "opinnäytteen ohjaaja aineistossa", nl: "heeft graad-begeleider"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60421,
      definition: {en: "Relates a resource to an agent who decorates a specific resource using precious metals or colour, often with elaborate designs and motifs.", ar: "يربط مصدر بوكيل يقوم بتزيين مصدر محدد باستخدام معادن ثمينة أو ألوان، غالبًا بتصاميم وزخارف منمقة.", da: "Relaterer en ressource til en agent, der tilfører udsmukning til en særlig ressource vha. ædelmetal eller farve, ofte med udsøgte mønstre og motiver.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der eine bestimmte Ressource durch Edelmetalle oder Farben, häufig mit kunstvollen Mustern und Motiven, (aus-)gestaltet.", fi: "Liittää aineiston toimijaan, joka koristelee tietyn aineiston, usein yksityiskohtaisin kuvioin tai motiivein, käyttäen jalometalleja tai värejä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/illuminator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60650",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has illuminator", ar: "له مزخرِف", da: "har illuminator", de: "hat Illuminatorin/Illuminator", fi: "aineiston illuminoinnin tekijä", nl: "heeft verluchter"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60422,
      definition: {en: "Relates a resource to an agent who is responsible for assembling, arranging, and trimming film, video, or other moving image formats, including both visual and audio aspects.", ar: "يربط مصدر بوكيل مسؤول عن تجميع أفلام، فيديو أو أشكال الصور المتحركة الأخرى وترتيبها وتشذيبها، بما في ذلك الجوانب المرئية والمسموعة.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have sammensat, arrangeret og klippet film, video eller andre levende billedformater, inkl. både visuelle og lydmæssige aspekter.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das Zusammensetzen, Arrangieren und Nachschneiden von Film-, Video- oder anderen Bewegtbildformaten zuständig ist. Dies betrifft sowohl Video- als auch Audio-Eigenschaften.", fi: "Liittää aineiston toimijaan, joka vastaa elokuvan, videon tai muiden elokuvaformaattien kokoamisesta, järjestämisestä ja leikkauksesta sekä kuvan että äänen osalta."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60663",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/editorOfMovingImageResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60651",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has editor of moving image resource", ar: "له محرر مصدر صور متحركة", da: "klipper", de: "hat Filmeditorin/Filmeditor", fi: "liikkuvan kuvan leikkaaja aineistossa", nl: "heeft filmeditor van bewegend beeld-resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60423,
      definition: {en: "Relates a resource to an agent who is responsible for creating a computer program.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء برنامج كمبيوتر.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt et computerprogram.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung eines Computerprogramms verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa tietokoneohjelman luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/programmer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60652",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has programmer", ar: "له مُبرمج", da: "har programmør", de: "hat Programmiererin/Programmierer", fi: "aineiston ohjelmoija", nl: "heeft programmeur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60424,
      definition: {en: "Relates a resource to an agent who is responsible for creating a design for an object.", ar: "يربط مصدر بوكيل مسؤول عن إعداد تصميم لكائن ما.", da: "Relaterer en ressource til en agent, der er ansvarlig for ideen bag designet for et objekt.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Gestaltung des Designs eines Objekts verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa esineen suunnittelusta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/designer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60653",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has designer", ar: "له مُصمم", da: "har designer", de: "hat Designerin/Designer", fi: "aineiston suunnittelija", nl: "heeft ontwerper"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60425,
      definition: {en: "Relates a resource to an agent who is responsible for a cartographic resource.", ar: "يربط مصدر بوكيل مسؤول عن مصدر خرائطي", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt et kort, et atlas, en globus eller en anden kartografisk ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für eine kartografische Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa kartografisesta aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/cartographer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60654",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has cartographer", ar: "له رسام خرائط", da: "har kartograf", de: "hat Kartografin/Kartograf", fi: "aineiston kartografi", nl: "heeft cartograaf"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60426,
      definition: {en: "Relates a resource to an agent who is responsible for creating a musical resource.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء مصدر موسيقي.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en musikressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung einer Musikressource verantwortlich ist.", fi: "Liitää aineiston toimijaan, joka vastaa musiikkiaineiston luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/composer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Adaptation of another musical resource to form a distinct alteration, paraphrasing a resource or creating a resource in the general style of another composer, or creating a resource that is based on the music of another composer, is included.", ar: "يتم تضمين تكييف مصدر موسيقي آخر لتشكيل تغيير مميز، أو إعادة صياغة مصدر أو إنشاء مصدر بالأسلوب العام لمؤلف موسيقي آخر، أو إنشاء مصدر يعتمد على موسيقى مُلحن آخر.", da: "Bearbejdninger af en anden musikressource for at danne en distinkt forandring ved at parafrasere en ressource eller skabe en ressource i en anden komponists typiske stil, eller skabe en ressource, der er baseret på en anden komponists musik, er omfattet.", de: "Darunter fallen Adaptionen anderer Musikressourcen, die sich deutlich vom Original unterscheiden, Paraphrasierungen von Ressourcen oder Schaffungen neuer Ressourcen im Stil einer anderen Komponistin/eines anderen Komponisten oder Schaffungen von Ressourcen, die auf der Musik einer anderen Komponistin/eines anderen Komponisten basieren.", fi: "Koskee toisen musiikkiaineiston muuttamista erillisen muunnoksen muodostamiseksi, mukailua, aineiston luomista toisen säveltäjän tyylillä taitai toisen säveltäjän musiikkiin perustuvan aineiston luomista."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60655",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has composer", ar: "له مُلحن", da: "komponist", de: "hat Komponistin/Komponist", fi: "aineiston säveltäjä", nl: "heeft componist"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60427,
      definition: {en: "Relates a resource to an agent who is responsible for creating a new device or process.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء جهاز جديد أو عملية جديدة.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en ny anordning eller proces.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung eines neuen Geräts oder Prozesses verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa uuden laitteen tai prosessin luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/inventor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60656",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has inventor", ar: "له مخترع", da: "har opfinder", de: "hat Erfinderin/Erfinder", fi: "keksijä aineistossa", nl: "heeft uitvinder"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60428,
      definition: {en: "Relates a resource to an agent who is responsible for creating a metadata description set.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء مصدر جديد مثل ببليوجرافية أو دليل عن طريق اختيار البيانات والمعلومات وترتيبها وتجميعها وتحريرها، إلخ.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en ny ressource, fx en bibliografi eller en fortegnelse, ved at udvælge, arrangere, samle og redigere data, information etc.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der durch Selektieren, Gliedern, Aggregieren und Editieren von Daten und Informationen und so weiter für die Schaffung einer neuen Ressource, zum Beispiel einer Bibliografie oder eines Verzeichnisses, verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa metatietokokonaisuuden luomisesta."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60393",
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60067",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/compiler.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A metadata description set includes a bibliography of resources, a directory of agents and places, and an analytic finding aid.", ar: "يُستبعد مراجعة أو توضيح محتوى، أو اختيار وتجميع مصادر أو أجزاء من المصادر معًا، بواسطة واحد أو أكثر من المبدعين.", da: "Revisioner eller indholdspræciseringer, eller udvælgelse og sammensætning af værker og dele af ressourcer, af et eller flere ophav er ikke omfattet.", de: "Darunter fallen keine Überarbeitungen oder Erläuterungen des Inhalts oder die Auswahl und das Zusammenstellung von Ressourcen oder Teilen von Ressourcen durch eine geistige Schöpferin/einen geistigen Schöpfer oder mehrere geistige Schöpferinnen/geistiger Schöpfer.", fi: "Metatietokokonaisuus sisältää aineistojen bibliografian, toimijoiden ja paikkojen hakemiston sekä hakemiston."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60657",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has compiler", ar: "له جامع", da: "har kompilator", de: "hat Zusammenstellende/Zusammenstellenden", fi: "aineiston kokoaja", nl: "heeft samensteller"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61091",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60429,
      definition: {en: "Relates a resource to an agent who is responsible for creating a photographic resource.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء مصدر فوتوجرافي.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en fotografisk ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung eines fotografischen Werks verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa valokuva-aineiston luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/photographer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60658",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has photographer", ar: "له مصوِّر فوتوجرافي", da: "har fotograf", de: "hat Fotografin/Fotograf", fi: "aineiston valokuvaaja", nl: "heeft fotograaf"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60430,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by acting as an interviewer, reporter, pollster, or some other kind of agent who gathers information.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء مصدر من خلال العمل كمحاور أو مراسل أو خبير استطلاعات رأي أو وكيل من نوع آخر يجمع المعلومات.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en ressource ved at optræde som interviewer, journalist, medarbejder ved et meningsmålingsinstitut eller en anden informationsindsamler.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung einer Ressource verantwortlich ist, indem er als Interviewerin/Interviewer, Reporterin/Reporter, Meinungsforscherin/Meinungsforscher oder anderer Akteur Informationen zusammenträgt.", fi: "Liittää aineiston toimijaan, joka vastaa aineiston luomisesta toimimalla haastattelijana, toimittajana, mielipidetutkijana tai muunlaisena tiedonkerääjänä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/interviewer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60659",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has interviewer", ar: "له مُحاور", da: "har interviewer", de: "hat Interviewerin/Interviewer", fi: "haastattelija aineistossa", nl: "heeft interviewer"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60431,
      definition: {en: "Relates a resource to an agent who is responsible for creating an original graphic design, drawing, painting, etc.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء تصميم رسومي أصلي، رسم، تصوير زيتي...إلخ.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt et værk ved at udtænke, og ofte udføre originalgrafik, en original tegning, et originalt maleri etc.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung einer originalen grafischen Gestaltung, einer Zeichnung, eines Gemäldes und so weiter verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa alkuperäisen graafisen suunnittelun, piirroksen, maalauksen tms. luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60475", "http://rdaregistry.info/Elements/u/P60752", "http://rdaregistry.info/Elements/u/P60753"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/artist.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60660",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has artist", ar: "له فنان", da: "har kunstner", de: "hat Künstlerin/Künstler", fi: "taiteilija aineistossa", nl: "heeft kunstenaar"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60432,
      definition: {en: "Relates a resource to an agent who is responsible for creating a resource by responding to an interviewer, usually a reporter, pollster, or some other kind of agent who gathers information.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء مصدر من خلال الاستجابة لمحاور، وعادة ما يكون مراسلًا أو مستطلع رأي أو وكيل من نوع آخر يجمع معلومات.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en ressource ved at besvare spørgsmål fra en interviewer, normalt en journalist, medarbejder ved et meningsmålingsinstitut eller en anden informationsindsamler.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung einer Ressource verantwortlich ist, indem er einer Interviewerin/einem Interviewer antwortet. Dabei handelt es sich normalerweise um eine Reporterin/einen Reporter, eine Meinungsforscherin/einen Meinungsforscher oder eine andere Akteurin/einen anderen Akteur, die/der Informationen zusammenträgt.", fi: "Liittää aineiston toimijaan, joka vastaa aineiston luomisesta vastaamalla haastattelijalle. Yleensä haastattelija on toimittaja, mielipidetutkija tai muunlainen tiedonkeruun tekijä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/interviewee.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60661",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has interviewee", ar: "له مُستجوَب", da: "har interviewede", de: "hat Interviewte/Interviewten", fi: "haastateltava aineistossa", nl: "heeft geïnterviewde"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60433,
      definition: {en: "Relates a resource to an agent who is responsible for creating a choreographic resource.", ar: "يربط مصدر بوكيل مسؤول عن مصدر لتصميم الرقصات.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en ressource bestående af bevægelser.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für eine choreografische Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa koreografisesta aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/choreographer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60662",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has choreographer", ar: "له مصمم رقصات", da: "har koreograf", de: "hat Choreografin/Choreograf", fi: "aineiston koreografi", nl: "heeft choreograaf"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60434,
      definition: {en: "Relates a resource to an agent who is responsible for a textual resource.", ar: "يربط بين مصدرووكيل مسؤول عن مصدر نصي.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en ressource, hvis indhold primært består af tekst, uanset hvilken medietype eller genre der er tale om.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für eine textliche Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa tekstiaineistosta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60476", "http://rdaregistry.info/Elements/u/P60477", "http://rdaregistry.info/Elements/u/P60478", "http://rdaregistry.info/Elements/u/P60751"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/author.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60663",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has author", ar: "له مؤلف", da: "har forfatter", de: "hat Verfasserin/Verfasser", fi: "aineiston kirjoittaja", nl: "heeft auteur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60435,
      definition: {en: "Relates a resource to an agent who is responsible for an architectural design, including a pictorial representation intended to show how a building or other structure will look when completed.", ar: "يربط مصدر بوكيل مسؤول عن تصميم معماري، ويشمل ذلك عمل تمثيل تصويري لبيان كيف سيبدو مبنى أو هيكل آخر عند اكتماله.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt et arkitektonisk design, inkl. en billedrepræsentation, der er beregnet til at vise, hvordan en bygning etc. vil se ud, når den er færdig.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für einen architektonischen Entwurf verantwortlich ist, einschließlich einer bildlichen Darstellung, die zeigt, wie ein Gebäude oder eine andere Konstruktion nach der Fertigstellung aussehen soll.", fi: "Liittää aineiston toimijaan, joka vastaa arkkitehtonisen suunnitelman luomisesta, mukaan lukien kuvaesityksestä, jonka tarkoitus on näyttää, miltä rakennus tai muu rakennelma näyttää valmiina."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60473",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/architect.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60664",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has architect", ar: "له مهندس معماري", da: "har arkitekt", de: "hat Architektin/Architekt", fi: "aineiston arkkitehti", nl: "heeft architect"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60436,
      definition: {en: "Relates a resource to an agent who is responsible for creating an independent or personal film.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء فيلم مستقل أو شخصي.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have skabt en uafhængig eller personlig film.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Schaffung eines unabhängigen oder privaten Films verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa itsenäisen tai henkilökohtaisen elokuvan luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/filmmaker.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60665",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has filmmaker", ar: "له صانع أفلام", da: "har filmskaber", de: "hat Filmemacherin/Filmemacher", fi: "aineiston elokuvantekijä", nl: "heeft filmmaker"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60437,
      definition: {en: "Relates a resource to an agent who is responsible for designing the overall visual appearance of a moving image production.", ar: "يربط مصدر بوكيل مسؤول عن تصميم المظهر المرئي العام لإنتاج فيلم.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have designet en levende billedproduktions overordnede visuelle udseende.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die Gestaltung des gesamten visuellen Erscheinungsbilds einer Bewegtbildproduktion verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa elokuvatuotannon visuaalisen ilmeen suunnittelusta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionDesigner.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60666",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has production designer", ar: "له مصمم إنتاج", da: "har produktionsdesigner", de: "hat Szenenbildnerin/Szenenbildner", fi: "aineiston tuotantosuunnittelija", nl: "heeft productieontwerper"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60438,
      definition: {en: "Relates a resource to an agent who is responsible for distributing a published resource.", ar: "يربط مصدر بوكيل مسؤول عن توزيع مصدر منشور.", da: "Relaterer en ressource til en agent, der er ansvarlig for distribution af en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für den Vertrieb einer Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa julkaistun aineiston jakelusta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60408",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/distributor.en",
