    property :P60443,
      definition: {en: "Relates a resource to an agent who is responsible for printing, duplicating, casting, or other method of manufacturing a published resource.", ar: "يربط مصدر بوكيل مسؤول عن طبع، نسخ، طَرَح، أو مرتبط بأي طريقة أخرى بتصنيع مصدر منشور.", da: "Relaterer en ressource til en agent, der er ansvarlig for trykning, duplikering, støbning etc. af en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für den Druck, die Vervielfältigung, den Guss oder eine andere Herstellungsmethode einer veröffentlichten Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa julkaistun aineiston painamisesta, monistamisesta, kirjasinten valamisesta tai muusta valmistustavasta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60411", "http://rdaregistry.info/Elements/u/P60418"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/manufacturer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60669",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has manufacturer", ar: "له مُصَنِّع", da: "har producent", de: "hat Hersteller", fi: "aineiston valmistaja", nl: "heeft vervaardiger"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60909",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60444,
      definition: {en: "Relates a resource to an agent who is responsible for publishing, releasing, or issuing a published resource.", ar: "يربط مصدر بوكيل مسؤول عن نشر، تحرير، أو إصدار مصدر منشور.", da: "Relaterer en ressource til en agent, der er ansvarlig for at publicere, offentliggøre eller udgive en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das Veröffentlichen, die Freigabe oder die Herausgabe einer Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa julkaistun manifestaation kustantamisesta, julkaisemisesta tai ilmestymisestä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60407",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/publisher.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60670",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has publisher", ar: "له ناشر", da: "har udgiver", de: "hat Verlag", fi: "aineiston kustantaja", nl: "heeft uitgever"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60446,
      definition: {en: "Relates a resource to an agent who is responsible for recording the minutes of a meeting.", ar: "يربط مصدر بوكيل مسؤول عن تسجيل محاضر اجتماع.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have taget referat ved et møde.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das Aufzeichnen des Protokolls einer Sitzung verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa kokouksen pöytäkirjan laatimisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/minuteTaker.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60671",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has minute taker", ar: "له مدون لمحضر اجتماع", da: "har referent", de: "hat Protokollantin/Protokollant", fi: "pöytäkirjan laatija aineistossa", nl: "heeft notulist"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60447,
      definition: {en: "Relates a resource to an agent who is responsible for a resource", ar: "يربط مصدر بوكيل مسؤول عن مصدر.", da: "Relaterer en ressource til en agent, der er ansvarlig for en ressources tilblivelse.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für eine Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60045", "http://rdaregistry.info/Elements/u/P60066", "http://rdaregistry.info/Elements/u/P60096", "http://rdaregistry.info/Elements/u/P60409", "http://rdaregistry.info/Elements/u/P60412", "http://rdaregistry.info/Elements/u/P60413", "http://rdaregistry.info/Elements/u/P60420", "http://rdaregistry.info/Elements/u/P60423", "http://rdaregistry.info/Elements/u/P60424", "http://rdaregistry.info/Elements/u/P60425", "http://rdaregistry.info/Elements/u/P60426", "http://rdaregistry.info/Elements/u/P60427", "http://rdaregistry.info/Elements/u/P60429", "http://rdaregistry.info/Elements/u/P60430", "http://rdaregistry.info/Elements/u/P60431", "http://rdaregistry.info/Elements/u/P60432", "http://rdaregistry.info/Elements/u/P60433", "http://rdaregistry.info/Elements/u/P60434", "http://rdaregistry.info/Elements/u/P60435", "http://rdaregistry.info/Elements/u/P60436", "http://rdaregistry.info/Elements/u/P60463", "http://rdaregistry.info/Elements/u/P60465", "http://rdaregistry.info/Elements/u/P60826", "http://rdaregistry.info/Elements/u/P60891", "http://rdaregistry.info/Elements/u/P61091"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/creator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Creators include agents who are jointly responsible for the creation of a resource either performing the same role, such as in a collaboration between two writers, or performing different roles, such as in a collaboration between a composer and a lyricist.", ar: "يشمل المبدعون وكلاء يكونون مسؤولين بشكل مشترك عن إنشاء مصدر إما عن طريق أداء نفس الدور الذي يؤديه وكيل آخر كما هو الحال في التعاون بين كاتبين، أو عن طريق أداء دور مختلف كما هو الحال في التعاون بين ملحن ومؤلف أغاني", da: "Ophav inkluderer agenter der har fælles ansvar for at have skabt en ressource, enten ved at udføre den samme rolle, som i et samarbejde mellem to forfattere, eller udføre forskellige roller, som i et samarbejde mellem fx en komponist og en sangskriver.", de: "Darunter fallen Akteure, die für die Schaffung einer Ressource mitverantwortlich sind, wenn sie entweder dieselbe Rolle ausführen, wie bei einer Zusammenarbeit zwischen zwei Schriftstellerinnen/Schriftstellern, oder unterschiedliche Rollen ausführen, wie bei einer Zusammenarbeit zwischen einer Komponistin/einem Komponisten und einer Textdichterin/einem Textdichter.", fi: "Koskee toimijoita, jotka yhdessä vastaavat teoksen luomisesta joko toimimalla samassa roolissa kuin toinen toimija, kuten kahden kirjoittajan välisessä yhteistyössä, tai toimimalla eri rooleissa, kuten säveltäjän ja sanoittajan välisessä yhteistyössä."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60672",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has creator", ar: "له مُبدع", da: "har ophav", de: "hat geistige Schöpferin/geistigen Schöpfer", fi: "aineiston tekijä", nl: "heeft maker"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60449,
      definition: {en: "Relates a resource to an agent who is responsible for the general management and supervision of a filmed performance, a radio or television program, etc.", ar: "يربط مصدر بوكيل مسؤولا عن الإدارة العامة والإشراف على أداء فيلم، برنامج إذاعي أو برنامج تلفزيوني، إلخ.", da: "Relaterer en ressource til en agent, der er ansvarlig for ledelse af og tilsyn med en filmoptagelse, et radio- eller tv-program etc.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das allgemeine Management und die Leitung einer verfilmten Darbietung, einer Hörfunk- oder Fernsehsendung und so weiter verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa elokuvaesityksen, radio- tai televisio-ohjelman tms. yleisestä johtamisesta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60084", "http://rdaregistry.info/Elements/u/P60085", "http://rdaregistry.info/Elements/u/P60086"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/director.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60452",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has director", ar: "له مخرج", da: "har instruktør", de: "hat Regisseurin/Regisseur", fi: "aineiston ohjaaja", nl: "heeft regisseur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60450,
      definition: {en: "Relates a resource to an agent who is responsible for the set of technical, editorial, and intellectual procedures aimed at compensating for the degradation of a resource by bringing it back to a state as close as possible to its original condition.", ar: "يربط مصدر بوكيل مسؤولًا عن مجموعة اجراءات فنية، وتحريرية، وفكرية تهدف إلى تعويض مصدر عن التدهور الذي لحق به بإعادته إلى حالة أقرب ما يكون إلى حالته الأصلية.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource ved at restaurere og/eller kombinere tidligere ressourcer, som kan være beskadigede eller fragmenterede, til at skabe en ny ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die technischen, redaktionellen und intellektuellen Verfahren verantwortlich ist, die darauf abzielen, die Zersetzung einer Ressource auszugleichen, indem sie in einen Zustand zurückversetzt wird, der ihrer ursprünglichen Beschaffenheit möglichst nahe kommt.", fi: "Liittää aineiston toimijaan, joka vastaa teknisistä, toimituksellisista ja tiedollisista toimenpiteistä, joiden tarkoitus on palauttaa huonokuntoinen aineisto mahdollisimman lähelle sen alkuperäistä kuntoa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/restorationist.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60674",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has restorationist", ar: "له أخصائي ترميم", da: "har konservator", de: "hat Restauratorin/Restaurator", fi: "aineiston entisöijä", nl: "heeft restaurator"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60451,
      definition: {en: "Relates a resource to an agent who sponsors some aspect of a resource.", ar: "يربط مصدر بوكيل يرعى بعض جوانب مصدر ما.", da: "Relaterer en ressource til en agent, der har bidraget til en ressource via fx forskningsfinansiering, sponsorering af en event.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der einzelne Aspekte einer Ressource finanziell unterstützt.", fi: "Liittää aineiston sitä sponsoroivaan toimijaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/sponsoringAgentOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Includes funding research and sponsoring an event that is the basis of a resource.", ar: "يشمل ذلك تمويل البحوث ورعاية حدث يكون أساس لمصدر.", de: "Darunter fallen Forschungsförderungen und die finanzielle Unterstützung einer Veranstaltung, die die Grundlage einer Ressource bilden.", fi: "Kattaa tutkimuksen rahoituksen ja teoksen perustana olevan tapahtuman sponsoroinnin."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60675",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
