    property :P60452,
      definition: {en: "Relates a resource to an agent who captures images, either electronically or on film or video stock, and often selects and arranges lighting.", ar: "يربط بين مصد ووكيل يلتقط الصور، إما إلكترونيًا أو في فيلم أو فيديو، وغالبًا ما يكون مسئولا عن اختيار الإضاءة وتوزيعها.", da: "Relaterer en ressource til en agent, der optager billeder, enten elektronisk eller på film eller video og ofte vælger og arrangerer lyssætning.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der Bilder aufzeichnet, entweder elektronisch oder auf Film- oder Videomaterial, und häufig Belichtung auswählt und arrangiert.", fi: "Liittää toimijan aineistoon, jossa hän vastaa kuvien tallentamisesta joko sähköisesti tai filmille tai videolle, usein myös valaistuksen valitsemisesta ja järjestämisestä."},
