    property :P60457,
      definition: {en: "Relates a resource to an agent who appeals a decision of a lower court recorded in a legal resource of a higher court.", ar: "يربط مصدر بوكيل يستأنف حكم صادر عن محكمة أدنى مسجل في مصدر قانوني لمحكمة أعلى.", da: "Relaterer en ressource til en agent der gør indsigelse mod en underrets beslutning, der er registreret i et juridisk værk fra en højere retsinstans.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der gegen ein Gerichtsurteil einer unteren Instanz, das in einer juristischen Ressource einer höheren Instanz erfasst ist, Rechtsmittel (Berufung/Revision) einlegt.", fi: "Liittää aineiston toimijaan, joka hakee muutosta alemman oikeusasteen päätökseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/appellant.en",
