    property :P60461,
      definition: {en: "Relates a resource to an agent who hears and decides on legal matters in court.", ar: "يربط مصدر بوكيل يسمع ويفصل في المسائل القانونية في محكمة.", da: "Relaterer en ressource til en agent, der hører og træffer beslutning om juridiske anliggender i retten.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der bei Gericht juristische Angelegenheiten anhört und darüber entscheidet.", fi: "Liittää aineiston toimijaan, joka kuulee ja päättää oikeusasioista tuomioistuimessa."},
