      definition: {en: "Relates a resource to an agent who is accused in a criminal proceeding or sued in a civil proceeding.", ar: "يربط مصدر بوكيل متهم في دعوى جنائية أو يحاكم في دعوى مدنية.", da: "Relaterer en ressource til en agent, der er anklaget i en straffesag eller sagsøgt i en civilsag.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der in einem Strafverfahren angeklagt oder in einem Zivilverfahren verklagt ist.", fi: "Liittää aineiston henkilöön, joka on syytteessä rikosoikeudenkäynnissä tai haastettuna siviilioikeudenkäynnissä."},
