    property :P60463,
      definition: {en: "Relates a resource to an agent who is a faculty moderator of an academic disputation, normally proposing a thesis and participating in the ensuing disputation.", ar: "يربط مصدر بوكيل يعمل بصفته رئيس جلسة أعضاء هيئة التدريس في مناظرة أكاديمية، ويقترح عادة مبحثا ويشارك في المناظرة اللاحقة.", da: "Relaterer en ressource til en agent, der er fakultetsordstyrer for et akademisk afhandlingsforsvar, normalt ved at fremsætte en tese og deltage i det efterfølgende afhandlingsforsvar.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der auf Fakultätsseite eine akademische Disputation moderiert, normalerweise eine These vorschlägt und an der sich daraus ergebenden Disputation teilnimmt.", fi: "Liittää aineiston toimijaan, joka on vastuussa väitöskirjan esittelystä väitöstilasuudessa tiedekunnan edustajana ja osallistuu keskusteluun väitöstilaisuuden puheenjohtajana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/praeses.en",
