      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60465,
      definition: {en: "Relates a resource to an agent who provides consultation services, and often makes recommendations, for a related agent who is represented as a creator of a resource.", ar: "يربط مصدر بوكيل يُقدم خدمات استشارية، وغالبًا ما يقدم مقترحات، لوكيل ذي صلة يُقدم على أنه منشيء مصدر.", da: "Relaterer en ressource til en agent, der yder rådgivning, og ofte kommer med anbefalinger, til en anden agent, der er repræsenteret som ophav til en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der Beratungsdienste anbietet und häufig einem in Beziehung stehenden Akteur, der als geistiger Schöpfer einer Ressource repräsentiert wird, Empfehlungen macht.", fi: "Liittää teoksen toimijaan, joka on vastuussa asiantuntijapalveluiden tarjoamisesta ja suositusten antamisesta teoksen tekijänä pidetylle henkilölle."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/consultant.en",
