      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60466,
      definition: {en: "Relates a resource to an agent whose manuscript signature appears on a resource.", ar: "يربط مصدر بوكيل يظهر توقيعه بخط اليد على مصدر.", da: "Relaterer en ressource til en agent, der laver manuskriptnotater på en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, dessen handschriftliche Unterschrift auf einer Ressource steht.", fi: "Liittää aineiston toimijaan, jonka käsinkirjoitettu nimikirjoitus aineistossa on."},
