    property :P60467,
      definition: {en: "Relates a resource to an agent who issues a resource.", ar: "يربط مصدر بوكيل يقوم بإصدار مصدر ما.", da: "Relaterer en ressource til en agent, der har udgivet en ressource, såsom et officielt skrift fra agenten.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der eine Ressource heraus gibt.", fi: "Liittää aineiston sen julkaisevaan toimijaan."},
