    property :P60484,
      definition: {en: "Relates an agent to a summary of information about the history of an agent.", ar: "يربط بين وكيل ومعلومات متعلقة بالسيرة الذاتية أو معلومات تاريخية عن وكيل ما.", da: "Relaterer en ressource til biografiske eller historiske oplysninger om en agent.", de: "Setzt einen Akteur in Beziehung zu biografischen oder historischen Informationen über einen Akteur.", fi: "Liittää toimijan biografiseen tai historialliseen informaatioon toimijasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/agentHistory.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has agent history", ar: "له وكيل تاريخ", da: "har agenthistorie", de: "hat Geschichte eines Akteurs", fi: "toimijan historia", nl: "heeft actor geschiedenis"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60485,
      definition: {en: "Relates a resource to an indication of the kinds of resource that supplement the main resources that are embodied by an augmentation aggregate.", ar: "يربط بين مصدر ومؤشر لأنواع المصادر التي تُكمل المصادر الرئيسية التي يتم تجسيدها بواسطة إضافة تجميعة.", da: "Relaterer en ressource til en indikation af indhold der opdaterer eller supplerer en ressources primære indhold.", de: "Setzt eine Ressource in Beziehung zu einer Angabe der Ressourcenarten, die die Hauptressourcen ergänzen, welche durch ein Erweiterungsaggregat verkörpert werden.", fi: "Liittää aineiston ilmaukseen niistä aineistoista, jotka täydentävät laajennusaggregaatin sisältämiä aineistoja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/supplementaryContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has supplementary content", ar: "له محتوى تكميلي", da: "har supplerende indhold", de: "hat ergänzenden Inhalt", fi: "lisätty aineistosisältö", nl: "heeft aanvullende content"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60486,
      definition: {en: "Relates a resource to an indication of the kinds of image content that supplement the main resources that are embodied by an augmentation aggregate.", ar: "يربط بين مصدر ومؤشر لأنواع محتوى الصورة التي تُكمل المصادر الرئيسية التي يتم تجسيدها بواسطة إضافة تجميعة.", da: "Relaterer en ressource til en tilstedeværelse af billedindhold, der medfølger en ressources primære indhold.", de: "Setzt eine Ressource in Beziehung zu einer Angabe der Arten von Bildinhalt, die die Hauptressourcen ergänzt, die durch ein Erweiterungsaggregat verkörpert werden.", fi: "Liittää aineiston ilmaukseen niistä kuvasisällöistä, jotka täydentävät laajennusaggregaatin sisältämiä aineistoja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/illustrativeContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has illustrative content", ar: "له محتوى توضيحي", da: "har illustrativt indhold", de: "hat illustrierenden Inhalt", fi: "aineiston kuvasisältö", nl: "heeft illustratieve content"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60487,
      definition: {en: "Relates a resource to an indication of the kinds of resource that provide alternative sensory modes to perceive the main resources that are embodied by an augmentation aggregate.", ar: "يربط بين مصدر ومؤشر لأنواع المصادر التي تُوفر أنماطًا حسية بديلة لإدراك المصادر الرئيسية التي يتم تجسيدها بواسطة إضافة تجميعة.", da: "Relaterer en ressource til en indikation af indhold, der giver alternative sansemåder for at forstå en ressources primære indhold.", de: "Setzt eine Ressource in Beziehung zu einer Angabe der Ressourcenarten, die alternative, sensorische Formen liefern, um die Hauptressource wahrzunehmen, welche durch ein Erweiterungsaggregat verkörpert werden.", fi: "Liittää aineiston ilmaukseen niistä aineistoista, jotka tarjoavat vaihtoehtoisia aistintatapoja laajennusaggregaatin sisältämien pääaineistojen vastaanottamiseksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/accessibilityContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Accessibility content includes accessible labels, audio description, captioning, image description, sign language, and subtitles. Accessibility content does not include subtitles in a language different from the spoken content.", ar: "يتضمن المحتوى التَسهيلي الآتي: ملصقات يمكن الوصول إليها، وصف صوتي، تعليق، وصف صورة، لغة إشارة، وترجمات. ولا يتضمن المحتوى التَسهيلي ترجمة بلغة مختلفة عن المحتوى المنطوق.", da: "Omfatter lydbeskrivelser, rubrikker, billedbeskrivelser, tegnsprog, og undertekster. Omfatter ikke undertekster på et andet sprog end det talte.", de: "Zum barrierefreien Inhalt gehören barrierefreie Labels, eine Audiodeskription, Untertitel für Hörgeschädigte, Bildbeschreibungen, Gebärdensprache und Untertitel. Zum barrierefreien Inhalt gehören nicht die Untertitel in einer Sprache, die von dem gesprochenen Inhalt abweichen.", fi: "Saavutettavuussisältö sisältää saavutettavat nimikkeet, kuunneltavan kuvauksen, otsikoinnin, kuvien kuvauksen, viittomakielen ja tekstityksen. Saavutettavuussisältö ei sisällä tekstitystä, joka eroaa puhutusta sisällöstä."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has accessibility content", ar: "له محتوى تَسهيلي/ محتوى إتاحة", da: "har tilgængelighedsfremmende indhold", de: "hat barrierefreien Inhalt", fi: "aineiston saavutettavuussisältö", nl: "heeft toegankelijkheidscontent"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60488,
      definition: {en: "Relates a resource to a musical or physical layout of the content of a resource that is presented in the form of musical notation.", ar: "يربط بين مصدر وتخطيط موسيقي أو مادي لمحتوى مصدر يُعرض في شكل من أشكال التدوين الموسيقي.", da: "Relaterer en ressource til et musikalsk eller fysisk layout af en ressources indhold, der er præsenteret som musikalsk notation.", de: "Setzt eine Ressource in Beziehung zu einem musikalischen oder physischen Layout des Inhalts einer Ressource, der in Form einer Musiknotation präsentiert wird.", fi: "Liittää aineiston nuottikirjoituksen muodossa esitetyn aineiston musiikilliseen tai fyysiseen layoutiin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/formatOfNotatedMusic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has format of notated music", ar: "لها صيغة من موسيقى مدونة", da: "har type af noteret musik", de: "hat musikalische Ausgabeform", fi: "nuottiaineiston muoto", nl: "heeft format van bladmuziek"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60489,
      definition: {en: "Relates a resource to a statement that identifies an academic institution, degree, and year for which a resource was presented.", ar: "يربط بين مصدر وبيان يحدد المؤسسة الأكاديمية، والدرجة العلمية، والسَنة التي قُدم فيها المصدر.", da: "Relaterer en ressource til en oplysning der identificerer en akademisk institution, en akademisk grad og året hvor ressourcen blev forsvaret.", de: "Setzt eine Ressource in Beziehung zu einer Angabe, die eine akademische Institution, einen Grad oder ein Jahr, in dem eine Arbeit präsentiert wurde, bezeichnet.", fi: "Liittää aineiston merkintöön akateemisesta instituutiosta, tutkinnosta ja aineiston vuodesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dissertationOrThesisInformation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has dissertation or thesis information", ar: "له معلومات عن رسالة جامعية دكتوراه أو ماجستير", da: "har afhandlings- eller specialeoplysninger", de: "hat Hochschulschriftenvermerk", fi: "väitöskirjan tai opinnäytteen tiedot", nl: "heeft dissertatie- of these-informatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60490,
      definition: {en: "Relates a resource to a name, address, or other means of communicating with an agent from which a resource may be obtained.", ar: "يربط بين مصدر وإسم، عنوان، أو غيرها من بيانات الاتصال لوكيل يمكن الحصول منه على مصدر.", da: "Relaterer en ressource til et navn, en adresse, etc. for en organisation etc. hvorfra en ressource kan fremskaffes.", de: "Setzt eine Ressource in Beziehung zu einem Namen, einer Adresse oder einem anderen Kommunikationsmittel eines Akteurs, von dem eine Ressource erworben werden kann.", fi: "Liitää aineiston toimijan, jolta aineisto on saatavissa, nimeen, osoitteeseen tai muuhun yhteystietoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/contactInformation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Contact information includes the name, address, etc. of the publisher, distributor, etc. of a published resource, or of the archival repository that holds the resource.", ar: "تتضمن بيانات الاتصال اسم وعنوان الناشر، الموزع، إلخ. وغيرها من بيانات الاتصال الخاصة بمصدر منشور، أو بالمستودع الأرشيفي الذي يحتفظ بالمصدر.", da: "Kontaktoplysninger inkluderer navn adresse, etc. på en udgiven ressources udgiver, distributør, etc., eller på det arkiv som ejer ressourcen.", de: "Darunter fällt der Name, die Adresse und so weiter des Verlags, Vertriebs und so weiter eine veröffentlichten Ressource oder des Archivrepositorys, das die Ressource aufbewahrt.", fi: "Yhteystietoon sisältyy julkaistun aineiston kustantajan, jakelijan jne. tai säilyttävän arkiston nimi, osoite jne."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has contact information", ar: "له بيانات اتصال", da: "har kontaktoplysninger", de: "hat Kontaktinformationen", fi: "yhteystiedot", nl: "heeft contactinformatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60491,
      definition: {en: "Relates a resource to a summary of information about the history of a resource.", ar: "يربط بين مصدر وملخص معلومات عن تاريخ مصدر ما.", da: "Relaterer en ressource til en opsummering af oplysninger om en ressources historie.", de: "Setzt eine Ressource in Beziehung zu Informationen über die Geschichte einer Ressource.", fi: "Liittää aineiston tiivistelmään aineiston historiatiedoista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/historyOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has history of resource", ar: "له تاريخ مصدر", da: "har ressourcehistorie", de: "hat Geschichte einer Ressource", fi: "aineiston historia", nl: "heeft geschiedenis van resource"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60492,
      definition: {en: "Relates an agent to a summary of information about the life or history of an agent. (Deprecated)", da: "Relaterer en agent til en opsummering af oplysninger om en persons liv eller historie."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/biographicalInformation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has biographical information (Deprecated)", da: "har biografiske oplysninger"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60493,
      definition: {en: "Relates a resource to a word, character, or group of words or characters that appears in conjunction with, and is subordinate to, a title proper of a resource.", ar: "يربط بين مصدر وكلمة، حرف، أو مجموعة كلمات أو تمثيلات تظهر بمصاحبة عنوان مُنَاسِب لمصدر، وتكون تابعًا له.", da: "Relaterer en ressource til et ord, tegn eller en gruppe af ord og/eller tegn, der optræder i forbindelse med, og er underordnet, en ressources hovedtitel.", de: "Setzt eine Ressource in Beziehung zu einem Wort, einem Zeichen oder einer Gruppe von Wörtern oder Zeichen, die in Verbindung mit dem Haupttitel einer Ressource erscheinen und diesem nachgeordnet sind.", fi: "Liittää aineiston sanaan, merkkiin tai ryhmään sanoja ja/tai merkkejä, jotka esiintyvät aineiston päänimekkeen kanssa ja sille alisteisina."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/otherTitleInformation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has other title information", ar: "له بيانات أخرى لعنوان", da: "har anden titelinformation", de: "hat Titelzusatz", fi: "aineiston muu nimeketieto", nl: "heeft andere titelinformatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60369",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60494,
      definition: {en: "Relates a resource to a word, character, or group of words or characters that appears in conjunction with, and is subordinate to, a title proper of a series.", ar: "يربط بين مصدر وكلمة، حرف، أو مجموعة كلمات أو تمثيلات تظهر بمصاحبة عنوان مُنَاسِب لسلسلة، وتكون تابعًا لها.", da: "Relaterer en ressource til et ord, tegn eller en gruppe af ord og/eller tegn, der optræder i forbindelse med, og er underordnet, en series hovedtitel.", de: "Setzt eine Ressource in Beziehung zu einem Wort, einem Zeichen oder einer Gruppe von Wörtern oder Zeichen, die in Verbindung mit dem Haupttitel einer Ressource erscheinen und diesem nachgeordnet sind.", fi: "Liittää aineiston sanaan, merkkiin tai ryhmään sanoja ja/tai merkkejä, jotka esiintyvät sarjan päänimekkeen kanssa ja sille alisteisina."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/otherTitleInformationOfSeries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has other title information of series", ar: "له بيانات عنوان أخرى لسلسلة", da: "har anden titelinformation for serie", de: "hat Titelzusatz einer Reihe", fi: "sarjan muu nimeketieto aineistolle", nl: "heeft andere titelinformatie van reeks"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60495,
      definition: {en: "Relates a resource to a word, character, or group of words or characters that appears in conjunction with, and is subordinate to, a title proper of a subseries. (Deprecated)", da: "Relaterer en ressource til et ord, tegn eller en gruppe af ord og/eller tegn, der optræder i forbindelse med, og er underordnet, en underseries hovedtitel."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/otherTitleInformationOfSubseries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has other title information of subseries (Deprecated)", da: "har anden titelinformation for underserie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60496,
      definition: {en: "Relates a resource to limitations placed on access to a resource.", ar: "يربط بين مصدر وقيود مفروضة على الوصول إلى مصدر ما.", da: "Relaterer en ressource til begrænsninger for adgang til en ressource.", de: "Setzt eine Ressource in Beziehung zu Beschränkungen des Zugangs zu einer Ressource.", fi: "Liittää aineiston aineiston saatavuudelle asetettuihin rajoituksiin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/restrictionsOnAccess.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has restrictions on access", ar: "له قيود على الإتاحة", da: "har adgangsrestriktioner for ressource", de: "hat Zugangsbeschränkung", fi: "saatavuuden rajoitukset aineistolle", nl: "heeft beperking op toegang"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60497,
      definition: {en: "Relates a resource to a limitation placed on reproduction, publication, exhibition, etc., of a resource.", ar: "يربط بين مصدر وقيود مفروضة على الاستنساخ، النشر، المعَرض، إلخ.، لمصدر ما.", da: "Relaterer en ressource til begrænsninger relateret til ret til reproduktion, publicering, udstilling etc. af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Beschränkung der Verwendungsart einer Ressource, wie zum Beispiel Reproduktion, Veröffentlichung, Ausstellung und so weiter.", fi: "Liittää aineiston aineiston käyttörajoituksiin koskien esim. kopiointia, julkaisemista tai esille asettamista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/restrictionsOnUse.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has restrictions on use", ar: "له قيود على الاستخدام", da: "har brugsrestriktioner for ressource", de: "hat Benutzungsbeschränkung", fi: "aineiston käyttöehdot", nl: "heeft beperking op gebruik"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60498,
      definition: {en: "Relates a resource to an indication of mathematical data and other features of the cartographic content of a resource not recorded in statements of scale, projection, and coordinates.", ar: "يربط بين مصدر ومؤشر لبيانات رياضية ومعالم أخرى لمحتوى رسم خرائط لمصدر لم يتم تسجيله في بيانات مقياس، عَرض، وإحداثيات.", da: "Relaterer en ressource til en indikation af matematiske data og andre karakteristika ved en ressources kartografiske indhold, der ikke er registreret som del af målestoks-, projicerings- eller koordinatoplysninger.", de: "Setzt eine Ressource in Beziehung zu einer Angabe von mathematische Daten und sonstigen Besonderheiten des kartografischen Inhalts einer Ressource, die nicht in Maßstabs-, Projektions- und Koordinatenangaben erfasst werden.", fi: "Merkintä matemaattisista tiedoista ja muista aineiston kartografisen sisällön ominaisuuksista, joita ei ole merkitty mittakaava-, projektio- tai koordinaatiomerkintöihin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfCartographicContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of cartographic content", ar: "له تفاصيل محتوى رسم الخرائط", da: "har andre detaljer om kartografisk indhold", de: "hat Details zu kartografischem Inhalt", fi: "aineiston kartografisen sisällön tarkemmat tiedot", nl: "heeft details van cartografische content"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60499,
      definition: {en: "Relates a resource to a nomen that is a designation in the form of numbers or alphabetic characters that is used to indicate the first in a sequence of numbering of the parts or iterations of a resource.", ar: "يربط بين مصدر وتسمية على شكل رقمي أو أبجدي مُقدمة في عدد أول أو جزء أول من تسلسل صدر في ترقيم متسلسل.", da: "Relaterer en ressource til en betegnelse i numerisk og/eller alfabetisk form på første nummer eller del af en nummereringssekvens for et periodikum.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung in Form von Nummern oder Buchstaben, die innerhalb einer Zählfolge auf der ersten Ausgabe einer fortlaufenden Ressource erscheint.", fi: "Liittää aineiston numeroista tai kirjaimista muodostuvaan määritteeseen, joka ilmaisee aineiston osien tai iteraatioiden numerointijakson ensimmäisen määritteen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/firstAlphanumericDesignationOfSequence.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61211",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has first alphanumeric designation of sequence", ar: "له تسمية رقمية أولى لتسلسل", da: "har numerisk og/eller alfabetisk betegnelse for første nummer eller del af sekvens", de: "hat alphanumerische Bezeichnung der ersten Ausgabe einer fortlaufenden Ressource", fi: "numerointijakson ensimmäinen numero- ja/tai kirjainmäärite aineistolle", nl: "heeft eerste alfanumerieke aanduiding van reeks"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60533",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60500,
      definition: {en: "Relates a resource to a nomen that is a designation in the form of numbers or alphabetic characters that is used to indicate the last in a sequence of numbering of the parts or iterations of a resource.", ar: "يربط بين مصدر وتسمية على شكل رقمي أو أبجدي مُقدمة في عدد أخير أو جزء أخير من تسلسل صدر في ترقيم متسلسل.", da: "Relaterer en ressource til en betegnelse i numerisk og/eller alfabetisk form på sidste nummer eller del af en nummereringssekvens for et periodikum.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung in Form von Nummern oder Buchstaben, die innerhalb einer Zählfolge auf der letzten Ausgabe einer fortlaufenden Ressource erscheint.", fi: "Liittää aineiston numeroista tai kirjaimista muodostuvaan määritteeseen, joka ilmaisee aineiston osien tai iteraatioiden numerointijakson viimeisen määritteen."},
