    property :P60503,
      definition: {en: "Relates a resource to a resource that is a diachronic resource that continues the partial content of another diachronic resource that is completed.", ar: "يربط بين مصدر ومصدر ممتد زمنيًا يُكْمل المحتوى الجزئي لمصدر آخر ممتد زمنيًا ومكتمل.", da: "Relaterer et ressource til en ressource, der er resultatet af opdelingen af en tidligere ressource i to eller flere separate ressourcer.", de: "Setzt eine Ressource in Beziehung zu einer diachronen Ressource, die teilweise den Inhalt einer anderen abgeschlossenen, diachronen Ressource fortführt.", fi: "Liittää aineiston aineistoon, joka on diakroninen aineisto, joka jatkaa toisen, valmiin diakronisen aineiston osittaista sisältöä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/splitInto.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
