    property :P60504,
      definition: {en: "Relates a resource to a resource that is formed from a coming together of two or more resources.", ar: "يربط بين مصدر ومصدر مكون من تجميع لمصدرين أو أكثر معًا.", da: "Relaterer en ressource til en ressource, der er dannet ved at lægge to eller flere ressourcer sammen.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die durch ein Zusammenführen von zwei oder mehreren Ressourcen gebildet wird.", fi: "Liittää aineiston aineistoon, joka on syntynyt kahden tai useamman aineiston yhdistymisestä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mergedToForm.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
