      definition: {en: "Relates a resource to a resource that came together with one or more other resources to form a new resource.", ar: "يربط بين مصدر ومصدر تم دمجه مع مصدر آخر أو أكثر لتكوين مصدر جديد.", da: "Relaterer en ressource til en ressource, der sammen med en eller flere andre ressourcer danner en ny ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, die mit einer anderen Ressource oder mehreren anderen Ressourcen zusammengeführt wird, um eine neue Ressource zu bilden.", fi: "Liittää aineiston aineistoon, joka on yhdistynyt yhden tai useamman aineiston kanssa ja muodostanut uuden aineiston."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mergerOf.en",
