      subPropertyOf: "http://rdaregistry.info/Elements/u/P60261",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60506,
      definition: {en: "Relates a resource to a timespan that is a point of intersection of the ecliptic and the celestial equator, occupied by the sun when its declination is 0°.", ar: "يربط بين مصدر وفترة زمنية تمثل نقطة تقاطع بين مسار الشمس وخط الاستواء السماوي، تحتله الشمس عندما يكون انحرافها صفر \"0\".", da: "Relaterer en ressource til et af himmelsfærens og himmelækvators to skæringspunkter, hvor solen befinder sig, når dens hældning er 0°.", de: "Setzt eine Ressource in Beziehung zu einem von zwei Kreuzungspunkten der Sonnenbahn und des Himmelsäquators, die von der Sonne überquert werden, wenn ihre Deklination 0° beträgt.", fi: "Liittää aineiston ajanjaksoon, joka käyttää ekliptikan ja taivaanekvaattorin leikkauspistettä, jossa aurinko on, kun sen deklinaatio on 0°."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/equinox.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60992",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has equinox", ar: "له اعتدال", da: "har jævndøgn", de: "hat Äquinoktium", fi: "tasauspiste aineistossa", nl: "heeft equinox"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60507,
      definition: {en: "Relates a resource to an other title information in a language or script that differs from that recorded in an other title information element.", ar: "يربط بين مصدر وبيانات أخرى لعنوان بلغة أو نص مختلف عن تلك المُسجلة داخل عنصر بيانات عنوان أخر.", da: "Relaterer en ressource til andre titeloplysninger på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af andre titeloplysninger. ", de: "Setzt eine Ressource in Beziehung zu einem Titelzusatz in einer Sprache oder Schrift, der von dem bereits erfassten Titelzusatz abweicht.", fi: "Liittää aineiston tietoelementtiin tallennetusta muusta nimiketiedosta eroavaan toiseen nimeketietoon toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60508",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelOtherTitleInformation.en",
