      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel other title information", ar: "له بيانات عنوان أخرى بديلة", da: "har parallel anden titelinformation", de: "hat parallelen Titelzusatz", fi: "rinnakkainen muu nimiketieto aineistolle", nl: "heeft parallelle overige titelinformatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60369",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60508,
      definition: {en: "Relates a resource to an other title information of a series in a language or script that differs from that recorded in an other title information of series element.", ar: "يربط بين مصدر وبيانات عنوان أخرى لسلسة بلغة أو نص مختلف عن تلك المُسجلة داخل عنصر بيانات عنوان أخرى لسلسة.", da: "Relaterer en ressource til andre titeloplysninger for en serie på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af andre titeloplysninger for en serie.", de: "Setzt eine Ressource in Beziehung zu einem Titelzusatz einer Reihe in einer Sprache oder Schrift, der von dem bereits erfassten Titelzusatz einer Reihe abweicht.", fi: "Liittää aineiston tietoelementtiin tallennetusta muusta sarjan nimiketiedosta eroavaan toiseen nimeketietoon toisella kielellä ja/tai kirjoitusjärjestelmällä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60509",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/parallelOtherTitleInformationOfSeries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has parallel other title information of series", ar: "له بيانات عنوان أخرى بديلة لسلسلة", da: "har parallel anden titelinformation for serie", de: "hat parallelen Titelzusatz einer Reihe", fi: "sarjan rinnakkainen muu nimiketieto aineistolle", nl: "heeft parallelle overige titelinformatie van reeks"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60507",
