    property :P60509,
      definition: {en: "Relates a resource to an other title information of a subseries in a language or script that differs from that recorded in an other title information of subseries element. (Deprecated)", da: "Relaterer en ressource til andre titeloplysninger for en serie på et andet sprog og/eller i et andet alfabet end det som er anvendt ved angivelsen af andre titeloplysninger for en underserie."},
