    property :P60510,
      definition: {en: "Relates a resource to an indication of supplemental information about scale.", ar: "يربط بين مصدر ومؤشر لمعلومات تكلميلية بشأن مقياس.", da: "Relaterer en ressource til en indikation af supplerende oplysninger om målestoksforhold.", de: "Setzt eine Ressource in Beziehung zu ergänzenden Informationen zu einem Maßstab.", fi: "Liittää aineiston mittakaavaan lisättyjen tietojen merkintään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/additionalScaleInformation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Statement of comparative measurements or limitation of the scale to particular parts of the content of a resource are included.", ar: "تتضمن بيان قياسات مقارنة أو قيود لمقياس لأجزاء محددة من محتوى المصدر.", da: "Supplerende målestoksforhold omfatter angivelse i flere måleenheder eller som begrænsning af målestoksforholdet til visse dele af ressourcen.", de: "Darunter fällt eine Angabe von Vergleichsmaßen oder eine Begrenzung des Maßstabs auf bestimmte Teile des Inhalts einer Ressource.", fi: "Lisätieto mittakaavasta tarkoittaa merkintöä vertailevista mitoista tai mittakaavan rajauksesta aineiston sisällön tiettyihin osiin yms."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has additional scale information", ar: "له معلومات إضافية لمقياس", da: "har supplerende målestoksforhold", de: "hat zusätzliche Informationen zu einem Maßstab", fi: "lisätieto aineiston mittakaavasta", nl: "heeft aanvullende schaalinformatie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60565",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60511,
      altLabel: {en: "URL", ar: "محّدد مصادر مُوحّد", de: "URL", fi: "URL-osoite"},
      definition: {en: "Relates a resource to an address of an online resource.", ar: "يربط بين مصدر وعنوان لمصدر متاح على الخط المباشر", da: "Relaterer en ressource til en adresse på en ressource hvortil der er fjernadgang.", de: "Setzt eine Ressource in Beziehung zu einer Adresse einer Online-Ressource.", fi: "Liittää aineiston verkkoaineiston osoitteeseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/uniformResourceLocator.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A Uniform Resource Locators includes all resource identifiers intended to provide online access to a resource using a standard Internet browser.", ar: "تتضمن محّددات المصادر المُوحّدة كل معرفات المصدر التي تهدف إلى توفير الإتاحة على الخط المباشر لمصدر باستخدام متصفح إنترنت معياري", da: "En Uniform Ressource Locator inkluderer alle ressourceidentifikatorer der har for hensigt at give online access til en ressource gennem at bruge en standard internetbrowser.", de: "Darunter fallen alle Identifikatoren, die konzipiert sind, um unter Verwendung eines Standard-Internet-Browsers Online-Zugang auf eine Ressource anzubieten.", fi: "URL-osoite käsittää kaikki aineiston tunnisteet, joiden tarkoituksena on antaa pääsy verkossa olevaan aineistoon standardia verkkoselainta käyttäen."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has uniform resource locator", ar: "له محّدد مصادر مُوحّد", da: "har uniform resource locator", de: "hat Uniform Resource Locator", fi: "URL-osoite", nl: "heeft Uniform Resource Locator"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60512,
      definition: {en: "Relates an agent to an address of an agent.", ar: "يربط بين وكيل وعنوان مراسلة خاص بوكيل.", da: "Relaterer en ressourcetil en agents bopælsadresse, forretningsadresse eller arbejdsgivers adresse og/eller en e-mail- eller internetadresse.", de: "Setzt einen Akteur in Beziehung zu einer Adresse eines Akteurs.", fi: "Liittää aineiston toimijan osoitteeseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/addressOfAgent.en",
