      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60513,
      definition: {en: "Relates a resource to an arrangement of text, images, tactile notation, or other content in a resource.", ar: "يربط بين مصدر وترتيب نص، صور، كتابة بارزة، أو أي محتوى آخر في مصدر ما.", da: "Relaterer en ressource til opstilling af tekst, billeder, taktil notation etc. i en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Anordnung von Text, Bildern, taktiler Notation und so weiter in einer Ressource.", fi: "Liittää aineiston aineistoon sisältyvien tekstin, kuvien, taktiilin nuottikirjoituksen tai muun aineiston sisällön sommitteluun."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/layout.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has layout", ar: "له تصميم طباعي", da: "har layout", de: "hat Layout", fi: "aineiston layout", nl: "heeft opmaak"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60514,
      definition: {en: "Relates a resource to a timespan during which an academic degree is conferred by a granting institution or faculty.", ar: "يربط بين مصدر وفترة زمنية يتم خلالها منح درجة أكاديمية من قبل مؤسسة مانحة أو هيئة تدريس.", da: "Relaterer en ressource til et kalenderår, hvor en institution eller et fakultet har tildelt en kandidat en akademisk grad.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, in dem ein akademischer Grad, der mit einer Hochschulschrift in Verbindung steht, von einer Institution oder Fakultät verliehen wird.", fi: "Liittää aineiston ajanjaksoon, jolloin laitos tai tiedekunta on myöntänyt akateemisen oppiarvon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/yearDegreeGranted.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61110",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has year degree granted", ar: "له عام منح درجة", da: "har år, hvor grad er tildelt", de: "hat Jahr, in dem ein akademischer Grad verliehen wird", fi: "tutkinnon myöntämisvuosi", nl: "heeft jaar graad toegekend"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60527",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60515,
      definition: {en: "Relates a resource to a chief name of a resource, that is, a title normally used when naming a resource.", ar: "يربط بين مصدر ومصدر له اسم بارز (اسم رئيسي)، وهذا يعني استخدام عنوان يستخدم عادةً عند تسمية مصدر.", da: "Relaterer en ressource til et hovednavn på en ressource, dvs. en titel, der normalt anvendes, når en ressource navngives.", de: "Setzt eine Ressource in Beziehung zu einem Hauptnamen einer Ressource, das heißt einem Titel, der normalerweise bei der Benennung einer Ressource verwendet wird.", fi: "Liittää aineiston aineiston ensisijaiseen nimekkeeseen eli aineiston nimeämisessä normaalisti käytettyyn nimekkeeseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/titleProper.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "An alternative title is treated as part of the title proper.", ar: "يتم التعامل مع العنوان البديل كجزء من العنوان نفسه.", da: "En alternativ titel behandles som del af en hovedtitel.", de: "Ein Alternativtitel wird als Teil eines Haupttitels behandelt.", fi: "Vaihtoehtoista nimekettä pidetään päänimekkeen osana."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60957",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has title proper", ar: "له العنوان نفسه", da: "har hovedtitel", de: "hat Haupttitel", fi: "aineiston päänimeke", nl: "heeft hoofdtitel"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60369",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60516,
      definition: {en: "Relates a resource to a name of a series appearing on a resource of a part of a series.", ar: "يربط بين مصدر واسم سلسلة تظهر على مصدر لجزء من سلسلة.", da: "Relaterer en ressource til et navn på en ressource, der optræder på en ressource af en del af en serie.", de: "Setzt eine Ressource in Beziehung zu einem Namen einer Reihe, der auf einer Ressource als Teil einer Reihe erscheint.", fi: "Liittää aineiston sarjan nimeen, joka esiintyy aineistossa, joka on sarjan osa."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60517",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/titleOfSeries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60958",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has title of series", ar: "له عنوان لسلسلة", da: "har hovedtitel for serie", de: "hat Titel einer Reihe", fi: "sarjan nimeke aineistolle", nl: "heeft titel van reeks"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60367",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60517,
      definition: {en: "Relates a resource to a name of a series appearing on a resource of a part of a subseries. (Deprecated)", da: "Relaterer en ressource til et navn på en ressource, der optræder på en ressource af en del af en underserie."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/titleProperOfSubseries.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60959",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has title proper of subseries (Deprecated)", da: "har hovedtitel for underserie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60516",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60518,
      definition: {en: "Relates a resource to a chronological or geographic coverage of the content of a resource.", ar: "يربط بين مصدرًا وتغطية زمنية أو جغرافية لمحتوى مصدر.", da: "Relaterer en ressource til en kronologisk eller geografisk dækning af en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einem chronologischen oder geografischen Bezugsrahmen des Inhalts einer Ressource.", fi: "Liittää aineiston ajalliseen tai maantieteelliseen kattavuuteen aineiston sisällössä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/coverageOfContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has coverage of content", ar: "له تغطية المحتوى", da: "har indholdsdækning", de: "hat inhaltlichen Bezugsrahmen", fi: "aineiston sisällön kattavuus", nl: "heeft bereik van content"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60519,
      definition: {en: "Relates a resource to a clarity or fineness of detail in a digital image, expressed by a measurement of the image in pixels, etc.", ar: "يربط بين مصدر ووضوح أو جودة التفاصيل في صورة رقمية، تم التعبير عنها بمقاييس الصورة بالبكسل، إلخ", da: "Relaterer en ressource til et digitalt billedes skarphed eller finhedsgrad, udtrykt som en måling af pixels i et billede etc.", de: "Setzt eine Ressource in Beziehung zu einer Klarheit oder einem Feinheitsgrad der Details in einem digitalen Bild, die/der durch eine Abmessung des Bilds in Pixeln und so weiter ausgedrückt wird.", fi: "Liittää aineiston digitaalisen kuvan tarkkuuteen, joka ilmaistaan pikseleinä tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resolution.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resolution", ar: "له درجة وضوح", da: "har opløsning", de: "hat Auflösung", fi: "resoluutio aineistossa", nl: "heeft resolutie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60350",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60520,
      definition: {en: "Relates a resource to a category of user for whom the content of a resource is intended, or for whom the content is considered suitable.", ar: "يربط بين مصدر وفئة من المستخدمين المُستهدفين من قبل محتوى مصدر، أو الذين يُعد محتوى المصدر مناسبًا لهم.", da: "Relaterer en ressource til en brugerkategori, som en ressources indhold er beregnet for, eller for hvilken indholdet anses passende.", de: "Setzt eine Ressource in Beziehung zu einer Gruppe von Benutzenden, für die der Inhalt einer Ressource gedacht ist oder für die der Inhalt als passend angesehen wird.", fi: "Liittää aineiston käyttäjäryhmään, jolle aineiston on tarkoitettu tai jolle aineiston katsotaan soveltuvan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/intendedAudience.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has intended audience", ar: "له جمهور مستهدف", da: "har målgruppe", de: "hat Zielgruppe", fi: "aineiston kohderyhmä", nl: "heeft beoogde doelgroep"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60521,
      definition: {en: "Relates a resource to a condition under which a publisher, distributor, etc., will normally supply a resource or the price of a resource.", ar: "يربط بين مصدر وحالة يقوم عادةً بموجبها ناشر، موزع، إلخ. بتوريد مصدر أو ثمن مصدر.", da: "Relaterer en ressource til en etingelse, under hvilke udgiveren, distributøren etc. normalt vil levere en ressource eller prisen på en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Preis oder einer Kondition, zu dem/der ein Verlag, Vertrieb und so weiter eine Ressource normalerweise liefert.", fi: "Liittää aineiston kustantajan, jakelijan tms. asettamiin aineiston toimitusta tai hintaa määrittäviin ehtoihin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/termsOfAvailability.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has terms of availability", ar: "له شروط إتاحة", da: "har anskaffelsesvilkår", de: "hat Bezugsbedingung", fi: "aineiston saatavuusehdot", nl: "heeft voorwaarden voor beschikbaarheid"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60522,
      definition: {en: "Relates a resource to a configuration of an audio track on a sound-track film.", ar: "يربط بين مصدر وضبط مسار صوتي على مسار صوت فيلم.", da: "Relaterer en ressource til en konfiguration af lydsporet til en film med lydspor.", de: "Setzt eine Ressource in Beziehung zu einer Positionierung der Tonspur auf einem Film mit Tonspur.", fi: "Liittää aineiston ääniraidan asemointiin äänifilmissä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/trackConfiguration.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has track configuration", ar: "له بنية مسار", da: "har sporkonfiguration", de: "hat Tonspurlage", fi: "aineiston ääniraidan asemointi", nl: "heeft trackconfiguratie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60351",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60523,
      definition: {en: "Relates a resource to a place from which a resource originated.", ar: "يربط بين مصدرً ومكان نشأ منه مصدر", da: "Relaterer en ressource til et land eller andet område, hvorfra en ressource stammer.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, aus dem eine Ressource stammt.", fi: "Liittää aineiston paikkaan, jossa aineisto on saanut alkunsa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfOriginOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60970",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of origin of resource", ar: "له مكان لمنشأ مصدر", da: "har oprindelsessted for ressourcen", de: "hat Ursprungsort einer Ressource", fi: "aineiston alkuperään liittyvä paikka", nl: "heeft plaats van herkomst van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61014",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60524,
      definition: {en: "Relates an agent to a timespan during which an agent is established or founded.", ar: "يربط بين مصدر وتاريخ أنشئ أو تأسس خلاله وكيل.", da: "Relaterer en ressource til et år eller en dato hvor en agent blev etableret eller grundlagt.", de: "Setzt eine Ressource in Beziehung zu einem Datum, zu dem ein Akteur eingeführt oder gegründet wurde.", fi: "liittää aineiston ajanjaksoon, jonka aikana toimija on perustettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfEstablishment.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60980",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of establishment", ar: "له تاريخ تأسيس", da: "har etableringsår", de: "hat Gründungsdatum", fi: "aineistoon liittyvä toimijan perustamisaika", nl: "heeft datum van oprichting"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60324",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60525,
      definition: {en: "Relates an agent to a timespan during which an agent is terminated or dissolved.", ar: "يربط بين مصدر وتاريخ توقف الوكيل خلاله أو حُلّ.", da: "Relaterer en ressource til år eller dato, hvor en agent ophørte eller blev opløst.", de: "Setzt eine Ressource in Beziehung zu einem Datum, zu dem ein Akteur aufgehoben oder aufgelöst wurde.", fi: "liittää aineiston ajanjaksoon, jonka aikana toimija on lakkautettu tai hajotettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfTermination.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60985",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of termination", ar: "له تاريخ توقف", da: "har ophørsår", de: "hat Auflösungsdatum", fi: "aineistoon liittyvä toimijan lakkauttamisaika", nl: "heeft datum van opheffing"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60324",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60526,
      definition: {en: "Relates an agent to a timespan during which a conference, exhibition, or other formally named and convened event is held.", ar: "يربط بين مصدر وتاريخ أو نطاق تواريخ تم فيها عقد مؤتمر، اِجتماع، لقاء، معرض فني، مهرجان، اِحتِفَال، إلخ.", da: "Relaterer en ressource til et år eller en dato eller en række heraf, hvor en konference, en kongres, et møde, en udstilling, en messe, en festival etc. blev afholdt.", de: "Setzt eine Ressource in Beziehung zu einem Datum oder einem Datumsbereich, zu dem eine Konferenz, ein Kongress, eine Ausstellung, eine Messe, ein Festival und so weiter stattfindet.", fi: "Liittää aineiston päivämäärään tai päivämääriin, jolloin konferenssi, kongressi, kokous, näyttely, messut, festivaalit tms. pidettiin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfConference.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60977",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of conference", ar: "له تاريخ مؤتمر", da: "har datering af konference etc.", de: "hat Datum einer Konferenz", fi: "konferenssin aika", nl: "heeft datum van conferentie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60324",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60527,
      definition: {en: "Relates a resource to a timespan that is the earliest associated with a resource.", ar: "يربط بين مصدر ونطاق زمني يمثل أقرب تاريخ مرتبط بمصدر.", da: "Relaterer en ressource til tidligste dato knyttet til en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Zeitraum, der am frühesten mit einer Ressource in Verbindung steht.", fi: "Liittää aineiston varhaisimpaan aineistoon liittyvään ajankohtaan."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60514",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60984",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has date of resource", ar: "له تاريخ مصدر", da: "har datering af ressource", de: "hat Datum einer Ressource", fi: "aineiston ajankohta", nl: "heeft datum van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61020",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60528,
      definition: {en: "Relates a resource to a system or equipment required for access to the content of an electronic analog or digital resource.", ar: "يربط بين مصدر ونظام أو جهاز مطلوب للوصول إلى محتوى مصدر إلكتروني تناظري أو رقمي.", da: "Relaterer en ressource til udstyr eller system, der er påkrævet, for at en analog, digital etc. ressource kan anvendes, afspilles etc.", de: "Setzt eine Ressource in Beziehung zu einem Gerät oder einem System, das für die Verwendung, Wiedergabe und so weiter einer elektronisch-analogen oder digitalen Ressource erforderlich ist.", fi: "Liittää aineiston laitteisiin tai järjestelmiin, joita tarvitaan analogiseen tai digitaaliseen sisältöön pääsemiseksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/equipmentOrSystemRequirement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has equipment or system requirement", ar: "له أجهزة أو متطلبات تشغيل", da: "har afspilningsudstyr eller systemkrav", de: "hat Geräte- oder Systemanforderung", fi: "aineiston laitteisto- tai järjestelmävaatimukset", nl: "heeft apparatuur- of systeemeis"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60529,
      definition: {en: "Relates a resource to a format that is used in the production of a projected image.", ar: "يربط بين مصدر وصيغة مُستخدمة في إنتاج صورة مرئية.", da: "Relaterer en ressource til et format, der er anvendt ved fremstillingen af et projiceret billede.", de: "Setzt eine Ressource in Beziehung zu einem Format, das bei der Entstehung eines projizierten Bilds verwendet wird.", fi: "Liittää aineiston heijastettavan kuvan tuottamisessa käytettävään formaattiin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/presentationFormat.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has presentation format", ar: "له شكل عرض", da: "har fremvisningsformat", de: "hat Wiedergabeformat", fi: "aineiston esitysformaatti", nl: "heeft presentatieformaat"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60353",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60530,
      definition: {en: "Relates a resource to a nomen that is a name of agent that includes the fuller form of a name or part of a name represented by an initial, abbreviation, or shortened or otherwise modified form.", ar: "يربط بين مصدر وشكل كامل لجزء من الاسم يتم تمثيله فقط من خلال اسم أول أو اختصار في شكل يتم اختياره كاسم مفضل، أو جزء من اسم غير مضمن في شكل تم اختياره كاسم مفضل.", da: "Relaterer en ressource til en mere fuldstændig navneform for en person, hvis navn i foretrukken form indeholder initialer, forkortelser eller andre varianter.", de: "Setzt eine Ressource in Beziehung zu einer vollständigen Form eines Namens, dessen bevorzugte Namensform nur durch eine Initiale oder eine Abkürzung dargestellt wird, oder zu einem Teil eines Namens, der nicht als bevorzugte Namensform gewählt wird.", fi: "Liittää aineiston alkukirjaimin, lyhenteellä tai muuten lyhennetyn tai muokatun nimen tai nimen osan täydellisempään muotoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/fullerFormOfName.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61192",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has fuller form of name", ar: "له شكل كامل للاسم", da: "har mere fuldstændig navneform", de: "hat vollständigere Namensform", fi: "nimen täydellisempi muoto aineistossa", nl: "heeft meer volledige vorm van naam"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60531,
