    property :P60532,
      definition: {en: "Relates a resource to a groove width of an analog disc or a groove pitch of an analog cylinder.", ar: "يربط بين مصدر وعرض مسار لقرص تناظري أو مسار لاسطوانة تناظرية.", da: "Relaterer en ressource til rillebredde på en analog disc eller rilledybde på en analog cylinder.", de: "Setzt eine Ressource in Beziehung zu einer Rillenbreite einer Schallplatte oder einem Rillenabstand eines Phonographenzylinders.", fi: "Liittää aineiston analogisen levyn uran leveyteen tai analogisen äänilieriön urajakoon."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P61105", "http://rdaregistry.info/Elements/u/P61106"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/grooveCharacteristic.en",
