    property :P60533,
      definition: {en: "Relates a resource to the first and last designations of a sequence of the individual parts or iterations of a resource.", ar: "يربط بين مصدر وأول وآخر تسمية لتسلسل خاص بأجزاء منفردة أو أجزاء أو أعداد لمصدر.", da: "Relaterer en ressource til en betegnelse for hvert nummer eller hver del af et periodikum.", de: "Setzt eine Ressource in Beziehung zu der ersten und letzten Bezeichnung der einzelnen Ausgaben einer fortlaufenden Ressource.", fi: "Liittää aineiston ensimmäiseen ja viimeiseen määritteseen, joilla ilmaistaan aineiston yksittäisten osien tai iteraatioiden peräkkäisyyttä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60499", "http://rdaregistry.info/Elements/u/P60500", "http://rdaregistry.info/Elements/u/P60501", "http://rdaregistry.info/Elements/u/P60502", "http://rdaregistry.info/Elements/u/P60818", "http://rdaregistry.info/Elements/u/P60819", "http://rdaregistry.info/Elements/u/P60820", "http://rdaregistry.info/Elements/u/P60821"],
