      "http://www.w3.org/2004/02/skos/core#scopeNote": {da: "Nummerering af omfatter et tal, et bogstav, ethvert andet tegn eller en kombination af disse med eller uden tilhørende tekst og/eller en kronologisk betegnelse."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has numbering of sequence", ar: "له ترقيم متسلسل", da: "har nummerering af periodika", de: "hat Zählung einer fortlaufenden Ressource", fi: "numerointijakso aineistossa", nl: "heeft nummering van volgorde"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60534,
      definition: {en: "Relates a resource to an identifier that is assigned to a series by an ISSN registration agency.", ar: "يربط بين مصدر ومعرف خُصص لسلسلة من قبل وكالة تسجيل الترقيم الدولي الموحد للدوريات", da: "Relaterer en ressource til en unik identifikator givet til en serie af en ISSN-registreringsinstitution.", de: "Setzt eine Ressource in Beziehung zu einem Identifikator, der einer Reihe von einem ISSN-Zentrum zugewiesen wird.", fi: "Liittää aineiston ISSN-rekisteröintitoimistoon myöntämään sarjan tunnisteeseen."},
