    property :P60537,
      definition: {en: "Relates a resource to an instrument, voice, or ensemble and the number of parts, performers and hands used, or intended to be used, to perform the musical content of a resource.", ar: "يربط بين مصدرً وآلة، صوت، أو مجموعة وعدد من أجزاء، فنانين وعاملين مُستخدمين أو يُعتزم استخدامهم لأداء المحتوى الموسيقي لمصدر ما.", da: "Relaterer en ressource til et instrument, en stemme og eller ensemble anvendt, eller påtænkt anvendt, til opførelse af musikindhold.", de: "Setzt eine Ressource in Beziehung zu einem Instrument, einer Singstimme oder einem Ensemble und der Anzahl der Stimmen, der Ausführenden und Hände, das/die zur Darbietung eines musikalischen Inhalts einer Ressource verwendet wird/werden oder verwendet werden soll/sollen.", fi: "Liittää aineiston musiikkiesityksessä käytettävään tai käytettäväksi aiottuun soittimeen, lauluääneen tai esittäjäryhmään ja osien, esiintyjien ja käsien lukumäärään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mediumOfPerformanceOfMusicalContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
