    property :P60538,
      definition: {en: "Relates a resource to an interval at which an issue or part of a diachronic resource is issued.", ar: "يربط بين مصدر وفترة زمنية يتم فيها صدور عدد أو جزء من مصدر ممتد زمنيًا.", da: "Relaterer en ressource til et interval, ved hvilke en series numre eller dele udgives eller det interval der er mellem opdateringer af en integrerende ressource.", de: "Setzt eine Ressource in Beziehung zu einem Intervall, in dem die Ausgaben oder Teile einer diachronen Ressource erscheinen.", fi: "Liittää aineiston diakronisen teoksen osien, numeroiden tai iteraatioiden ilmestymistiheyteen."},
