    property :P60539,
      definition: {en: "Relates a resource to a measurement of a carrier or a container of a resource.", ar: "يربط بين مصدر ومقاييس حامل أو حاوية خاصة بمصدر.", da: "Relaterer en ressource til et mål for en ressources bærer eller dens opbevaringsudstyr.", de: "Setzt eine Ressource in Beziehung zu einer Abmessung eines Datenträgers oder eines Behältnisses einer Ressource.", fi: "Liittää aineiston tallenteen tai säilytyskotelon mittoihin."},
