      subPropertyOf: "http://rdaregistry.info/Elements/u/P60539",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60542,
      definition: {en: "Relates a resource to a method or system used to represent the surface of the earth or of a celestial sphere on a plane.", ar: "يربط بين مصدر وطريقة أو نظام مستخدم لتمثيل سطح الأرض أو الكرة السماوية على مسطح.", da: "Relaterer en ressource til en metode eller system anvendt til at repræsentere jordens overflade eller overfladen på et himmellegeme på et kort.", de: "Setzt eine Ressource in Beziehung zu einer Methode oder einem System, die/das angewendet wird, um die Oberfläche der Erde oder einer Himmelskugel auf einer Ebene zu repräsentieren.", fi: "Liittää aineiston maapallon tai taivaanpallon pinnan kaksiulotteiseen esittämiseen käytettyyn menetelmään tai järjestelmään."},
