      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60543,
      definition: {en: "Relates a resource to a method used to encode audio content for playback.", ar: "يربط بين مصدر وطريقة مستخدمة في تشفير محتوى صوتي مطلوب للتشغيل.", da: "Relaterer en ressource til en metode, der er anvendt til at kode lydindhold til afspilning.", de: "Setzt eine Ressource in Beziehung zu einem Verfahren, das zur Kodierung von Audio-Inhalt für die Wiedergabe verwendet wird.", fi: "Liittää aineiston menetelmään, jota on käytetty äänen tallentamiseksi äänentoistoa varten."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/typeOfRecording.en",
