      subPropertyOf: "http://rdaregistry.info/Elements/u/P60909",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60545,
      definition: {en: "Relates a resource to a nomen that is a name of an agent who is responsible for inscribing, fabricating, constructing, or other method of producing an unpublished resource.", ar: "يربط بين مصدر وتسمية وهي اسم وكيل مسؤول عن تسجيل، تصنيع، إنشاء، أو بأي طريقة أخرى من طرق الإنتاج، مصدر غير منشور.", da: "Relaterer en ressource til et navn på agent, der er ansvarlig for indgravering, fremstilling, konstruktion etc. af ressource i upubliceret form.", de: "Setzt eine Ressource in Beziehung zum Namen eines Akteurs, der für das Gravieren, Fabrizieren, Konstruieren oder eine andere Entstehungsmethode einer unveröffentlichten Ressource verantwortlich ist.", fi: "Liittää aineiston nomeniin, joka on julkaisemattoman aineiston kaiverruksesta, valmistuksesta, kokoonpanosta tai muusta tuotantotavasta vastaavan toimijan nimi."},
