      subPropertyOf: "http://rdaregistry.info/Elements/u/P60909",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60546,
      definition: {en: "Relates a resource to a nomen that is a name of an agent who is responsible for printing, duplicating, casting, or other method of manufacturing a published resource.", ar: "يربط بين مصدر وتسمية وهي اسم وكيل مسؤول عن طبع، نسخ، طَرَح، أو مرتبط بأي طريقة أخرى بتصنيع مصدر منشور.", da: "Relaterer en ressource til et navn på agent, der er ansvarlig for trykning, duplikering, støbning etc. af en ressource i publiceret form.", de: "Setzt eine Ressource in Beziehung zum Namen eines Akteurs, der für den Druck, die Vervielfältigung, den Guss oder eine andere Herstellungsmethode einer veröffentlichten Ressource verantwortlich ist.", fi: "Liittää aineiston nomeniin, joka on julkaistun aineiston painamisesta, monistamisesta, kirjasinten valamisesta tai muusta valmistustavasta vastaavan toimijan nimi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/nameOfManufacturer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60948",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
