      subPropertyOf: "http://rdaregistry.info/Elements/u/P60368",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60550,
      definition: {en: "Relates a resource to a type, number, and measurement unit that quantify an aspect of the extent of a resource.", ar: "يربط بين مصدر ونوع، رقم، ووحدة القياس التي تحدد جانبًا من مدى مصدر.", da: "Relaterer en ressource til antal og type af enheder og/eller underenheder, der udgør en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Art, Nummer und Maßeinheit, die eine Eigenschaft des Umfangs einer Ressource beziffert.", fi: "Liittää aineiston tyyppiin, lukuun ja mittayksikköön, jotka ilmaisevat aineiston laajuutta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/extent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has extent", ar: "له امتداد", da: "har omfang", de: "hat Umfang", fi: "aineiston laajuus", nl: "heeft omvang"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60551,
      definition: {en: "Relates a resource to a number of bytes in a digital file.", ar: "يربط بين مصدر وعدد البايتات في ملف رقمي.", da: "Relaterer en ressource til antal bytes i en digital fil.", de: "Setzt eine Ressource in Beziehung zu einer Anzahl der Bytes in einer Datei.", fi: "Liittää aineiston digitaalisen tiedoston tavumäärään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/fileSize.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has file size", ar: "له حجم ملف", da: "har filstørrelse", de: "hat Dateigröße", fi: "aineiston tiedoston koko", nl: "heeft bestandsgrootte"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60350",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60552,
      definition: {en: "Relates a resource to a number of sound channels used to make a recording.", ar: "يربط بين مصدر ورقم قنوات الصوت المستخدمة في تسجيل.", da: "Relaterer en ressource til et antal lydkanaler, der blev anvendt til at lave en indspilning.", de: "Setzt eine Ressource in Beziehung zu einer Anzahl von Tonkanälen, die für die Wiedergabe einer Aufnahme verwendet werden.", fi: "Liittää aineiston äänityksessä käytettyjen äänikanavien määrään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/configurationOfPlaybackChannels.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has configuration of playback channels", ar: "له إعدادات قنوات التشغيل", da: "har konfiguration af afspilningskanaler", de: "hat Konfiguration von Wiedergabekanälen", fi: "toistokanavien määrä aineistossa", nl: "heeft configuratie van afspeelkanalen"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60351",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60553,
