      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/tapeConfiguration.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has tape configuration", ar: "له بنية شريط", da: "har båndkonfiguration", de: "hat Bandkonfiguration", fi: "ääninauhan ääniraitojen määrä aineistossa", nl: "heeft bandconfiguratie"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60351",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60554,
      definition: {en: "Relates a resource to a physical material used for the support or backing to which the base material of a resource is attached.", ar: "يربط بين مصدر ومادة مادية تُستخدم في التدعيم أو السند لمادة القاعدة التي يكون المصدر ملصق بها.", da: "Relaterer en ressource til et fysisk materiale, der udgør den støtte eller bagbeklædning, som en ressources basismateriale er fastgjort på.", de: "Setzt eine Ressource in Beziehung zu einem physischen Material, das für die Halterung oder die Stütze verwendet wird, an dem das Trägermaterial einer Ressource angebracht ist.", fi: "Liittää aineiston materiaaliin, johon aineiston pohjamateriaali kiinnitetään aineiston tukemiseksi tai kannattamiseksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mount.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has mount", ar: "له حامل", da: "har montage / ramme", de: "hat Halterung", fi: "aineiston tukimateriaali", nl: "heeft ondersteuning"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60555,
      definition: {en: "Relates a resource to a place, date, or other information that is associated with the recording, filming, or other method of obtaining the content of a resource.", ar: "يربط بين مصدر ومكان، تاريخ، أو أية معلومات أخرى مرتبطة بتسجيل، تصوير، إلخ.، محتوى مصدر.", da: "Relaterer en ressource til et sted og år eller dato, hvor et udtryks indhold blev optaget, indspillet etc.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, einem Datum oder anderen Informationen, das/die mit der Aufnahme, dem Filmen und so weiter des Inhalts einer Ressource in Verbindung steht/stehen. ", fi: "Liittää aineiston paikkaan, päivämäärään tai muuhun informaatioon, joka liittyy aineiston sisällön äänittämiseen, filmaamiseen tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/captureInformation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has capture information", ar: "له معلومات مُلتقطة", da: "har sted, år eller dato for optagelse", de: "hat Information zur Aufzeichnung", fi: "tallennusinformaatio aineistosta", nl: "heeft vastleginformatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60556,
      definition: {en: "Relates a resource to a place associated with recording, filming, etc., the content of a resource.", ar: "يربط بين مصدر ومكان مرتبط بتسجيل، تصوير، إلخ.، محتوى مصدر.", da: "Relaterer en ressource til et sted, hvor et udtryks indhold, optagelse, indspilning etc., blev optaget.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, das mit der Aufnahme, dem Filmen und so weiter des Inhalts einer Ressource in Verbindung steht.", fi: "Liittää aineiston paikkaan, joka liitty aineiston sisällön äänittämiseen, filmaamiseen tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfCapture.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60966",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has place of capture", ar: "له مكان التقاط", da: "har optagelsessted", de: "ist Aufzeichnungsort", fi: "aineiston tallennuspaikka", nl: "heeft plaats van vastleggen"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61014",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60557,
      definition: {en: "Relates a resource to an extent of resource that is a playing time, performance time, running time, or other length of time.", ar: "يربط بين مصدر ومدى مصدر يمثل وقت التشغيل، وقت الأداء، مدة العرض، أو فترة زمنية أخرى.", da: "Relaterer en ressource til varighed, spilletid, opførelsestid, etc. for en ressources indhold.", de: "Setzt eine Ressource in Beziehung zum Umfang einer Ressource, bei dem es sich um eine Wiedergabezeit, eine Aufführungszeit, eine Laufzeit oder eine andere Zeitspanne handelt.", fi: "Liittää aineiston aineiston laajuuteen, joka on soittoaika, esitysaika, toistoaika tai muu ajan pituus."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/duration.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61109",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has duration", ar: "له مُدة", da: "har spilletid", de: "hat Dauer", fi: "aineiston kesto", nl: "heeft tijdsduur"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60558,
      definition: {en: "Relates a resource to an indication of the presence of colour or tone in a resource.", ar: "يربط بين مصدر ومؤشر وجود اللون أو درجة اللون في مصدر.", da: "Relaterer en ressource til en tilstedeværelse af farve, nuance etc. i en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einer Angabe über das Vorhandensein von Farbe oder Tönung in einer Ressource.", fi: "Liittää aineiston aineistoon sisältyvän värin tai sävyn ilmaukseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/colourContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Black, white, single colour shades of black, single colour tints of white, and single colour tones of gray are considered to be single colours. Colour content applies to a resource with a content type of \"cartographic image\", \"cartographic moving image\", \"cartographic three-dimensional form\", \"notated movement\", \"notated music\", \"performed movement\", \"still image\", \"text\", \"three-dimensional moving image\", \"three-dimensional form\", or \"two-dimensional moving image\".", ar: "تعتبر الألوان التالية: الأسود، الأبيض، تدرجات أحادية اللون من الأسود، صبغات أحادية اللون من الأبيض، ودرجات أحادية اللون من الرمادي من الألوان الفردية. ينطبق محتوى اللون على مصدر له نوع محتوى من \"صورة خرائطية\"، \"صورة متحركة خرائطية\"، \"شكل خرائطي ثلاثي الأبعاد\"، \"حركة مدونة\"، \"موسيقى مدونة\"، \"حركة مؤداة\"، \"صورة ثابتة\"، \"نص\"، \"صورة متحركة ثُلاثية الأبعاد\"، \"شكل ثلاثي الأبعاد\"، أو \"صورة متحركة ثنائية الأبعاد\"", da: "Sort, hvid, enkeltfarvede skygger af sort, enkeltfarvede nuancer af hvidt og enkeltfarvede toner af gråt anses for at være enkelte farver.", de: "Schwarz, Weiß, einfarbige Schwarztöne, einfarbige Weißtönungen und einfarbige Grauschattierungen werden als einfarbig angesehen. Farbinhalt gibt es in einer Ressource mit dem Inhaltstyp \u0084kartografisches Bild\u0093, \u0084kartografisches Bewegtbild\u0093, \u0084kartografische dreidimensionale Form\u0093, \u0084Bewegtnotation\u0093, \u0084Noten\u0093, \u0084aufgeführte Bewegung\u0093, \u0084unbewegtes Bild\u0093, \u0084Text\u0093, \u0084dreidimensionales Bewegtbild\u0093, \u0084dreidimensionale Form\u0093 oder \u0084zweidimensionales Bewegtbild\u0093.", fi: "Musta, valkoinen, yksiväriset mustan sävyt, yksiväriset valkoisen sävyt ja yksiväriset harmaan sävyt lasketaan yksivärisiksi. Värisisältöä sovelletaan aineistoon jonka sisältötyypin arvo on \"kartografinen kuva\", \"kartografinen liikkuva kuva\", \"kartografinen kolmiulotteinen muoto\", \"liikenotaatio\", \"nuottiaineisto\", \"esitetty liike\", \"stillkuva\", \"teksti\", \" kolmiulotteinen liikkuva kuva\", \"kolmiulotteinen muoto\" tai \"kaksiulotteinen liikkuva kuva\"."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has colour content", ar: "له محتوى ملون", da: "har farveindhold", de: "hat Farbinhalt", fi: "aineiston värisisältö", nl: "heeft kleurcontent"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60559,
      definition: {en: "Relates a resource to an indication of the presence or absence of sound embodied by a resource.", ar: "يربط بين مصدر وإشارة إلى وجود أو عدم وجود صوت متجسد في مصدر.", da: "Relaterer en ressource til en tilstedeværelse eller fravær af lyd i en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Angabe über das Vorhandensein beziehungsweise Nichtvorhandensein von Ton, der durch eine Ressource verkörpert wird.", fi: "Liittää aineiston ilmaukseen aineiston sisältämän äänen mukanaolosta tai puuttumisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/soundContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Sound content is present in an resource with a content type of \"recorded music\", \"sounds\", or \"spoken word.\"", ar: "محتوى صوت متواجد في مصدر له نوع محتوى من \"موسيقى مُسجلة\"، \" أصوات\"، أو \"كلمة منطوقة\".", da: "Lydindhold findes i en ressource med indholdstype \"indspillet musik\", \"lyd\", eller \"talet ord\".", de: "Toninhalte gibt es in einer Ressource mit dem Inhaltstyp \u0084aufgeführte Musik\u0093, \u0084Töne\u0093 oder \u0084gesprochene Worte\u0093.", fi: "Äänisisältö ilmaistaan aineistossa sisältötyypin arvolla \"esitetty musiikki\", \"ääni\" tai \"puhe\"."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has sound content", ar: "له محتوى صوت", da: "har lydindhold", de: "hat Toninhalt", fi: "aineiston äänisisältö", nl: "heeft geluidscontent"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60560,
      definition: {en: "Relates a resource to a process that is used to produce a resource.", ar: "يربط بين مصدر وعملية مستخدمة في إنتاج مصدر.", da: "Relaterer en ressource til en proces anvendt til at fremstille en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Verfahren, das angewendet wird, um eine Ressource zu erzeugen.", fi: "Liittää aineiston aineiston tuottamisessa käytettävään menetelmään."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60561", "http://rdaregistry.info/Elements/u/P60562"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionMethod.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has production method", ar: "له طريقة إنتاج", da: "har produktionsmetode", de: "hat Entstehungsmethode", fi: "aineiston valmistusmenetelmä", nl: "heeft productiemethode"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60561,
      definition: {en: "Relates a resource to the process used to produce a tactile resource (e.g., embossing, thermoform).. (Deprecated)"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionMethodForTactileResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has production method for tactile resource (Deprecated)"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60560",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60562,
      definition: {en: "Relates a resource to the process used to produce an original manuscript or a copy.. (Deprecated)"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionMethodForManuscript.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has production method for manuscript (Deprecated)"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60560",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60563,
      definition: {en: "Relates a resource to a ratio of horizontal distances in the cartographic content of a resource to the actual distances they represent.", ar: "يربط بين مصدر ونسبة المسافات الأفقية في محتوى رسم خرائطي لمصدر بالمسافات الفعلية التي يمثلها.", da: "Relaterer en ressource til et forhold mellem horisontale afstande i et udtryks kartografiske indhold og de virkelige afstande, de repræsenterer.", de: "Setzt eine Ressource in Beziehung zu einem Verhältnis der horizontalen Entfernungen bei kartografischem Inhalt einer Ressource zu den tatsächlichen Entfernungen, die sie repräsentieren.", fi: "Liittää aineiston kartografisen sisällön horisontaalisten etäisyyksien suhteeseen niiden esittämiin todellisiin mittoihin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/horizontalScaleOfCartographicContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has horizontal scale of cartographic content", ar: "له مقياس أفقي لمحتوى رسم خرائطي", da: "har horisontal målestok for kartografisk indhold", de: "hat horizontalen Maßstab bei kartografischem Inhalt", fi: "kartografisen sisällön horisontaalinen mittakaava aineistossa", nl: "heeft horizontale schaal van cartografische content"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60565",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60564,
      definition: {en: "Relates a resource to a ratio of the dimensions of a still image or three-dimensional form embodied by a resource to the dimensions of the thing it represents.", ar: "يربط بين مصدر ونسبة أبعاد صورة ثابتة أو شكل ثلاثي الأبعاد يجسده مصدر بأبعاد الشيء الذي يمثله.", da: "Relaterer en ressource til et forhold mellem et fast billede eller en tredimensionel form i et udtryk og dimensionerne for den ting, billedet eller formen repræsenterer.", de: "Setzt eine Ressource in Beziehung zu einem Verhältnis der Maße eines unbewegten Bilds oder einer dreidimensionalen Form, das/die in einer Ressource verkörpert wird, zu den Maßen der Sache, die es/sie repräsentiert.", fi: "Liittää aineiston suhteeseen, joka on stillkuvan tai kolmiulotteisen muodon mittojen suhde esitetyn kohteen mittoihin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/scaleOfStillImageOrThreeDimensionalForm.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
