      subPropertyOf: "http://rdaregistry.info/Elements/u/P60565",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60565,
      definition: {en: "Relates a resource to a ratio of the dimensions of an image or three-dimensional form to the dimensions of the thing that is represented.", ar: "يربط بين مصدر ونسبة أبعاد صورة أو شكل ثلاثي الأبعاد بأبعاد الشيء الذي يتم تمثيله.", da: "Relaterer en ressource til et forhold mellem et billede eller en tredimensionel form og dimensionerne for den ting, billedet eller formen repræsenterer.", de: "Setzt eine Ressource in Beziehung zu einem Verhältnis der Maße eines Bilds oder einer dreidimensionalen Form zu den Maßen der Sache, die es/sie repräsentiert.", fi: "Liittää aineiston kuvan tai kolmiulotteisen muodon aineiston mittojen suhteeseen sen esittämän kohteen mittoihin."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60510", "http://rdaregistry.info/Elements/u/P60563", "http://rdaregistry.info/Elements/u/P60564", "http://rdaregistry.info/Elements/u/P60579"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/scale.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Scale can apply to horizontal, vertical, angular, and/or other measurements represented in the resource.", ar: "يمكن تطبيق المقياس على القياسات الأفقية والرأسية والزاوية و / أو غيرها من القياسات الممثلة في المصدر.", da: "Målestoksforhold kan gælde for horisontale, vertikale, kantede og/eller andre mål repræsenterede i en ressource.", de: "Ein Maßstab kann auf horizontale, vertikale, winklige und/oder andere Maße angewendet werden, die in einer Ressource repräsentiert sind.", fi: "Mittakaava voi koskea aineistossa esitettyjä horisontaalisia, vertikaalisia, kulma- tai muita mittoja."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has scale", ar: "له مقياس", da: "har målestoksforhold", de: "hat Maßstab", fi: "aineiston mittakaava", nl: "heeft schaal"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60566,
      definition: {en: "Relates a resource to a numerical ratio of the width to the height of a moving image.", ar: "يربط بين مصدر ونسبة عددية من العرض إلى ارتفاع لصورة متحركة.", da: "Relaterer en ressource til et numerisk forhold mellem bredde og højde i et levende billede.", de: "Setzt eine Ressource in Beziehung zu einem Zahlenverhältnis von der Breite zur Höhe einer Bewegtbildressource.", fi: "Liittää aineiston liikkuvan kuvan leveyden ja korkeuden väliseen numeeriseen suhteeseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/aspectRatio.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
