      subPropertyOf: "http://rdaregistry.info/Elements/u/P60568",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60568,
      definition: {en: "Relates a resource to a relationship between an original carrier and a carrier of a reproduction that is made from the original.", ar: "يربط بين مصدر وعلاقة بين حامل أصلي والحامل الخاص بإعادة الإنتاج المصنوع من الأصل.", da: "Relaterer en ressource til et forhold mellem en oprindelig bærere og bæreren af en reproduktion baseret på originalen.", de: "Setzt eine Ressource in Beziehung zu einer Beziehung zwischen einem Originaldatenträger und dem Datenträger einer Reproduktion, die vom Original erstellt wird.", fi: "Liittää aineiston alkuperäisen tallenteen ja siitä tuotetun jäljenteen tallenteen väliseen suhteeseen."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60567", "http://rdaregistry.info/Elements/u/P60569", "http://rdaregistry.info/Elements/u/P60570", "http://rdaregistry.info/Elements/u/P60571", "http://rdaregistry.info/Elements/u/P60572"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/generation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
