    property :P60573,
      definition: {en: "Relates a resource to a relationship of the colours and tones in an image to the colours and tones of the object reproduced.", ar: "يربط بين مصدر وعلاقة خاصة بالألوان ودرجات الألوان في صورة ما بألوان ودرجات شيء/لون معاد إنتاجه.", da: "Relaterer en ressource til et forhold mellem farver og nuancer i et billede og farver og nuancer i den reproducerede genstand.", de: "Setzt eine Ressource in Beziehung zum Verhältnis der Farben und Tönungen in einem Bild zu den Farben und Tönungen des reproduzierten Objekts.", fi: "Liittää aineiston suhteeseen, joka kuvan väreillä ja valoisuudella on kuvan kohteen väreihin ja valoisuuteen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/polarity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has polarity", ar: "له استقطاب ألوان", da: "har polaritet", de: "hat Polarität", fi: "polariteetti aineistossa", nl: "heeft polariteit"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60574,
      definition: {en: "Relates a resource to a resource whose content is incorporated in the content of another resource.", ar: "يربط بين مصدر ومصدر يكون محتواه مدمجًا في محتوى مصدر آخر.", da: "Relaterer en ressource til en ressource, der er blevet inkorporeret i en anden ressource.", de: "Setzt ein Ressource in Beziehung zu einer Ressource, deren Inhalt in den Inhalt einer anderen Ressource eingeflossen ist.", fi: "Liittää aineiston aineistoon, jonka sisältö on yhdistynyt toisen aineiston sisältöön."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/absorptionOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60247",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is absorption of", ar: "هو احتواء لـ", da: "er absorbering af", de: "ist darin aufgegangen", fi: "sulautunut aineisto", nl: "is opname van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60261",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60575,
      definition: {en: "Relates a resource to a resource whose partial content is incorporated in the content of another resource.", ar: "يربط بين مصدر ومصدر يكون محتواه الجزئي مدمجًا في محتوى مصدر آخر.", da: "Relaterer en ressource til en ressource, der er delvis inkorporeret i en anden ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, deren Inhalt teilweise in den Inhalt einer anderen Ressource eingeflossen ist.", fi: "Liittää aineiston aineistoon, jonka osittainen sisältö on yhdistynyt toisen aineiston sisältöön."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/absorptionInPartOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60248",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is absorption in part of", ar: "هو احتواء في جزء لـ", da: "er delvis absorbering af", de: "ist teilweise darin aufgegangen", fi: "osittain sulautunut aineisto", nl: "is gedeeltelijke opname van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60261",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60576,
      definition: {en: "Relates a resource to a resource that is a diachronic resource that is completed whose content is continued by another diachronic resource.", ar: "يربط بين مصدر ومصدر ممتد زمنيًا ومكتمل، ومحتواه مستمر من خلال مصدر آخر ممتد زمنيًا.", da: "Relaterer en ressource til en ressource, der fortsættes af en senere ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einer abgeschlossenen diachronen Ressource, deren Inhalt durch eine andere diachrone Ressource fortgeführt wird.", fi: "Liittää aineiston aineistoon, joka on valmis diakroninen aineisto, jonka sisältöä jatkaa toinen diakroninen aineisto."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/continuationOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "This element applies in general to a successive resource.", ar: "ينطبق هذا العنصر بشكل عام على مصدر متتالي.", da: "Denne relation anvends generelt for periodika.", de: "Im Allgemeinen trifft dieses Element auf eine sukzessive Ressource zu.", fi: "Tämä elementti soveltuu yleensä peräkkäisesti ilmestyvään aineistoon."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60306",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is continuation of", ar: "هو استمرار لـ", da: "er fortsættelse af", de: "ist Fortsetzung von", fi: "jatkoa aineistolle", nl: "is voortzetting van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60261",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60577,
      definition: {en: "Relates a resource to a resource whose narrative is continued by a later resource.. (Deprecated)", da: "Relaterer en ressource til en ressource, hvis fortælling fortsættes af en senere ressource."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/sequelTo.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60102",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is sequel to (Deprecated)", da: "er efterfølger til"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60261",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60578,
      definition: {en: "Relates a resource to a proportional relationship between a whole sheet in a printed or manuscript resource, and the individual leaves that result if that sheet is left full, cut, or folded.", ar: "يربط بين مصدر وعلاقة نسبية بين ورقة كاملة في مصدر مطبوع أو مخطوط، والأوراق الفردية التي تنتج إذا تركت الورقة كاملة، أو مقطوعة، أو مطوية.", da: "Relaterer en ressource til detaljer om resultatet af at folde et trykt ark, så der dannes en samling af blade.", de: "Setzt eine Ressource in Beziehung zu einem proportionalen Verhältnis zwischen einem ganzen Bogen in einer gedruckten oder handschriftlichen Ressource und den einzelnen Blättern, die resultieren, wenn der Bogen im Ganzen gelassen, geschnitten oder gefaltet wird.", fi: "Liittää aineiston painetussa tai käsikirjoitusaineistossa kokonaisen arkin ja yksittäisten lehtien väliseen kokosuhteeseen, joka riippuu siitä, onko arkki kokonainen, leikattu tai taitettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/bibliographicFormat.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has bibliographic format", ar: "له شكل ببليوجرافي", da: "har bibliografisk format", de: "hat bibliografisches Format", fi: "aineiston bibliografinen koko", nl: "heeft boekformaat"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60579,
      definition: {en: "Relates a resource to a scale of elevation or vertical dimension of the cartographic content of a resource.", ar: "يربط بين مصدر ومقياس ارتفاع أو بُعد عَمُودِي لمحتوى رسم خرائطي لمصدر ما.", da: "Relaterer en ressource til en koteskala eller skala for vertikal dimension for en ressources kartografiske indhold.", de: "Setzt eine Ressource in Beziehung zu einem Maßstab der Höhe oder einem vertikalen Maß von kartografischem Inhalt einer Ressource.", fi: "Liittää aineiston kartografisen sisällön esittämään korkeuden tai vertikaalisen ulottuvuuden mittakaavaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/verticalScaleOfCartographicContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has vertical scale of cartographic content", ar: "له مقياس عَمُودِي لمحتوى رسم خرائطي", da: "har vertikal skala for kartografisk indhold", de: "hat vertikalen Maßstab bei kartografischem Inhalt", fi: "aineiston kartografisen sisällön vertikaalinen mittakaava", nl: "heeft verticale schaal van cartografische content"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60565",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60580,
      definition: {en: "Relates a resource to a set of pitch relationships that establishes the tonal centre, or principal tonal centre, used, or intended to be used, for performance of musical content of a resource.", ar: "يربط بين مصدر ومجموعة من علاقات النغمات التي تؤسس مركز النغمات أو مركز النغمات الرئيسي المستخدم أو المزمع استخدامه لأداء المحتوى الموسيقي لمصدر ما.", da: "Relaterer en ressource til et sæt af tonehøjdeforhold, der fastlægger et musikressources tonale eller væsentligste tonale centrum.", de: "Setzt eine Ressource in Beziehung zu einem Satz an Tonhöhenbeziehungen, der das tonale Zentrum oder das hauptsächliche tonale Zentrum begründet, das für eine Darbietung eines musikalischen Inhalts einer Ressource verwendet wird oder verwendet werden soll.", fi: "Liittää aineiston sävelsuhteiden joukkoon, johon aineiston musiikillisen sisällön esityksessä käytetty tai käytettäväksi tarkoitettu tonaalinen keskus tai pääasiallinen tonaalinen keskus perustuu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/key.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has key", ar: "له مُفتاح", da: "har toneart", de: "hat Tonart", fi: "aineiston sävellaji", nl: "heeft toonsoort"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60581,
      definition: {en: "Relates a resource to a numerical ratio of the size of a micro-image in relation to an original from which it was produced.", ar: "يربط بين مصدر ونسبة عددية لحجم صورة مصغرة بالنسبة للأصل الذي انتجت منه.", da: "Relaterer en ressource til et numerisk forhold for størrelsen på et mikrobillede i forhold til den original, som det er fremstillet ud fra.", de: "Setzt eine Ressource in Beziehung zu einem Zahlenverhältnis zwischen der Größe eines Mikro-Bilds im Verhältnis zu dem Original, von dem es hergestellt wird.", fi: "Liittää aineiston numeeriseen suhdelukuun, joka ilmaisee mikrokokoiseksi pienennetyn kuvan suhteen alkuperäiseen kuvaan, josta pienennetty kuva on tuotettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/reductionRatio.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has reduction ratio", ar: "له معدل تصغير", da: "har reduktionsforhold", de: "hat Verkleinerungsfaktor", fi: "pienennyssuhde aineistossa", nl: "heeft verkleiningsfactor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60582,
      definition: {en: "Relates a resource to a size of the type that is used to represent the characters and symbols in a resource.", ar: "يربط بين مصدر وحجم الخط المستخدم في تمثيل التمثيلات والرموز في مصدر.", da: "Relaterer en ressource til en størrelse på den skrifttype, der er anvendt til at repræsentere tegn og symboler i en ressource.", de: "Setzt eine Ressource in Beziehung zu den Details zur Größe der Schrift, die zur Repräsentation der Zeichen und Symbole in einer Ressource verwendet wird.", fi: "Liittää aineiston aineiston merkeissä ja symboleissa käytettävään kirjasimen kokoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/fontSize.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has font size", ar: "له حجم خط", da: "har skriftstørrelse", de: "hat Schriftgröße", fi: "kirjasinkoko aineistossa", nl: "heeft lettergrootte"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60583,
      definition: {en: "Relates a resource to the circumstances under which a resource is directly acquired, including a method, source, and date of acquisition.", ar: "يربط بين مصدر والظروف التي تم فيها اقتناء مصدر بصورة مباشرة، ويشمل ذلك طريقة الاقتناء، مصدره، تاريخه.", da: "Relaterer en ressource til en kilde, hvorfra institutionen har anskaffet en ressource, samt de omstændigheder under hvilke det blev modtaget.", de: "Setzt eine Ressource in Beziehung zu den Umständen, unter denen eine Ressource direkt erworben wird. Darunter fallen Erwerbungsmethoden, Erwerbungsquellen und Erwerbungsdaten.", fi: "Liittää aineiston aineiston hankintaolosuhteisiin, kuten hankintatapaan, -lähteeseen ja -ajankohtaan."},
