    property :P60601,
      definition: {en: "Relates an agent to a legal resource of a higher court that records a decision of a lower court that appeals against an agent.", ar: "يربط بين وكيل ومصدر قانوني لمحكمة أعلى تُقر حكمًا صادرًا عن محكمة أدنى يُستأنف ضد وكيل.", da: "Relaterer en agent mod hvem der er gjort indsigelse over en underrets beslutning, der er registreret i en juridisk ressource fra en højere retsinstans til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer juristischen Ressource einer höheren Instanz, das ein Gerichtsurteil festhält, bei dem gegen einen Akteur Rechtsmittel gegen ein Gerichtsurteil einer unteren Instanz eingelegt werden.", fi: "Liittää toimijan ylemmän oikeusasteen aineistoon, johon sisältyy toimijan alemmasta oikeusasteesta saama langettava päätös."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/appelleeOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60373",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is appellee of", ar: "له مُستأنف ضده", da: "er indstævnet af", de: "ist Berufungsbeklagte/Berufungsbeklagter/Revisionsbeklagte/Revisionsbeklagter von", fi: "muutoksenhakijan (toimijan) vastapuoli", nl: "is gedaagde van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60602,
      definition: {en: "Relates an agent to a resource that involves a responsibility other than creating, having custody, owning, producing, publishing, distributing, or manufacturing. (Deprecated)", da: "Relaterer en agent, der er forbundet med en ressource på en anden måde end som ophav til en ressource."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60002", "http://rdaregistry.info/Elements/u/P60003", "http://rdaregistry.info/Elements/u/P60004", "http://rdaregistry.info/Elements/u/P60005", "http://rdaregistry.info/Elements/u/P60032", "http://rdaregistry.info/Elements/u/P60601", "http://rdaregistry.info/Elements/u/P60603", "http://rdaregistry.info/Elements/u/P60604", "http://rdaregistry.info/Elements/u/P60634", "http://rdaregistry.info/Elements/u/P60650", "http://rdaregistry.info/Elements/u/P60668", "http://rdaregistry.info/Elements/u/P60673", "http://rdaregistry.info/Elements/u/P60674", "http://rdaregistry.info/Elements/u/P60675", "http://rdaregistry.info/Elements/u/P60678", "http://rdaregistry.info/Elements/u/P60689", "http://rdaregistry.info/Elements/u/P60690", "http://rdaregistry.info/Elements/u/P60691", "http://rdaregistry.info/Elements/u/P60692", "http://rdaregistry.info/Elements/u/P60693", "http://rdaregistry.info/Elements/u/P60695", "http://rdaregistry.info/Elements/u/P60696", "http://rdaregistry.info/Elements/u/P60698", "http://rdaregistry.info/Elements/u/P60700", "http://rdaregistry.info/Elements/u/P60702", "http://rdaregistry.info/Elements/u/P60703", "http://rdaregistry.info/Elements/u/P60816", "http://rdaregistry.info/Elements/u/P60835", "http://rdaregistry.info/Elements/u/P60837", "http://rdaregistry.info/Elements/u/P60850", "http://rdaregistry.info/Elements/u/P60870", "http://rdaregistry.info/Elements/u/P60872"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/otherAgentAssociatedWithResourceOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60374",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is other agent associated with resource of (Deprecated)", da: "er anden agent forbundet med ressource"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60603,
      definition: {en: "Relates an agent to a resource that is assigned as an acknowledgement of the inspiration or support of a related agent.", ar: "يربط بين وكيل ومصدر تم تعيينه باعتباره إقرارًا بإلهام أو دعم وكيل ذي صلة.", da: "Relaterer en agent, som har tilegnet en ressource til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die als Zeichen der Anerkennung oder Unterstützung einem in Beziehung stehenden Akteur gewidmet ist.", fi: "Liittää toimijan aineistoon, joka on omistettu liittyvälle toimijalle kiitoksena inspiraatiosta tai tuesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dedicatorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60375",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is dedicator of", ar: "هو مُهدي كتاب", da: "er tilegner af", de: "ist Widmende/Widmender von", fi: "omistuskirjoitus aineistossa", nl: "is opdrager van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60604,
      definition: {en: "Relates an agent to a resource that is aggregated or organized in an exhibition or collection. (Deprecated)", ar: "يربط بين وكيل ومصدر تم تجميعه أو تنظيمه في معرض أو مجموعة.", da: "Relaterer en agent der har udtænkt, samlet og/eller arrangeret en udstilling, samling eller et andet eksemplar til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die in einer Ausstellung oder Sammlung aggregiert oder organisiert ist.", fi: "Liittää toimijan aineistoon, joka on koottu tai järjestetty näyttelyksi tai kokoelmaksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/curatorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60376",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is curator of (Deprecated)", ar: "هو أَمِين معرض لـ", da: "er kurator af", de: "ist Kuratorin/Kurator von", fi: "kuraattori aineistossa", nl: "is curator van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60605,
      definition: {en: "Relates an agent to a cartographic resource that incorporates a contribution by an agent of providing measurements or dimensional relationships for a geographic area that is represented.", ar: "يربط بين وكيل ومصدر رسم خرائطي يتضمن إسهام وكيل بتقديم القياسات أوالعلاقات بين الأبعاد لمنطقة جغرافية يتم تمثيلها.", da: "Relaterer en agent, der har bidraget til en kartografisk ressource ved at sørge for opmålinger eller målestoksforhold til et repræsenteret geografisk område til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer kartografischen Ressource, zu der ein Akteur beiträgt, indem er Messwerte oder Abmessungsverhältnisse für einen dargestellten geografischen Bereich zur Verfügung stellt.", fi: "Liittää toimijan kartografiseen aineistoon, jossa toimija on osallisena maantieteellisen alueen mittojen tai mittasuhteiden tuottamisessa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/surveyorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60377",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is surveyor of", ar: "هو مسّاح لـ", da: "er landmåler i", de: "ist Landvermesserin/Landvermesser von", fi: "maanmittari (toimija) aineistossa", nl: "is landmeter van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60606,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of giving apparent movement to inanimate objects or drawings.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل لإعطاء حركة واضحة لكائنات غير حية أو رسومات.", da: "Relaterer en agent der der har bidraget til en levende billed-ressource eller et computerprogram ved at give en illusion af bevægelse til livløse genstande eller tegninger til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er unbelebte Objekte oder Zeichnungen in scheinbare Bewegung versetzt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena tuottamalla näennäistä liikettä elottomiin esineisiin tai piirroksiin."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60660",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/animatorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Creation of the drawings that are animated is excluded.", ar: "يُستبعد إنشاء الرسومات المتحركة.", da: "Skabelse af de tegninger der er animeret er ikke omfattet.", de: "Darunter fällt nicht die Schaffung der Zeichnungen, die animiert werden.", fi: "Ei koske animaatiopiirrosten tekijää."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60378",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is animator of", ar: "هو فنان رسوم متحركة لـ", da: "er animator til", de: "ist Trickfilmzeichnerin/Trickfilmzeichner von", fi: "animaattori (toimija) aineistossa", nl: "is animator van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60607,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of rewriting a musical composition for a medium of performance different from that for which the resource was originally intended.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في إعادة كتابة لحن موسيقي لوسيط أداء يختلف عن الوسيط الذي كان العمل مقررا له أصلاً.", da: "Relaterer en agent der har bidraget til en musikressource ved at omskrive kompositionen til en anden besætning end den, ressourcen oprindeligt var beregnet til til et ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er eine Komposition für eine bestimmte Besetzung umschreibt, die sich von der Originalbesetzung unterscheidet, für die die Ressource ursprünglich konzipiert war.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena muokkaamalla sävellyksen alkuperäisteoksesta poikkeavalle esityskokoonpanolle."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60655",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/arrangerOfMusicOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60379",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is arranger of music of", ar: "هو موزع موسيقي لـ", da: "er musikarrangør af", de: "ist Arrangeurin/Arrangeur von", fi: "sovittaja (toimija) aineistossa", nl: "is arrangeur van muziek van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60608,
      definition: {en: "Relates an agent to a resource that includes a contribution of adding text, such as captions for photographs or descriptions of maps. (Deprecated)", da: "Relaterer en agent der har bidraget til et udtryk af en fortrinsvisikke-tekstlig ressource ved at sørge for tekst til den ikke-tekstlige ressource til en ressource."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60600",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/writerOfAddedTextOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60380",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is writer of added text of (Deprecated)", da: "er forfatter til tilføjet tekst til"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60620",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60609,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of making detailed plans or drawings for buildings, ships, aircraft, machines, objects, etc.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في وضع خطط أو رسومات مفصلة للمباني، السفن، الطائرات، الآلات، والأشياء، إلخ.", da: "Relaterer en agent, der har bidraget til en ressource af en arkitekt, opfinder etc. ved at lave detaljerede planer eller tegninger til bygninger, skibe, luftfartøjer, maskiner, genstande etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er detaillierte Pläne oder Zeichnungen für Gebäude, Schiffe, Flugzeuge, Maschinen, Objekte oder ähnliches erstellt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena tuottamalla tarkkoja suunnitelmia tai piirroksia rakennuksista, laivoista, lentokoneista, laitteista, esineistä tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/draftsmanOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60381",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is draftsman of", ar: "هو رسام هندسي لـ", da: "er teknisk tegner af", de: "ist technische Zeichnerin/technischer Zeichner von", fi: "piirtäjä (toimija) aineistossa", nl: "is technisch tekenaar van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60610,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of writing down or notating previously unwritten or unnotated content, or by changing it from one system of notation to another.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في كتابة أو تدوين محتوى لم يسبق كتابته أو تدوينه، أو عن طريق تغييره من نظام تدوين إلى آخر.", da: "Relaterer en agent, der har bidraget til en ressource ved at nedskrive eller notere uskrevet eller ikke-noteret indhold, eller ved at ændre det fra et notationssystem til et andet til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er ungeschriebenen und nicht notierten Inhalt niederschreibt oder ihn von einem Notationssystem in ein anderes überträgt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena kirjoittamalla muistiin tai nuotintamalla aiemmin kirjoittamattoman tai nuotintamattoman sisällön tai muuttamalla sen nuotinnusjärjestelmästä toiseen."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60607",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/transcriberOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Transcription of a musical resource for a different instrument or performing group is excluded.", ar: "يُستبعد نسخ مصدر موسيقي لآلة أو مجموعة أداء مختلفة.", da: "Afskrift af en musikressource for et andet instrument eller optrædende gruppe er ikke omfattet.", de: "Darunter fällt keine Transkription einer Musikressource für ein anderes Instrument oder ein anderes aufführendes Ensemble.", fi: "Tähän ei kuulu musiikkiteoksen transkribointi eri soittimelle tai esitysryhmälle."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60382",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is transcriber of", ar: "هو ناسخ لـ", da: "er afskriver af", de: "ist Transkribiererin/Transkribierer von", fi: "transkriboija (toimija) aineistossa", nl: "is transcribeerder van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60611,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of coordinating the activities of composers, sound editors, and sound mixers for a moving image production or for a musical or dramatic presentation or entertainment.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في تنسيق أنشطة ملحني، محرري، ومازجي الصوت لإنتاج فيلم أو لعرض موسيقي أو درامي أو ترفيهي.", da: "Relaterer en agent, der har bidraget til en ressource ved at koordinere komponistens, tonemesterens og lydmiksernes aktiviteter ved en levende billedproduktion eller en musikalsk eller dramatisk præsentation eller underholdning til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er die Arbeit der Komponistin/des Komponisten, der Tonarbeiterin/des Tonbearbeiters und der Tonmeisterin/des Tonmeisters für eine Bewegtbildproduktion oder eine musikalische oder dramatische Darbietung oder Aufführung koordiniert.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena koordinoimalla säveltäjien, äänileikkaajien ja äänimiksaajien toimintaa elokuvatuotannossa tai musiikki- tai näytelmäesityksessä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/musicalDirectorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60383",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is musical director of", ar: "هو مُدير موسيقي لـ", da: "er musikdirektør for", de: "ist musikalische Leiterin/musikalischer Leiter von", fi: "musiikkijohtaja (toimija) aineistossa", nl: "is muzikaal director van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60612,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of designing costumes for a moving image production or for a musical or dramatic presentation or entertainment.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في تصميم الأزياء لإنتاج صورة متحركة أو لعرض موسيقي أو درامي أو ترفيهي.", da: "Relaterer en agent, der har bidraget til en ressource ved at designe kostumer til en levende billedproduktion eller til en musikalsk eller dramatisk præsentation eller underholdning til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er die Kostüme für eine Bewegtbildproduktion oder für eine musikalische oder dramatische Darbietung oder Aufführung entwirft.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena suunnittelemalla elokuvatuotannon tai musiikki- tai näytelmäesityksen puvustuksen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/costumeDesignerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60384",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is costume designer of", ar: "هو مصمم أزياء لـ", da: "er kostumedesigner til", de: "ist Kostümbildnerin/Kostümbildner von", fi: "puvustaja (toimija) aineistossa", nl: "is kostuumontwerper van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60613,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of expressing the linguistic content of the resourc in a different language.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في التعبير عن المحتوى اللغوي للمصدر بلغة مختلفة.", da: "Relaterer en agent, der har bidraget til en ressource ved at udtrykke værkets sproglige indhold på et andet sprog end det, der er anvendt i tidligere udtryk af en oprindelig ressource til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er den sprachlichen Inhalt der Ressource in einer anderen Sprache ausdrückt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena ilmaisemalla teoksen kielellisen sisällön toisella kielellä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/translatorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Translation of linguistic content between forms of the same language from different time periods is included.", ar: "يتضمن ترجمة المحتوى اللغوي بين أشكال تكون من نفس اللغة من فترات زمنية مختلفة.", da: "En oversætter kan også oversætte sprogligt indhold mellem former af samme sprog fra forskellige tidsperioder.", de: "Darunter fallen Übersetzungen sprachlichen Inhalts zwischen Formen derselben Sprache aus verschiedenen Zeitperioden.", fi: "Kääntäjä voi myös kääntää kielisisältöä saman kielen eri aikakausien kielimuotojen välillä."},
