    property :P60614,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of overseeing artists and craftspeople who build sets for moving image productions.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالإشراف على الفنيين والحرفيين الذين يبنون مواقع لإنتاج الأفلام.", da: "Relaterer en agent, der har bidraget til en ressource ved at føre tilsyn med de kunstnere og håndværkere, der har bygget kulisserne til levende billedproduktioner til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er Künstlerinnen/Künstler und Kunsthandwerkerinnen/Kunsthandwerker betreut, die Sets für Bewegtbildproduktionen aufbauen.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena valvomalla taiteilijoita ja käsityöläisiä, jotka rakentavat lavasteita elokuvatuotantoihin."},
