    property :P60615,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of performing music, acting, dancing, speaking, etc.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في أداء موسيقى، تمثيل، رقص، حوار، إلخ.", da: "Relaterer en agent, der har bidraget til en ressource ved at opføre musik, spille skuespil, danse, tale etc., ofte i en musik- eller dramapræsentation etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er Musik aufführt, schauspielt, tanzt oder spricht und so weiter.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena tanssijana, näyttelijänä, puhujana tai muissa rooleissa, usein musiikillisessa tai draamallisessa esityksessä."},
