    property :P60621,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of revision or clarification of the content, or selection and aggregation of resources, or parts of resources, by one or more creators.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في مراجعة المحتوى أو توضيحه، أو اختيار وتجميع مصادر، أو أجزاء من مصادر، بواسطة واحد أو أكثر من المُنشِئُين.", da: "Relaterer en agent, der har bidraget til en ressource ved at revidere eller præcisere indholdet, fx tilføje en introduktion, noter, eller andet vigtigt materiale til en ressource.", de: "Setzt eine Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er den Inhalt überarbeitet oder erläutert, oder Ressourcen, oder Teile von Ressourcen, von einer geistige Schöpferin/einem geistigen Schöpfer oder mehreren geistigen Schöpferinnen/geistigen Schöpfern auswählt und aggregiert.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena yhden tai useamman toimijan luoman sisällön tarkistamisessa tai selventämisessä tai resurssien tai resurssien osien valinnassa ja yhdistämisessä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/editorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60393",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is editor of", ar: "هو مُحرر لـ", da: "er redaktør af", de: "ist Herausgeberin/Herausgeber von", fi: "toimittaja (toimija) aineistossa", nl: "is redacteur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60622,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of shortening another resource without changing the general meaning or manner of presentation.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في تلخيص مصدرًا آخر دون تغيير المعنى العام أو طريقة العرض.", da: "Relaterer en agent, der har bidraget til en ressource ved at forkorte eller komprimere den oprindelige ressource, men som i alt væsentligt har ladt den oprindelige ressources karakter og indhold være uændret til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er eine andere Ressource kürzt, ohne die allgemeine Bedeutung oder Art der Darstellung zu verändern.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena lyhentämällä siihen liittyvää aineistoa muuttamatta esityksen yleistä sisältöä tai tyyliä."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60663",
