    property :P60623,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of supervising the technical aspects of the audio content of a recording session.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بالإشراف على الجوانب الفنية لمحتوى صوتي لجلسة تسجيل.", da: "Relaterer en lydtekniker, der har bidraget til en ressource ved at føre tilsyn med de tekniske aspekter af en optagelsessession til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er die technischen Aspekte des Audio-Inhalts einer Aufnahme überwacht.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena valvomalla äänityksen teknistä toteutusta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/recordingEngineerOf.en",
