      definition: {en: "Relates an agent to a resource that is an aggregate that embodies a still image resource created by an agent.", ar: "يربط بين وكيل ومصدر عبارة عن تجميعة تجسد مصدر صور ثابتة أنشأه وكيل.", da: "Relaterer en agent, der har bidraget til en ressource ved at supplere hovedindholdet med tegninger, diagrammer, fotos etc.  til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der es sich um ein Aggregat handelt, das eine von einem Akteur erschaffene unbewegte Bildressource verkörpert.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena luomalla aggregaattiin sisältyvän stillkuva-aineiston."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60660",
