      label: {en: "is contributor agent of still image of", ar: "هو وكيل مساهم في صور ثابتة لـ", da: "er illustrator til", de: "ist Akteur als Illustratorin/Illustrator von", fi: "stillkuvaan osallinen (toimija) aineistossatoimija", nl: "is bijdrager-actor van stilstaand beeld van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60625,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of using a recording device to capture sound or video during a recording session, including field recordings of natural sounds, folkloric events, music, or other performances.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في استخدام جهاز تسجيل لالتقاط الصوت أو الفيديو أثناء جلسة تسجيل، بما في ذلك التسجيلات الخارجية للأصوات الطبيعية أو الأحداث الفولكلورية أو الموسيقى أو العروض الأخرى.", da: "Relaterer en agent, der har bidraget til en ressource ved at anvende et optageudstyr til at fange lyd og/eller video under en optagelsessession, inkl. feltoptagelser af naturlige lyde, folkloristiske begivenheder, musik etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er mit einem Aufnamegerät Ton oder Video aufnimmt. Darunter fallen Field Recordings natürlicher Geräusche, folkloristische Events, Musik oder ähnliches.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena käyttämällä tallennuslaitetta äänen tai videon taltioimiseen tallennustilanteessa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/recordistOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60397",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is recordist of", ar: "هو فني تسجيل لـ", da: "er tonemester for", de: "ist Tonmeisterin/Tonmeister von", fi: "taltioija (toimija) aineistossa", nl: "is opnamemaker van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
