      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of general management and supervision of a stage performance.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في الإدارة العامة لأداء مسرحي والإشراف عليه.", da: "Relaterer en agent, der har bidraget til en ressource af et sceneværk gennem den generelle ledelse af og tilsyn med en forestilling til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource einer Bühnendarbietung, zu der ein Akteur durch die allgemeine Betreuung und Leitung beiträgt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena johtamalla ja valvomalla näyttämöesitystä."},
