    property :P60635,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for broadcasting to an audience via radio, television, webcast, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن البث إلى جمهور عبر الإذاعة والتلفزيون والإنترنت، الخ.", da: "Relaterer en agent, der har været involveret i transmission af en ressource til et publikum via radio, tv, webcast etc til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Ausstrahlung über Hörfunk, Fernsehen oder Webcast und so weiter verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa radio-, televisio-, suoratoisto- tms. lähetyksen välittämisestä yleisölle."},
