    property :P60636,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for distribution of a moving image to theatres or other channels.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن توزيع فيلم على قاعات العرض أو عبر قنوات أخرى.", da: "Relaterer en agent, der har været involveret i distribueringen af en levende billed-ressource til biografer eller andre distributionskanaler til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für den Vertrieb eines Bewegtbilds an Kinos oder andere Vertriebskanäle verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa elokuvan tms. aineiston jakelusta elokuvateattereille tai muille jakelukanaville."},
