    property :P60637,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for the entire graphic design of a book, including arrangement of type and illustration, choice of materials, and process used.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن التصميم الجرافيكي لكتاب بالكامل، ويشمل ذلك تنسيق الحروف والإيضاحيات، واختيار المواد، والعمليات المستخدمة.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource ved at være ansvarlig for hele en bogs grafiske design, inkl. opsætning af tekst og illustrationer, materialevalg og anvendt proces til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das gesamte grafische Design eines Buchs, einschließlich Schriftbild, Bildgestaltung, Materialwahl und angewandter Verfahren, verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa kirjan graafisesta suunnittelusta, taitosta, materiaalien valinnasta ja käytettävistä valmistusmenetelmistä."},
