      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60638,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for cutting letters, figures, etc., on a surface such as a wooden or metal plate used for printing.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن نقش الحروف، والأشكال، إلخ.، على سطح مثل لوح خشبي أو معدني يستخدم للطباعة.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource ved at udskære bogstaver, figurer etc. på en overflade såsom en træ- eller metalplade, der har været anvendt til trykning til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das Schneiden von Buchstaben, figürlichen Darstellungen und so weiter in eine Oberfläche, wie zum Beispiel eine Holz- oder Metallplatte, die zum Drucken benutzt wird, verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa kirjainten, kuvioiden tai muiden merkkien painamisessa käytettävälle pinnalle, kuten puu- tai metallipinnalle."},
