    property :P60639,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for embossing braille cells using a stylus, special embossing printer, or other device.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن نقش حروف برايل باستخدام قلم، طابعة خاصة للنقش، أو أي أداة أخرى.", da: "Relater en agent, der har været involveret i fremstillingen af en ressource ved at præge punktskriftsceller vha. en stift, særlig prægeprinter eller anden anordning til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das Prägen von Braillezeichen verantwortlich ist, indem er einen Griffel, einen speziellen Brailledrucker oder ein anderes Gerät verwendet.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa pistekirjoitusmerkkien tuottamisesta piirtimen, erityistulostimen tai muun laitteen avulla"},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/brailleEmbosserOf.en",
