    property :P60641,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for pouring a liquid or molten substance into a mold and leaving it to solidify to take the shape of the mold.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن صب مادة سائلة أو مصهورة في قالب وتركها للتصلب لأخذ شكل القالب.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource ved at hælde en væske eller et varmt, flydende stof i en form og lade det størkne, så det har taget form efter formen til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur dafür verantwortlich ist, eine Flüssigkeit oder eine geschmolzene Substanz in eine Form zu gießen, die in der Gießform verbleibt, bis sie ausgehärtet ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa aineiston valmistamisesta muovaamalla sulatettua tai nestemäistä ainetta muotin avulla."},
