      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60642,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for preparing a stone or plate for lithographic printing.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن تجهيز حجر أو لوح للطباعة الحجرية.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource ved at forberede en sten eller plade til litografisk trykning til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Vorbereitung eines Steins oder einer Platte für lithografischen Druck verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa aineiston valmistamisesta valmistamalla litografiassa käytetyn kivilaatan tai muun painolaatan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/lithographerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A lithographer includes a graphic artist creating a design directly on the surface from which printing will be done.", ar: "يتضمن مصطلح طبّاع على الحجر كذلك فنان الجرافيك الذي ينشيء تصميمًا مباشرًا على السطح الذي ستتم الطباعة منه.", da: "En litograf inkluderer en grafisk artist der har skabt et design direkte på overfladen, hvorfra trykning vil blive lavet.", de: "Darunter fallen Grafikerinnen/Grafiker, die ein Muster direkt auf der Oberfläche erstellen, von der aus gedruckt werden soll.", fi: "Litografi tarkoittaa myös graafikkoa, joka tekee piirroksen suoraan painamiseen käytettävälle pinnalle."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60414",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is lithographer of", ar: "هو طبّاع على الحجر لـ", da: "er litograf af", de: "ist Lithografin/Lithograf von", fi: "litografi (toimija) aineistossa", nl: "is lithograaf van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60640",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60643,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for preparing plates used in the making of printed images or text.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن تجهيز الأسطح المستخدمة في إنتاج صور أو نص مطبوع.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource ved at forberede plader, der anvendes til fremstilling af trykte billeder og/eller tekst til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Anfertigung von Druckformen für die Produktion von gedruckten Bildern oder gedrucktem Text verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa painettujen kuvien tai tekstin valmistuksessa käytettävien painolaattojen tai -levyjen valmistuksesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/platemakerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60415",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is platemaker of", ar: "هو مُحضِّر سطح طباعى لـ", da: "er plademager af", de: "ist Druckformherstellerin/Druckformhersteller von", fi: "painolaatan valmistaja (toimija) aineistossa", nl: "is plaatmaker van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61009",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60644,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for subjecting metal, glass, or some other surface used for printing, to acid or another corrosive substance.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن غمر معدن أو زجاج أو أي سطح آخر يستخدم للطباعة، في حامض أو في أي مادة أخرى كاوية.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource ved at udsætte metal, glas eller en anden overflade, der anvendes til trykning, for syre eller et andet ætsende stof til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur dafür verantwortlich ist, Metall, Glas oder eine andere Oberfläche, die zum Drucken benutzt wird, mit Säure oder einer anderen ätzenden Substanz zu behandeln.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa metallin, lasin tai muun pinnan etsaamisesta hapon tai muun syövyttävän aineen avulla."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/etcherOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60416",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is etcher of", ar: "هو حَفَّارُ بالزِنْكُوغْراف (الكليشيهات) لـ", da: "er raderer af", de: "ist Radiererin/Radierer von", fi: "etsaaja (toimija) aineistossa", nl: "is etser van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60640",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60645,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for preparing a hardened film of gelatin or other colloid that has ink-receptive and ink-repellent surfaces and that is used to make prints using a photomechanical process.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن استخدام عمليات ميكانيكية ضوئية لإنتاج المطبوعات مباشرة من فيلم صلد من الجيلاتين أو من غيره من المواد الغروية التي تحتوي على أسطح مستقبلة أو طاردة للحبر.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource vha. en fotomekanisk proces, hvorved der er blevet lavet tryk direkte fra et hærdet gelatinelag eller andet kolloid, der har blækmodtagelige og blækafvisende overflader til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Verwendung eines fotomechanischen Verfahrens zur Herstellung von Abzügen direkt von einem gehärteten Film aus Gelatine oder einem anderen Kolloid, der druckerfarbenaufnehmende und -abweisende Oberflächen aufweist, verantwortlich ist.", fi: "Liittää toimijan aineistoon, jonka valmistamisesta toimija on vastuussa tekemällä vedoksia suoraan kovettuneelta gelatiinifilmiltä tai muulta materiaalilta, jossa on mustetta imeviä ja hylkiviä pintoja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/collotyperOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60417",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is collotyper of", ar: "هو طبّاع صور فوتوغرافية لـ", da: "er lystrykker af", de: "ist Lichtdruckerin/Lichtdrucker von", fi: "kollotypian valmistaja (toimija) aineistossa", nl: "is lichtdrukker van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60640",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60646,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for manufacturing printed text, notated music, etc., from type or plates, such as a book, newspaper, magazine, broadside, score, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن إنتاج نص مطبوع، موسيقى مدونة، إاخ.، من نوع أو من لوحات، مثل كتاب، جريدة، مجلة، نشرة مطوِيّة، توزيع الموسيقي، إلخ.", da: "Relaterer en agent, der har været involveret i fremstillingen af en ressource af trykt tekst, noteret musik etc. fra typer eller plader, såsom en bog, en avis, et tidsskrift, en plakat, et partitur etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Herstellung von gedrucktem Text, Noten und so weiter durch Drucktypen oder Druckformen, wie zum Beispiel in einem Buch, in einer Zeitung, in einem Magazin, in einem Einblattdruck, in einer Partitur oder ähnlichem, verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa painetun tekstin, nuottiaineiston tai muun aineiston valmistamisesta painolaatalta tai -levyltä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/printerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60418",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is printer of", ar: "هو فني طباعة لـ", da: "er trykker af", de: "ist Druckerin/Drucker von", fi: "painaja (toimija) aineistossa", nl: "is drukker van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60669",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60647,
      definition: {en: "Relates an agent to a resource with an \"X presents:\" credit in a resource of a moving image for an agent who is probably associated with production, finance, or distribution in some way.", ar: "يربط بين وكيل ومصدر ذو اعتماد \"أحد التقديمات:\" في مصدر لفيلم لوكيل قد يكون مرتبطًا بطريقة ما بالإنتاج، أو التمويل، أو التوزيع.", da: "Relaterer en agent, der er nævnt i en fortekst i levende billedmaterialer som ”X præsenterer”-tekst, og som sandsynligvis er knyttet til produktion, finansiering eller distribution på en eller anden måde til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur in einem \"X präsentiert\"-Vorspann einer Bewegtbildressource erwähnt wird und der wahrscheinlich mit Produktion, Finanzierung oder Vertrieb in Verbindung steht.", fi: "Liittää aineiston toimijaan, joka mainitaan alku- tai lopputekstien \"X esittää:\" -merkinnössä ja joka todennäköisesti liittyy liikkuvan kuvan teoksen aineiston tuotantoon, rahoitukseen tai jakeluun jollakin tavoin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/presenterOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60419",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is presenter of", ar: "هو مُقدم لـ", da: "er præsentator i", de: "ist Präsentatorin/Präsentator von", fi: "esittäjä (toimija) aineistossa", nl: "is presenterende van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60648,
      definition: {en: "Relates an agent of which an agent is a member to an agent.", ar: "يربط وكيلًا يكون الوكيل عضوًا لوكيل.", da: "Relaterer en agent som en agent er medlem af til en agent.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, dem ein Akteur angehört.", fi: "Liittää toimijan yhteistoimijaan, jonka jäsen toimija on."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/memberOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60697",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is member of", ar: "هو عضو لـ", da: "har medlem af", de: "ist Mitglied von", fi: "jäsen", nl: "is lid van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60649,
      definition: {en: "Relates an agent to a resource that involves a responsibility as an advisor or supervisor of thesis or dissertation research, overseeing either an academic degree or thesis.", ar: "يربط بين وكيل ومصدر ينطوي على تحمل المسؤولية بصفته مستشار أو مشرف على أطروحة ماجستير أو دكتوراه أو أبحاث متعلقة بأطروحة، والإشراف على إما درجة أكاديمية أو أطروحة.", da: "Relaterer en person, som fx en speciale- eller forskningsafhandlingsvejleder, der har ført tilsyn med enten en akademisk grad eller et speciale til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der eine Beraterin/ein Berater oder eine Betreuerin/ein Betreuer für die Beratung und Aufsicht von Forschungstätigkeiten im Rahmen einer Hochschularbeit verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa akateemisen opinnäytteen tai väitöskirjan ohjaamisesta tai valvomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/degreeSupervisorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60420",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is degree supervisor of", ar: "هو مشرف على درجة أكاديمية لـ", da: "er vejleder i", de: "ist Betreuerin/Betreuer einer Hochschulschrift von", fi: "opinnäytteen ohjaaja (toimija) aineistossa", nl: "is graad-begeleider van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60650,
      definition: {en: "Relates an agent to a resource that is decorated using precious metals or colour, often with elaborate designs and motifs.", ar: "يربط بين وكيل ومصدر مُزيّن بمعادن ثمينة أو بألوان، غالبًا بتصاميم وزخارف منمقة.", da: "Relaterer en person der sørger for at der er tilført en udsmukning til en særlig ressource vha. ædelmetal eller farve, ofte med udsøgte mønstre og motiver til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die durch Edelmetalle oder Farbe, häufig mit kunstvollen Mustern und Motiven, (aus-)gestaltet wird.", fi: "Liittää toimijan aineistoon, joka on koristeltu jalometalleja tai värejä käyttäen, usein yksityiskohtaisin kuvioin tai motiivein."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/illuminatorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60421",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is illuminator of", ar: "هو مزخرِف لـ", da: "er illuminator af", de: "ist Illuminatorin/Illuminator von", fi: "illuminoinnin tekijä (toimija) aineistossa", nl: "is verluchter van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60651,
      definition: {en: "Relates an agent to a resource that includes a contribution tof assembling, arranging, and trimming film, video, or other moving image formats, including both visual and audio aspects.", ar: "يربط بين وكيل ومصدر يتضمن المساهمة في تجميع الأفلام أو الفيديو أو أشكال الصور المتحركة الأخرى وترتيبها وتشذيبها، بما في ذلك الجوانب المرئية والمسموعة.", da: "Relaterer en agent, der er ansvarlig for at have samlet, arrangeret og klippet film, video eller andre levende billedformater, inkl. både visuelle og lydmæssige aspekter til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die einen Beitrag zum Zusammensetzen, Arrangieren und Nachschneiden von Film-, Video- oder anderen Bewegtbildformaten beinhaltet. Darunter fallen Video- und Audio-Eigenschaften.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa elokuvan, videon tai muiden elokuvaformaattien kokoamisesta, järjestämisestä ja leikkauksesta sekä kuvan että äänen osalta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/editorOfMovingImageResourceOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60422",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is editor of moving image resource of", ar: "هو محرر مصدر صور متحركة لـ", da: "er klipper af", de: "ist Filmeditorin/Filmeditor von", fi: "liikkuvan kuvan leikkaaja (toimija) aineistossa", nl: "is filmeditor van bewegend beeld-resource van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60652,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for computer programming.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن برمجة الكمبيوتر.", da: "Relaterer en agent, der er ansvarlig for at have skabt et computerprogram til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Schaffung eines Computerprogramms verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa tietokoneohjelman luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/programmerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60423",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is programmer of", ar: "هو مُبرمج لـ", da: "er programmør af", de: "ist Programmiererin/Programmierer von", fi: "ohjelmoija (toimija) aineistossa", nl: "is programmeur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60653,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for design of an object.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن تصميم كائن.", da: "Relaterer en agent, der er ansvarlig for at have skabt et design for en genstand til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Gestaltung eines Objekts verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa esineen suunnittelusta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/designerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60424",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is designer of", ar: "هو مصمم لـ", da: "er designer af", de: "ist Designerin/Designer von", fi: "suunnittelija (toimija) aineistossa", nl: "is ontwerper van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60654,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for a cartographic resource.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن مصدر رسم خرائط.", da: "Relaterer en agent, der er ansvarlig for at have skabt et kort, et atlas, en globus eller et andet kartografisk værk til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für eine kartografische Ressource verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa kartografisesta aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/cartographerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60425",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is cartographer of", ar: "هو رسام خرائط لـ", da: "er kartograf til", de: "ist Kartografin/Kartograf von", fi: "kartografi (toimija) aineistossa", nl: "is cartograaf van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60655,
      definition: {en: "Relates an agent to a musical resource that involves a responsibility of an agent for music.", ar: "يربط وكيل بمصدر موسيقي ينطوي على مسؤولية وكيل عن موسيقى.", da: "Relaterer en agent der er ansvarlig for at have skabt et musikværk til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Musikressource, bei dem ein Akteur für die Musik verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa musiikkiaineiston luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/composerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60426",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is composer of", ar: "هو مُلحن لـ", da: "er komponist til", de: "ist Komponistin/Komponist von", fi: "säveltäjä (toimija) aineistossa", nl: "is componist van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60656,
      definition: {en: "Relates an agent who is responsible for creating a new device or process to a resource.", ar: "يربط وكيل مسؤول عن تصنيع جهاز جديد أو عملية جديدة لمصدر.", da: "Relaterer en agent der er ansvarlig for at have skabt en ny anordning eller proces til en ressource.", de: "Setzt einen Akteur, der für die Schaffung eines neuen Geräts oder Prozesses verantwortlich ist, in Beziehung zu einer Ressource.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa uuden laitteen tai prosessin luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/inventorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60427",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is inventor of", ar: "هو مخترع لـ", da: "er opfinder af", de: "ist Erfinderin/Erfinder von", fi: "keksijä (toimija) aineistossa", nl: "is uitvinder van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60657,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for creating a metadata description set.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن اختيار البيانات والمعلومات لمصدر وترتيبها، وتجميعها، وتحريرها، في ببليوجرافية أو في دليل.", da: "Relaterer en agent, der er ansvarlig for at have skabt et nyt værk såsom en bibliografi eller fortegnelse ved at udvælge, arrangere, sammenlægge og redigere data, oplysninger etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das Selektieren, Gliedern, Aggregieren und Editieren von Daten und Informationen für eine Ressource, zum Beispiel einer Bibliografie oder eines Verzeichnisses, verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa metatietokokonaisuuden luomisesta."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60621",
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60007",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/compilerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A metadata description set includes a bibliography of resources, a directory of agents and places, and an analytic finding aid.", fi: "Metatietokokonaisuus sisältää aineistojen bibliografian, toimijoiden ja paikkojen hakemiston sekä hakemiston."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60428",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is compiler of", ar: "هو جامع لـ", da: "er kompilator af", de: "ist Zusammenstellende/Zusammenstellender von", fi: "kokoaja (toimija) aineistossa", nl: "is samensteller van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61090",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60658,
      definition: {en: "Relates an agent to a resource that is a photographic resource that involves a responsibility of an agent for photography.", ar: "يربط بين وكيل ومصدر يمثل مصدرًا فوتوغرافيًا يتضمن مسؤولية وكيل عن التصوير الفوتوغرافي.", da: "Relaterer en agent der er ansvarlig for at have skabt et nyt fotografisk værk til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Fotografie verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa valokuva-aineiston luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/photographerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60429",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is photographer of", ar: "هو مصور لـ", da: "er fotograf til", de: "ist Fotografin/Fotograf von", fi: "valokuvaaja (toimija) aineistossa", nl: "is fotograaf van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60659,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of interviewing, reporting, or some other information gathering agent.", ar: "يربط بين وكيل ومصدر يتضمن مساهمة وكيل في إجراء مقابلات، إعداد تقارير، أو وكيل من نوع آخر يجمع معلومات.", da: "Relaterer en agent, der er ansvarlig for at have skabt en ressource ved at optræde som interviewer, journalist, medarbejder ved et meningsmålingsinstitut eller en anden informationsindsamler til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er als Interviewerin/Interviewer, Reporterin/Reporter, Meinungsforscherin/Meinungsforscher oder anderweitig Informationen zusammenträgt.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa aineiston luomisesta toimimalla haastattelijana, toimittajana, mielipidetutkijana tai muunlaisena tiedonkerääjänä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/interviewerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60430",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is interviewer of", ar: "هو مُحاور لـ", da: "er interviewer i", de: "ist Interviewerin/Interviewer von", fi: "haastattelija (toimija) aineistossa", nl: "is interviewer van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60660,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for conceiving, and often implementing, an original graphic design, drawing, painting, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن وضع تصور لتصميم جرافيكي، أو لرسم، أو للوحة زيتية أصلية، إلخ وغالباً تنفيذها.", da: "Relaterer en agent, der er ansvarlig for at have skabt en ressource ved at udtænke, og ofte udføre, et originalt grafisk design, en original tegning, et originalt maleri etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Konzeption und oft auch Umsetzung einer originalen grafischen Gestaltung, einer Zeichnung oder eines Gemäldes und so weiter verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa alkuperäisen graafisen suunnittelun, piirroksen, maalauksen tms. luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60705", "http://rdaregistry.info/Elements/u/P60758", "http://rdaregistry.info/Elements/u/P60759"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/artistOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60431",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is artist of", ar: "هو فنان لـ", da: "er kunstner til", de: "ist Künstlerin/Künstler von", fi: "taiteilija (toimija) aineistossa", nl: "is kunstenaar van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60661,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of being interviewed, usually by a reporter or some other information gathering agent.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل بإجراء مقابلة معه، عادةً من جانب مراسل أو وكيل من نوع آخر يجمع معلومات.", da: "Relaterer en agent, der er ansvarlig for at have skabt en ressource ved at besvare spørgsmål fra en interviewer, normalt en journalist, medarbejder ved et meningsmålingsinstitut eller en anden informationsindsamler en ressource..", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er einer Interviewerin/einem Interviewer antwortet. Dabei handelt es sich normalerweise um eine Reporterin/einen Reporter oder einen anderen Akteur, der Informationen zusammenträgt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena vastaamalla haastattelijalle. Yleensä haastattelija on toimittaja, mielipidetutkija tai muunlainen tiedonkeruun tekijä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/intervieweeOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60432",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is interviewee of", ar: "هو ضيف مقابلة لـ", da: "er interviewet i", de: "ist Interviewte/Interviewter von", fi: "haastateltava (toimija) aineistossa", nl: "is geïnterviewde van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60662,
      definition: {en: "Relates an agent to a choreographic resource that involves a responsibility of an agent for choreography.", ar: "يربط بين وكيل ومصدر رقص ينطوي على مسؤولية وكيل عن تصميم الرقصات.", da: "Relaterer en agent, der er ansvarlig for at have skabt en ressource af bevægelser til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer choreografischen Ressource, bei der ein Akteur für die Choreografie verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa koreografisesta aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/choreographerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60433",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is choreographer of", ar: "هو مصمم رقصات لـ", da: "er koreograf til", de: "ist Choreografin/Choreograf von", fi: "koreografi (toimija) aineistossa", nl: "is choreograaf van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60663,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for creating a textual resource.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن إنشاء مصدر نصي.", da: "Relaterer en agent, der er ansvarlig for at have skabt en ressource hvis indhold primært består af tekst, uanset hvilken medietype eller genre der er tale om til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Erschaffung einer textlichen Ressource verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa tekstiaineiston luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60706", "http://rdaregistry.info/Elements/u/P60707", "http://rdaregistry.info/Elements/u/P60708", "http://rdaregistry.info/Elements/u/P60757"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/authorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60434",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is author of", ar: "هو مؤلف لـ", da: "er forfatter til", de: "ist Verfasserin/Verfasser von", fi: "kirjoittaja (toimija) aineistossa", nl: "is auteur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60664,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for creating an architectural design, including a pictorial representation intended to show how a building or other structure will look when completed.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن إنشاء تصميم معماري، ويشمل ذلك عمل تمثيل تصويري لبيان كيف سيبدو مبنى أو هيكل آخر عند اكتماله.", da: "Relaterer en agent, der er ansvarlig for at have skabt et arkitektonisk design, inkl. en billedrepræsentation, der er beregnet til at vise, hvordan en bygning etc. vil se ud, når den er færdig til et værk.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für einen architektonischen Entwurf verantwortlich ist, einschließlich einer bildlichen Darstellung, die zeigt, wie ein Gebäude oder eine andere Konstruktion nach der Fertigstellung aussehen soll.", fi: "Liittää toimijan aineiston, jossa toimija vastaa arkkitehtisuunnitelman luomisesta, mukaan lukien kuvaesityksestä, jonka tarkoitus on näyttää, miltä rakennus tai muu rakennelma näyttää valmiina."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60704",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/architectOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60435",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is architect of", ar: "هو مهندس معماري لـ", da: "er arkitekt til", de: "ist Architektin/Architekt von", fi: "arkkitehti (toimija) aineistossa", nl: "is architect van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60665,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for an independent or personal film.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن فيلم مستقل أو شخصي.", da: "Relaterer en agent der er ansvarlig for at have skabt en uafhængig eller personlig film til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Schaffung eines unabhängigen oder privaten Films verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa itsenäisen tai henkilökohtaisen elokuvan luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/filmmakerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60436",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is filmmaker of", ar: "هو صانع أفلام لـ", da: "er filmskaber til", de: "ist Filmemacherin/Filmemacher von", fi: "elokuvantekijä (toimija) aineistossa", nl: "is filmmaker van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60666,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of designing the overall visual appearance of a moving image production.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في تصميم الصورة المرئية العامة لإنتاج أفلام.", da: "Relaterer en agent, der er ansvarlig for at have designet en levende billedproduktions overordnede visuelle udseende til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er für die Gestaltung des gesamten visuellen Erscheinungsbilds einer Bewegtbildproduktion verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa elokuvatuotannon visuaalisen ilmeen suunnittelusta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productionDesignerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60437",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is production designer of", ar: "هو مصمم إنتاج لـ", da: "er produktionsdesigner for", de: "ist Szenenbildnerin/Szenenbildner von", fi: "tuotannonsuunnittelija (toimija) aineistossa", nl: "is productieontwerper van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60667,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for distribution.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن التوزيع.", da: "Relaterer en agent der er ansvarlig for distribution af en manifestation til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für den Vertrieb verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa julkaistun aineiston jakelusta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60636",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/distributorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60438",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is distributor of", ar: "هو مُوزع لـ", da: "er distributør af", de: "ist Vertrieb von", fi: "jakelija (toimija) aineistossa", nl: "is distributeur van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60668,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for most of the business aspects of a production for screen, sound recording, television, webcast, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن معظم جوانب العمل في إنتاج للشاشة، وللتسجيل الصوتي، وللتلفزيون، وللبث عبر الإنترنت، إلخ.", da: "Relaterer en agent, der er ansvarlig for størstedelen af de forretningsmæssige aspekter ved en produktion beregnet til lærred, lydoptagelse, tv, webcast etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die meisten geschäftlichen Aspekte einer Produktion für die Leinwand, für eine Tonaufnahme, für das Fernsehen, für einen Webcast und so weiter verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa suurimmasta osasta elokuvan liiketoimintaa."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60033", "http://rdaregistry.info/Elements/u/P60034", "http://rdaregistry.info/Elements/u/P60035", "http://rdaregistry.info/Elements/u/P60883"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/producerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60441",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is producer of", ar: "هو مُنتج لـ", da: "er producer af", de: "ist Produzentin/Produzent von", fi: "tuottaja (toimija) aineistossa", nl: "is producent van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60669,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for printing, duplicating, casting, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن الطباعة، النسخ، الطَرَح، إلخ.", da: "Relaterer en agent der er ansvarlig for trykning, duplikering, støbning etc., til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für den Druck, die Vervielfältigung, den Guss und so weiter verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa painamisesta, monistamisesta, kirjasinten valamisesta tai muusta valmistustavasta."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60639", "http://rdaregistry.info/Elements/u/P60646"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/manufacturerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60443",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
