      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for publishing, releasing, or issuing.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن النشر، أو التحرير، أو الإصدار.", da: "Relaterer en agent, der er ansvarlig for at publicere, offentliggøre eller udsende en ressource til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das Veröffentlichen, die Freigabe oder die Herausgabe verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa kustantamisesta, julkaisemisesta tai ilmestymisestä."},
