      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60671,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of recording the minutes of a meeting.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في تسجيل محاضر اجتماع.", da: "Relaterer en agent der er ansvarlig for at have taget referat ved et møde til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er für das Aufzeichnen des Protokolls einer Sitzung verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa kokouksen pöytäkirjan laatimisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/minuteTakerOf.en",
