      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60673,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for the general management and supervision of a filmed performance, a radio or television program, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن الإدارة العامة والإشراف على أداء فيلم، برنامج إذاعي أو برنامج تلفزيوني، إلخ.", da: "Relaterer en agent der er ansvarlig for ledelse af og tilsyn med en filmoptagelse, et radio- eller tv-program etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das allgemeine Management und die Leitung einer verfilmten Darbietung, einer Hörfunk- oder Fernsehsendung und so weiter verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa a elokuvaesityksen, radio- tai televisio-ohjelman tms. yleisestä johtamisesta."},
