      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60674,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for compensation of degradation by bringing it back to a state as close as possible to its original condition using a set of technical, editorial, and intellectual procedures.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن التعويض عن تدهور حالته عن طريق إعادته إلى حالته الأصلية قدر المستطاع باستخدام مجموعة من الإجراءات الفنية، والتحريرية، والفكرية.", da: "Relaterer en agent, der er ansvarlig for rækken af tekniske, redaktionsmæssige og intellektuelle procedurer, der sigter mod at kompensere for forringelsen af en ressource ved at føre den tilbage til en tilstand, der er så tæt som muligt på dens oprindelige tilstand til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die technischen, redaktionellen und intellektuellen Verfahren verantwortlich ist, die darauf abzielen, die Zersetzung einer Ressource auszugleichen, indem sie in einen Zustand zurückversetzt wird, der ihrer ursprünglichen Beschaffenheit möglichst nahe kommt.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa teknisistä, toimituksellisista ja tiedollisista toimenpiteistä, joiden tarkoitus on palauttaa huonokuntoinen aineisto mahdollisimman lähelle sen alkuperäistä kuntoa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/restorationistOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
