      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60675,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for sponsoring some aspect of a resource,", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن رعاية بعض جوانب مصدر.", da: "Relaterer en agent, der har sponsoreret et aspekt af en ressource, fx forskningsfinansiering, sponsorering af en event til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die finanzielle Unterstützung einzelner Aspekte einer Ressource verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa aineiston sponsoroinnista joltakin osin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/sponsoriedResourceOfAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Includes funding research and sponsoring an event that is the basis of a resource.", ar: "يشمل ذلك تمويل البحوث ورعاية حدث يكون أساس لمصدر.", da: "Omfatter finansiering af forskning og sponsorering af et event, der er basis for en ressource.", de: "Darunter fallen Forschungsförderungen und die finanzielle Unterstützung einer Veranstaltung, die die Grundlage eines Werks bilden.", fi: "Kattaa tutkimuksen rahoituksen ja teoksen perustana olevan tapahtuman sponsoroinnin."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60451",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has sponsored resource of agent", ar: "له مصدر راعي لوكيل", da: "er sponsorerende institution for", de: "hat Akteur als Trägerin/Träger eines Werks von", fi: "sponsori (toimija) aineistossa", nl: "heeft gesponsorde resource van actor"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60676,
      definition: {en: "Relates an agent sponsoring an agent to an agent.", ar: "يربط بين وكيل راعي لوكيل ووكيل.", da: "Relaterer en agent der sponsorerer en agent til en agent.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, der einen Akteur fördert.", fi: "Liittää toimijaan toimijaa sponsoroivan toimijan."},
