      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60678,
      definition: {en: "Relates an agent to a resoure that involves a responsibility of an agent for capturing images, either electronically or on film or video stock, and often selecting and arranging the lighting.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن التقاط الصور، إما إلكترونيًا أو في فيلم أو فيديو، وغالبا ما يكون مسئولا عن اختيار الإضاءة وتوزيعها.", da: "Relaterer en agent, der optager billeder, enten elektronisk eller på film eller video og ofte vælger og arrangerer lyssætning.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Aufzeichnung von Bildern, entweder elektronisch oder auf Film- oder Videomaterial, verantwortlich ist und häufig die Belichtung auswählt und arrangiert.", fi: "n vastaa kuvien tallentamisesta joko sähköisesti tai filmille tai videolle, usein myös valaistuksen valitsemisesta ja järjestämisestä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/directorOfPhotographyOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
