      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60684,
      definition: {en: "Relates an agent who resulted from a merger of two or more other agents to an agent.", ar: "يربط بين وكيل ووكيل نتج عن اندماج وكيلين أو أكثر من الوكلاء الأخرين.", da: "Relaterer en agent der er resultatet af en sammenlægning af to eller flere andre agenter til en agent.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, der aus einer Fusion von zwei oder mehreren Akteuren entstanden ist.", fi: "Kahden tai useamman yhteistoimijan yhdistymisestä muodostunut yhteistoimija."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productOfMerger.en",
