    property :P60685,
      definition: {en: "Relates an agent who resulted from a split or division of a related agent to an agent.", ar: "يربط بين وكيل ووكيل نتج عن انفصال أو تقسيم وكيل ذي صلة.", da: "Relaterer en agent der er resultatet af en opsplitning af to eller flere andre agenter til en agent.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, der aus einer Aufteilung oder einer Teilung eines anderen Akteurs entstanden ist.", fi: "Liittää yhteistoimijan yhteistoimijaan, joka on seuraus toisen yhteistoimijan jakautumisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/productOfSplit.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
