    property :P60699,
      definition: {en: "Relates an agent to a resource that involves a responsibility as a faculty moderator of an academic disputation, normally proposing a thesis and participating in the ensuing disputation.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤوليته رئاسة جلسة أعضاء هيئة التدريس في مناظرة أكاديمية، ويقترح عادة أطروحة ويشارك في المناظرة اللاحقة.", da: "Relaterer en agent der er fakultetsordstyrer for et akademisk afhandlingsforsvar, normalt ved at fremsætte en tese og deltage i det efterfølgende afhandlingsforsvar til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur auf Fakultätsseite eine akademische Disputation moderiert, normalerweise eine These vorschlägt und an der sich daraus ergebenden Disputation teilnimmt.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa väitöskirjan esittelystä väitöstilasuudessa tiedekunnan edustajana ja osallistuu keskusteluun väitöstilaisuuden puheenjohtajana."},
