      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for issuing a resource, such as an official organ of the body.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن إصدار مصدر، مثل العضوية الرسمية لهيئة.", da: "Relaterer en agent, der har udgivet en ressource, såsom en officiel skrift fra agenten til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Herausgabe einer Ressource, zum Beispiel eines offiziellen Organs der Körperschaft, verantwortlich ist.", fi: "Liittää toimijan aineistoon, jonka julkaisemisesta toimija, esimerkiksi virallinen toimielin, vastaa."},
