    property :P60747,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for making paper.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن إنتاج ورق.", da: "Relaterer en agent, der er ansvarlig for at producere papir der bruges til at fremstille en manifestation til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Produktion von Papier verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa paperin valmistamisesta."},
