    property :P60748,
      definition: {en: "Relates a resource to an agent who contributes to a moving image resource by designing and creating post-production visual effects.", ar: "يربط مصدر بوكيل يُساهم في مصدر فيلم سينمائي من خلال تصميم وإنشاء مؤثرات مرئية لمرحلة ما بعد الإنتاج.", da: "Relaterer en ressource til en agent, der har bidraget til en levende billed-ressource ved at designe og skabe visuelle effekter efter produktionen.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Bewegtbildressource beiträgt, indem er in der Postproduktion visuelle Effekte entwirft und erstellt.", fi: "Liittää aineiston toimijaan, joka on osallisena liikkuvan kuvan aineiston tekemisessä suunnittelemalla ja luomalla visuaaliset tehosteet jälkituotantovaiheessa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/visualEffectsProvider.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
