      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has visual effects provider", ar: "له مُوَرّد للمؤثرات المرئية", da: "har leverandør af visuelle effekter", de: "hat Visual-effects-Provider", fi: "aineiston visuaalisten tehosteiden tekijä", nl: "heeft aanbieder visuele effecten"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60749,
      definition: {en: "Relates a resource to an agent who contributes to a moving image or audio resource by designing and creating on-set special effects such as on-set mechanical effects and in-camera optical effects.", ar: "يربط مصدر بوكيل يُساهم في مصدر فيلم سينمائي أو مصدر صوتي من خلال تصميم مؤثرات خاصة وإنشائها أثناء التصوير، مثل المؤثرات الميكانيكية والمؤثرات البصرية في الكاميرا.", da: "Relaterer en ressource til en agent, der har bidraget til en levende billed- eller audioressource ved at designe og skabe specialeffekter på stedet som fx mekaniske effekter og optiske kameraeffekter.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Bewegtbild- oder Tonressource beiträgt, indem er am Set Spezialeffekte wie mechanische Effekte und optische Effekte in der Kamera entwirft und erstellt.", fi: "Liittää aineiston toimijaan, joka on osallisena liikkuvan kuvan aineiston tai ääniteosaineiston tekemisessä suunnittelemalla ja luomalla taltioinnin aikana tapahtuvat erikoistehosteet, kuten mekaaniset tehosteet ja kameralla toteutettavat optiset tehosteet."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/specialEffectsProvider.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60755",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has special effects provider", ar: "له مُوَرّد للمؤثرات الخاصة", da: "har leverandør af specialeffekter", de: "hat Special-effects-Provider", fi: "erikoistehosteiden tekijä", nl: "heeft aanbieder speciale effecten"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60750,
      definition: {en: "Relates a resource to an agent who contributes to a comic book, graphic novel, etc., by drawing the text and graphic sound effects.", ar: "يربط بين مصدر ورسّام توضيحي يُساهم في كتاب مصور، رواية مصورة، إلخ.، من خلال رسم النص وتصميم المؤثرات الصوتية المصاحبة.", da: "Relaterer en ressource til en illustrator, der har bidraget til et udtryk af en tegneserie, en graphic novel etc. ved at tegne teksten og de grafiske lydeffekter.", de: "Setzt eine Ressource in Beziehung zu einer Illustratorin/einem Illustrator, die/der zu einem Comicbuch, einer Graphic Novel und so weiter beiträgt, indem sie/er den Text und die grafischen Toneffekte zeichnet.", fi: "Liittää aineiston kuvittajaan, joka on osallisena sarjakuvan, sarjakuvaromaanin tms. tekemisessä piirtämällä tekstin ja graafiset äänitehosteet."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/letterer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60756",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has letterer", ar: "له رسّام حروف", da: "har bogstavtegner", de: "ist Letterer", fi: "aineiston tekstaaja", nl: "heeft letteraar"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60396",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60751,
      definition: {en: "Relates a resource to an agent who is an author who is appointed by an organization to report on the proceedings of its meetings.", ar: "يربط مصدر بوكيل مؤلف تم تعيينه من جانب منظمة لإعداد تقارير عن وقائع اجتماعاتها.", da: "Relaterer en ressource til en forfatter, der er udpeget af en organisation til at rapportere om udviklingen af dens møder.", de: "Setzt eine Ressource in Beziehung zu einer Verfasserin/einem Verfasser (Akteur), die/der von einer Organisation eingestellt ist, um über den Ablauf ihrer Sitzungen zu berichten.", fi: "Liittää aineiston toimijaan, joka vastaa organisaation kokousmenettelyistä."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60446",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/rapporteur.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Responsibility limited to taking minutes is excluded.", ar: "يتم استبعاد المسؤولية التي تقتصر على تدوين مضابط الجلسات.", da: "Omfatter ikke ansvar begrænset til at tage referat.", de: "Darunter fällt nicht die Verantwortlichkeit, die sich auf das Protokollschreiben beschränkt.", fi: "Ei koske kokouksen pöytäkirjan laatimiseen rajautuvaa vastuuta."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60757",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has rapporteur", ar: "له مقَرِّر", da: "har rapportør", de: "ist Berichterstatterin/Berichterstatter", fi: "kokousten raportoija aineistossa", nl: "heeft rapporteur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60434",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60752,
      definition: {en: "Relates a resource to an agent who is an artist who is responsible for calligraphy where the focus of interest lies in the aesthetic value of the penmanship or graphic artistry, regardless of whether the same agent is also responsible for the inscribed text.", ar: "يربط مصدر بوكيل فنانً مسؤول عن الخط حيث يكمن تركيز الاهتمام في القيمة الجمالية للخط أو فن الرسم، بغض النظر عما إذا كان الوكيل نفسه مسؤولاً أيضًا عن النص المدرج.", da: "Relaterer en ressource til en kunstner, der er ansvarlig for at have skabt en kalligrafisk ressource, hvor fokus ligger på den æstetiske værdi af skrivekunsten eller den kunstneriske grafiske dygtighed, uanset om den samme agent etc. også har forfattet den indskrevne tekst.", de: "Setzt eine Ressource in Beziehung zu einer Künstlerin/einem Künstler (Akteur), die/der für die Kalligrafie verantwortlich ist, bei der im Mittelpunkt des Interesses der ästhetische Wert dessen Schreibkunst oder die grafische Kunstfertigkeit liegt, unabhängig davon, ob derselbe Akteur auch für den aufgeschriebenen Text verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa kalligrafiasta, jossa pääpaino on käsin kirjoittamisen tai graafisen taiteen esteettisissä arvoissa, riippumatta siitä, vastaako sama toimija myös kirjoitetusta tekstistä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/calligrapher.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60758",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has calligrapher", ar: "له خَطَّاط", da: "har kalligraf", de: "ist Kalligrafin/Kalligraf", fi: "kalligrafi aineistossa", nl: "heeft kalligraaf"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60431",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60753,
      definition: {en: "Relates a resource to an agent who is an artist who is responsible for exploiting the book form or altering its physical structure.", ar: "يربط مصدر بوكيل فنان مسؤول عن توظيف شكل الكتاب أو تغيير بنيته المادية.", da: "Relaterer en ressource til en kunstner, der er ansvarlig for at have skabt kunstressourcer, der udnytter bogformen eller ændrer dens fysiske struktur som en del af en ressources indhold.", de: "Setzt eine Ressource in Beziehung zu einer Künstlerin/einem Künstler (Akteur), die/der für die Verwertung der Buchform oder für die Veränderung ihrer physischen Struktur verantwortlich ist.", fi: "Liittää aineiston toimijaan, jossa toimija vastaa kirjan muodon hyödyntämisestä tai sen fyysisen rakenteen muuttamisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/bookArtist.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60759",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has book artist", ar: "له رَسّام كتب", da: "har bogkunstner", de: "hat Buchkünstlerin/Buchkünstler", fi: "kirjataiteilija aineistossa", nl: "heeft boekkunstenaar"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60431",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60754,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of designing and creating post-production visual effects.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في تصميم وإنشاء مؤثرات مرئية لمرحلة ما بعد الإنتاج.", da: "Relaterer en agent, der har bidraget til en levende billed-ressource ved at designe og skabe visuelle effekter efter produktionen til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er in der Postproduktion visuelle Effekte entwirft und erstellt.", fi: "Liittää toimijan aineistoon, jonka tekemiseen toimija osallistuu suunnittelemalla ja luomalla visuaaliset tehosteet jälkituotantovaiheessa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/visualEffectsProviderOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60748",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is visual effects provider of", ar: "هو مورد للمؤثرات المرئية لـ", da: "er leverandør af visuelle effekter til", de: "ist Visual-effects-Provider von", fi: "visuaalisten tehosteiden tekijä (toimija) aineistossa", nl: "is aanbieder visuele effecten van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60755,
      definition: {en: "Relates an agent to a resource that includes a contribution designing and creating on-set special effects, such as on-set mechanical effects and in-camera optical effects.", ar: "يربط بين وكيل ومصدر يشمل المساهمة في تصميم مؤثرات خاصة وإنشائها أثناء التصوير، مثل المؤثرات الميكانيكية المُحددة والمؤثرات البصرية في الكاميرا.", da: "Relaterer en agent, der har bidraget til et udtryk af en levende billed- eller audioressource ved at designe og skabe specialeffekter på stedet til kulisser såsom mekaniske kulisseeffekter og optiske kameraeffekter til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die einen Beitrag zum Entwurf und zur Erstellung von Spezialeffekten am Set leistet, wie zum Beispiel mechanische Effekte am Set und optische Effekte in der Kamera.", fi: "Liittää toimijan aineistoon, jonka tekemiseen toimija osallistuu suunnittelemalla ja luomalla taltioinnin aikana tapahtuvat erikoistehosteet, kuten mekaaniset tehosteet ja kameralla toteutettavat optiset tehosteet."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/specialEffectsProviderOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60749",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is special effects provider of", ar: "هو مورد للمؤثرات الخاصة لـ", da: "er leverandør af specialeffekter til", de: "ist Special-effects-Provider von", fi: "erikoistehosteiden tekijä (toimija) aineistossa", nl: "is aanbieder speciale effecten van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60626",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60756,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of drawing text and graphic sound effects for a comic book, graphic novel, etc. ", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في رسم نص وتصميم المؤثرات الصوتية المصاحبة لرسومات كتاب مصور، أو رواية مصورة، إلخ.", da: "Relaterer en illustrator, der har bidraget til en tegneserie, en graphic novel etc. til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er für ein Comicbuch, eine Graphic Novel und so weiter Text und grafische Toneffekte zeichnet.", fi: "Liitttää toimijan aineistoon, jossa toimija on osallisena sarjakuvan, sarjakuvaromaanin tms. tekemisessä piirtämällä tekstin ja graafiset äänitehosteet."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/lettererOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60750",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is letterer of", ar: "هو رسّام حروف لـ", da: "er bogstavtegner til", de: "ist Letterer von", fi: "tekstaaja (toimija) aineistossa", nl: "is letteraar van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60624",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60757,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for reporting on the proceedings of meetings of an organization.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن إعداد تقرير عن وقائع اجتماعات منظمة.", da: "Relaterer en forfatter, der er udpeget af en organisation til at rapportere om udviklingen af dens møder til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das Berichten über den Ablauf von Sitzungen einer Organisation verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa organisaation kokousmenettelyistä."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60708",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/rapporteurOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60751",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is rapporteur of", ar: "هو مقَرِّر لـ", da: "er rapportør af", de: "ist Berichterstatterin/Berichterstatter von", fi: "kokousten raportoija (toimija) aineistossa", nl: "is rapporteur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60663",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60758,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for calligraphy where the focus of interest lies in the aesthetic value of the penmanship or graphic artistry, regardless of whether the same agent is also responsible for the inscribed text.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن الخط حيث ينصب الاهتمام على القيمة الجمالية لفن الخط أو فن الرسم، بغض النظر عما إذا كان الوكيل نفسه مسؤولًا أيضًا عن النص المكتوب أم لا.", da: "Relaterer en kunstner, der er ansvarlig for at have skabt en kalligrafisk ressource, hvor interessefokusset ligger på den æstetiske værdi af dets skønskrift eller kunstneriske grafiske dygtighed, uanset om den samme agent etc. også har forfattet den indskrevne tekst til et ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Kalligrafie verantwortlich ist, bei der im Mittelpunkt des Interesses der ästhetische Wert dessen Schreibkunst oder die grafische Kunstfertigkeit liegt, unabhängig davon, ob derselbe Akteur auch für den aufgeschriebenen Text verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa kalligrafiasta, jossa pääpaino on käsin kirjoittamisen tai graafisen taiteen esteettisissä arvoissa, riippumatta siitä, vastaako sama toimija myös kirjoitetusta tekstistä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/calligrapherOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60752",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is calligrapher of", ar: "هو خَطَّاط لـ", da: "er kalligraf til", de: "ist Kalligrafin/Kalligraf von", fi: "kalligrafi (toimija) aineistossa", nl: "is kalligraaf van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60660",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60759,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for exploiting the book form or altering its physical structure", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن توظيف شكل الكتاب أو تغيير بنيته المادية.", da: "Relaterer en kunstner, der er ansvarlig for at have skabt kunstressourcer, der udnytter bogformen eller ændrer dens fysiske struktur som en del af en ressources indhold til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Verwertung der Buchform oder für die Veränderung ihrer physischen Struktur verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa kirjan muodon hyödyntämisestä tai sen fyysisen rakenteen muuttamisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/bookArtistOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60753",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is book artist of", ar: "هو رَسّام كتب لـ", da: "er bogkunstner til", de: "ist Buchkünstlerin/Buchkünstler von", fi: "kirjataiteilija (toimija) aineistossa", nl: "is boekkunstenaar van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60660",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60760,
      definition: {en: "Relates a resource to details of a ratio of the width to the height of a moving image.", ar: "يربط بين مصدر وتفاصيل عن نسبة العرض إلى ارتفاع لصورة المتحركة.", da: "Relaterer en ressource til detaljer om forholdet mellem bredde og højde i et levende billede.", de: "Setzt eine Ressource in Beziehung zu Details zu einem Verhältnis von der Breite zu der Höhe eines Bewegtbilds.", fi: "Liittää aineiston tarkempiin tietoihin liikkuvan kuvan leveyden suhteesta korkeuteen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfAspectRatioDesignation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of aspect ratio designation", ar: "له تفاصيل لنسب باعية لتسمية", da: "har detaljer om billedformatbetegnelse", de: "hat Details zur Bezeichnung eines Bildformats", fi: "aineiston kuvasuhdemääritteen tarkemmat tiedot", nl: "heeft details van aspectratio-aanduiding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60761,
      altLabel: {en: "has details of color content (Deprecated)", ar: "له تفاصيل لمحتوى ملون", fi: "värisisällön tarkemmat tiedot"},
      definition: {en: "Relates a resource to details of a presence of colour, tone, etc., in the content of a resource, and the specific colours, tones, etc., including black and white, present. (Deprecated)", ar: "يربط بين مصدر وتفاصيل عن وجود لون، درجة اللون، إلخ.، في محتوى مصدر، والألوان والدرجات المحددة، إلخ.، بما في ذلك الأسود والأبيض، الحالي.", da: "Relaterer en ressource til detaljer om tilstedeværelse af farve, nuance etc. i en ressources indhold, samt de specifikke farver, nuancer etc., inkl. sort og hvid, der er til stede.", de: "Setzt eine Ressource in Beziehung zu Details zu dem Vorhandensein von Farbe, Tönung und so weiter im Inhalt einer Ressource und den spezifischen vorhandenen Farben, Tönungen und so weiter (einschließlich Schwarz und Weiß).", fi: "Liittää aineiston tietoihin, värien, (musta ja valkoinen mukaanlukien), sävyjen jne. esiintymisestä aineiston sisällössä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfColourContent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of colour content (Deprecated)", ar: "له تفاصيل لمحتوى ملون", da: "har detaljer om farveindhold", de: "hat Details zum Farbinhalt", fi: "värisisällön tarkemmat tiedot", nl: "heeft details van kleurcontent"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60762,
      definition: {en: "Relates a resource to details of a set of characters or symbols used to express musical content of a resource.", ar: "يربط بين مصدر وتفاصيل عن مجموعة من التمثيلات أو الرموز المستخدمة للتعبير عن محتوى موسيقي لمصدر.", da: "Relaterer en ressource til detaljer om det tegnsæt og/eller symboler der anvendes for at udtrykke en ressources musikalske indhold.", de: "Setzt eine Ressource in Beziehung zu Details zu dem Satz von Zeichen oder Symbolen der verwendet wird, um den musikalischen Inhalt einer Ressource auszudrücken.", fi: "Tarkemmat tiedot merkeistä ja symboleista, joilla aineiston musiikkisisältö on ilmaistu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfFormOfMusicalNotation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of form of musical notation", ar: "له تفاصيل عن شكل من أشكال التدوين الموسيقي", da: "har detaljer om musikalsk notationsform", de: "hat Details zur Form der Musiknotation", fi: "aineiston nuottikirjoituksen tyypin tarkemmat tiedot", nl: "heeft details van vorm van muzieknotatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60763,
      definition: {en: "Relates a resource to details of a set of characters or symbols used to express movement content of a resource.", ar: "يربط بين مصدر وتفاصيل عن مجموعة من التمثيلات أو الرموز المستخدمة للتعبير عن محتوى حركي لمصدر.", da: "Relaterer en ressource til detaljer om det sæt af tegn og/eller de symboler, der er anvendt til at udtrykke en ressources bevægelsesindhold.", de: "Setzt eine Ressource in Beziehung zu Details zu dem Satz von Zeichen oder Symbolen der verwendet wird, um den Bewegungsinhalt einer Ressource auszudrücken.", fi: "Liittää aineiston tarkempiin tietoihin merkeistä ja symboleista, joilla aineiston liikesisältö on ilmaistu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfFormOfNotatedMovement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of form of notated movement", ar: "له تفاصيل عن شكل من أشكال الحركات المدونة", da: "har detaljer om bevægelsesnotationsform", de: "hat Details zur Form der Bewegungsnotation", fi: "aineiston nuottikirjoituksen tyypin tarkemmat tiedot", nl: "heeft details van vorm van bewegingsnotatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60764,
      definition: {en: "Relates a resource to details of a musical or physical layout of the content of a resource that is presented in a form of musical notation.", ar: "يربط بين مصدر وتفاصيل عن تخطيط موسيقي أو مادي لمحتوى مصدر يُعرض في شكل من أشكال التدوين الموسيقي.", da: "Relaterer en ressource til detaljer om det musikalske eller fysiske layout af en ressources indhold, der er repræsenteret som musikalsk notation.", de: "Setzt eine Ressource in Beziehung zu Details zu dem musikalischen oder physischen Layout des Inhalts einer Ressource, der in Form einer Musiknotation präsentiert wird.", fi: "Liittää aineiston tarkempiin tietoihin nuottikirjoituksen muodossa esitetyn aineiston sisällön musiikillisesta tai fyysisestä taitosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfFormatOfNotatedMusic.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of format of notated music", ar: "له صيغة من موسيقى مدونة", da: "har detaljer om format af noteret musik", de: "hat Details zur musikalischen Ausgabeform", fi: "nuottiaineiston muodon tarkemmat tiedot", nl: "heeft details van format van bladmuziek"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60765,
      definition: {en: "Relates a resource to details of a set of characters or symbols used to express the content of a resource in a form that can be perceived through touch.", ar: "يربط بين مصدر وتفاصيل عن مجموعة من التمثيلات أو الرموز المستخدمة للتعبير عن محتوى مصدر في شكل يمكن إدراكه من خلال اللمس.", da: "Relaterer en ressource til detaljer om det tegnsæt og/eller symboler, der er anvendt til at udtrykke en ressources indhold på en måde, der kan opfattes ved berøring.", de: "Setzt eine Ressource in Beziehung zu Details zu dem Satz von Zeichen oder Symbolen der verwendet wird, um den Inhalt einer Ressource in einer Form auszudrücken, die über den Tastsinn wahrgenommen werden kann.", fi: "Liittää aineiston tarkempiin tietoihin merkeistä ja symboleista, joilla aineiston sisältö on ilmaistu kosketeltavassa muodossa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfFormOfTactileNotation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of form of tactile notation", ar: "له تفاصيل عن شكل من أشكال التدوين عن طريق اللمس", da: "har detaljer om taktil notationsform", de: "hat Details zur Form der taktilen Notation", fi: "aineiston taktiilin merkkijärjestelmän tyypin tarkemmat tiedot", nl: "heeft details van vorm van tactiele notatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60766,
      definition: {en: "Relates a resource to details of set of characters or symbols used to express written language content of a resource.", ar: "يربط بين مصدر وتفاصيل عن مجموعة من التمثيلات أو الرموز المستخدمة للتعبير عن محتوى لغة مكتوبة لمصدر.", da: "Relaterer en ressource til detaljer om det sæt af tegn og/eller de symboler, der er anvendt til at udtrykke en ressources skriftlige sprogindhold.", de: "Setzt eine Ressource in Beziehung zu Details zu dem Satz von Buchstaben oder Zeichen der verwendet wird, um den geschriebenen Sprachinhalt einer Ressource auszudrücken.", fi: "Liittää aineiston tarkempiin tietoihin merkki- tai symbolijärjestelmästä, jolla aineiston kirjoitettu kielellinen sisältö on kirjoitettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfScript.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of script", ar: "له تفاصيل عن نص", da: "har detaljer om skriftstørrelse", de: "hat Details zur Schrift", fi: "kirjoitusjärjestelmän tarkemmat tiedotaineiston", nl: "heeft details van schrift"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60767,
      definition: {en: "Relates a resource to details of a physical or chemical substance applied to a base material of a resource.", ar: "يربط بين مصدر وتفاصيل عن مادة فيزيائية أو كيميائية مستخدمة كمادة أساسية لمصدر.", da: "Relaterer en ressource til detaljer om et fysisk eller kemisk stof, der er påført en ressources basismateriale.", de: "Setzt eine Ressource in Beziehung zu Details zu einer physischen oder chemischen Substanz, die auf ein Trägermaterial einer Ressource aufgebracht ist.", fi: "Liittää aineiston fysikaaliseen tai kemialliseen aineeseen, jota on laitettu aineiston pohjamateriaalin päälle."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60774",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfAppliedMaterial.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of applied material", ar: "له تفاصيل عن مادة مُستخدمة", da: "har detaljer om anvendt materiale", de: "hat Details zu aufgebrachtem Material", fi: "aineiston päällimateriaali", nl: "heeft details van aangebracht materiaal"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60768,
      definition: {en: "Relates a resource to details of an underlying physical material of a resource.", ar: "يربط بين مصدر وتفاصيل عن مادة ملموسة أساسية لمصدر.", da: "Relaterer en ressource til detaljer om en ressources underliggende fysiske materiale til en ressource.", de: "Setzt eine Ressource in Beziehung zu Details zu einem zugrunde liegenden, physischen Material einer Ressource.", fi: "Liittää aineiston tarkempiin tietoihin aineiston fyysisestä pohjamateriaalista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfBaseMaterial.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of base material", ar: "له تفاصيل عن مادة أساسية", da: "har detaljer om basismateriale", de: "hat Details zum Trägermaterial", fi: "aineiston pohjamateriaalin tarkemmat tiedot", nl: "heeft details van basismateriaal"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60769,
      definition: {en: "Relates a resource to details of the proportional relationship between a whole sheet in a printed or manuscript resource, and the individual leaves that result if that sheet is left full, cut, or folded.", ar: "يربط بين مصدر وتفاصيل عن علاقة نسبية بين ورقة كاملة في مصدر مطبوع أو مخطوط، والأوراق الفردية التي تنتج إذا تركت الورقة كاملة، مقطوعة، أو مطوية.", da: "Relaterer en ressource til detaljer om resultatet af at folde et trykt ark, så der dannes en samling af blade.", de: "Setzt eine Ressource in Beziehung zu Details zu dem proportionalen Verhältnis zwischen einem ganzen Bogen in einer gedruckten oder handschriftlichen Ressource und den einzelnen Blättern, die resultieren, wenn der Bogen im Ganzen gelassen, geschnitten oder gefaltet wird.", fi: "Liittää aineiston tarkempiin tietoihin aineiston tai käsikirjoitusaineiston kokonaisen arkin ja erillisten lehtien välisestä kokosuhteesta, joka riippuu siitä, onko arkki kokonainen, leikattu tai taitettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfBibliographicFormat.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of bibliographic format", ar: "له تفاصيل عن شكل ببليوجرافي", da: "har detaljer om bogformat", de: "hat Details zum bibliografischen Format", fi: "aineiston bibliografisen koon tarkemmat tiedot", nl: "heeft details van boekformaat"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60770,
      definition: {en: "Relates a resource to details of a system used to format a video resource for television broadcast.", ar: "يربط بين مصدر وتفاصيل عن نظام مستخدم لتهيئة مصدر فيديو للبث التلفزيوني.", da: "Relaterer en ressource til detaljer om system, der anvendes til at formatere en videoressource til tv-transmission", de: "Setzt eine Ressource in Beziehung zu Details zu einem System, das zur Formatierung einer Videoressource für eine Fernsehsendung verwendet wird.", fi: "Liittää aineiston tarkempiin tietoihin tiedot järjestelmästä, jonka mukaan videon manifestaatio muunnetaan televisiolähetystä varten."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfBroadcastStandard.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of broadcast standard", ar: "له تفاصيل عن معيار بث", da: "har detaljer om transmissionsstandard", de: "hat Details zum Sendestandard", fi: "aineiston lähetysstandardin tarkemmat tiedot", nl: "heeft details van uitzendstandaard"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60801",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60771,
      definition: {en: "Relates a resource to details of a number of sound channels used to make a recording.", ar: "يربط بين مصدر وتفاصيل عن رقم قنوات الصوت المستخدمة في تسجيل.", da: "Relaterer en ressource til detaljer om et antal af lydkanaler, der blev anvendt til en indspilning", de: "Setzt eine Ressource in Beziehung zu Details zur Anzahl von Tonkanälen, die für die Wiedergabe einer Aufnahme verwendet werden.", fi: "Liittää aineiston tarkempiin tietoihin äänitteen tekoon käytettyjen äänikanavien määrästä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfConfigurationOfPlaybackChannels.en",
