      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for inscribing, fabrication, construction, etc.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن الكتابة، التصنيع، الإنشاء، إلخ.", da: "Relaterer agent der er ansvarlig for at indgravere, fremstille, konstruere etc. til en ressource,", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das Gravieren, Fabrizieren, Konstruieren und so weiter verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa julkaistun aineiston painamisesta, monistamisesta, kirjasinten valamisesta tai muusta valmistustavasta."},
