      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60824,
      definition: {en: "Relates a resource to an agent who contributes to a nonfiction moving image resource by taking an active role as a participant.", ar: "يربط مصدر بوكيل يُساهم في مصدر صور متحركة غير خيالية من خلال القيام بدور نشط كمشارك.", da: "Relaterer et udtryk til en agent, der har bidraget til en levende billed-ressource af faktuel karakter ved at påtage sig en aktiv rolle som deltager.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Dokumentarfilmressource beiträgt, indem er eine aktive Rolle als Teilnehmer einnimmt.", fi: "Liittää aineiston toimijaan, joka osallistuu ei-fiktiivisen liikkuvan kuvan teoksen aineiston tekemiseen ottamalla aktiivisen roolin osallistujana."},
