    property :P60847,
      definition: {en: "Relates a resource to a resource commemorated in a later resource.", ar: "يربط بين مصدر ومصدر تم الاحتفاء به في عمل لاحق.", da: "Relaterer n ressource til en ressource, der mindes i en senere ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressource, der durch eine spätere Ressource gedacht wird.", fi: "Liittää aineiston aineistoon, jota muistetaan myöhemmässä aineistossa."},
