    property :P60849,
      definition: {en: "Relates a resource to an agent who organizes a conference, exhibition, or other event that gives rise to a resource.", ar: "يربط مصدر بوكيل يُنظم مؤتمر، معرض، أو حدث آخر يسفر عن مصدر.", da: "Relaterer en ressource til en agent, der har arrangeret den udstilling, event eller konference eller det kursus eller program etc., der gav anledning til en ressource.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der eine Konferenz, eine Ausstellung oder ein anderes Ereignis organisiert beziehungsweise veranstaltet, aus der/dem eine Ressource hervorgeht.", fi: "Liittää aineiston toimijaan, joka järjestää konferenssin, näyttelyn tai muun tapahtuman, jonka seurauksena syntyy aineisto."},
