    property :P60850,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for organizing a conference, exhibition, or other event that gives rise to a resource.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن تنظيم مؤتمر، معرض، أو حدث آخر يسفر عن مصدر.", da: "Relaterer en agent, der organiserer en udstilling, et event, en konference etc. der gav ophav til en ressource til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die Organisation beziehungsweise Veranstaltung einer Konferenz, einer Ausstellung oder eines anderen Ereignisses verantwortlich ist, aus der/dem eine Ressource hervorgeht.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa konferenssin, näyttelyn tai muun tapahtuman, jonka seurauksena syntyy aineisto, järjestämisestä."},
