      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Substantial modification that results in the creation of a new resource is excluded.", ar: "يُستبعد إجراء تعديل جوهري ينتج عنه إنشاء مصدر جديد.", da: "Væsentlige ændringer, der resulterer i skabelsen af et nyt værk er ikke omfattet.", de: "Darunter fallen keine substantiellen Veränderungen, die zur Schaffung einer neuen Ressource führen.", fi: "Ei koske oleellista muokkausta, joka johtaa uuden aineiston luomiseen."},
