      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60852,
      definition: {en: "Relates an agent to a resource that includes a contribution for revising the content for the purpose of suppressing parts deemed objectionable on moral, political, military, or other grounds, but leaving the nature and content substantially unchanged.", ar: "يربط بين وكيل ومصدر يتضمن المُساهمة في مراجعة محتوى بغرض حذف المحتوى الذي قد يُرفض لأسباب أخلاقية أو سياسية أو عسكرية أو لاعتبارت أخرى، دون إحداث تغيير جوهري في طابعه العام أو في مضمونه.", da: "Relaterer en agent, der har bidraget til en ressource ved at revidere indholdet med henblik på at undertrykke dele, der anses for at være moralsk, politisk, militært eller af anden årsag stødende, men som i alt væsentligt har ladt det oprindelige værks karakter og indhold være uændret til en ressource", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er den Inhalt überarbeitet, um Teile zu unterdrücken, die aus moralischen, politischen, militärischen oder anderen Gründen unerwünscht sind, ohne den Charakter und den Inhalt substantiell zu verändern.", fi: "Liittää toimijan aineistoon, jossa toimija tarkastaa aineiston sisältöä kiistanalaisen sisällön salaamiseksi moraalisin, poliittisin, sotilaallisin tai muin perustein, mutta jättäen alkuperäisen teoksen luonteen ja yleisen sisällön olennaisilta osiltaan muuttumattomaksi."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60663",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/censorOf.en",
