    property :P60854,
      definition: {en: "Relates an agent to an agent who shares a bond of mutual affection or regard with a related agent.", ar: "يربط بين وكيل ووكيل تجمعه مودة أو احترام متبادل مع وكيل ذي صلة.", da: "Relaterer en agent til en agent, der deler et bånd af gensidig ømhed eller respekt med en anden agent.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, der eine gegenseitige Zuneigung oder Achtung mit einem in Beziehung stehenden Akteur teilt.", fi: "Liittää toimijan toimijaan, jolla on molemminpuolinen kiintymys- tai kunnioitussuhde liittyvään toimijaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/friend.en",
