      definition: {en: "Relates an agent to an agent who is a colleague who helps another agent.", ar: "يربط بين وكيل ووكيل هو زميل يساعد وكيلًا آخر.", da: "Relaterer en agent til en kollega, der hjælper en anden agent.", de: "Setzt einen Akteur in Beziehung zu einer Kollegin/einem Kollegen, die/der einen anderen Akteur unterstützt.", fi: "Liittää toimijan toimijaan, joka on kollega, joka avustaa toista toimijaa."},
