      definition: {en: "Relates an agent to an agent who is a colleague who is helped by another agent.", ar: "يربط بين وكيل ووكيل هو زميل تلقى مساعدة من وكيلًا آخر.", da: "Relaterer en agent til en kollega, der bliver hjulpet af en anden agent.", de: "Setzt einen Akteur in Beziehung zu einer Kollegin/einem Kollegen, der/dem von einem anderen Akteur geholfen wird.", fi: "Liittää toimijan toimijaan, joka on kollega, jota toinen toimija avustaa."},
