      subPropertyOf: "http://rdaregistry.info/Elements/u/P60853",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60860,
      definition: {en: "Relates an agent to an agent who is a colleague working with a related agent in an activity of common interest, most often a business partnership.", ar: "يربط بين وكيل ووكيل هو زميل يعمل مع وكيل ذي صلة في نشاط محل اهتمام مشترك، غالبًا شراكة تجارية.", da: "Relaterer en agent til en kollega, der arbejder sammen med en anden agent med en aktivitet af fælles interesse, i de fleste tilfælde, et forretningspartnerskab.", de: "Setzt einen Akteur in Beziehung zu einer Kollegin/einem Kollegen, die/der mit einem in Beziehung stehenden Akteur in einer Tätigkeit von gemeinsamem Interesse, meist in einer Geschäftspartnerschaft, zusammenarbeitet.", fi: "Liittää toimijan toimijaan, joka on kollega, joka toimii toisen toimijan kanssa yhteiseksi hyväksi, useimmiten liikekumppanina."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/partner.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60860",
