      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60867,
      definition: {en: "Relates an agent to an agent who grants powers of administration to an officer in order to act for its benefit.", ar: "يربط بين وكيل ووكيل مُنح صلاحيات الإدارة فيها للعمل من أجل مصلحتها.", da: "Relaterer en agent til en agent, der giver administrationsbeføjelser til en embedsmand til at agere i dens interesse.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, der einer leitenden Angestellten/einem leitenden Angestellten die Verwaltungsvollmachten überträgt, um zu dessen Nutzen zu agieren.", fi: "Liittää toimijan yhteistoimijaan, jossa toimihenkilöllä on valtuudet tehdä päätöksiä yhteisön eduksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/trusteeOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60866",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is trustee of", ar: "هو مدير عام لـ", da: "er forvalter af", de: "ist Treuhänderin/Treuhänder von", fi: "edunvalvoja (toimija)", nl: "is trustee van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60737",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60868,
      definition: {en: "Relates a resource to a note on resource that provides information on an identifier for a resource.", ar: "يربط بين مصدر وتبصرة على مصدر تعطي معلومات عن معرف لمصدر.", da: "Relaterer en ressource til en note, der giver oplysninger om identifikatorer for ressourcen, der ikke fremgår af identifikatorangivelsen for ressourcen.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die Informationen über einen Identifikator für eine Ressource enthält.", fi: "Liittää aineiston huomautukseen, joka sisältää tietoa aineiston tunnisteesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/noteOnIdentifierForResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has note on identifier for resource", ar: "له تبصرة عن محدد لمصدر", da: "har note om identifikator for ressourcen", de: "hat Anmerkung zum Identifikator für eine Ressource", fi: "huomautus aineiston tunnisteesta", nl: "heeft noot bij identificatie van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60470",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60869,
      definition: {en: "Relates a resource to an agent who has legal or intellectual responsibility, but not creative responsibility, for the editorial policy and content of a diachronic resource.", ar: "يربط مصدر بوكيل يتحمل مسؤولية قانونية أو مسؤولية فكرية، ولا يتحمل مسؤولية إبداعية، بشأن سياسة تحريرية ومحتوى مصدر ممتد زمنيا.", da: "Relaterer en ressource til en agent, der er juridisk og/eller intellektuelt ansvarlig for indholdet, bortset fra dets skabelse, af et periodikum, en integrerende ressource eller et flerbindsværk.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der die rechtliche oder intellektuelle, aber keine kreative, Verantwortung für die redaktionelle Vorgehensweise und den Inhalt einer diachronen Ressource trägt.", fi: "Aineisto, jossa toimija on juridisesti tai tiedollisesti, mutta ei luovasti, vastuussa diakronisen aineiston toimituslinjasta ja sisällöstä."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60393",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/editorialDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60870",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has editorial director", ar: "له مدير تحرير", da: "har ansvarshavende redaktør", de: "hat Chefredakteurin/Chefredakteur", fi: "toimituspäällikkö aineistossa", nl: "heeft hoofdredacteur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60870,
      definition: {en: "Relates an agent to a resource that involves a responsibility other than creating for the content of a serial, integrating resource, or multipart monographic resource.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية تختلف عن إنشاء محتوى تسلسلي، مصدر متكامل، أو مصدر دراسات متعددة الأجزاء.", da: "Relaterer en agent, der er juridisk og/eller intellektuelt ansvarlig for indholdet, bortset fra dets skabelse,  af et periodikum, en integrerende ressource eller et flerbindsværk til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die mit einer anderen Verantwortung verbunden ist, als den Inhalt einer fortlaufenden, integrierenden oder mehrteiligen monografischen Ressource zu erstellen.", fi: "Liittää toimijan aineistoon, jossa toimija on juridisesti tai tiedollisesti, mutta ei luovasti, vastuussa diakronisen aineiston toimituslinjasta ja sisällöstä."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60621",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/editorialDirectorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60869",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is editorial director of", ar: "هو مدير تحرير لـ", da: "er ansvarshavende redaktør af", de: "ist Chefredakteurin/Chefredakteur von", fi: "toimituspäällikkö (toimija)", nl: "is hoofdredacteur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60871,
      definition: {en: "Relates a resource to an agent who is responsible for initiating a diachronic resource.", ar: "يربط مصدر بوكيل مسؤول عن البدء في مصدر ممتد زمنيًا.", da: "Relaterer en ressource til en agent, der er ansvarlig for at have etableret et periodikum, en integrerende ressource eller et flerbindsværk.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das Begründen einer diachronen Ressource verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka on vastannut diakronisen teoksen alullepanosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/founderAgentOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60872",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has founder agent of resource", ar: "له وكيل مؤسس لمصدر", da: "har stifter af ressource", de: "hat Begründerin/Begründer einer Ressource", fi: "aineiston perustaja", nl: "heeft oprichter-actor van resource"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60374",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60872,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for establishing a serial, integrating resource, or multipart monograph.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل إنشاء سلسلة، مصدر متكامل، أو دراسات متعددة الأجزاء.", da: "Relaterer en agent, der er ansvarlig for at have etableret et periodikum, en integrerende ressource eller et flerbindsværk til en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, die mit einer Verantwortung eines Akteurs verbunden ist, eine fortlaufende, integrierende oder mehrteilig monografische Ressource einzuführen.", fi: "Liittää toimijan aineistoon, johon liittyy toimijan vastuu sarja-aineiston, päivittyvän aineiston tai moniosaisen monografian luomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/founderAgentOfResourceOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60871",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is founder agent of resource of", ar: "هو وكيل مؤسس لمصدر لـ", da: "er stifter af værk til", de: "ist Begründerin/Begründer einer Ressource von", fi: "perustaja (toimija) aineistossa", nl: "is oprichter-actor van resource van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60602",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60873,
      definition: {en: "Relates a resource to a general designation of the ratio of the width to the height of a moving image.", ar: "يربط بين مصدر وتسمية عامة لنسبة من العرض إلى ارتفاع لصورة متحركة.", da: "Relaterer en ressource til en almindelig betegnelse for det numeriske forhold mellem bredde og højde i et levende billede.", de: "Setzt eine Ressource in Beziehung zu einer allgemeinen Bezeichnung des Verhältnisses von Breite zu Höhe eines Bewegtbilds.", fi: "Liittää aineiston liikkuvan kuvan aineiston leveyden ja korkeuden välisen suhteen yleiseen määritteeseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/aspectRatioDesignation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has aspect ratio designation", ar: "له تسمية نسب باعية", da: "har billedformatbetegnelse", de: "hat Bezeichnung eines Bildformats", fi: "kuvasuhdemäärite aineistolle", nl: "heeft aspectratio-aanduiding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60874,
      definition: {en: "Relates a resource to a general designation of a lack of a ratio of the dimensions of the content of an image or three-dimensional form to the dimensions of the thing it represents.", ar: "يربط بين مصدر وتسمية عامة لنقص نسبة أبعاد محتوى صورة أو شكل ثلاثي الأبعاد إلى أبعاد الشيء الذي تمثله.", da: "Relaterer en ressource til en almindelig betegnelse for manglen på forhold mellem indholdet af et billede eller en tredimensionel form, og dimensionerne for den ting, billedet eller formen repræsenterer.", de: "Setzt eine Ressource in Beziehung zu einer allgemeinen Bezeichnung für ein fehlendes Verhältnis der Abmessungen des Inhalts eines Bilds oder einer dreidimensionalen Form zu den Abmessungen der Sache, das es/sie repräsentiert.", fi: "Liittää aineiston yleiseen määritteeseen kuvan tai kolmiulotteisen muodon ja niiden esittämän asian mittojen välisten mittasuhteiden puuttumisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/scaleDesignation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has scale designation", ar: "له تسمية مقياس", da: "har målestoksbetegnelse", de: "hat Maßstabsbezeichnung", fi: "mittakaavan määrite aineistolle", nl: "heeft schaalaanduiding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60875,
      definition: {en: "Relates a resource to a machine-readable representation of geospatial features.", ar: "يربط بين مصدر وتمثيل مقروء آليًا لملامح جغرافية مكانية.", da: "Relaterer en ressource til en maskinlæsbar repræsentation af geospatiale træk.", de: "Setzt eine Ressource in Beziehung zu einer maschinenlesbaren Darstellung von Geodaten.", fi: "Liittää aineiston maantieteellisten ominaisuuksien konelukuiseen esitykseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/cartographicDataType.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has cartographic data type", ar: "له نوع بيانات خرائطية", da: "har kartografisk datatype", de: "hat kartografischen Datentyp", fi: "aineiston kartografinen tietotyyppi", nl: "heeft cartografisch datatype"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60323",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60876,
      definition: {en: "Relates a resource to details of a machine-readable representation of geospatial features.", ar: "يربط بين مصدر وتفاصيل عن تمثيل مقروء آليًا لملامح جغرافية مكانية.", da: "Relaterer en ressource til detaljer om en maskinlæsbar repræsentation af geospatiale træk.", de: "Setzt eine Ressource in Beziehung zu den Details zu einer maschinenlesbaren Darstellung von Geodaten.", fi: "Liittää aineiston tarkempiin tietoihin maantieteellisten ominaisuuksien konelukuisesta esityksestä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfCartographicDataType.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of cartographic data type", ar: "له تفاصيل عن نوع بيانات خرائطية", da: "har detaljer om kartografisk datatype", de: "hat Details zum kartografischen Datentyp", fi: "aineiston kartografisen tietotyypin tarkemmat tiedot", nl: "heeft details van cartografisch datatype"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60877,
      definition: {en: "Relates a resource to a general designation of the size of a micro-image in relation to an original from which it was produced.", ar: "يربط بين مصدر وتسمية عامة لحجم الصورة المصغرة وعلاقتها بالأصل الذي تم إنتاجها منه.", da: "Relaterer en ressource til en almindelig betegnelse for størrelsen på et mikrobillede i forhold til den original, som det er fremstillet ud fra.", de: "Setzt eine Ressource in Beziehung zu einer allgemeinen Bezeichnung für die Größe eines Mikro-Bilds im Verhältnis zum Original, von dem es hergestellt wird.", fi: "Liittää aineiston yleiseen määritteeseen, joka ilmaisee mikrokokoiseksi pienennetyn kuvan suhteen alkuperäiseen kuvaan, josta pienennetty kuva on tuotettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/reductionRatioDesignation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has reduction ratio designation", ar: "له تسمية نسبة تصغير الصور", da: "har reduktionsforholdsbetegnelse", de: "hat Bezeichnung des Verkleinerungsfaktors", fi: "pienennyssuhteen määrite aineistolle", nl: "heeft aanduiding verkleiningfactor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60878,
      definition: {en: "Relates an agent to a name used as a family name.", ar: "يربط بين وكيل واسم يُستخدم كاسم عائلة.", da: "Relaterer en agent til et navn, der anvendes som familienavn.", de: "Setzt einen Akteur in Beziehung zu einem Namen, der als Familienname benutzt wird.", fi: "Liittää toimijan suvun nimenä käytettyyn nimeen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/surname.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61196",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has surname", ar: "له اسم عائلة", da: "har efternavn", de: "hat Nachname", fi: "toimijan sukunimi", nl: "heeft achternaam"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60879,
      definition: {en: "Relates an agent to a nomen that is a name of agent given at birth or at some later point in addition to, or instead of, a surname.", ar: "يربط بين وكيل واسم أطلق على وكيل عند ولادته أو لاحقا مضافا إليه اسم عائلة أو عوضا عنه.", da: "Relaterer en agent til et navn, der gives til en agent ved fødslen eller, på et senere tidspunkt oveni, eller i stedet for, et efternavn.", de: "Setzt einen Akteur in Beziehung zu einem Namen, der ihm bei der Geburt oder zu einem späteren Zeitpunkt, zusätzlich oder anstatt eines Nachnamens, gegeben wird.", fi: "Liittää toimijan nimeen, joka on annettu toimijalle syntymässä tai myöhempänä ajankohtana sukunimen lisäksi tai sen sijaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/givenName.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61193",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has given name", ar: "له اسم أول", da: "har fornavn", de: "hat Vornamen", fi: "toimijan etunimi", nl: "is voornaam"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60880,
      definition: {en: "Relates a place to a name of place that is not selected for preference in a specific application or context.", ar: "يربط بين مكان واسم مكان لم يتم اختياره كاسم مختلف مفضل في تطبيق معين أو في سياق معين.", da: "Relaterer et sted til en navn eller navneform, hvorunder et sted er kendt, og som adskiller sig fra det navn eller den navneform, der er valgt som foretrukket navn.", de: "Setzt ein Geografikum in Beziehung zu einem Namen eines Geografikums, der in einer bestimmten Anwendung oder in einem bestimmten Kontext nicht als Vorzugsform bestimmt wird.", fi: "Liittää paikan paikannimeen, jota ei ole valittu ensisijaiseksi tietyssä sovelluksessa tai kontekstissa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/variantNameOfPlace.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60922",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has variant name of place", ar: "له اسم مختلف لمكان", da: "har variantnavn for et sted", de: "hat abweichenden Namen eines Geografikums", fi: "paikan varianttinimi", nl: "heeft variant naam van plaats"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60366",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60881,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for manipulating, recombining, mixing, and reproducing previously recorded sounds.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن معالجة المواد السمعية المسجلة مسبقًا وإعادة تجميعها ومزجها واستنساخها.", da: "Relaterer en agent til en lydressource, skabt ved at manipulere, rekombinere, mixet og reproducere tidligere indspillede lyde.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für das Bearbeiten, Rekombinieren, Mischen und Reproduzieren einer bestehenden Tonaufnahme verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa aiemmin äänitettyjen äänten manipuloimisesta, yhdistelemisestä, sekoittamisesta ja uudelleen tuottamisesta."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60886",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/remixArtistOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Remixing activities that do not substantially change the nature and content of the original resource, and mixing recorded tracks together to appear as one continuous track are excluded.", ar: "تُستبعد أنشطة إعادة المزج التي لا تغير بشكل جوهري طبيعة ومحتوى المصدر الأصلي، وأنشطة مزج المسارات المسجلة لكي تبدو مسارًا واحدًا مستمرًا.", da: "Remixaktiviteter der ikke væsentligt ændrer natur og indhold på den oprindelige ressource, og miksning af indspillede lydspår til at fremstå som et uafbrudt spor ekskluderes.", de: "Darunter fallen keine Nachbearbeitungen, die weder Art noch Inhalt der Originalressource wesentlich verändern, sowie das Zusammenmischen von aufgenommenen Einzelspuren (Kanälen) zu einem scheinbar ununterbrochen durchgehenden Klangerlebnis.", fi: "Ei kata uudelleenmiksaamista, joka ei oleellisesti muuta alkuperäisen teoksen luonnetta ja sisältöä eikä aiemmin äänitettyjen musiikkikappaleiden yhdistämistä yhdeksi musiikkikappaleeksi."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60891",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is remix artist of", ar: "هو فنان ريميكس لـ", da: "er remixer til", de: "ist Remix Artist von", fi: "uudelleenmiksaaja (toimija) aineistossa", nl: "is remixartiest van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60882,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for most aspects of assigning parts and duties to performers.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن تحديد معظم الجوانب المتعلقة بأدوار الممثلين ومهامهم.", da: "Relaterer en agent til en ressource, der inkorporerer et bidrag ved ansvar for de fleste aspekter af at tildele roller og opgaver til performere.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die meisten Aspekte der Rollenvergabe und Aufgabenzuteilung an Ausführende verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa useimmista esiintyjien roolien ja tehtävien antamiseen kuuluvista tehtävistä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/castingDirectorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60890",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is casting director of", ar: "هو مدير طاقم التمثيل لـ", da: "er casting director for", de: "ist Casting Director von", fi: "roolittaja (toimija) aineistossa", nl: "is castingdirector van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60672",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60883,
      definition: {en: "Relates an agent to a resource that involves a responsibility of an agent for managing most of the business aspects of an audio recording.", ar: "يربط بين وكيل ومصدر ينطوي على مسؤولية وكيل عن إدارة معظم جوانب الأعمال التجارية للتسجيل الصوتي.", da: "Relaterer en agent til en ressource, der involverer et ansvar for de fleste forretningsmæssige aspekter af en lydoptagelse.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der ein Akteur für die meisten geschäftlichen Aspekte einer Audioaufnahme verantwortlich ist.", fi: "Liittää toimijan aineistoon, jossa toimija vastaa useimpien äänitteen liiketoiminnallisten tehtävien hoitamisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/audioProducerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60889",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is audio producer of", ar: "هو منتج مواد صوتية لـ", da: "er lydproducer for", de: "ist Produzentin/Produzent einer Tonaufnahme von", fi: "äänituottaja (toimija) aineistossa", nl: "is geluidsproducent van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60668",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60884,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of managing the technical aspects of sound during the processes of recording, mixing, and reproduction.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في إدارة الجوانب الفنية للصوت أثناء عمليات التسجيل والمزج والاستنساخ.", da: "Relaterer en agent til een ressource, der inkorporerer et bidrag til lydindholdet ved overvågning af de tekniske lydaspekter under processen med indspilning, mixning og reproduktion.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er die technischen Aspekte für den Ton während der Aufnahme, des Misch-Verfahrens und der Vervielfältigung handhabt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena valvomalla äänen teknisiä ominaisuuksia äänityksen, miksauksen ja toiston aikana."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60885",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/audioEngineerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60892",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is audio engineer of", ar: "هو مهندس صوت لـ", da: "er lydtekniker i", de: "ist Tontechnikerin/Tontechniker von", fi: "ääniteknikko (toimija) aineistossa", nl: "is geluidstechnicus van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60158",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60885,
      definition: {en: "Relates an agent to a resource that incorporates a contribution by an agent of manipulating, mixing and assembling the multiple tracks of an audio recording.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في معالجة المسارات المتعددة لتسجيل صوتي ومزجها وتجميعها.", da: "Relaterer en agent til en ressource, der inkorporerer et bidrag til lydindholdet ved at manipulere, mixe og samle en indspilnings forskellige spor.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er mehrere Tonspuren einer Aufnahme bearbeitet, mischt und zusammenlegt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena aineiston äänisisällössä käsittelemällä, miksaamalla ja yhdistelemällä useampia äänitteen raitoja."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60881",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mixingEngineerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Remixing activities that substantially change the nature and content of the original resource, resulting in a new resource, are excluded.", ar: "تُستبعد أنشطة إعادة المزج التي تغير بشكل جوهري طبيعة ومحتوى المصدر الأصلي، إلى حد ينتج معه مصدر جديد.", da: "Remixingaktiviteter der fortrinsvis ændrer natur og indhold på en oprindelig ressource og derved resulterer i en ny ressource, er ikke omfattet.", de: "Darunter fallen keine Nachbearbeitungen, die die Art und den Inhalt der Originalressource substantiell verändern, so dass eine neue Ressource entsteht.", fi: "Ei koske uudelleenmiksauksia, jotka olennaisesti muuttavat alkuperäisen aineiston luonnetta ja sisältöä, mikä johtaa uuteen aineistoon."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60893",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is mixing engineer of", ar: "هو مهندس مكساج لـ", da: "er mixing engineer i", de: "ist Mischtontechnikerin/Mischtontechniker von", fi: "miksaaja (toimija) aineistossa", nl: "is mixtechnicus van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60884",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60886,
      definition: {en: "Relates an agent to a resource that includes a contribution by an agent of mixing recorded tracks together during a live performance or in a recording studio to appear as one continuous track.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في مزج ألحان مسجلة أثناء أدائها مباشرة أو أثناء تسجيلها في استوديو لتبدو كمسار واحد مستمر.", da: "Relaterer en agent til en ressource, der inkorporerer et bidrag ved at mikse indspillede spor sammen under en live-optræden eller i et indspilningsstudie så at de fremstår som et uafbrudt spor.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er während eines Live-Auftritts oder in einem Aufnahme-Studio aufgenommene Einzelspuren (Kanäle) zu einem scheinbar ununterbrochen durchgehenden Klangerlebnis zusammen mischt.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena miksaamalla ääniraitoja yhteen yhtäjaksoiseksi raidaksi live-esityksessä tai äänitysstudiossa."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60885",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/DJOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Remixing activities that substantially change the nature and content of the original resource, resulting in a new resource, and mixing and assembling the multiple tracks of a recording are excluded.", ar: "تُستبعد أنشطة إعادة المزج التي تغير بشكل جوهري طبيعة ومحتوى المصدر الأصلي، إلى حد ينتج معه مصدر جديد، ومزج وتجميع المسارات المتعددة للتسجيل.", da: "Remixingaktiviteter der fortrinsvis ændrer natur og indhold på en oprindelig ressource og derved resulterer i en ny ressource og mixe og samle in indspillings forskellige spor, er ikke omfattet.", de: "Darunter fallen keine Nachbearbeitungen, die die Art und den Inhalt der Originalressource substantiell verändern, so dass eine neue Ressource entsteht, sowie das Mischen und Zusammenlegen von mehreren Einzelspuren einer Aufnahme.", fi: "Ei koske uudelleenmiksauksia, jotka olennaisesti muuttavat alkuperäisen aineiston luonnetta ja sisältöä, mikä johtaa uuteen aineistoon. Ei koske useiden raitojen miksaamista ja kokoamista."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60896",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is DJ of", ar: "هو منسق دي جي لـ", da: "er dj i", de: "ist DJ von", fi: "DJ (toimija)", nl: "is deejay van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60158",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60887,
      definition: {en: "Relates an agent to a resource that incorporates a contribution by an agent of an agent for the general management and supervision of the process of adding new dialogue or other sounds to complete a sound track.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في الإدارة العامة والإشراف على عملية إضافة حوار جديد أو أصوات أخرى لإكمال مقطع صوتي.", da: "Relaterer en agent til en ressource, der inkorporerer et bidrag af ansvar for generel ledelse og tilsyn af processen med at tilføje ny dialog eller andre lyde for at lave lydsporet komplet.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, zu der ein Akteur beiträgt, indem er das allgemeine Management und die Leitung beim Hinzufügen von neuem Dialog oder anderen Geräuschen übernimmt, um die Tonspur zu vervollständigen.", fi: "Liittää toimijan aineistoon, jossa toimija on osallisena uuden dialogin tai muiden äänien lisäämisprosessin yleisessä johtamisessa ja valvonnassa aineiston ääniraidan täydentämiseksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dubbingDirectorOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60895",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is dubbing director of", ar: "هو مخرج الدبلجة لـ", da: "dubbinginstruktør", de: "ist Synchronregisseurin/Synchronregisseur von", fi: "dubbausohjaaja (toimija) aineistossa", nl: "is stemregisseur van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60158",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60888,
      definition: {en: "Relates an agent to a musical resource that incorporates a contribution by an agent of using electronic audio devices or computer software to generate sounds.", ar: "يربط بين وكيل ومصدر يتضمن إسهام وكيل في استخدام أجهزة الصوت الإلكترونية أو برمجيات الحاسب لتوليد أصوات.", da: "Relaterer en agent til en musikressource, der inkorporerer et bidrag ved at bruge elektronisk lydapparatur og/eller computersoftware til at skabe lyd.", de: "Setzt einen Akteur in Beziehung zu einer musikalischen Ressource, zu der ein Akteur beiträgt, indem er durch das Einsetzen elektronischer Audio-Geräte oder von Computerprogrammen Klangeffekte erzeugt.", fi: "Liittää toimijan musiikkiaineistoon, jossa toimija on osallisena tuottamalla ääniä sähköisillä äänilaitteilla tai tietokoneohjelmilla."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60655",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/musicProgrammerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60894",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is music programmer of", ar: "هو مبرمج موسيقي لـ", da: "er musikprogrammør i", de: "ist Musik-Programmiererin/Musik-Programmierer von", fi: "musiikkiohjelmoija (toimija) aineistossa", nl: "is music programmer van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60158",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60889,
      definition: {en: "Relates a resource to an agent who is a producer who is responsible for managing most of the business aspects of an audio recording. ", ar: "يربط مصدر بوكيل منتج مسؤول عن إدارة معظم جوانب الأعمال التجارية للتسجيل الصوتي.", da: "Relaterer en ressource til en producer der er ansvarlig for de fleste forretningsmæssige aspekter af en lydoptagelse.", de: "Setzt eine Ressource in Beziehung zu einer Produzentin/einem Produzenten, die/der für die meisten geschäftlichen Aspekte einer Audioaufnahme verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka on osallisena aineiston tekemisessä huolehtimalla äänen teknisistä näkökohdista äänitys-, miksaus- ja äänentoistoprosessien aikana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/audioProducer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60883",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has audio producer", ar: "له منتج مواد صوتية", da: "har lydproducer", de: "hat Produzentin/Produzenten einer Tonaufnahme", fi: "äänituottaja aineistossa", nl: "heeft geluidsproducent"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60441",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60890,
      definition: {en: "Relates a resource to an agent who is responsible for most aspects of assigning parts and duties to performers.", ar: "يربط مصدر بوكيل مسؤول عن معظم الجوانب المتعلقة بأدوار الممثلين ومهامهم.", da: "Relaterer en ressource til en agent ansvarlig for de fleste aspekter af at tildele roller og ansvar til performere.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für die meisten Aspekte der Rollenvergabe und Aufgabenzuteilung an Ausführende verantwortlich ist.", fi: "Liittää aineiston toimijaan, joka vastaa useimmista esiintyjien roolien ja tehtävien antamiseen kuuluvista tehtävistä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/castingDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60882",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has casting director", ar: "له مدير لطاقم التمثيل", da: "har casting director", de: "hat Casting Director", fi: "roolittaja aineistossa", nl: "heeft castingdirector"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60158",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60891,
      definition: {en: "Relates a resource to an agent who is responsible for creating an audio resource by manipulating, recombining, mixing, and reproducing previously recorded sounds.", ar: "يربط مصدر بوكيل مسؤول عن إنشاء مصدر صوتي من خلال معالجة المواد السمعية المسجلة مسبقًا وإعادة تجميعها ومزجها واستنساخها.", da: "Relaterer en ressource til en agent ansvarlig for at skabe en lydressource ved at manipulere, rekombinere, mixe og reproducere tidligere indspillede lyde.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das Schaffen einer Tonressource verantwortlich ist, indem er eine bestehende Tonaufnahme bearbeitet, rekombiniert, mischt und reproduziert.", fi: "Liittää aineiston toimijaan, joka vastaa ääniteoksen luomisesta manipuloimalla, yhdistelemällä, sekoittamalla ja uudelleen tuottamalla aiemmin äänitettyjä ääniä."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60896",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/remixArtist.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Remixing activities that do not substantially change the nature and content of the original resource, and mixing recorded tracks together to appear as one continuous track are excluded.", ar: "تُستبعد أنشطة إعادة المزج التي لا تغير بشكل جوهري طبيعة ومحتوى المصدر الأصلي، وأنشطة مزج المسارات المسجلة لكي تبدو مسارًا واحدًا مستمرًا.", da: "Remix-aktiviteter der ikke væsentligt ændrer natur og indhold på originalværket, og mixning af indspillede lydspor til at fremstå som et uafbrudt spor er ikke omfattet.", de: "Darunter fallen keine Nachbearbeitungen, die weder Art noch Inhalt der Originalressource wesentlich verändern, sowie das Zusammenmischen von aufgenommenen Einzelspuren (Kanälen) zu einem scheinbar ununterbrochen durchgehenden Klangerlebnis.", fi: "Ei kata uudelleenmiksaamista, joka ei oleellisesti muuta alkuperäisen teoksen luonnetta ja sisältöä eikä aiemmin äänitettyjen musiikkikappaleiden yhdistämistä yhdeksi musiikkikappaleeksi."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60881",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has remix artist", ar: "له فنان ريميكس", da: "har remixer", de: "hat Remix Artist", fi: "äänitaiteilija aineistossa", nl: "heeft remixartiest"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60447",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60892,
      definition: {en: "Relates a resource to an agent who contributes to a resource by managing the technical aspects of sound during the processes of recording, mixing, and reproduction.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال إدارة الجوانب الفنية للصوت أثناء عمليات التسجيل والمزج والاستنساخ.", da: "Relaterer en ressource til en agent der bidrager til en ressources lydindhold ved at overvåge de tekniske lydaspekter under optagelse, mixing og reproduktion.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er die technischen Aspekte für den Ton während der Aufnahme, des Misch-Verfahrens und der Vervielfältigung handhabt.", fi: "Liittää aineiston toimijaan, joka on osallisena aineiston tekemisessä huolehtimalla äänen teknisistä näkökohdista äänitys-, miksaus- ja äänentoistoprosessien aikana."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": "http://rdaregistry.info/Elements/u/P60893",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/audioEngineer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60884",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has audio engineer", ar: "له مهندس صوت", da: "har lydtekniker", de: "hat Tontechnikerin/Tontechniker", fi: "ääniteknikko aineistossa", nl: "heeft geluidstechnicus"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60893,
      definition: {en: "Relates a resource to an audio engineer who contributes to the audio content of a resource by manipulating, mixing, and assembling the multiple tracks of a recording.", ar: "يربط بين مصدر ومهندس صوت يساهم في المحتوى الصوتي لمصدر من خلال معالجة المواد السمعية المسجلة مسبقًا وإعادة تجميعها ومزجها واستنساخها.", da: "Relaterer en ressource til en lydtekniker der bidrager til en ressources lydindhold ved at manipulere, mixe og samle de forskellige lydspor på en optagelse.", de: "Setzt eine Ressource in Beziehung zu einer Tontechnikerin/einem Tontechniker, die/der zum Audio-Inhalt einer Ressource beiträgt, indem sie/er mehrere Tonspuren einer Aufnahme bearbeitet, mischt und zusammenlegt.", fi: "Liittää aineiston toimijaan, joka on osallisena aineiston äänisisällössä käsittelemällä, miksaamalla ja yhdistelemällä useampia äänitteen raitoja."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60891",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/mixingEngineer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Remixing activities that substantially change the nature and content of the original resource, resulting in a new resource, are excluded.", ar: "تُستبعد أنشطة إعادة المزج التي تغير بشكل جوهري طبيعة ومحتوى المصدر الأصلي، إلى حد ينتج معه مصدر جديد.", da: "Remixing-aktiviteter der væsentligt forandrer originalværkets karakter og indhold og derved resulterer i et nyt værk, er ikke omfattet.", de: "Darunter fallen keine Nachbearbeitungen, die die Art und den Inhalt der Originalressource substantiell verändern, so dass eine neue Ressource entsteht.", fi: "Ei koske uudelleenmiksauksia, jotka olennaisesti muuttavat alkuperäisen teoksen luonnetta ja sisältöä, mikä johtaa uuteen aineistoon."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60885",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has mixing engineer", ar: "له مهندس مكساج", da: "har mixingtekniker", de: "hat Mischtontechnikerin/Mischtontechniker", fi: "aineiston miksaaja", nl: "heeft mixtechnicus"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60892",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60894,
      definition: {en: "Relates a resource to an agent who contributes to a musical resource by using electronic audio devices or computer software to generate sounds.", ar: "يربط مصدر بوكيل يُساهم في مصدر من خلال في استخدام أجهزة الصوت الإلكترونية أو برمجيات الحاسب لتوليد أصوات.", da: "Relaterer en ressource til en agent, der bidrager til en musikressource ved at bruge elektronisk lydudstyr og/eller computersoftware til at generere lyd.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der zu einer Ressource beiträgt, indem er durch das Einsetzen elektronischer Audio-Geräte oder von Computerprogrammen Klangeffekte erzeugt.", fi: "Liittää aineiston toimijaan, joka on osallisena aineistossa tuottamalla ääniä sähköisillä äänilaitteilla tai tietokoneohjelmilla."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60426",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/musicProgrammer.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "The creation of a new musical resource is excluded.", ar: "يُستبعد إنشاء مصدر موسيقي جديد.", da: "Skabelse af en ny musikressource er ikke omfattet.", de: "Darunter fällt nicht das Schaffen einer neuen Musikressource.", fi: "Ei koske uuden musiikkiteoksen luomista."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60888",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has music programmer", ar: "له مبرمج موسيقي", da: "har musikprogrammør", de: "hat Musik-Programmiererin/Musik-Programmierer", fi: "musiikkiohjelmoija aineistossa", nl: "heeft music programmer"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60895,
      definition: {en: "Relates a resource to an agent who is responsible for the general management and supervision of the process of adding new dialogue or other sounds to complete a sound track for a resource", ar: "يربط مصدر بوكيل مسؤول عن الإدارة العامة والإشراف على عملية إضافة حوار جديد أو أصوات أخرى لإكمال مقطع صوتي لمصدر.", da: "Relaterer en ressource til en agent, der er ansvarlig for den generelle ledelse og overvågning af processen med at tilføje ny dialog eller andre lyd for at fuldstændiggøre en ressources soundtrack.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der für das allgemeine Management und die Leitung beim Hinzufügen von neuem Dialog oder anderen Geräuschen verantwortlich ist, um die Tonspur einer Ressource zu vervollständigen.", fi: "Liittää aineiston toimijaan, joka vastaa uuden dialogin tai muiden äänien lisäämisprosessin yleisessä johtamisessa ja valvonnassa aineiston ääniraidan täydentämiseksi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dubbingDirector.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60887",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has dubbing director", ar: "له مخرج الدبلجة", da: "har dubbinginstruktør", de: "hat Synchronregisseurin/Synchronregisseur", fi: "dubbausohjaaja aineistossa", nl: "heeft stemregisseur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60896,
      definition: {en: "Relates a resource to an agent who contributes to a resource by mixing recorded tracks together during a live performance or in a recording studio to appear as one continuous track.", ar: "يربط مصدر بوكيل يمزج ألحان مسجلة أثناء أدائها مباشرة أو أثناء تسجيلها في استوديو لتبدو كمسار واحد مستمر.", da: "Relaterer en ressource til en agent, der mixer indspillede spor sammen under en live optræden eller i et indspilningsstudie så de fremstår som et uafbrudt spor.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der während eines Live-Auftritts oder in einem Aufnahme-Studio aufgenommene Einzelspuren (Kanäle) zu einem scheinbar ununterbrochen durchgehenden Klangerlebnis zusammen mischt.", fi: "Liittää aineiston toimijaan, joka osallistuu aineiston tekemiseen miksaamalla ääniraitoja yhteen yhtäjaksoiseksi raidaksi live-esityksessä tai äänitysstudiossa."},
      "http://metadataregistry.org/uri/profile/rdakit/seeAlso": "http://rdaregistry.info/Elements/u/P60893",
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/DJ.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Remixing activities that substantially change the nature and content of the original resource, resulting in a new resource, and mixing and assembling the multiple tracks of a recording are excluded.", ar: "تُستبعد أنشطة إعادة المزج التي تغير بشكل جوهري طبيعة ومحتوى المصدر الأصلي، إلى حد ينتج معه مصدر جديد، ومزج وتجميع المسارات المتعددة للتسجيل.", da: "Remixing-aktiviteter der væsentligt forandrer originalressourcens karakter og indhold og derved resulterer i en ny ressource samt mixing og sammensætning af de forskellige spor på en optagelse, er ikke omfattet.", de: "Darunter fallen keine Nachbearbeitungen, die die Art und den Inhalt der Originalressource substantiell verändern, so dass eine neue Ressource entsteht, sowie das Mischen und Zusammenlegen von mehreren Einzelspuren einer Aufnahme.", fi: "Ei koske uudelleenmiksauksia, jotka olennaisesti muuttavat alkuperäisen aineiston luonnetta ja sisältöä johtaen uuteen aineistoon, eikä äänitteen useampien raitojen miksaamista ja yhdistelyä."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60886",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has DJ", ar: "له منسق دي جي", da: "har dj", de: "hat DJ", fi: "DJ aineistossa", nl: "heeft deejay"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60398",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60897,
      definition: {en: "Relates a resource to the distance of a place on a planet or satellite that is measured north and south from the equator.", ar: "يربط بين مصدر ومسافة نقطة على كوكب أو قمر إصطناعي تم قياسها شمالًا وجنوبا من خط الاستواء.", da: "Relaterer en ressource til en afstand fra et punkt på en planet eller satellit målt nord og syd fra ækvator.", de: "Setzt eine Ressource in Beziehung zu einer Entfernung eines Punkts auf einem Planeten oder Satelliten, der nördlich oder südlich vom Äquator gemessen wird.", fi: "Liittää aineiston planeetan tai satelliitin pisteen etäisyyteen, joka on mitattu pohjoiseen ja etelään päiväntasaajalta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/latitude.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has latitude", ar: "له خط عرض", da: "har breddegrad", de: "hat Breitengrad", fi: "leveysaste aineistossa", nl: "heeft breedtegraad"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60898,
      definition: {en: "Relates a resource to the distance of a place on a planet or satellite that is measured east and west from a reference meridian.", ar: "يربط بين مصدر ومسافة نقطة على كوكب أو قمر إصطناعي تم قياسها شرقًا وغربًا من خط الزوال المرجعي.", da: "Relaterer en ressource til en afstand fra et punkt på en planet eller satellit målt øst og vest fra referencemeridianen.", de: "Setzt eine Ressource in Beziehung zu einer Entfernung eines Punkts auf einem Planeten oder Satelliten, der östlich und westlich von einem Bezugsmeridian gemessen wird.", fi: "Liittää aineiston planeetan tai satelliitin pisteen etäisyyteen, joka on mitattu itään ja länteen vertailumeridiaanista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/longitude.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has longitude", ar: "له خط طول", da: "har længdegrad", de: "hat Längengrad", fi: "pituusaste aineistossa", nl: "heeft lengtegraad"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60899,
      definition: {en: "Relates a resource to the angular distance of a celestial body that is measured eastward on the equator from the vernal equinox to the hour circle through the body, from 0 to 24 hours.", ar: "يربط بين مصدر ومسافة زاوية مقاسة باتجاه الشرق على خط الاستواء من الاعتدال الربيعي إلى دائرة الساعة عبر جرم سماوي، من 0 إلى 24 ساعة.", da: "Relaterer en ressource til en vinkelafstand målt mod øst ved ækvator fra forårsjævndøgn til timekransen gennem et himmellegeme, fra 0 til 24 timer.", de: "Setzt eine Ressource in Beziehung zu einem Winkelabstand zwischen dem Frühlingspunkt und dem Längenkreis, der auf der Äquatorebene gegen den Uhrzeigersinn gemessen und in einem Maß von 0 bis 24 Stunden angegeben wird.", fi: "Liittää aineiston taivaankappaleen kulmaetäisyyteen, joka on mitattu aikamitoissa taivaanekvaattoria pitkin kevättasauspisteestä vastapäivään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/rightAscension.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has right ascension", ar: "له صعود مستقيم", da: "har rektascension", de: "hat Rektaszension", fi: "rektaskensio aineistossa", nl: "heeft rechte klimming"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60900,
      definition: {en: "Relates a resource to the angular distance of a celestial body that is measured north or south through 90° from the celestial equator along the hour circle through the body.", ar: "يربط بين مصدر ومسافة زاوية لجسم على الكرة السماوية مقاسة شمالًا أو جنوبًا خلال 90 درجة من خط الاستواء السماوي على طول دائرة ساعة الجسم.", da: "Relaterer en ressource til en vinkelafstand til et himmellegeme, målt nord eller syd gennem 90° fra himmelækvator langs himmellegemets timekrans.", de: "Setzt eine Ressource in Beziehung zu einem Winkelabstand eines Himmelskörpers vom Himmelsäquator, der nördlich oder südlich durch 90° vom Himmelsäquator entlang des Stundenkreises des Körpers gemessen wird.", fi: "Liittää aineiston taivaankappaleen kulmaetäisyyteen, joka on mitattu taivaanekvaattorista pohjoiseen tai etelään 90°:een läpi kappaleen tuntiympyrää pitkin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/declination.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has declination", ar: "له زاوية ميل أو انحراف", da: "har deklination", de: "hat Deklination", fi: "deklinaatio aineistossa", nl: "heeft declinatie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60901,
      definition: {en: "Relates an agent to an agent who was absorbed by another agent.", ar: "يربط بين وكيل ووكيل مستحوذ عليه من قبل وكيل أخر.", da: "Relaterer en agent til en agent, der var absorberet af en anden agent.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, der von einem anderen Akteur übernommen wird.", fi: "Liittää toimijan toimijaan, joka on sulautunut toiseen toimijaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/absorbedAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60902",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has absorbed agent", ar: "له وكيل مستحوذ عليه", da: "har absorberet agent", de: "hat übernommenen Akteur", fi: "sulautunut toimija", nl: "heeft opgenomen actor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60902,
      definition: {en: "Relates an agent to an agent who absorbed another agent.", ar: "يربط بين وكيل ووكيل يستحوذ على وكيل آخر.", da: "Relaterer en agent til en agent, der indlemmede en anden agent.", de: "Setzt einen Akteur in Beziehung zu einem Akteur, der einen anderen Akteur übernimmt.", fi: "Liittää toimijan toimijaan, joka on sulauttanut itseensä toisen toimijan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/absorbingAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60901",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has absorbing agent", ar: "له وكيل مستحوذ", da: "har indlemmende agent", de: "hat übernehmenden Akteur", fi: "sulautunut toimija", nl: "heeft opnemende actor"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60903,
      definition: {en: "Relates an agent to an agent who is a conference that is jointly held with a related conference.", ar: "يربط بين وكيل ووكيل مؤتمر ر يُعقد بصورة مشتركة مع مؤتمر ذي صلة.", da: "Relaterer en konference til en konference, der afholdes i fællesskab med en anden konference.", de: "Setzt einen Akteur in Beziehung zu einer Konferenz, die gemeinsam mit einer anderen Konferenz durchgeführt wird.", fi: "Liittää toimijan toimijaan, joka on yhdessä toisen konferenssin kanssa järjestettävä konferenssi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/jointlyHeldConference.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60903",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has jointly held conference", ar: "له مؤتمر يعقد بصورة مشتركة", da: "har konference afholdt i fællesskab", de: "hat gemeinsam durchgeführte Konferenz", fi: "yhteiskonferenssi (yhteistoimija)", nl: "heeft gezamenlijk gehouden conferentie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60904,
      definition: {en: "Relates a resource to details of a designation for one or more regions of the world for which a videodisc or video game carrier is encoded, indicating that playback is restricted to a device configured to decode it.", ar: "يربط بين مصدر وتفاصيل عن تسمية لواحدة أو أكثر من مناطق العالم التي تم تشفير حامل الفيديو أو ألعاب الفيديو، يشير إلى أن عملية التشغيل مقصورة على الأجهزة المكودة بكود المنطقة فقط.", da: "Relaterer en ressource til detaljer om en kode, der identificerer den region i verden, som en videodisc er kodet til, og som forhindrer, at videodiscen bliver spillet på en afspiller solgt i en anden region.", de: "Setzt eine Manifestation in Beziehung zu Details zu einer Bezeichnung, die die Region(en) der Welt angibt, für die eine Videodisk oder ein Videospiel-Datenträger kodiert ist, und der verhindert, dass die Disk von einem Wiedergabegerät, das in einer anderen Region verkauft wurde, abgespielt werden kann.", fi: "Liittää aineiston lisätietoihin määritteestä, jolla tunnistetaan videolevyn tai videopelitallenteen käyttöalue ja estetään niiden käyttäminen toisella alueella myydyllä soittimella."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/detailsOfRegionalEncoding.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has details of regional encoding", ar: "له تفاصيل عن كود منطقة", da: "har detaljer om regional kodning", de: "hat Details zum Regionalcode", fi: "aineiston aluekoodin lisätiedot", nl: "heeft details van regiocodering"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60772",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60905,
      definition: {en: "Relates a resource to a note on resource that provides information associated with the recording, filming, etc., of the content of a resource.", ar: "يربط بين مصدر وتبصرة عن مصدر مرتبطة بتسجيل، تصوير...إلخ، محتوى مصدر.", da: "Relaterer en ressource til en note der giver oplysninger knyttet til optagelse, indspilning etc. af indholdet af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Anmerkung zur Ressource, die Informationen liefert, die mit der Aufnahme, dem Filmen und so weiter des Inhalts einer Ressource in Verbindung stehen.", fi: "Liittää aineiston aineistoa koskevaan huomautukseen, joka sisältää aineiston sisällön äänitykseen, kuvaukseen tms. liittyviä tietoja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/noteOnCapture.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "Note on capture includes the circumstances such as a live or studio recording, the equipment used, etc.", ar: "تتضمن تبصرة عن التقاط الظروف مثل التسجيل المباشر أو التسجيل في الاستوديو، والمعدات المستخدمة...إلخ.", da: "Note om optagelse omfatter forhold såsom live- eller studieoptagelse, anvendt udstyr etc.", de: "Darunter fallen auch die Umstände einer Aufzeichnung wie zum Beispiel, ob es sich um eine Live- oder Studioaufnahme handelt, welches Equipment verwendet wurde und so weiter.", fi: "Tallennusta koskevaan huomautukseen kuuluvat sellaiset tapaukset kuin live- tai studioäänitys, käytetty laitteisto jne."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has note on capture", ar: "له تبصرة عن التقاط", da: "har note om optagelse", de: "hat Anmerkung zur Aufzeichnung", fi: "huomautus aineiston tallennuksesta", nl: "heeft noot bij vastleggen"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60470",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60906,
      definition: {en: "Relates an entity to a nomen that is an appellation of entity in natural language that is taken from a vocabulary encoding scheme or is constructed using a string encoding scheme.", ar: "يربط بين كيان وتسمية كيان باللغة الطبيعية المأخوذة من مخطط ترميز مفردات أو مبنية باستخدام خطة ترميز سلسلة تمثيلات.", da: "Relaterer en entitet til en entitetsbenævnelse på naturligt sprog, der er hentet fra et vokabularkodningsskema eller er konstrueret ved hjælp af et strengkodningsskema.", de: "Setzt eine Entität in Beziehung zu einer Bezeichnung für eine Entität in natürlicher Sprache, die einem Vocabulary Encoding Scheme entnommen oder mit einem String Encoding Scheme konstruiert wird.", fi: "Liittää entiteetin luonnollisella kielellä olevaan entiteetin nimitykseen, joka on otettu sanaston merkintäjärjestelmästä tai on muodostettu käyttämällä merkkijonon merkintäjärjestelmää."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60916", "http://rdaregistry.info/Elements/u/P60917", "http://rdaregistry.info/Elements/u/P61162", "http://rdaregistry.info/Elements/u/P61164", "http://rdaregistry.info/Elements/u/P61166", "http://rdaregistry.info/Elements/u/P61168"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/accessPointForEntity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60910",
