      subPropertyOf: "http://rdaregistry.info/Elements/u/P60909",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60909,
      definition: {en: "Relates an entity to a nomen that is used within a given scheme or context to refer to an entity.", ar: "يربط بين كيان وتسمية مستخدمة ضمن خطة أو سياق معين للإشارة إلى كيان.", da: "Relaterer en entitet til et nomen, som er anvendt indenfor et givet skema eller en given kontekst for at henvise til en entitet.", de: "Setzt eine Entität in Beziehung zu einem Nomen, das in einem bestimmten Schema oder Kontext verwendet wird, um eine Entität zu referenzieren.", fi: "Liittää entiteetin nomeniin, jota on käytetty tietyssä järjestelmässä tai kontekstissa viittaamaan entiteettiin."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60368", "http://rdaregistry.info/Elements/u/P60369", "http://rdaregistry.info/Elements/u/P60443", "http://rdaregistry.info/Elements/u/P60544", "http://rdaregistry.info/Elements/u/P60545", "http://rdaregistry.info/Elements/u/P60546", "http://rdaregistry.info/Elements/u/P60547", "http://rdaregistry.info/Elements/u/P60906", "http://rdaregistry.info/Elements/u/P60919", "http://rdaregistry.info/Elements/u/P60939"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/appellationOfEntity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
