      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has appellation of entity", ar: "له تسمية لكيان", da: "har benævnelse på entitet", de: "hat Bezeichnung für eine Entität", fi: "entiteetin nimitys", nl: "heeft benaming van entiteit"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60910,
      definition: {en: "Relates a nomen to an entity that has an appellation in natural language that is taken from a vocabulary encoding scheme or is constructed using a string encoding scheme.", ar: "يربط بين تسمية وكيان له اسم في لغة طبيعية مأخوذة من خطة ترميز مفردات أو مبنية باستخدام خطة ترميز سلسلة تمثيلات.", da: "Relaterer et nomen til en entitet, der har en benævnelse på naturligt sprog, der er hentet fra et vokabularkodningsskema eller er konstrueret ved hjælp af et strengkodningsskema.", de: "Setzt ein Nomen in Beziehung zu einer Entität, die eine Bezeichnung in natürlicher Sprache hat, die einem Vocabulary Encoding Scheme entnommen oder mit einem String Encoding Scheme konstruiert wird.", fi: "Liittää nomenin entiteettiin, jolla on luonnollisella kielellä oleva nimitys, joka on otettu sanaston merkintäjärjestelmästä tai on muodostettu käyttämällä merkkijonon merkintäjärjestelmää."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60918", "http://rdaregistry.info/Elements/u/P60934", "http://rdaregistry.info/Elements/u/P61163", "http://rdaregistry.info/Elements/u/P61165", "http://rdaregistry.info/Elements/u/P61167", "http://rdaregistry.info/Elements/u/P61169"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/accessPointForEntityOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60906",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is access point for entity of", ar: "هو نقطة وصول لكيان لـ", da: "er søgeindgang for entitet af", de: "ist Sucheinstieg für eine Entität von", fi: "entiteetin hakutieto", nl: "is ingang voor entiteit van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60911",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60911,
      definition: {en: "Relates a nomen to an entity that is referred to by a nomen used within a given scheme or context.", ar: "يربط بين تسمية وكيان يشار إليه بتسمية مستخدمة ضمن خطة أو سياق معين.", da: "Relaterer et nomen til en entitet, der er henvist til af et nomen brugt indenfor et givet skema eller et givet sammehhæng.", de: "Setzt ein Nomen in Beziehung zu einer Entität, auf die mit einem Nomen referenziert wird, das in einem bestimmten Schema oder Kontext verwendet wird.", fi: "Liittää nomenin entiteettiin, johon tietyssä järjestelmässä tai kontekstissa käytetyllä nomenilla viitataan."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60669", "http://rdaregistry.info/Elements/u/P60910", "http://rdaregistry.info/Elements/u/P60912", "http://rdaregistry.info/Elements/u/P60920", "http://rdaregistry.info/Elements/u/P60928", "http://rdaregistry.info/Elements/u/P60946", "http://rdaregistry.info/Elements/u/P60947", "http://rdaregistry.info/Elements/u/P60948", "http://rdaregistry.info/Elements/u/P60949", "http://rdaregistry.info/Elements/u/P60950"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/appellationOfEntityOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60909",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is appellation of entity of", ar: "هي تسمية لكيان لـ", da: "er benævnelse af en entitet af", de: "ist Bezeichnung für eine Entität von", fi: "entiteetin nimitys", nl: "is benaming van entiteit van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60912,
      definition: {en: "Relates a nomen to a resource that has an appellation of resource in natural language and phrasing used in common discourse.", ar: "يربط تسمية بمصدر له تسمية مصدر في لغة طبيعية وفي العبارات المستخدمة في الخطاب العام.", da: "Relaterer et nomen til en ressource der har en ressourcebenævnelse på naturligt sprog og med naturlig formulering, anvendt i almindelig samtale.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, die über eine Bezeichnung für eine Ressource in natürlicher Sprache und Ausdrucksweise verfügt, die beim normalen Sprechen und Schreiben verwendet wird.", fi: "Liittää nomenin aineistoon, jolla on yleisessä diskurssissa käytetty nimitys luonnollisella kielellä ja sanamuodolla."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60925", "http://rdaregistry.info/Elements/u/P60933", "http://rdaregistry.info/Elements/u/P60958"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/titleOfResourceOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60367",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is title of resource of", ar: "هو عنوان لمصدر لـ", da: "er titel af ressource af", de: "ist Titel einer Reihe von", fi: "aineiston nimeke", nl: "is titel van resource van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60911",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60913,
      definition: {en: "Relates a nomen to the combination of signs that forms an appellation associated with an entity.", ar: "يربط بين تسمية ومجموعة من العلاقات التي تشكل تسمية مرتبطة بكيان.", da: "Relaterer et nomen til den kombination af tegn, der danner en betegnelse knyttet til en entitet.", de: "Setzt ein Nomen in Beziehung zu einer Kombination von Zeichen, die eine Bezeichnung bildet, die mit einer Entität in Verbindung steht.", fi: "Liittää nomenin merkkien yhdistelmään, joka muodostaa entiteettiin liittyvän nimityksen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/nomenString.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has nomen string", ar: "له سلسلة تمثيلات تسمية", da: "har nomenstreng", de: "hat Nomen-Zeichenkette", fi: "nomenin merkkijono", nl: "heeft nomenstring"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60914,
      altLabel: {en: "has relief type", fi: "korkokuvan tyyppi"},
      definition: {en: "Relates a resource to a cartographic representation of the surface forms of the earth or other celestial body, real or imaginary, by means of special graphic methods.", ar: "يربط بين مصدر وطريقة تشير إلى الأبعاد الأفقية والرأسية لسطح الأرض وتضاريسها.", da: "Relaterer en ressource til en metode til at angive de vandrette og lodrette dimensioner af landoverflade og terræn.", de: "Setzt eine Ressource in Beziehung zu einer Methode zur Angabe der horizontalen und vertikalen Darstellung des Geländes.", fi: "Liittää aineiston maanpinnan ja pinnanmuodostuksen horisontaalisten ja vertikaalisten mittojen merkitsemisen menetelmään."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/reliefRepresentation.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has relief representation", ar: "له نوع بارز", da: "har relieftype", de: "hat Reliefdarstellung", fi: "korkokuvan tyyppi", nl: "heeft reliëftype"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60915,
      definition: {en: "Relates a resource to a line of constant longitude passing through a given place on the surface of the earth and the terrestrial poles, from which longitude east and west is measured.", ar: "يربط بين مصدر وخط طول ثابت يمر عبر مكان معين على سطح الأرض والأقطاب الأرضية، والتي يقاس منها خط الطول شرقًا وغربًا.", da: "Relaterer en ressource til en linje med konstant længdegrad, der passerer et givet sted på jordoverfladen og på de jordbaserede poler, hvorfra østlig og vestlig længdegrad måles.", de: "Setzt eine Ressource in Beziehung zu einer Linie konstanter Länge, die durch ein bestimmtes Geografikum auf der Erdoberfläche und den Erdpolen verläuft und von der aus die Längengrade Ost und West gemessen werden.", fi: "Liittää aineiston pysyvän pituusasteen viivaan, joka kulkee maan pinnalla olevan tietyn paikan ja maapallon napojen läpi, ja josta itäinen ja läntinen pituusaste mitataan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/primeMeridian.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has prime meridian", ar: "له خط الطول الأول", da: "har primær meredian", de: "hat Nullmeridian", fi: "nollameridiaani aineistossa", nl: "heeft nulmeridiaan"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60916,
      definition: {en: "Relates an entity to an access point for entity that is selected for preference in a specific vocabulary encoding scheme.", ar: "يربط بين كيان ونقطة إتاحة لكيان اُختيرت نقطة اتاحة مقننة مُفضلة في خطة ترميز مفردات محددة.", da: "Relaterer en entitet til en søgeindgang for entitet, der er valgt som foretrukken i et specifikt vokabularkodningsskema.", de: "Setzt eine Entität in Beziehung zu einem Sucheinstieg für eine Entität, der in einem bestimmten Vocabulary Encoding Scheme als Vorzugsform bestimmt wird.", fi: "Liittää entiteetin entiteetin hakutietoon, joka on valittu ensisijaiseksi tietyssä sanaston merkintäjärjestelmässä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P61170", "http://rdaregistry.info/Elements/u/P61171", "http://rdaregistry.info/Elements/u/P61172", "http://rdaregistry.info/Elements/u/P61173"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/authorizedAccessPointForEntity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60918",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has authorized access point for entity", ar: "له نقطة اتاحة مقننة لكيان", da: "har autoriseret søgeindgang for entitet", de: "hat normierten Sucheinstieg für eine Entität", fi: "entiteetin auktorisoitu hakutieto", nl: "heeft geautoriseerde ingang voor entiteit"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60906",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60917,
      definition: {en: "Relates an entity to an access point for entity that is not selected for preference in a specific vocabulary encoding scheme.", ar: "يربط بين كيان ونقطة إتاحة لكيان لم يتم اختياره كنقطة إتاحة مختلفة مفضلة في خطة ترميز مفردات محددة.", da: "Relaterer en entitet til en søgeindgang for entitet, der ikke er valgt som foretrukken i et specifikt vokabularkodningsskema.", de: "Setzt eine Entität in Beziehung zu einem Sucheinstieg für eine Entität, der in einem bestimmten Vocabulary Encoding Scheme nicht als Vorzugsform bestimmt wird.", fi: "Liittää entiteetin entiteetin hakutietoon, jota ei ole valittu ensisijaiseksi tietyn sanaston merkintäjärjestelmässä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P61186", "http://rdaregistry.info/Elements/u/P61187", "http://rdaregistry.info/Elements/u/P61188", "http://rdaregistry.info/Elements/u/P61189"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/variantAccessPointForEntity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60934",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has variant access point for entity", ar: "له نقطة إتاحة مختلفة لكيان", da: "har variant af søgeindgang for entitet", de: "hat zusätzlichen Sucheinstieg für eine Entität", fi: "entiteetin varianttihakutieto", nl: "heeft variant ingang voor entiteit"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60906",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60918,
      definition: {en: "Relates a nomen to an entity that has an access point for entity that is selected for preference in a specific vocabulary encoding scheme.", ar: "يربط بين تسمية وكيان له نقطة إتاحة لكيان اُختيرت نقطة اتاحة مقننة في خطة ترميز مفردات محددة.", da: "Relaterer et nomen til en entitet, der har en søgeindgang for entitet, der er valgt som foretrukken i et særskilt vokabularkodningsskema.", de: "Setzt ein Nomen in Beziehung zu einer Entität, die über einen Sucheinstieg für eine Entität verfügt, der in einem bestimmten Vocabulary Encoding Scheme als Vorzugsform bestimmt wird.", fi: "Liittää nomenin entiteettiin, jolla on hakutieto, joka on valittu ensisijaiseksi tietyssä sanaston merkintäjärjestelmässä."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P61174", "http://rdaregistry.info/Elements/u/P61175", "http://rdaregistry.info/Elements/u/P61176", "http://rdaregistry.info/Elements/u/P61177"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/authorizedAccessPointForEntityOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60916",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is authorized access point for entity of", ar: "هو نقطة إتاحة مقننة لكيان لـ", da: "er autoriseret søgeindgang for entitet af", de: "ist normierter Sucheinstieg für eine Entität von", fi: "entiteetin auktorisoitu hakutieto", nl: "is geautoriseerde ingang voor entiteit van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60910",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60919,
      definition: {en: "Relates an entity to a nomen that is an appellation of entity that consists of a code, number, or other string, usually independent of natural language and social naming conventions, used to identify an entity.", ar: "يربط بين كيان وتسمية لكيان يتكون من رمز، رقم، أو سلسلة تمثيلات أخرى، مستقلة عادة عن اللغة الطبيعية وعن التسميات المتعارف عليها اجتماعيًا، المستخدمة لتعريف كيان.", da: "Relaterer en entitet til en entitetsbenævnelse, der består af kode, nummer, eller anden streng, normalt uafhængig af normalt sprog og sociale navngivningskonventioner, anvendt for at identificere en entitet.", de: "Setzt eine Entität in Beziehung zu einer Bezeichnung für eine Entität, die aus einem Code, einer Nummer oder einer anderen Zeichenkette besteht, der/die normalerweise nicht in natürlicher Sprache und unabhängig von den sozialen Benennungskonventionen ist und zur Identifizierung einer Entität verwendet wird.", fi: "Liittää entiteetin entiteetin nimitykseen, joka koostuu koodista, luvusta tai muusta tavallisesti luonnollisesta kielestä ja yleisistä nimeämiskäytännöistä riippumattomasta merkkijonosta, jota käytetään entiteetin dentifiointiin."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60052", "http://rdaregistry.info/Elements/u/P60053", "http://rdaregistry.info/Elements/u/P61178", "http://rdaregistry.info/Elements/u/P61179"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/identifierForEntity.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "The coded string is usually independent of natural language and social naming conventions.", ar: "عادة ما تكون سلسلة التمثيلات المرمزة مستقلة عن اللغة الطبيعية وعن التسميات المتعارف عليها اجتماعيًا.", da: "Den kodede streng er normalt uafhængig af naturligt sprog og sociale navngivningskonventioner.", de: "Die kodierte Zeichenkette ist normalerweise nicht in natürlicher Sprache und unabhängig von den sozialen Benennungskonventionen.", fi: "Koodattu merkkijono on yleensä luonnollisesta kielestä ja sosiaalisista nimeämisen käytännöistä riippumaton."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60928",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has identifier for entity", ar: "له معرف لكيان", da: "har dentifikator for entitet", de: "hat Identifikator für eine Entität", fi: "entiteetin tunniste", nl: "heeft identificatie voor entiteit"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60909",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60920,
      definition: {en: "Relates an appellation of agent in natural language and phrasing used in common discourse to an agent.", ar: "يربط بين وكيل وتسمية وكيل فىي اللغة الطبيعية وفي العبارات المستخدمة في الخطاب العام.", da: "Relaterer en agentbenævnelse på naturligt sprog og med naturlig formulering, anvendt i almindelig diskurs til en agent.", de: "Setzt eine Bezeichnung für einen Akteur in natürlicher Sprache und Ausdrucksweise, die beim normalen Sprechen und Schreiben verwendet wird, in Beziehung zu einem Akteur.", fi: "Liittää toimijaan luonnollisella kielellä olevan toimijan nimityksen, jota käytetään yleisessä diskurssissa."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60921", "http://rdaregistry.info/Elements/u/P60927", "http://rdaregistry.info/Elements/u/P61192", "http://rdaregistry.info/Elements/u/P61193", "http://rdaregistry.info/Elements/u/P61196"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/nameOfAgentOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60368",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is name of agent of", ar: "هو اسم لوكيل لـ", da: "er agentnavn på", de: "ist Name eines Akteurs von", fi: "toimijan nimi", nl: "is naam van actor van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60911",
