    property :P60938,
      definition: {en: "Relates a nomen to a resource that has an appellation of resource that is a reference code taken from a vocabulary encoding scheme.", ar: "يربط تسمية بمصدر له تسمية لمصدر عبارة عن رمز إحالة مأخوذ من خطة ترميز مفردات.", da: "Relaterer et nomen til en ressource der har en ressourcebenævnelse, som er en referencekode hentet fra et vokabularkodningsskema.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, die über eine Bezeichnung für eine Ressource verfügt, die einen Referenzcode darstellt, der aus einem Vocabulary Encoding Scheme entnommen wird.", fi: "Liittää nomenin aineistoon, jolla jolla on sanaston merkintäjärjestelmästä otettu viitekoodi nimityksenään."},
