      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60949,
      definition: {en: "Relates a nomen to a resource that involves a responsibility of an agent for inscribing, fabricating, constructing, etc., an unpublished resource.", ar: "يربط تسمية بمصدر ينطوي على مسؤولية وكيل عن تسجيل، تصنيع، إنشاء...إلخ، مصدر غير منشور.", da: "Relaterer et nomen til en ressource, som involverer ett agentansvar for indskrift, fremstilling, konstruktion etc. af en ikke udgiven ressource.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, bei der ein Akteur für das Gravieren, Fabrizieren, Konstruieren und so weiter einer unveröffentlichten Ressource verantwortlich ist.", fi: "Liittää nomenin aineistoon, johon liittyy toimijan vastuu julkaisemattoman aineiston kaiverruksesta, valmistuksesta, kokoonpanosta tms."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/nameOfProducerOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60545",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is name of producer of", ar: "له اسم لمنتج لـ", da: "er navn på producer af", de: "ist Erzeugername von", fi: "aineiston tuottajan nimi", nl: "is naam van producent van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60911",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60950,
      definition: {en: "Relates a nomen to a resource that involves a responsibility of an agent for publishing, releasing, or issuing a published resources.", ar: "يربط تسمية بمصدر ينطوي على مسؤولية وكيل عن نشر، تحرير، أو إصدار مصدر منشور.", da: "Relaterer et nomen til en ressource, som involverer et agentansvar for publicering frigivelse eller udgivelse af en udgiven ressource.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, bei der ein Akteur für das Veröffentlichen, die Freigabe oder die Herausgabe einer veröffentlichten Ressource verantwortlich ist.", fi: "Liittää nomenin aineistoon, johon liittyy toimijan vastuu julkaistujen aineistojen kustantamisesta, julkaisemisesta tai ilmestymisestä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/nameOfPublisherOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60547",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is name of publisher of", ar: "هو اسم لناشر لـ", da: "er navn på udgiver af", de: "ist Verlagsname von", fi: "aineiston kustantajan nimi", nl: "is naam van uitgever van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60911",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60951,
      definition: {en: "Relates a nomen to an entity that has a name of entity that is selected for preference in a specific application or context.", ar: "يربط بين تسمية وكيان له اسم كيان اُختير كاسم مُفضل في تطبيق محدد أو سياق محدد.", da: "Relaterer et nomen til en entitet, som har et entitetsnavn, der er valgt som foretrukket i en specifik applikation eller et specifikt sammenhæng.", de: "Setzt ein Nomen in Beziehung zu einer Entität, die über einen Namen für eine Entität verfügt, der in einer bestimmten Anwendung oder in einem bestimmten Kontext als Vorzugsform bestimmt wird.", fi: "Liittää nomenin entiteettiin, jolla on on tietyssä sovelluksessa tai kontekstissa ensisijaiseksi valittu entiteetin nimi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/preferredNameOfEntityOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60940",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is preferred name of entity of", ar: "هو اسم مُفضل لكيان لـ", da: "er foretrukket navn på entitet af", de: "ist bevorzugter Name einer Entität von", fi: "entiteetin ensisijainen nimi", nl: "is geprefereerde naam van entiteit van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60947",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60952,
      definition: {en: "Relates a nomen to an entity that has a name of entity that is not selected for preference in a specific application or context.", ar: "يربط بين تسمية وكيان لم يتم اختياره كاسم مختلف مفضل ضمن تطبيق محدد أو سياق محدد.", da: "Relaterer et nomen til en entitet, som har et entitetsnavn, der ikke er valgt som foretrukket i en specifik applikation eller et specifikt sammenhæng.", de: "Setzt ein Nomen in Beziehung zu einer Entität, die über einen Namen für eine Entität verfügt, der in einer bestimmten Anwendung oder in einem bestimmten Kontext nicht als Vorzugsform bestimmt wird.", fi: "Liittää nomenin entiteettiin, jolla on nimi, jota ei tietyssä sovelluksessa tai kontekstissa ole valittu ensisijaiseksi entiteetin nimeksi."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P61182", "http://rdaregistry.info/Elements/u/P61183", "http://rdaregistry.info/Elements/u/P61184", "http://rdaregistry.info/Elements/u/P61185"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/variantNameOfEntityOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60941",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is variant name of entity of", ar: "هو اسم مختلف لكيان لـ", da: "er variantnavn på entitet af", de: "ist abweichender Name einer Entität von", fi: "entiteetin varianttinimi", nl: "is variant naam van corporatie van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60947",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60953,
      definition: {en: "Relates a resource to a numeric designation of musical resource that is assigned from a list of resources of a composer, usually arranged in chronological order or by categories, with the theme given for each composition or for each section of large compositions.", ar: "يربط بين مصدر وتسمية رقمية لمصدر موسيقي مخصص من قائمة مصادر لمؤلف موسيقى، وعادةً ما يتم ترتيبها بترتيب زمني أو حسب الفئات، مع تحديد الموضوع لكل تلحين أو لكل قسم من المقطوعات الكبيرة.", da: "Relaterer en ressource til en numerisk betegnelse for en musikressource, som er tildelt fra en liste af ressourcer af en komponist, normalt arrangeret i kronologisk rækkefølge eller efter kategorier, med temaet angivet for enhver komposition eller for enhver del af store kompostioner.", de: "Setzt eine Ressource in Beziehung zu einer numerischen Bezeichnung einer Musikressource aus einem Ressourcenverzeichnis einer Komponistin/eines Komponisten, das in einer chronologischen Reihenfolge oder nach Kategorien angeordnet ist. Zusätzlich können darin Notenzitate in Form von Incipits oder thematischem Material für jede Komposition oder für jede Passage längerer Kompositionen aufgeführt sein.", fi: "Liittää aineiston musiikkiaineiston numeeriseen määritteeseen, joka on otettu säveltäjän aineistoluettelosta. aineistoluettelo on tavallisesti järjestetty aikajärjestykseen tai kategorioittain sisältäen teeman jokaisesta sävellyksestä tai laajan sävellyksen jokaisesta osasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/thematicIndexNumber.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60960",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has thematic index number", ar: "له رقم كشاف موضوعي", da: "har tematisk indeksnummer", de: "hat Werkverzeichnisnummer", fi: "aineiston temaattisen aineistoluettelon numero", nl: "heeft thematische index-nummer"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60315",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60954,
      definition: {en: "Relates a resource to a nomen that is a numeric designation of musical resource that is assigned by a composer or a reference source that indicates a sequence of musical resources that share the same title or that share the same title and the same representative medium of performance.", ar: "يربط بين مصدر وتسمية رقمية لمصدر موسيقي يخصص من جانب ملحن أو مصدر مرجعي يشير إلى تسلسل المصادر الموسيقية التي تشترك في نفس العنوان أو التي تشترك في نفس العنوان ونفس وسيلة الأداء الممثلة.", da: "Relaterer en ressource til en numerisk betegnelse for en musikressource, som er tildelt af en komponist eller en referencekilde, som indikerer en sekvens af musikressourcer, som deler samme titel eller deler samme titel og den samme repræsentative besætning.", de: "Setzt eine Ressource in Beziehung zu einer numerischen Bezeichnung einer Musikressource, die von einer Komponistin/einem Komponisten vergeben oder aus einem Nachschlagewerk entnommen wird und auf eine Folge von Musikressourcen hinweist, die den gleichen Titel oder den gleichen Titel und die gleiche repräsentative Besetzung haben.", fi: "Liittää aineiston musiikkiteoksen numeeriseen määritteeseen, joka on säveltäjän antama tai tietolähteestä otettu. Määrite ilmaisee saman nimekkeen tai saman nimekkeen ja saman edustavan esityskokoonpanon jakavien musiikkiaineistoten järjestystä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/serialNumber.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60961",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has serial number", ar: "له رقم تسلسلي", da: "har serienummer", de: "hat laufende Nummer", fi: "järjestysnumero aineistolle", nl: "heeft serienummer"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60315",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60955,
      definition: {en: "Relates a resource to a nomen that is a numeric designation of musical resource assigned from a list of resources of a composer indicating the chronological order of composition.", ar: "يربط بين مصدر وتسمية رقمية لمصدر موسيقي مخصص من قائمة مصادر لمؤلف موسيقى تشير إلى ترتيب زمنى للقطع الموسيقية.", da: "Relaterer en ressource til en numersik betengelse for en musikressource, tildelt fra en liste af ressourcer af en komponist, som indikerer den kronoligiske rækkefølge af kompositionen.", de: "Setzt eine Ressource in Beziehung zu einer numerische Bezeichnung einer Musikressource, die von einer Komponistin/einem Komponisten oder einem Verlag vergeben wird oder gemäß einem Nachschlagewerk oder Werkverzeichnis verwendet wird. Sie gibt meist Aufschluss über die chronologische Reihenfolge der Komposition innerhalb eines Gesamtwerks.", fi: "Liittää aineiston musiikkiteoksen numeeriseen määritteeseen, joka on sävellykset aikajärjestyksessä esittävästä säveltäjän aineistoluettelosta otettu numerointi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/opusNumber.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60962",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has opus number", ar: "له رقم قطعة موسيقية", da: "har opusnummer", de: "hat Opus-Nummer", fi: "opusnumero aineistolle", nl: "heeft opusnummer"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60315",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60956,
      definition: {en: "Relates an agent to a broad unstructured description of one or more attributes of an agent.", ar: "يربط بين وكيل ووصف مستفيض غير محدد لواحدة أو أكثر من سمات وكيل", da: "Relaterer en agent til en bred ustruktureret beskrivelse af en eller flere attibuter til en agent.", de: "Setzt einen Akteur in Beziehung zu einer umfassenden, unstrukturierten Beschreibung eines Merkmals oder mehrerer Merkmale eines Akteurs.", fi: "Liittää toimijan laajaan rakenteistamattomaan kuvailuun toimijan yhdestä tai useammasta attribuutista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/noteOnAgent.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has note on agent", ar: "له تبصرة عن وكيل", da: "har note om agent", de: "hat Anmerkung zum Akteur", fi: "huomautus toimijasta", nl: "heeft noot bij actor"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60936",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60957,
      definition: {en: "Relates a nomen to a resource that has a chief name of a resource, that is, a title normally used when naming a resource.", ar: "تسمية ومصدر له اسم بارز (اسم رئيسي)، وهذا يعني استخدام عنوان يستخدم عادةً عند تسمية مصدر.", da: "Relaterer et nomen til en ressource, som har et hovednavn på en ressource, dvs. en titel som man normalt bruger når man navngiver en ressource.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, die über einen Hauptnamen, das heißt einem Titel, der normalerweise bei der Benennung einer Ressource verwendet wird, verfügt.", fi: "Liittää nomenin aineistoon, jolla on ensisijainen aineiston nimi eli aineiston nimeämisessä normaalisti käytetty nimeke."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/titleProperOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "An alternative title is treated as part of the title proper.", ar: "يتم التعامل مع العنوان البديل كجزء من العنوان نفسه.", da: "En alternativ titel behandles som en del af hovedtitlen.", de: "Ein Alternativtitel wird als Teil eines Haupttitels behandelt.", fi: "Vaihtoehtoista nimekettä pidetään päänimekkeen osana."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60515",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is title proper of", ar: "هو عنوان مناسب لـ", da: "er hovedtitel af", de: "ist Haupttitel von", fi: "päänimeke aineistolle", nl: "is hoofdtitel van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60958,
      definition: {en: "Relates a nomen to a resource that has a title that identifies a series to which a resource belongs.", ar: "يربط تسمية بمصدر له عنوان يحدد سلسلة تنتمي إليها مصدر.", da: "Relaterer et navn til en ressource, som har en titel, der identificerer en serie som en ressource tilhører.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, die über einen Titel verfügt, der die Reihe identifiziert, zu der eine Ressource gehört.", fi: "Liittää nomenin aineistoon, jolla on nimeke, joka ilmaisee, mihin sarjaan aineisto kuuluu."},
      "http://metadataregistry.org/uri/profile/regap/hasSubproperty": ["http://rdaregistry.info/Elements/u/P60959", "http://rdaregistry.info/Elements/u/P61197"],
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/titleOfSeriesOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60516",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is title of series of", ar: "هو عنوان لسلسلة لـ", da: "er serietitel af", de: "ist Titel einer Reihe von", fi: "sarjan nimeke aineistolle", nl: "is reekstitel van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60912",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60959,
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/titleProperOfSubseriesOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      inverseOf: "http://rdaregistry.info/Elements/u/P60517",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is title proper of subseries of (Deprecated)"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60958",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60960,
      definition: {en: "Relates a nomen to a musical resource that has an identifier for resource that is a numeric designation assigned from a list of resources of a composer, usually arranged in chronological order or by categories, with the theme given for each composition or for each section of large compositions.", ar: "يربط تسمية بمصدر موسيقي له معرف لمصدر عبارة عن تسمية رقمية مخصصة من قائمة مصادر المؤلف، وعادةً ما يتم ترتيبها بترتيب زمني أو حسب الفئات، مع تحديد الموضوع لكل تلحين أو لكل قسم من المقطوعات الكبيرة.", da: "Relaterer et nomen til en musikressource, som har en identifikator for ressource, der er en numerisk betegnelse tildelt fra en liste af ressourcer af en komponist, normalt arrangerede i kronologisk rækkefølge eller efter kategorier, med temaet angivet for enhever komposition eller for enhver del af en stor komposition.", de: "Setzt ein Nomen in Beziehung zu einer Musikressource, die über einen Identifikator für eine Ressource in Form einer numerischen Bezeichnung aus einem Ressourcenverzeichnis einer Komponistin/eines Komponisten verfügt, das in einer chronologischen Reihenfolge oder nach Kategorien angeordnet ist. Zusätzlich können darin Notenzitate in Form von Incipits oder thematischem Material für jede Komposition oder für jede Passage längerer Kompositionen aufgeführt sein.", fi: "Liittää nomenin musiikkiaineistoon, jolla on säveltäjän aineistoluettelosta otettu numeerinen määrite. Aineistoluettelo on tavallisesti järjestetty aikajärjestykseen tai kategorioittain sisältäen teeman jokaisesta sävellyksestä tai laajan sävellyksen jokaisesta osasta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/thematicIndexNumberOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60953",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is thematic index number of", ar: "هو رقم كشاف موضوعى لـ", da: "er tematisk indeksnummer af", de: "ist Werkverzeichnisnummer von", fi: "temaattisen aineistoluettelon numero aineistolle", nl: "is thematisch indexnummer van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60963",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60961,
      definition: {en: "Relates a nomen to a musical resource that has a numeric designation of musical resource assigned by a composer or a reference source that indicates a sequence of musical resources that share the same title or that share the same title and the same representative medium of performance.", ar: "يربط تسمية بمصدر موسيقي له تسمية رقمية لمصدر موسيقي يخصص من جانب ملحن أو مصدر مرجعي يشير إلى تسلسل المصادر الموسيقية التي تشترك في نفس العنوان أو التي تشترك في نفس العنوان ونفس وسيلة الأداء الممثلة.", da: "Relaterer et nomen til en musikressource, som har en numerisk betegnelse af en musikressource, tildelt af en komponist eller af en referencekilde, som indikerer en sekvens af musikressourcer, som deler samme titel eller deler samme titel og den samme repræsentative besætning.", de: "Setzt ein Nomen in Beziehung zu einer Musikressource, die über eine numerische Bezeichnung einer Musikressource verfügt, die von einer Komponistin/einem Komponisten vergeben oder aus einem Nachschlagewerk entnommen wird und auf eine Folge von Musikressourcen hinweist, die den gleichen Titel oder den gleichen Titel und die gleiche repräsentative Besetzung haben.", fi: "Liittää nomenin musiikkiaineistoon, jolla on säveltäjän aineistoluettelosta tai tietolähteestä otettu järjestysnumero. Määrite ilmaisee saman nimekkeen tai saman nimekkeen ja saman edustavan esityskokoonpanon jakavien musiikkiaineistoten järjestystä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/serialNumberOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60954",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is serial number of", ar: "هو رقم مسلسل لـ", da: "er serienummer af", de: "ist Opus-Nummer von", fi: "järjestysnumero aineistossa", nl: "is serienummer van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60963",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60962,
      definition: {en: "Relates a nomen to a musical resource that has an identifier for resource that is a numeric designation assigned from a list of resources of a composer indicating chronological order of composition.", ar: "يربط تسمية بمصدر موسيقي له معرف لمصدر عبارة عن تسمية رقمية مخصصة من قائمة مصادر لمؤلف موسيقى تشير إلى ترتيب زمنى للقطع الموسيقية.", da: "Relaterer et nomen til en musikressource, som har en identifikator for ressource, der er en numerisk betegnelse tildelt fra en liste af ressourcer af en komponist der indikerer den kronoligiske rækkefølge af kompositionen.", de: "Setzt ein Nomen in Beziehung zu einer Musikressource, die über einen Identifikator für eine Ressource verfügt, der von einer Komponistin/einem Komponisten oder einem Verlag vergeben wird oder gemäß einem Nachschlagewerk oder Werkverzeichnis verwendet wird. Er gibt meist Aufschluss über die chronologische Reihenfolge der Komposition innerhalb eines Gesamtwerks.", fi: "Liittää nomenin musiikkiaineistoon, jolla on säveltäjän aineistoluettelosta otettu numeerinen, sävellyksen kronologisen järjestyksen kertova tunniste."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/opusNumberOf.en",
