    property :P60968,
      definition: {en: "Relates a place to a resource that is a published resource that is distributed from a place.", ar: "يربط مكان بمصدر عبارة عن مصدر منشور ووُزع من مكان.", da: "Relaterer et sted til en ressource, som er en udgivet ressourse, der er distribueret fra et sted.", de: "Setzt ein Geografikum in Beziehung zu einer veröffentlichten Ressource, die an einem Ort vertrieben wird.", fi: "Liittää paikan julkaistuun aineistoon, jota jaellaan paikasta käsin."},
