    property :P60969,
      definition: {en: "Relates a place to a resource that is a published resource that is printed, duplicated, cast, etc. in a place.", ar: "يربط مكان بمصدر عبارة عن مصدر منشور طُبع، ونُسخ، وبُث...إلخ، في مكان.", da: "Relaterer et sted til en ressource, som er en udgivet ressourse, der er trykt, dupliceret, støbt, etc. et sted.", de: "Setzt ein Geografikum in Beziehung zu einer veröffentlichten Ressource, die an einem Ort gedruckt, vervielfältigt, gegossen und so weiter wird.", fi: "Liittää paikan julkaistuun aineistoon, joka on painettu, monistettu, valettu kirjainten osalta tms. paikassa."},
