    property :P60979,
      definition: {en: "Relates a timespan to a resource that is a published resource that is distributed during a timespan.", ar: "يربط بين فترة زمنية ومصدر عبارة عن مصدر منشور تم توزيعه خلال فترة زمنية.", da: "Relaterer et tidsforløb til en ressource, som er en udgiven ressource, der er distribueret i løbet af et tidsforløb.", de: "Setzt einen Zeitraum in Beziehung zu einer veröffentlichten Ressource, die in einem Zeitraum vertrieben wird.", fi: "Liittää ajanjakson julkaistuun aineistoon, jota jaellaan ajanjakson aikana."},
