    property :P60980,
      definition: {en: "Relates a timespan to an agent who is established or founded during a timespan.", ar: "يربط بين فترة زمنية ووكيل أُنشئ أو تأسس خلال فترة زمنية.", da: "Relaterer et tidsforløb til en agent, som er etableret eller grundlagt i løbet af et tidsforløb.", de: "Setzt einen Zeitraum in Beziehung zu einem Akteur, der in einem Zeitraum eingeführt oder gegründet wurde.", fi: "Liittää ajanjakson toimijaan, joka on perustettu ajanjakson aikana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfEstablishmentOf.en",
