    property :P60981,
      definition: {en: "Relates a timespan to a resource that is a published resource that is printed, duplicated, cast, etc., during a timespan.", ar: "يربط بين فترة زمنية ومصدر عبارة عن مصدر منشور طُبع، ونسخ، وبث...إلخ، خلال فترة زمنية.", da: "Relaterer et tidsforløb til en ressource, som er en udgiven ressource, der er trykt, duplicert, støbt etc. i løbet af et tidsforløb.", de: "Setzt einen Zeitraum in Beziehung zu einer veröffentlichten Ressource, die in einem Zeitraum gedruckt, vervielfältigt, gegossen und so weiter wird.", fi: "Liittää ajanjakson julkaistuun aineistoon, joka on painettu, monistettu, valettu kirjasinten osalta tms. ajanjakson aikana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfManufactureOf.en",
