      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60982,
      definition: {en: "Relates a timespan to a resource that is an unpublished resource that is inscribed, fabricated, constructed, etc., during a timespan.", ar: "يربط بين فترة زمنية ومصدر عبارة عن مصدر غير منشور تم تأليفه، تجميعه، إنتاجه...إلخ، خلال فترة زمنية.", da: "Relaterer et tidsforløb til en ressource, som er en ikke publiceret ressource, der er indskrevet, fremstillet, konstrueret etc. i løbet af et tidsforløb.", de: "Setzt einen Zeitraum in Beziehung zu einer unveröffentlichten Ressource, die in einem Zeitraum beschriftet, fabriziert, konstruiert und so weiter wird.", fi: "Liittää ajanjakson julkaisemattomaan aineistoon, joka on kaiverrettu, valmistettu, koottu tms. ajanjakson aikana."},
