    property :P60983,
      definition: {en: "Relates a timespan to a resource that is published, released, or issued in a published form during a timespan.", ar: "يربط بين فترة زمنية ومصدر تم نشره، بثه، أو إصداره في شكل منشور خلال فترة زمنية.", da: "Relaterer et tidsforløb til en ressource, som er publiceret, frigivet,eller udgivet i publiceret form i løbet af et tidsforløb.", de: "Setzt einen Zeitraum in Beziehung zu einer Ressource, die in einem Zeitraum in veröffentlichter Form veröffentlicht, freigeschaltet oder herausgegeben wird.", fi: "Liittää ajanjakson aineistoon, joka on kustannettu, julkaistu tai ilmestynyt ajanjakson aikana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfPublicationOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60073",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is date of publication of", ar: "هو تاريخ نشر لـ", da: "er publiceringsdato af", de: "ist Erscheinungsdatum von", fi: "aineiston julkaisuaika", nl: "is datum van publicatie van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61012",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60984,
      definition: {en: "Relates a timespan to a resource associated with an earliest timespan.", ar: "يربط بين فترة زمنية ومصدر مرتبط بأقرب فترة زمنية.", da: "Relaterer et tidsforløb til en ressource, der er knyttet til et tidligste tidsforløb.", de: "Setzt einen Zeitraum in Beziehung zu einer Ressource, die mit dem frühesten Zeitraum in Verbindung steht.", fi: "Liittää ajanjakson aineistoon, johon ajanjakso aikaisintaan liittyy."},
