      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is date of resource of", ar: "هو تاريخ مصدر لـ", da: "er dato for ressource af", de: "ist Datum einer Ressource von", fi: "aineiston ajankohta", nl: "is datum van resource van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61012",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60985,
      definition: {en: "Relates a timespan to an agent who is terminated or dissolved during a timespan.", ar: "يربط بين فترة زمنية ووكيل توقف أو حُلَّ خلال فترة زمنية.", da: "Relaterer et tidsforløb til en agent, som er ved at ophøre eller opløses i løbet af et tidsforløb.", de: "Setzt einen Zeitraum in Beziehung zu einem Akteur, der in einem Zeitraum aufgehoben oder aufgelöst wurde.", fi: "Liittää ajanjakson yhteistoimijaan, joka on lakkautettu tai hajotettu ajanjakson aikana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/dateOfTerminationOf.en",
