    property :P60988,
      definition: {en: "Relates a nomen to a notated music resource that has an identifier for resource other than a publisher number for notated music, assigned by a publisher to indicate the printing plate used in the printing process.", ar: "يربط بين تسمية ومدونة موسيقية لها معرف لمصدر بخلاف رقم ناشر خاص بمدونة موسيقيه، التى يخصصها ناشر لتحديد اللوحات المطبوعة المستخدمة في عملية الطباعة.", da: "Relaterer et nomen til en noteret musikressource, som har en ressourceidentifkator anden end et editionsnummer for noteret musik, tildelt af en udgiver for at angive den trykplade der blev brugt i trykprocessen.", de: "Setzt ein Nomen in Beziehung zu einer Noten-Ressource, die über einen Identifikator für eine Ressource verfügt, der von einem Verlag zugewiesen wird, um die im Druckprozess verwendete Druckplatte anzugeben, und bei dem es sich nicht um die Noten-Bestellnummer handelt.", fi: "Liittää nomenin musiikkiaineistoon, jonka tunniste ei ole kustantajan nuottiaineistolle antama numero vaan nuottiaineiston laatan numero. Nuottiaineiston laatan numero ilmaisee, mitä ilmaisee, painolaattaa on käytetty painamisprosessissa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/plateNumberForNotatedMusicOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A plate number for notated music sometimes includes initials, abbreviations, or words identifying the publisher. It is sometimes followed by a number corresponding to the number of pages or plates or a number corresponding to an individual page or plate.", ar: "يتضمن رقم لوحة لموسيقى مدونة أحيانًا استهلاليات، إختصارات، أو كلمات التى تُعرّف بالناشر.تُتبع أحيانًا برقم يشير إلى رقم الصفحات أو اللوحات أو رقم يشير إلى صفحة أو لوحة واحدة.", da: "Et pladenummer for musik indeholder sommetider initialer, forkortelser eller ord som idenficerer udgiveren. Det er nogen gange efterfulgt af et tal der svarer til antallet af sider eller plader, eller et tal der svarer til en individuel side eller plade.", de: "Eine Druckplattennummer für Noten enthält manchmal Initialen, Abkürzungen oder Wörter, die den Verlag identifizieren. Ihr folgt manchmal eine Zahl, die der Zahl der Seiten oder Platten entspricht oder eine Zahl, die einer einzelnen Seite oder Platte entspricht.", fi: "Nuottiaineiston laattanumero sisältää joskus kustantajaa identifioivia alkukirjaimia, lyhenteitä tai sanoja. Numeron perässä voi olla vastaavien sivujen tai laattojen numerot tai yksittäisten sivujen ja laattojen numerot."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60140",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is plate number for notated music of", ar: "هو رقم لوحة لمدونة موسيقية لـ", da: "er pladenummer for noteret musik af", de: "ist Druckplattennummer für Noten von", fi: "nuottiaineiston laatan numero", nl: "is plaatnummer voor bladmuziek van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60938",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60989,
      definition: {en: "Relates a resource to a numbering designation assigned to a notated music resource by a publisher.", ar: "يربط بين مصدر وترقيم محدد خصصه ناشر لمصدر موسيقى مدونة.", da: "Relaterer en ressource til en nummerangivelse tildelt to en noteret musikressource af en udgiver.", de: "Setzt eine Ressource in Beziehung zu einer Bezeichnung einer Zählung, die einer notierten Musikressource vom Verlag zugewiesen wird.", fi: "Liittää musiikkiaineiston kustantajan nuottiaineistolle antamaan tunnisteeseen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/publisherNumberForNotatedMusicOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "The number normally appears only on the title page, the cover, or the first page of music, and sometimes includes initials, abbreviations, or words identifying the publisher.", ar: "يظهر الرقم عادة فقط على صفحة العنوان، الغلاف، أو الصفحة الأولى من الموسيقى، ويشمل أحيانًا على الاستهلاليات، أو الإختصارات، أو الكلمات التى تعرف بالناشر.", da: "Nummeret optræder normalt kun på titelsiden, omslaget, den første musikside, og indeholder nogen gange initialer, forkortelser g ord der identificerer udgiveren.", de: "Die Nummer erscheint normalerweise nur auf der Titelseite, der Einbanddecke oder der ersten Seite von Musikalien und enthält manchmal Initialen, Abkürzungen oder Wörter, die den Verlag identifizieren.", fi: "Numero esiintyy yleensä jokaisen sivun alalaidassa ja joskus nimiösivulla. Numero voi sisältää kustantajaa identifioivia alkukirjainlyhenteitä, sanalyhenteitä tai sanoja."},
      inverseOf: "http://rdaregistry.info/Elements/u/P60139",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is publisher number for notated music of", ar: "هو رقم ناشر لموسيقى مدونة", da: "er editionsnummer for noteret musik", de: "ist Noten-Bestellnummer von", fi: "kustantajan nuottiaineistolle antama numero", nl: "is uitgeversnummer voor bladmuziek van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60938",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60990,
      definition: {en: "Relates a timespan to an agent who is active in its primary field of endeavour during a timespan.", ar: "تربط بين فترة زمنية ووكيل نشط في مجال عمله الأساسي خلال فترة زمنية.", da: "Relaterer et tidsforløb til en agent, som er virksom indenfor sit primære virksomhedsområde under et tidforløb.", de: "Setzt einen Zeitraum in Beziehung zu einem Akteur, der in einem Zeitraum in seinem primären Tätigkeitsfeld aktiv ist.", fi: "Liittää ajanjakson toimijaan, joka on ollut aktiivinen ensisijaisella toiminta-alallaan ajanjakson aikana."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/periodOfActivityOfAgentOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60076",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is period of activity of agent of", ar: "هي فترة لنشاط وكيل لـ", da: "er aktivitetsperiode af agent af", de: "ist Wirkungszeitraum eines Akteurs von", fi: "toimijan toiminta-aika", nl: "is actieve periode van actor van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60974",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60991,
      definition: {en: "Relates a timespan to a resource that refers to measurements of position for a body or orientation for an orbit.", ar: "يربط بين فترة زمنية ومصدر يُحال إليه قياسات وضع لجسم أو لتوجه مداري.", da: "Relaterer et tidsforløb til en ressource der refererer til målinger af position for et legeme eller retning for en bane.", de: "Setzt einen Zeitraum in Beziehung zu einer Ressource, die Positionsmessungen für einen Körper oder eine Orientierung für eine Umlaufbahn referenziert.", fi: "Liittää ajanjakson aineistoon, johon tähtitaivaan kohteiden sijaintien ja ratojen suuntien mittajärjestelmä viittaa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/epochOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60472",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is epoch of", ar: "له مُدّة زمنية", da: "er epoke af", de: "ist Epoche von", fi: "epookki aineistossa", nl: "is tijdperk van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60992,
      definition: {en: "Relates a timespan to a resource that uses a point of intersection of the ecliptic and the celestial equator, occupied by the sun when its declination is 0°.", ar: "يربط بين فترة زمنية ومصدر يستخدم نقطة تقاطع مسار الشمس مع خط الاستواء عندما يكون انحرافها صفر \"0\".", da: "Relaterer et tidsforløb til en ressource, som bruger et skæringspunkt mellem ekliptika og himlens ækvator, hvor solen befinder sig, når dens deklination er 0°.", de: "Setzt einen Zeitraum in Beziehung zu einer Ressource, die einen von zwei Kreuzungspunkten der Sonnenbahn und des Himmelsäquators verwendet, die von der Sonne überquert werden, wenn ihre Deklination 0° beträgt.", fi: "Liittää ajanjakson aineistoon, joka käyttää ekliptikan ja taivaanekvaattorin leikkauspistettä, jossa aurinko on, kun sen deklinaatio on 0°."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/equinoxOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60506",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is equinox of", ar: "هو اعتدال لـ", da: "er jævndøgn for", de: "ist Äquinoktium von", fi: "tasauspiste aineistossa", nl: "is equinox van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P60993,
      definition: {en: "Relates a place to an agent who is associated with a place. (Deprecated)"},
