      subPropertyOf: "http://rdaregistry.info/Elements/u/P60698",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61096,
      definition: {en: "Relates a resource to an agent who is responsible for overseeing academic activity of any kind that results in a resource, including theses, research, and projects.", ar: "يربط مصدر بوكيل مسؤول عن الإشراف على نشاط أكاديمي من أي نوع يسفر عن مصدر، ويشمل ذلك الأطروحات والبحوث والمشاريع.", da: "Relaterer en ressource til en agent, som er ansvarlig for at føre tilsyn med akademisk aktivitet af enhver art, der resulterer i en ressource, herunder afhandlinger, forskning og projekter.", de: "Setzt eine Ressource in Beziehung zu einem Akteur, der akademische Tätigkeiten jeglicher Art betreut, die zu einer Ressource führen. Darunter fallen Hochschulschriften, Forschungen und Projekte.", fi: "Liittää aineiston toimijaan, joka vastaa kaikenlaisen aineistoon johtavan akateemisen toiminnan valvonnasta, mukaan lukien tutkielmat, tutkimukset ja projektit."},
