      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61097,
      definition: {en: "Relates a resource to a categorization reflecting an intention to extend the content of a resource.", ar: "يربط بين مصدر وفئة تعكس نية لتوسيع محتوى مصدر.", da: "Relaterer en ressource til en kategorisering, som afspejler en hensigt om at udvide indholdet af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Kategorisierung der Absicht, ob beziehungsweise wie der Inhalt einer Ressource erweitert werden soll.", fi: "Liitää aineiston kategorisointiin, joka ilmaisee aikomuksen laajentaa aineiston sisältöä."},
