      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61098,
      definition: {en: "Relates a resource to an academic supervisor who is responsible for advising or supervising research that results in a resource.", ar: "يربط مصدر بمشرف أكاديمي مسؤول عن تقديم المشورة أو الإشراف على الأبحاث التي تؤدي إلى مصدر.", da: "Relaterer en ressource til en akademisk vejleder, som er ansvarlig for at rådgive", de: "Setzt eine Ressource in Beziehung zu einer akademischen Betreuerin/einem akademischen Betreuer, die/der Forschungstätigkeiten beaufsichtigt oder betreut, die zu einer Ressource führen.", fi: "Liittää toimijan akateemiseen ohjaajaan, joka vastaa aineistoon johtavan tutkimuksen valvomisesta tai tutkimuksessa neuvomisesta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/researchSupervisor.en",
