      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61099,
      definition: {en: "Relates a resource to an unstructured or structured description of a range of resources for which the value of a metadata resource is valid.", ar: "يربط بين مصدر ووصف غير مهيكل أو مهيكل لمجموعة من الأعمال التي تكون قيمة مصدر الميتاداتا صالحة لها.", da: "Relaterer en ressource til en ustruktureret eller struktureret beskrivelse af en række ressourcer, for hvilke værdien af en metadataressource er gyldig.", de: "Setzt eine Ressource in Beziehung zu einer unstrukturierten oder strukturierten Beschreibung eines breiten Spektrums von Ressourcen, für die der Wert einer Metadatenressource gültig ist.", fi: "Liittää aineiston rakenteistettuun tai rakenteistamattomaan kuvaukseen aineistojen aikavälistä, jonka ajan metatietoaineiston arvo on voimassa."},
