      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61100,
      definition: {en: "Relates a resource to a source of information for a metadata resource that is an unstructured description transcribed from a resource being described.", ar: "يربط بين مصدر ومصدر معلومات لمصدر ميتاداتا الذي يعد وصفًا غير مهيكل يتم نسخه من مصدر يتم وصفها.", da: "Relaterer en ressource til en informationskilde for en metadataressource, der er en ustruktureret beskrivelse transkiberet fra en ressource, der beskrives.", de: "Setzt eine Ressource in Beziehung zu einer Informationsquelle für eine Metadatenressource, bei der es sich um eine unstrukturierte Beschreibung handelt, die aus einer beschriebenen Ressource transkribiert ist.", fi: "Liittää aineiston metatietoaineiston tietolähteeseen, joka on kuvailtavasta aineistosta transkriboitu rakenteistamaton kuvailu."},
