      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61103,
      definition: {en: "Relates an agent to a resource that involves a responsibility as an academic supervisor of research that results in a resource.", ar: "يربط بين وكيل ومصدر ينطوي على تحمل المسؤولية بصفته مُشرف أكاديمي على الأبحاث التي تؤدي إلى مصدر.", da: "Relaterer en agent til en ressource, som involverer en akademisk forskningsvejleder, og som resulterer i en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der eine akademische Betreuerin/ein akademischer Betreuer dafür verantwortlich ist, die Forschungstätigkeiten zu beaufsichtigen oder zu betreuen, die zu einer Ressource führen.", fi: "Liittää toimijan aineistoon, jossa akateeminen ohjaaja vastaa tutkimuksesta, jonka tuloksena on aineisto."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/researchSupervisorOf.en",
