      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61104,
      definition: {en: "Relates an agent to a resource that involves a responsibility as an academic supervisor of a project undertaken by a student that results in a resource.", ar: "يربط بين وكيل ومصدر ينطوي على تحمل المسؤولية بصفته مشرف أكاديمي على مشروع ينفذه طالب يُسفر عن مصدر.", da: "Relaterer en agent til en ressource, som involverer et ansvar som akademisk vejleder af et projekt, der udføres af en strudent, og som resulterer i en ressource.", de: "Setzt einen Akteur in Beziehung zu einer Ressource, bei der eine akademische Betreuerin/ein akademischer Betreuer dafür verantwortlich ist, ein Projekt einer Studentin/eines Studenten zu beaufsichtigen oder zu betreuen, das zu einer Ressource führt.", fi: "Liittää toimijan aineistoon, jossa toimija akateemisena ohjaajana vastaa opiskelijan projektista, jonka tuloksena on aineisto."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/projectSupervisorOf.en",
