    property :P61140,
      definition: {en: "Relates a resource to a resource statement about a date that is associated with a claim of protection under copyright or a similar regime.", ar: "يربط بين مصدر وبيان مصدر حول تاريخ مرتبط بالحماية تحت حقوق النشر أو أي نظام مشابه.", da: "Relaterer en ressource til en oplysning om ressource om et tidspunkt, som er knyttet til et krav om beskyttelse under copyright eller en lignende ordning.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe zu einem Datum, das mit einem Schutzanspruch nach dem Urheberrecht oder einem ähnlichen Regelwerk in Verbindung steht.", fi: "Liittää aineiston aineistomerkintöön, joka kertoo copyright-säädöksen tai vastaavien säädösten alaiseen copyright-suojaukseen liittyvän ajankohdan."},
