      definition: {en: "Relates a resource to a resource statement about an edition to which a resource belongs.", ar: "يربط بين مصدر وبيان مصدر حول طبعة التي ينتمي إليها مصدر.", da: "Relaterer en ressource til en ressourceoplysning om en udgave, som en ressource tilhører.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe über eine Ausgabe, zu der eine Ressource gehört.", fi: "Liittää aineiston aineistomerkintöön painoksesta, johon aineisto kuuluu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceEditionStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource edition statement", ar: "له بيان طبعة لمصدر", da: "har oplysning om udgave for ressource", de: "hat Ausgabevermerk einer Ressource", fi: "aineiston painosmerkintö", nl: "heeft resource-editievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61145,
      definition: {en: "Relates a resource to a resource statement about an interval at which the resources of parts, issues, or iterations of a diachronic resource are issued.", ar: "يربط بين مصدر وبيان مصدر حول الفترة الزمنية التي وفقًا لها يتم إصدار مصادر أجزاء، أعداد، أو تكرارات لمصدر ممتد زمنيًاً.", da: "Relaterer en ressource til en oplysning om ressource om et interval, hvori ressourcerne for dele, udgaver eller iterationer af en diakronisk ressouce udgives.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe die angibt, in welchem Intervall die Ressourcen von Teilen, Ausgaben oder Iterationen einer diachronen Ressource erscheinen.", fi: "Liittää aineiston aineistomerkintöön tiheydestä, jolla diakronisen aineiston osat, numerot tai iteraatiot ilmestyvät."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceFrequencyStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource frequency statement", ar: "له بيان تتابع لمصدر", da: "har oplysning om hyppighed for ressource", de: "hat Angabe zur Erscheinungsfrequenz einer Ressource", fi: "aineiston ilmestymistiheysmerkintö", nl: "heeft resource-frequentievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61146,
      definition: {en: "Relates a resource to a resource statement about a code, number, or other string, usually independent of natural language and social naming conventions, used to identify a resource.", ar: "يربط بين مصدر وبيان مصدر حول رمز، رقم، أو سلسلة تمثيلات أخرى، عادة ما تكون مستقلة عن اللغة الطبيعية وعن التسميات المتعارف عليها اجتماعيًا، المستخدمة في تحديد هوية مصدر.", da: "Relaterer en ressource til en oplysning om ressource om en kode, et nummer, eller en anden streng, normalt uafhængig af naturligt sprog og sociale navnekonventioner, der bruges til at identificere en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe über einen Code, eine Nummer oder eine andere Zeichenkette, der/die normalerweise nicht in natürlicher Sprache und unabhängig von den sozialen Benennungskonventionen ist und zur Identifizierung einer Ressource verwendet wird.", fi: "Liittää aineiston aineistomerkintöön koodista, numerosta tai muusta merkkijonosta, joka on luonnollisesta kielestä ja kielen sosiaalisista konventioista riippumaton aineiston tunnistamiskeino."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceIdentifierStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource identifier statement", ar: "له بيان معرف مصدر", da: "har identfikatoroplysning for ressource", de: "hat Angaben zum Identifikator einer Ressource", fi: "aineiston tunnistemerkintö", nl: "heeft resource-identificatievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61147,
      definition: {en: "Relates a resource to a resource statement about data relating to the printing, duplicating, casting, etc., of a published resource.", ar: "يربط بين مصدر وبيان مصدر حول البيانات المتعلقة بطباعة، نسخ، طَرَح...إلخ، مصدر منشور.", da: "Relaterer en ressource til en oplysning om ressource om data vedrørende trykning, duplikering, støbning etc. af en udgiven ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe, die Daten zum Druck, zur Vervielfältigung, zum Guss und so weiter einer veröffentlichten Ressource enthält.", fi: "Liittää aineiston aineistomerkintöön julkaistun aineiston painamiseen, monistamiseen, kirjasinten valamiseen tai muuhun valmistustapaan liittyvistä tiedoista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceManufactureStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource manufacture statement", ar: "له بيان تصنيع لمصدر", da: "har oplysning om producent for ressource", de: "hat Herstellungsangabe einer Ressource", fi: "aineiston valmistusmerkintö", nl: "heeft resource-vervaardigingsvermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61148,
      definition: {en: "Relates a resource to a resource statement about data relating to the inscription, fabrication, construction, etc., of an unpublished resource.", ar: "يربط بين مصدر وبيان مصدر حول البيانات المتعلقة بتسجيل، تصنيع، إنشاء...إلخ، مصدر غير منشور.", da: "Relaterer en ressource til en oplysning om ressource om data vedrørende indskrift, fremstilling, konstruktion etc. af en ikke udgiven ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe, die Daten zu der Beschriftung, der Fabrikation, der Konstruktion und so weiter einer unveröffentlichten Ressource enthält.", fi: "Liittää aineiston aineistomerkintöön julkaisemattoman aineiston kaivertamiseen, valmistamiseen, kokoamiseen tai muuhun tuotantotapaan liittyvistä tiedoista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceProductionStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource production statement", ar: "له بيان إنتاج لمصدر", da: "har oplysning om produktion for ressource", de: "hat Entstehungsangabe einer Ressource", fi: "aineiston tuotantomerkintö", nl: "heeft resource-productievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61149,
      definition: {en: "Relates a resource to a resource statement about the publication, release, or issuing of a resource.", ar: "يربط بين مصدر وبيان مصدر حول نشر، تحرير، أو إصدار مصدر.", da: "Relaterer en ressource til en oplysning om en ressource om publicering, frigivelse eller udgivelse af en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe, die Informationen über die Veröffentlichung, das Release oder die Herausgabe einer Ressource enthält.", fi: "Liittää aineiston aineistomerkintöön aineiston kustantamiseen, julkaisemiseen, ilmestymiseen tms. liittyvistä tiedoista."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourcePublicationStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource publication statement", ar: "له بيان نشر لمصدر", da: "har oplysning om publicering for ressource", de: "hat Veröffentlichungsangabe einer Ressource", fi: "aineiston julkaisumerkintö", nl: "heeft resource-publicatievermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61150,
      definition: {en: "Relates a resource to a resource statement about a designation for one or more regions of the world for which a videodisc or video game carrier has been encoded, indicating that playback is restricted to a device configured to decode it.", ar: "يربط بين مصدر وبيان مصدر حول تسمية منطقة أو أكثر من العالم التي تم تشفير حامل قرص الفيديو أو ألعاب الفيديو وفقًا له، ويوضح أن التشغيل مقيد بجهاز معد لفك الكود.", da: "Relaterer en ressource til en oplysning om ressource om en betegnelse for en eller flere regioner i verden, som en videodisk eller video spillekonsol er blevet kodet til, hvilket indikerer, at afspilning er begrænset til en enhed, der der konfigureret til at afkode den.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe, die die Region(en) der Welt angibt, für die eine Videodisk oder ein Videospiel-Datenträger kodiert ist, und der verhindert, dass die Disk von einem Wiedergabegerät, das in einer anderen Region verkauft wurde, abgespielt werden kann.", fi: "Liittää aineiston aineistomerkintöön määritteestä, jolla identifioidaan videolevyn tai videopelitallenteen käyttöalue ja estetään niiden käyttäminen toisella alueella myydyllä soittimella."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceRegionalEncodingStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource regional encoding statement", ar: "له بيان أكواد مناطق لمصدر", da: "har oplysning om regional kodning for ressource", de: "hat Angabe zum Regionalcode einer Ressource", fi: "aineistomerkintö aluekoodista", nl: "heeft resource-regiocoderingsvermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61151,
      definition: {en: "Relates a resource to a resource statement about a series to which a resource belongs and a sequence within the series.", ar: "يربط بين مصدر وبيان مصدر حول سلسلة ينتمي إليها مصدر وتسلسل داخل السلسلة.", da: "Relaterer en ressource til en oplysning om ressource om en serie, som en ressource tilhører og en rækkefølge indenfor denne serie.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe, die Informationen über eine Reihe enthält, zu der eine Ressource gehört und zu deren Reihenfolge innerhalb der Reihe.", fi: "Liittää aineiston aineistomerkintöön aineistoon liittyvästä sarjasta ja aineiston numeroinnista sarjassa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceSeriesStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource series statement", ar: "له بيان سلسلة لمصدر", da: "har oplysning om serie for ressource", de: "hat Gesamttitelangabe einer Ressource", fi: "aineiston sarjamerkintö", nl: "heeft resource-reeksvermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61152,
      definition: {en: "Relates a resource to a resource statement appearing in a resource and deemed to be significant for users to understand how the resource represents itself.", ar: "يربط بين مصدر وبيان مصدر حول سلسلة مرتبطة بمصدر وترقيم مصدر داخل السلسلة.", da: "Relaterer en ressource til en oplysning om ressource om en serie, der er knyttet til en ressource og nummrering af en ressource indenfor denne serie.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe, die Informationen über eine Reihe enthält, mit der eine Ressource in Verbindung steht und die eine Zählung einer Ressource innerhalb der Reihe aufweist.", fi: "Liittää aineiston aineistomerkintöön liittyvästä sarjasta ja aineiston numeroinnista sarjassa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource statement", ar: "له بيان مصدر", da: "har oplysning om ressource", de: "hat Ressourcenangabe", fi: "aineistomerkintö", nl: "heeft resourcevermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61153,
      definition: {en: "Relates a resource to a resource statement about a name of a resource and the agent creating or contributing to the content of the resource.", ar: "يربط بين مصدر وبيان مصدر حول اسم المصدر والوكيل الذي ينشئ محتوى مصدر أو يساهم فيه.", da: "Relaterer en ressource til en oplysning om ressource om et navn på en ressource og den agent der har skabt eller bidraget til ressourcens indhold.", de: "Setzt eine Ressource in Beziehung zu einer Ressourcenangabe, die einen Namen einer Ressource und den Akteur enthält, der den Inhalt der Ressource erstellt oder dazu beigetragen hat.", fi: "Liittää aineiston aineistomerkintöön aineiston nimekkeistä ja aineistoon sisältyvän aineiston sisältöön vaikuttavien toimijoiden nimistä."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/resourceTitleAndResponsibilityStatement.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "A resource title and responsibility statement includes any kind of title or statement of responsibility that is associated with the content of the resource, but does not include a title or statement of responsibility that is associated with an edition, revision or series that is related to the resource.", ar: "يتضمن بيان عنوان ومسؤولية لمصدر على أي نوع من العناوين أو بيان المسؤولية المرتبط بمحتوى المصدر، ولكن لا يتضمن عنوانًا أو بيان مسؤولية مرتبطًا بإصدار، مراجعة أو سلسلة مرتبطة بالمصدر.", da: "En oplysning om ressourcetitel og ophav omfatter enhver form for titel eller ophavsangivelse, som er knyttet til ressourcens indhold, men omfatter ikke en titel eller ophavsanivelse, som er knyttet til en udgave, serierevistion, der er relateret til ressourcen.", de: "Darunter fallen alle Arten von Titeln (Haupttitel, abweichende Titel und Titelzusätze) oder Verantwortlichkeitsangaben, die mit dem Inhalt der Ressource in Beziehung stehen. Darunter fallen keine Titel oder Verantwortlichkeitsangaben von in Beziehung stehenden Ausgaben, Überarbeitungen oder Reihen, die mit der Ressource in Verbindung stehen.", fi: "Aineiston nimeke- ja vastuullisuusmerkintö sisältää kaikenlaiset nimekkeet (ml. päänimekkeen, nimekkeen varianttimuodot ja muun nimeketiedon) sekä kaikenlaiset aineiston sisältöön liittyvät vastuullisuusmerkinnöt. aineiston nimeke- ja vastuullisuusmerkintö ei sisällä sarjaan liittyviä nimekkeitä eikä sarjasta vastuussa olevien toimijoiden nimiä."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has resource title and responsibility statement", ar: "له بيان عنوان ومسؤولية لمصدر", da: "har oplysning om ressourcetitel og ophav", de: "hat Titel und Verantwortlichkeitsangabe einer Ressource", fi: "aineiston nimeke- ja vastuullisuusmerkintö", nl: "heeft resource-titel en verantwoordelijkheidsvermelding"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61154,
      definition: {en: "Relates a resource to a point size of the type used to represent the characters and symbols in a resource.", ar: "يربط بين مصدر وحجم الخط المستخدم في طباعة التمثيلات والرموز في مصدر.", da: "Relaterer en ressource til en punktstørrelse af den skrifttype der er brugt for at repræsentere bogstæverne og symbolerne i en ressource.", de: "Setzt eine Ressource in Beziehung zu einer Punktgröße der Schrift, die zur Darstellung der Zeichen und Symbole in einer Ressource verwendet wird.", fi: "Liittää aineiston aineistossa esiintyvien merkkien ja symbolien pistekokoon."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/fontPointSize.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has font point size", ar: "له حجم خط", da: "har skrifttypes punktstørrelse", de: "hat Punktgröße der Schrift", fi: "aineiston kirjasimen pistekoko", nl: "heeft puntgrootte font"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61155,
      definition: {en: "Relates a resource to a word or phrase that distinguishes a resource from another resource.", ar: "يربط بين مصدر وكلمة أو عبارة تميز مصدر عن مصدر آخر.", da: "Relaterer en ressource til et ord eller en frase, som adskiller en ressource fra en anden ressource.", de: "Setzt eine Ressource in Beziehung zu einem Wort oder einer Phrase, die dazu dient, eine Ressource von einer anderen Ressource zu unterscheiden.", fi: "Liittää aineiston sanaan tai ilmaukseen, joka erottaa aineiston toisesta aineistosta."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/designationOfVersion.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has designation of version", ar: "له تسمية لنسخة", da: "har betegnelse for version", de: "hat Ausgabebezeichnung", fi: "aineiston version määrite", nl: "heeft aanduiding van versie"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61156,
      definition: {en: "Relates a nomen to a scheme in which a nomen is established.", ar: "يربط بين تسمية وخطة يتكون من خلالها إنشاء التسمية.", da: "Relaterer et nomen til et skema, hvori der er etabelerat en appellation.", de: "Setzt ein Nomen in Beziehung zu einem Schema, in dem eine Bezeichnung festgelegt ist.", fi: "Liittää nomenin järjestelmään, jossa nimitys on luotu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/schemeOfNomen.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      "http://www.w3.org/2004/02/skos/core#scopeNote": {en: "The scheme can be a value or vocabulary encoding scheme or a syntax encoding scheme.", ar: "يمكن أن تكون الخطة عبارة عن قيمة أو خطة ترميز مصطلحات او خطة ترميز بناء جملة.", da: "Skemaet kan være et værdi eller et vokabularkodningsskema, eller et syntakskodningsskema.", de: "Das Schema kann entweder ein Value oder Vocabulary Encoding Scheme oder ein Syntax Encoding Scheme sein.", fi: "Järjestelmä voi olla arvojen, sanaston tai syntaksin merkintäjärjestelmä."},
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has scheme of nomen", ar: "له خطة لتسمية", da: "har skema for nomen", de: "hat Schema eines Nomens", fi: "nomenin järjestelmä", nl: "heeft schema van nomen"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61157,
      definition: {en: "Relates a nomen to a set of characters or symbols with which an appellation is formed.", ar: "يربط بين تسمية ومجموعة من تمثيلات أو رموز تتكون من خلالها التسمية.", da: "Relaterer et nomen til et set af tegn eller sympoler, som en appellation er dannet med.", de: "Setzt ein Nomen in Beziehung zu einem Satz von Zeichen oder Symbolen, mit denen eine Bezeichnung gebildet wird.", fi: "Liittää nomenin merkkien ja symbolien joukkoon, josta nimitys muodostetaan."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/scriptOfNomen.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has script of nomen", ar: "له نص لتسمية", da: "har skriftsystem for nomen", de: "hat Schrift eines Nomens", fi: "nomenin kirjoitusjärjestelmä", nl: "heeft schrift van nomen"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61158,
      definition: {en: "Relates a nomen to a resource that has an identifier for resource that consists of a group of characters from specified locations in a resource combined with a date of publication or other element.", ar: "يربط تسمية بمصدر له مُعرِّف لمصدر يتضمن مجموعة تمثيلات من مواقع محددة فى مصدر مدمجة مع تاريخ نشر أو عنصر آخر.", da: "Relaterer et nomen til en ressource, som har en identifikator for ressource, der består af en gruppe tegn fra specificerede steder i en ressource kombineret med en udgivelsesdato eller et andet element.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, die über einen Identifikator für eine Ressource verfügt, der aus einer Kombination von einer Gruppe von Zeichen von bestimmten Stellen einer Ressource und einem Veröffentlichungsdatum oder einem anderen Element besteht.", fi: "Liittää nomenin aineistoon, jonka tunniste muodostuu aineiston tietyistä kohdista poimittujen merkkien yhdistämisestä julkaisuaikaan tai muihin elementteihin."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/fingerprintOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60945",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is fingerprint of", ar: "هي بصمة لـ", da: "er fingeraftryk af", de: "ist Fingerabdruck von", fi: "sormenjälkitunniste", nl: "is vingerafdruk van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61159,
