    property :P61200,
      definition: {en: "Relates a place to a resource that is a cartographic resource that has an area of coverage that is identifiedy by a polygon using coordinates for each vertex.", ar: "يربط مكان بمصدر عبارة عن مصدر خرائطي يحدد بدقة منطقة معينة باستخدام إحداثيات لكل قمة مضلع.", da: "Relaterer et sted til en ressource, som er en kartografisk ressource, der har et dækningsområde, der identificeres af en polygon ved hjælp af koordinater for hvert toppunkt.", de: "Setzt ein Gebiet in Beziehung zu einer kartografischen Ressource, deren Abdeckungsbereich durch ein Vieleck mit Koordinaten für jeden Eckpunkt identifiziert wird.", fi: "Liittää paikan aineistoon, joka on kartografinen aineisto, jonka kattama alue identifioidaan polygonein käyttämällä monikulmion jokaisen kärjen koordinaatteja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/stringsOfCoordinatePairsOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60347",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is strings of coordinate pairs of", ar: "هو خطوط إحداثيات مزدوجة لـ", da: "er strenge af koordinatpar for", de: "sind Reihen von Koordinatenpaaren von", fi: "koordinaattiparit", nl: "is tekenreeksen van coördinatenparen van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61191",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61201,
      definition: {en: "Relates a place to a resource that is a cartographic resource that locates a celestial body that is the coverage of the resource and is identified using the angles of right ascension and declination.", ar: "يربط مكان بمصدر عبارة عن مصدر خرائطي يحدد جرم سماوي عبارة عن تغطية المصدر ويتم تحديده باستخدام زوايا الصعود المستقيم والانحراف.", da: "Relaterer et sted til en ressource, som er en kartografisk ressource, der lokaliserer et himmellegeme, der er dækning for ressourcen, og som er identificeret ved hjælp af vinklerne for rekstascension og deklination.", de: "Setzt einen Ort in Beziehung zu einer kartografischen Ressource, die einen Himmelskörpers verortet, der Gegenstand der Ressource ist und anhand der Winkel der Rektaszension und der Deklination identifiziert wird.", fi: "Liittää paikan aineistoon, joka on kartografinen aineisto, joka määrittää taivaankappaleen sijainnin ja teoksen sisällöllisen kattavuuden käyttämällä rektaskension ja deklinaation kulmamittoja."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/rightAscensionAndDeclinationOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P60346",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is right ascension and declination of", ar: "هو صعود مستقيم وانحراف لـ", da: "er rektascension og deklination for", de: "Rektaszension und Deklination von", fi: "rektaskensio ja deklinaatio", nl: "is rechte klimming en declinatie van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61191",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61202,
      definition: {en: "Relates a resource to an agent who is a performer who contributes to a resource by teaching or providing a demonstration. (Deprecated)", ar: "يربط بين مصدرووكيل مؤدِ يساهم في مصدر عن طريق التدريس أو تقديم عرض توضيحي.", da: "Relaterer en ressource til en agent, som er performer, der bidrager til en ressource, ved at undervise eller give en demonstration.", de: "Setzt eine Ressource in Beziehung zu einer Ausführenden/einem Ausführenden, die/der zu einer Ressource beiträgt, indem sie/er unterrichtet oder etwas demonstriert.", fi: "Liittää aineiston toimijaan, joka on aineistossa osallisena opettamalla tai antamalla havaintoesityksen."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/instructor.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1008",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "has instructor (Deprecated)", ar: "له محاضر", da: "har instruktør", de: "hat Ausbilderin/Ausbilder", fi: "opettaja", nl: "heeft instructeur"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P60387",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61203,
      definition: {en: "Relates a resource to a nomen that is a name of an agent who is responsible for distributing, printing, duplicating, casting, publishing, releasing, issuing, etc., a published resource, or inscribing, fabricating, constructing, etc., an unpublished resource.", ar: "يربط بين مصدر واسم وكيل مسؤول عن توزيع، طباعة، نسخ، صب، نشر، تحرير، إصدار...إلخ، مصدرًا منشور، أو تسجيل، تصنيع، إنشاء...إلخ، مصدرًا غير منشور.", de: "Setzt eine Ressource in Beziehung zu einem Namen eines Akteurs, der für den Vertrieb, den Druck, die Vervielfältigung, den Guss, das Veröffentlichen, das Release, die Herausgabe und so weiter einer veröffentlichten Ressource oder der für das Gravieren, Fabrizieren, Konstruieren und so weiter einer unveröffentlichten Ressource verantwortlich ist.", fi: "Liittää aineiston nomeniin, joka on painetun aineiston jakelusta, painamisesta, monistamisesta, julkaisemisesta jne. vastaavan toimijan nimi tai julkaisemattoman aineiston kirjoittamisesta, valmistamisesta, rakentamisesta jne. vastaavan toimijan nimi."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/nameOfAgentOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
