      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61205,
      definition: {en: "Relates a resource to a place that is associated with the distribution, printing, duplicating, casting, publication, release, or issuing, etc., of a published resource, or the inscription, fabrication, construction, etc., of an unpublished resource.", ar: "يربط بين مصدر ومكان مرتبط بطباعة، نسخ، صب، نشر، تحرير، إصدار...إلخ، مصدرًا منشورًا، أو تسجيل، تصنيع، إنشاء...إلخ، مصدرًا غير منشور.", de: "Setzt eine Ressource in Beziehung zu einem Geografikum, das mit dem Vertrieb, dem Druck, der Vervielfältigung, dem Guss, der Veröffentlichung, dem Release oder der Herausgabe und so weiter einer veröffentlichten Ressource oder mit der Beschriftung, der Fabrikation, der Konstruktion und so weiter einer unveröffentlichten Ressource in Verbindung steht.", fi: "Liittää aineiston paikkaan, jossa julkaistu aineisto on kustannettu, julkaistu, ilmestynyt, painettu, monistettu, valettu kirjasinten osalta tai jaettu. Liittää aineiston paikkaan, jossa julkaisematon aineisto on kaiverrettu, valmistettu, koottu tai muuten tuotettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfResource.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
