      subPropertyOf: "http://rdaregistry.info/Elements/u/P61014",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61206,
      definition: {en: "Relates a place to a resource that is a published resource that is distributed, printed, duplicated, cast, published, released, or issued, etc., or an unpublished resource that is inscribed, fabricated, constructed, etc., in a place.", ar: "يربط مكان بمصدر يُعد مصدرًا منشورًا يتم توزيعه، طباعته، نسخه، صبه، نشره، تحريره، أو إصداره...إلخ، أو يعد مصدرًا غير مطبوع يتم تسجيله أو تصنيعه أو إنشائه...إلخ، في مكان ما.", de: "Setzt ein Geografikum in Beziehung zu einer veröffentlichten Ressource, die an einem Geografikum vertrieben, gedruckt, vervielfältigt, gegossen, veröffentlicht, freigegeben oder herausgegeben und so weiter wird oder zu einer unveröffentlichte Ressource, die an einem Geografikum beschriftet, fabriziert, konstruiert und so weiter wird.", fi: "Liittää paikan aineistoon, joka on kustannettu, julkaistu, ilmestynyt, painettu, monistettu, valettu kirjasinten osalta tai jaettu. Liittää aineiston paikkaan, jossa julkaisematon aineisto on kaiverrettu, valmistettu, koottu tai muuten tuotettu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/placeOfResourceOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61205",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is place of resource of", ar: "هو مكان لمصدر لـ", de: "ist Ort einer Ressource von", fi: "aineiston paikka", nl: "is plaats van resource van"},
      subPropertyOf: "http://rdaregistry.info/Elements/u/P61013",
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61207,
      definition: {en: "Relates a timespan to a timespan that starts at the time that is a timespan.", ar: "يربط بين فترة زمنية وفترة زمنية تبدأ في وقت هو فترة زمنية.", de: "Setzt einen Zeitraum in Beziehung zu einem Zeitraum, der zu diesem Zeitpunkt beginnt. Auch dieser wird als Zeitraum bezeichnet.", fi: "Liittää ajanjakson ajanjakson ajankohtaan, josta ajanjakso alkaa."},
