    property :P61208,
      definition: {en: "Relates a timespan to a timespan that finishes at the time that is a timespan.", ar: "يربط بين فترة زمنية وفترة زمنية تنتهي في وقت هو فترة زمنية.", de: "Setzt einen Zeitraum in Beziehung zu einem Zeitraum, der zu diesem Zeitpunkt endet. Auch dieser wird als Zeitraum bezeichnet.", fi: "Liittää ajanjakson ajanjakson ajankohtaan, johon ajanjakso loppuu."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/endingOf.en",
      "http://metadataregistry.org/uri/profile/regap/status": "http://metadataregistry.org/uri/RegStatus/1001",
      inverseOf: "http://rdaregistry.info/Elements/u/P61000",
      isDefinedBy: "http://rdaregistry.info/Elements/u/",
      label: {en: "is ending of", ar: "هو نهاية لـ", de: "ist Ende von", fi: "ajanjakson loppu", nl: "is einde van"},
      type: "http://www.w3.org/1999/02/22-rdf-syntax-ns#Property"
    property :P61209,
      definition: {en: "Relates a nomen to a resource that has a designation that identifies its position in a sequence of individual parts of a larger resource or parts or issues of a larger resource.", ar: "يربط تسمية بمصدر له تسميه تحدد موقعه داخل تسلسل أجزاء فردية من مصدر أكبر، أو أجزاء أو إصدارات لمصدر أكبر.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, die über eine Bezeichnung verfügt, die ihre Position in einer Reihe einzelner Teile einer größeren Ressource oder Teilen oder Ausgaben einer größeren Ressource identifiziert.", fi: "Liittää nomenin aineistoon, jonka määrite identifioi sen sijainnin laajemman aineiston yksittäisten osien tai laajemman aineiston osien tai numeroiden jaksossa."},
      "http://metadataregistry.org/uri/profile/regap/lexicalAlias": "http://rdaregistry.info/Elements/u/numberingWithinSequenceOf.en",
