    property :P61210,
      definition: {en: "Relates a nomen to a resource that has a designation in the form of numbers or alphabetic characters that is used to indicate the first in a concurrent sequence of numbering of parts or iterations.", ar: "يربط تسمية بمصدر له تسمية على شكل أرقام أو حروف هجائية مستخدمة لتشير إلى أول تسلسل رقمي متزامن للأجزاء أو الأعداد.", de: "Setzt ein Nomen in Beziehung zu einer Ressource, die über eine Bezeichnung in Form von Nummern oder Buchstaben verfügt, die verwendet wird, um in einer alternativen Zählfolge der Ausgaben oder Iterationen auf die erste hinzuweisen.", fi: "Liittää nomeniin aineistoon, jolla on numeroista tai kirjaimista muodostuva määrite, joka on aineiston osien tai iteraatioiden rinnakkaisen numerointijakson ensimmäinen määrite."},
